(1, 7, 15717, 'iReader', 'ireader', ' <div jsname="C4s9Ed">▶Professional app for eBook reading.<br>▶300,000 online eBooks: Genuine，Cheap and  No Advertisement.<br> <br><b>New Look in December</b><br>■ Hot novels: The Kite Runner, A Tale of Two Cities<br>■ Magic novels: One Hundred Years of Solitude<br>■ Hardcover novels: Jude the Obscure<br>■ Featured comics: Sunshine in my heart<p>※Why do users choose iReader?※<br>■ Advanced functions，simplified  but not simple.<p>   Special layout: The same layout experience as paper books.<br>   Screen rotation: Free to portrait-landscape screen switch.<br>   Supporting formats: PDF/EPUB/TXT/UMD etc.<br>   More languages: 12 languages for your better reading experience.<br>   Simplified-traditional Chinese: One-click switch.<br>   Auto operating: Divide text into chapters automatically.<br>   Eye care: Filter blue light for your eyes relief.<br>   Animated scrolling: Customize your reading with 4 scrolling methods.<br>   Auto reading: Relieve your hands with auto reading function.<br>   Auto sync: Sync reading progress and cloud notes automatically.<br>   Nice-looking interface: Simplified interface, convenient operating, with no ads.<br>   Book management: Manage books on the shelf to your preference.<br>   WiFi transfer: Transfer books anywhere and anyplace with WiFi.<p>■Considerate service<p>   Solve all problems in details as soon as possible.We are willing to do everything for your better reading.<p>■Rich eBooks resources, we are always committed to genuine books.<p>   High-quality published books:<p>Novel, Literature, Economy, Management, Biography, History, Health, Social Science, Investment, Psychology,      Financing, Computer, Food, Fashion, Home, Art, Nature, Medicine, Tourism, Parenting, Romance, Public, Journal,  Magazine, Comic etc.<p>■NOTICE<br>WHEN YOU USE CM Security,please add ireader to you white list. The CM Security might clean the download ebooks.<p>※Please join us※<p>Website: <a href="https://www.google.com