(2, 7, 511, 'Dictionary.com', 'dictionarycom', ' <div jsname="C4s9Ed">Dictionary.com is the leading free English dictionary app for Android – with over 2,000,000 definitions and synonyms.<p>This app works offline – you do not need an internet connection.<p>In addition to the trusted reference content from Dictionary.com and Thesaurus.com, this app includes:<p>• Word of the Day – learn a new word every day<br>• Audio pronunciation – hear every word<br>• Voice search – speak to search<br>• Translator – get translations for over 30 languages<br>• Blog – explore over 800 fun language topics <br>• Slideshows – fascinating facts about language<br>• Quiz widget - test your vocabulary with Word of the Day quizzes<br>• Word origin - find out interesting etymologies<br>• Favorite words and search history – never forget the words you learn<br>• Spelling suggestions – get help with how words are spelled<br>• Local lookups - see which words are being searched near you<br>• Advanced learner’s dictionary – special content for ESL, EFL and English learners<p>Want even more? You can add to your app with our in-app purchases:<p>• Encyclopedia<br>• Slang Dictionary<br>• Idioms and Phrases<br>• Example Sentences<br>• Medical, Science and Rhyming Dictionaries<p>Or you can get all of this additional content and remove ads for one low price with our Premium App.</p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/dictionary', 'dictionarycom.png', '["dictionarycom-0.png","dictionarycom-1.png","dictionarycom-2.png","dictionarycom-3.png","dictionarycom-4.png","dictionarycom-5.png","dictionarycom-6.png"]', 0, 0, '', 'com.dictionary', 'words, dictionary, content, english, you can, with our, words are, – get', '', 0, '0.0', 0, 0, 0, 0, '2016-05-17 09:21:42', '2016-05-17 09:21:42', 0),
(3, 7, 510, 'Amazon Kindle', 'amazon-kindle', ' <div jsname="C4s9Ed">The Kindle app puts over a million books at your fingertips.  It’s the app for every reader, whether you’re a book reader, magazine reader, or newspaper reader—and you don’t need to own a Kindle to use it.  Choose from over a million Kindle books from the Kindle Store or enjoy popular magazines like The Economist and Reader’s Digest with high-resolution color images.*<p>• Read Free Books—Choose from thousands of free ebooks such as Pride &amp; Prejudice or The Adventures of Sherlock Holmes.<p>• Shop for Books—Easily shop for ebooks, including new releases and New York Times Best Sellers.<p>• Use the Built-In Dictionary, Google, and Wikipedia—The Kindle app has a built-in dictionary that allows you to look up words instantly while you’re reading your ebooks.  Simply tap and hold a word to view its definition or use the Google and Wikipedia links to get more information.<p>• Sync Your eBooks—The Kindle app lets you read the same book across devices and automatically syncs where you left off so you can start reading on one device and pick up where you left off on another device.  The app syncs your furthest page read, bookmarks, notes, and highlights between Android, PC, Mac, iPad, iPhone, iPod touch, BlackBerry, Windows Phone 8, and any of our Kindle devices using our Whispersync technology. <p>• Sample Books Before You Buy—Read the first chapter of a book for free before you decide to buy.<p>• Customize Your Reading—Choose your preferred font size, screen brightness, background color, and orientation (portrait or landscape) to read your books.<p>• Borrow eBooks from the Library—Check out ebooks from your local library and have them delivered wirelessly to your Kindle app.<p>• Read print replica textbooks on Android tablets.  Print Replica Kindle books maintain the rich formatting and layout of their related print editions and provide features to help students study smarter including ability to highlight passages, add margin notes, and search for keywords.  Whispersync technology saves and synchronizes your bookmarks, notes, and highlights across your devices.<p>* Selection for U.S. users only; selection and price of ebooks and e-periodicals vary by country.<p><br>About app permissions<br>• <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://amazon.com/help/kindleforandroid/permissions%26sa%3DD%26usg%3DAFQjCNFcq5lKbGoWU3W1vaoCkZAiuV1SBQ&amp;sa=D&amp;usg=AFQjCNHxI83t3N1aBhkO9ii79xi4-SJt1w" target="_blank">https://amazon.com/help/kindleforandroid/permissions</a><p>Support<br>• <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://amazon.com/help/kindle%26sa%3DD%26usg%3DAFQjCNG106a0Fn6o1pZ5uVFdA4UVNbCTig&amp;sa=D&amp;usg=AFQjCNFNhGtFudCtgv-JRn4-7OnHcWZr-w" target="_blank">http://amazon.com/help/kindle</a><br>• <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://amazon.com/fb/kindleforum%26sa%3DD%26usg%3DAFQjCNHCyYgPhrLMdmqeQcMBpIN_OVkuRQ&amp;sa=D&amp;usg=AFQjCNGqUW3LnzbTEkbFL5hckPJIMqqbZw" target="_blank">http://amazon.com/fb/kindleforum</a></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/amazon/kindle', 'amazon-kindle.png', '["amazon-kindle-0.png","amazon-kindle-1.png","amazon-kindle-2.png","amazon-kindle-3.png","amazon-kindle-4.png","amazon-kindle-5.png","amazon-kindle-6.png"]', 0, 0, '', 'com.amazon.kindle', 'kindle, ebooks, books, amazon, kindle app, amazon com, notes and, whispersync technology', '', 1, '0.0', 0, 0, 0, 0, '2016-05-17 09:21:48', '2016-05-17 09:21:48', 0),
(4, 7, 15774, 'Bible', 'bible', ' <div jsname="C4s9Ed">On more than 200 million devices around the world, people are reading, listening to, watching, and sharing the Bible using the #1 rated Bible App—completely free. 1,200+ Bible versions, hundreds of languages. Listen to audio Bibles. Hundreds of Reading Plans &amp; Devotionals, in 40+ languages. Download the best rated Bible App.<p>Customize your Bible with Highlights, Bookmarks, and public/private Notes. Access everything online or download select versions to use offline. Read, study, and share with friends. Enjoy honest conversations about faith in trusted community. Grow together every day with friends, sharing your discoveries. Create shareable art: add Scripture verses to your photos.<p>READ THE BIBLE DAILY<br>● Experience the Bible App in any of 30+ languages<br>● Switch between hundreds of Bible versions, 900+ languages<br>● Popular versions: King James Version KJV, New International Version NIV, New King James Version NKJV, New Living Translation NLT, English Standard Version ESV, NASB, The Message,Yoruba, Zulu, Hindi, French<br>● Offline Bibles: Read even w/o network access (select versions)<br>● Audio Bibles: Audio for select versions. Not downloadable<br>● Verse of the Day<p>USE THE BIBLE WITH FRIENDS<br>● Center your Christian friendships around holy Scripture in the Bible App<br>● Home Feed: See what you and friends bookmark &amp; highlight<br>● Comments: Connect with friends each day as you study Bible truths together, sharing ideas, asking questions<p>STUDY THE BIBLE<br>● Reading Plans: Hundreds of Devotionals, Bible Plans. Study topics or portions of the Bible. Read the entire Bible (both One Year® Bible and Bible in One Year)<br>● Video: Watch clips from The Bible, the JESUS film, Lumo Project &amp; more<p>CUSTOMIZE YOUR FREE BIBLE<br>● Verse Images: Turn Scripture into shareable art<br>● Highlights: Like a paper Bible with custom colors<br>● Bookmarks: Sharing, memorizing, finding your favorite verses<br>● Share verses with friends: social media, email, or SMS/text<br>● Notes: Keep them private so only you can see them, or public to share with friends<br>● Cloud Sync: With a free YouVersion account, see all of your Notes, Highlights, Bookmarks, and Reading Plans on any supported device<br>● Easy Reading: Adjust font, text size, and contrast for bright or low-light<p>CONNECT WITH YOUVERSION<br>● Contact support from inside the Bible App<br>● Like us on Facebook<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://facebook.com/youversion%26sa%3DD%26usg%3DAFQjCNGbmtRs1knDWI5sMUpZEjtIU6IXAw&amp;sa=D&amp;usg=AFQjCNFRMUBke1hf-7rV4cpKj8Yi0zd9ug" target="_blank">http://facebook.com/youversion</a><br>● Follow us on Twitter<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://twitter.com/youversion%26sa%3DD%26usg%3DAFQjCNHZGEACN4M1vCIIojWzWCT2p_r5Ow&amp;sa=D&amp;usg=AFQjCNExLJWZgjDq_ZHv-nLdD933ZYCoWA" target="_blank">http://twitter.com/youversion</a><br>● Keep current on our blog<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://blog.youversion.com%26sa%3DD%26usg%3DAFQjCNESGwnaO_5Mg657aQOKcW4MpkXO-A&amp;sa=D&amp;usg=AFQjCNG70Krz8lZweSvGll-aKgJrme1qWw" target="_blank">http://blog.youversion.com</a><br>● YouVersion online<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://bible.com%26sa%3DD%26usg%3DAFQjCNFutq-8w-EImtu0esaelVnNmNGGtg&amp;sa=D&amp;usg=AFQjCNHp2QzCX2FIPEY1OpgxAZZ6CrBEyA" target="_blank">http://bible.com</a><p>1000+ Bible versions:<br>King James Version KJV<br>New International Version NIV<br>New Living Translation NLT<br>English Standard Version ESV<br>Holman Christian Standard Bible HCSB<br>New King James Version NKJV<br>New American Bible, revised edition (Catholic)<br>Chinese Bible -Chinese Simplified &amp; Traditional<br>Zulu<br>Yoruba<br>Hindi<br>French<p>Audio Bibles:<br>King James Version KJV<br>New International Version NIV<br>New Living Translation NLT<br>English Standard Version ESV<br>Holman Christian Standard Bible HCSB<br>Chinese Bible<p>More than 900 languages<br>English, Hindi, Spanish, Portuguese, Chinese, Korean, German, French, Russian, Indonesian, Javanese, Amharic, Twi, Serbian, Arabic, Zulu, Xhosa, Yoruba, Urdu, Bengali, Filipino, Tamil, Igbo, Hausa, Fulfulde, more<p>Thanks to generous content partners, we offer hundreds of Reading Plans, Devotionals and Free Bible Study Plans: Billy Graham, Francis Chan, One Hope: Bible App for Kids devotionals, FCA Fellowship of Christian Athletes, Our Daily Bread, One Year® Bible, Jesus Film, Lead Like Jesus, Daily Guideposts, Deeper into Scripture, Ligonier, Joseph Prince, Scripture Union, Focus on the Family, John Piper: Desiring God, Hillsong, Audio devotionals, Daily Bible Reading Guide Catholic, Rick Warren: Daily Hope, Set Me Free, NewSpring Church, 21 Days of our Daily Bread, Hope International, Marriage Today, New Life Christian, Daily Walk with the Lord, Once a Day Bible, Jesus Calling, Growing Leaders, Bible Plans.org, Love God Greatly, Our Daily Bread: China</p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/sirma/mobile/bible/android', 'bible.png', '["bible-0.png","bible-1.png","bible-2.png","bible-3.png","bible-4.png","bible-5.png","bible-6.png"]', 0, 0, '', 'com.sirma.mobile.bible.android', 'bible, version, daily, reading, the bible, james version, king james, reading plans, king james version, our daily bread', '', 1, '0.0', 0, 0, 0, 0, '2016-05-17 09:21:55', '2016-05-17 09:21:55', 0),
(5, 7, 512, 'Free Books &amp; Stories - Wattpad', 'free-books-amp-stories-wattpad', ' <div jsname="C4s9Ed">• Free stories and books written by published and aspiring authors<br>• Search popular genres and unique topics to find any story you can imagine<br>• Follow stories as they are written, get updates for new chapters<br>• Connect with writers and other readers. Leave comments on stories and discuss the newest plot twists!<br>• Save to your library and share what you’re reading with your friends<br>• Write your own stories. Share your writing with the supportive Wattpad community<p><br>Features:<br>• Download stories and books to the app so you can read offline<br>• Personalized recommendations of stories to read<br>• Stay connected to your stories with a newsfeed of updates and comments from friends<br>• Sync all your stories and ebooks between your phone, tablet, and computer<p><br>Millions of stories to choose from:<br>• Choose from popular romance, fanfic, non-fiction, mystery, fantasy, memoirs, travelogues, sci-fi, short stories and memes.<br>• Popular cast celebrities: Kylie Jenner, Harry Styles, Ian Somerhalder, Luke Hemmings, Rihanna, Tyga, August Alsina, Ariana Grande, Justin Bieber, Drake and Kim Kardashian.<br>• Works by well-known authors: Scott Westerfeld, Tyler Oakley, Margaret Atwood, Paulo Coelho, RL Stine, Dan Brown, Anna Todd, Christopher Pike, Pharrell, Felicia Day, Jennifer Armentrout, Meg Cabot, Marissa Meyer, Gena Showalter, Hugh Howey, Kevin J Anderson, Maureen Johnson<br>• Trending fan fiction: Anime, Supernatural, Twilight, One Direction, Harry Potter, 1d, Naruto, Manga, Star Wars, The Walking Dead, Percy Jackson, Hunger Games, 5SOS, Kpop, Divergent, Arrow, Fifth Harmony<br>• The classics: Alice in Wonderland, Sherlock Holmes, Romeo &amp; Juliet, Jane Eyre, Wuthering Heights, The Art of War, Pride &amp; Prejudice, and much more<br>• Find stories from new reading lists and book clubs<p><br>Discover the next 50 Shades of Grey!</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/wp/wattpad', 'free-books-amp-stories-wattpad.png', '["free-books-amp-stories-wattpad-0.png","free-books-amp-stories-wattpad-1.png","free-books-amp-stories-wattpad-2.png","free-books-amp-stories-wattpad-3.png","free-books-amp-stories-wattpad-4.png","free-books-amp-stories-wattpad-5.png"]', 0, 0, '', 'wp.wattpad', 'stories, popular, friends•, fiction, stories and, choose from, your stories, you can', '', 1, '0.0', 0, 0, 0, 0, '2016-05-17 09:22:03', '2016-05-17 09:22:03', 0),
(6, 8, 629, 'Job Search', 'job-search', ' <div jsname="C4s9Ed">Find jobs using Indeed, the most comprehensive search engine for jobs.<br>In a single search, Indeed offers free access to millions of jobs from thousands of company websites and job boards. <br>From search to apply, Job Search app helps you through the entire process of finding a new job.<p>World’s #1 Job Search<br>- Join over 200 million job seekers each month who use Indeed<br>- Find jobs in over 60 countries and 29 languages<br>- Search the Indeed database of over 15 million jobs<p>Search<br>- Simple, fast-loading job search <br>- Find openings in cities near you using your device’s GPS<br>- View new jobs added since your last search and be the first to apply<br>- Search by job title, company and location to find your dream job<br>- Find full-time, part-time, contract, freelance and internship jobs<p>Apply<br>- Use your Indeed Resume to easily apply to select jobs<br>- Create, upload or import a resume, joining Indeed’s network of over 35 million resumes<br>- Personalize a message for each job before applying<br>- Don’t want to apply just yet? Send a reminder to apply later<p>Personalize<br>- Save or email your favorite jobs<br>- Create a free Indeed account<br>- Follow favorite companies to get the latest jobs and news<br>- Have the newest jobs delivered to your inbox<br>- See which jobs you’ve visited, saved, and applied to<p>Research<br>- Preview page displays full description of job posting<br>- See how companies rate, as evaluated by employees<br>- Read reviews of companies posted by over 3 million employees<br>- See photos of what it’s like to work at companies before you apply<br>- Review your own employer<p>Please send feedback to <a href="mailto:android@indeed.com">android@indeed.com</a></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/indeed/android/jobsearch', 'job-search.png', '["job-search-0.png","job-search-1.png","job-search-2.png","job-search-3.png","job-search-4.png","job-search-5.png","job-search-6.png"]', 0, 0, '', 'com.indeed.android.jobsearch', 'search, apply, companies, million, job search, jobs create, find jobs', '', 1, '0.0', 0, 0, 0, 0, '2016-05-17 09:22:10', '2016-05-17 09:22:10', 0),
(7, 8, 10800, 'FastJobs', 'fastjobs', ' <div jsname="C4s9Ed">Looking for a job in Singapore? Simplify your job search and find work in Singapore at your fingertips. Act fast and browse thousands of classifieds jobs, part-time jobs, temporary jobs, contract jobs, freelance work, and holiday jobs on FastJobs. You can be a student looking for part-time work, a mum looking to work from home or just looking for a change in career, FastJobs has plenty of job opportunities available. With constantly updated job vacancies, getting employment in Singapore can be simple and direct.  INSERT INTO `apps` (`id`, `cat_id`, `developer_id`, `name`, `slug`, `content`, `path`, `image`, `thumbs`, `numDownloads`, `views`, `link`, `com`, `keyword`, `description`, `varieswithdevice`, `rate_value`, `rate_count`, `featured`, `jobs`, `jobs2`, `created_at`, `updated_at`, `noupdate`) VALUES
(21, 10, 1878, 'LINE: Free Calls &amp; Messages', 'line-free-calls-amp-messages', ' <div jsname="C4s9Ed">LINE reshapes communication around the globe, bringing you closer to your family, friends, and loved ones—for free. With voice and video calls, messages, and a limitless variety of exciting stickers, you’ll be able to express yourself in ways that you’ve never thought possible. With over 600 million users worldwide, LINE’s constantly expanding platform will continue to provide exciting new experiences and convenience.<p><br>▷ LINE’s New Features<p>- Make Group Calls with 200 People<br>Try our group call feature with members in chats.<p>- Keep Your Things Close with Keep <br>Store messages, photos, and videos in Keep and share them easily with friends.  <p><br>▷ LINE’s Main Features<p>- Free voice and video calls: Use your PC or smartphone to keep in touch with friends and family both at home and abroad, or hold a business meeting on the go!<p>- Instant messaging anywhere: Conversation is just a tap away. Spice it up with LINE’s exciting collection of stickers or send pictures, videos, and even GPS coordinates to let your friends know what you’re up to.<p>- A full-featured social networking service: Post your day-to-day activities to your Timeline or comment on your friends’ posts.<p>- Group chats: Share important information with your co-workers or talk about mutual interests with your closest friends.<p>- Find new expressions in the Sticker Shop: The world’s largest collection of stickers features famous and unique characters from around the world to let you express yourself just the way you want to.<p>- Stay informed with LINE official accounts: Connect directly with your favorite celebrities and companies by friending their official accounts.<p>- Get connected to new apps: LINE provides a gateway to entertainment and lifestyle apps that will keep you entertained and bring new convenience to your life.<p>- Make international calls with LINE Out: Make international calls to mobile phones and landlines at competitively low rates. You can even call friends who aren&#39;t LINE users (available in certain countries only).<p>We recommend that you use LINE with Android OS versions 4.0.3 and above.<p>For more information about LINE, check out our official website.<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://line.me/en/%26sa%3DD%26usg%3DAFQjCNHdIIqgCnS_qjeh8T_wKURmtPxW-A&amp;sa=D&amp;usg=AFQjCNFIdODcQpZO3frId5TGZcdvSY8E-Q" target="_blank">http://line.me/en/</a></p></p></p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/jp/naver/line/android', 'line-free-calls-amp-messages.png', '["line-free-calls-amp-messages-0.png","line-free-calls-amp-messages-1.png","line-free-calls-amp-messages-2.png","line-free-calls-amp-messages-3.png","line-free-calls-amp-messages-4.png","line-free-calls-amp-messages-5.png","line-free-calls-amp-messages-6.png"]', 0, 0, '', 'jp.naver.line.android', 'friends, calls, line’s, features, with your, with friends, with line, official accounts, make international calls, and video calls', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:12:22', '2016-05-18 01:12:22', 0),
(22, 11, 15833, 'PororoCon', 'pororocon', ' <div jsname="C4s9Ed">★★★welcome to pororocon!★★★<br>- Easily create my child’s avatar! <br>- Smart and fun English game learning! <br>- Pororo Fairy Tale, an amazing combination! <br>- Click, Click! Photo Zone!<p>★Attendance Check Event <br>- You can earn 10 candies every day simply by running the app!<p>★ By purchasing Candy Pass<br>- You gain limitless access to Games, Fairy Tales and Photo Zone!<br>- You gain access to 20+ Outfits and the entire 8 themes! <br>  (Upon cancellation of the pass, outfits and themes will be deleted automatically.)<br>- you gain complete access to games, fairy tales, photo zone, outfits and themes. <br>- However, the number of character slots can only be added with candies, <br>and outfits and themes purchased with the pass will automatically be deleted upon <br>cancellation of the free pass.<p>★ Help<br>- For inquiries, please send an email to <a href="mailto:help@weplli.com">help@weplli.com</a> and we will get back to you as soon as we can.</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/weplli/project/pororocon', 'pororocon.png', '["pororocon-0.png","pororocon-1.png","pororocon-2.png","pororocon-3.png","pororocon-4.png","pororocon-5.png","pororocon-6.png"]', 0, 0, '', 'com.weplli.project.pororocon', 'themes, outfits, access, fairy, outfits and, photo zone, and themes, you gain, games fairy tales', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:12:29', '2016-05-18 01:12:29', 0),
(23, 11, 15834, 'Tamil English Translator', 'tamil-english-translator', ' <div jsname="C4s9Ed">Free translator helps you to translate anything in Tamil to English or English to Tamil.<br> <br>•	Its completely free, faster and very easy solution for translations. You can use translated text to send message,<br>      mail, facebook post or whatsapp messages.<br>•	 Its also helpful for student who are learning English from their native language. <br>•	you can user app as Tamil dictionary or English dictionary.<br>•	App works in both mode, Tamil to English Translator or English to Tamil Translator.<br>•	 Its complete shabdkosh or dictionary.<br>•	English to Tamil translation is very accurate so that is can be used your school or college work.<br>•	App is also helpful for travellers and student.<br>•	Its solution for &quot;how to learn english&quot;.  <p>Later we will add dictionary and phrases in English, which will help English learners.</p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/thewebvalue/tamil/english', 'tamil-english-translator.png', '["tamil-english-translator-0.png","tamil-english-translator-1.png","tamil-english-translator-2.png","tamil-english-translator-3.png","tamil-english-translator-4.png","tamil-english-translator-5.png","tamil-english-translator-6.png"]', 0, 0, '', 'com.thewebvalue.tamil.english', 'english, tamil, dictionary, translator, • its, dictionary •, • app, helpful for', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:12:38', '2016-05-18 01:12:38', 0),
(24, 11, 4964, 'Dr. Panda''s Christmas Bus', 'dr-pandas-christmas-bus', ' <div jsname="C4s9Ed">Take the wheel and step on the gas as you head down snowy roads in Dr. Panda’s Bus Driver: Christmas! Dr. Panda has decorated his bus for the season, and it’s up to you to drive around picking up passengers and take them to where they want to go! With its intuitive and easy to use controls, even the youngest drivers will be able to enjoy the Christmas sights as they cruise around the wintery and wonderful world of Dr. Panda’s Bus Driver: Christmas!<p>Dr. Panda’s Bus Driver: Christmas was designed with kids in mind, and is most suitable for 3 to 7 year olds.<p>Key features:<p>• World is generated randomly for nearly endless play<br>• See snow covered trees, shining bright lights, and other Christmas sights!<br>• Dr. Panda’s Bus has had a makeover with reindeer horns and a shiny red nose!<br>• Drawbridges, railroad crossings, tunnels and dozens of other fun features fill the landscape<br>• Take it slow and enjoy the scenery or go at top-speed! It’s up to you!<br>• Kid-friendly interface so everyone can enjoy the game, no matter how big or small<br>• No in-app purchases<br>• No third party ads<p><br>Privacy Policy <p>As a designer of kids’ games, we understand how important privacy is in this modern, digital world. You can read our privacy policy here: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.drpandagames.com/privacy%26sa%3DD%26usg%3DAFQjCNGC47Q3q7ZWb0fvdJjtzl3a1pe4Vw&amp;sa=D&amp;usg=AFQjCNFrhYKok6iOhYM0twUaB9D5zUA8Eg" target="_blank">http://www.drpandagames.com/privacy</a> <p>About Dr. Panda<p>Dr. Panda is a developer of games for kids. We develop games with educational values that help kids learn about the world. All of our games are safe and do not contain inappropriate content, in-app purchases or any third-party advertising.<br> <br>If you’d like to know more about us and how we design games for kids visit our website www.drpandagames.com/about. If you have any questions feel free to send us an email at <a href="mailto:support@drpandagames.com">support@drpandagames.com</a> or contact us on Facebook (www.facebook.com/drpandagames) or Twitter (www.twitter.com/drpandagames) or Instagram www.instagram.com/drpandagames.</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/tribeplay/pandabusxmas', 'dr-pandas-christmas-bus.png', '["dr-pandas-christmas-bus-0.png","dr-pandas-christmas-bus-1.png","dr-pandas-christmas-bus-2.png","dr-pandas-christmas-bus-3.png","dr-pandas-christmas-bus-4.png","dr-pandas-christmas-bus-5.png","dr-pandas-christmas-bus-6.png"]', 0, 0, '', 'com.tribeplay.pandabusxmas', 'games, drpandagames, christmas, world, panda’s bus, com drpandagames, enjoy the, bus driver, bus driver christmas', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:12:44', '2016-05-18 01:12:44', 0),
(25, 11, 13950, 'Step By Step Salah - Namaz', 'step-by-step-salah-namaz', ' <div jsname="C4s9Ed"><b>“Step by Step Salah</b> is an Islamic Smartphone application meant for instructing Muslims all over the world about how to effectively offer prayers (Namaz) along with all the essential information. It is a comprehensive guide for believers to get themselves familiar with every aspect of daily prayers, non-obligatory Salat and others.<br>.<br><b>Features</b><br>Some of the unique features of this Salat app are:<p>• In depth illustration of each step taken during every Salat Prayer along with Audio<p>• Clear steps with detailed descriptions.<p>• Easy on the eye user interface.<p>• Covering each and every facet of performing Salaah.<p>• Different Settings options depending upon gender and sect.<p>• Share option for benefiting others with this useful Prayer App is also provided. <p><b>Categories</b><br>The learning outcomes of this application are divided into five major classes with real time step-by-step method:<br>.<br><b>1. Daily Prayers</b><br>This section tells about the nature of Rakaat (Fard or Mandatory, Sunnah Emphasized or Mu`akkadah, Sunnah Gher Mu`akkadah, Nafl Mustahab and Witr Wajib) that come in each Daily Prayer for all 5 five obligatory Namaz, i.e. <i>Fajar, Duhr, Asr, Maghrib and Isha</i>.<br>.<br><b>2. Occasional Salah</b><br>Number and kinds of Rakaat and different supplications that come in Jumma Prayer, Funeral (Namaz e Janazah), Tasbeeh (Salatul Tasbeeh), Salat al Istikhara and Eid are covered in this category.<br>.<br><b>3. Preparation</b><br>In this segment, the believers will come to know about necessary characteristics associated with learning Namaz rules. The learnings are spread over maintaining complete Cleanliness, how to perform Wudu, Covering all Body parts and keeping importance of Time of the prayer in mind. <br>.<br><b>4. Making up</b><br>This category is all about making Muslims aware of the significance of carrying out Missed Salah, how to offer Qaza Namaz and performance of omitted Salat under different circumstances. It also lets user know about common Mistakes that occur during routine prayers.<br>.<br><b>5. Timings</b><br>This part is all about making app consumers identify with the correct prayer timing for all five compulsory Salat. It tells about the actual occasion of Namaz based on different information sources of current <b>Location, Juristic</b> (Hanfi, Shafi), <b>Calculation</b> methods (WML, Makkad, Karachi, ISNA, Tahran, Egypt) and <b>Latitude</b> (Angle Based, Mid Night, One Seventh). It also informs about the upcoming Namaz instance in three different Adhan Sounds.<br>.<br>If you are looking for a complete guide on how to pray Namaz with step by step illustration, then download this Islamic application now in order to know about adequate information about performance of Salah.</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/quranreading/stepbystepsalat', 'step-by-step-salah-namaz.png', '["step-by-step-salah-namaz-0.png","step-by-step-salah-namaz-1.png","step-by-step-salah-namaz-2.png","step-by-step-salah-namaz-3.png","step-by-step-salah-namaz-4.png","step-by-step-salah-namaz-5.png","step-by-step-salah-namaz-6.png"]', 0, 0, '', 'com.quranreading.stepbystepsalat', 'namaz, prayer, salat, different, about the, know about, all about, about making, all about making', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:12:49', '2016-05-18 01:12:49', 0),
(26, 11, 2457, '3350+ English Grammar Practice', '3350-english-grammar-practice', ' <div jsname="C4s9Ed">NEW!!!! English grammar practice includes 3350 grammar exercises at three levels (beginner, intermediate , advanced) and is divided into different subjects of life.<br>Exercise is associated with context will help you understand and remember the grammar in a natural way.<br>The application will help you improve your English in general and in particular of English grammar.<p>------All topics of this app-----<br>Speaking already<br>Drive carefully<br>Listen vs. Hear<br>Finish vs. End<br>Start vs. Begin<br>Modal Verbs<br>How to use the articles<br>Relative Pronouns<br>Present Tense<br>Conditionals<br>We went on holiday<br>Grammar Questions<br>An Easy Question<br>Learn it by heart<br>White Water Rafting<br>Where am I?<br>Remove the Spoon<br>Weather Forecast<br>On TV tonight<br>The Bells<br>Sailing<br>Responses<br>Question Tags<br>Object Pronoun<br>Relative Pronoun Exercises<br>Reflexive Pronouns<br>Basic American English<br>Basic English Grammar<br>Basic Weather Expressions<br>Basic English Expressions<br>Elementary English Grammar<br>Question Words<br>Common Prepositions<br>Modal Verb Questions<br>Elementary Grammar Questions<br>English Grammar Exercise<br>Much, many, a lot, lots<br>Elementary Adjectives<br>Chit Chat: At the bus stop<br>Chit Chat: Talking about the Doctor<br>Chit Chat: In the Aeroplane<br>Chit Chat: At the pub<br>Chit Chat: At the restaurant<br>Chit Chat: On the phone<br>Chit Chat: In the theatre<br>Chit Chat: In the supermarket<br>Chit Chat: In the train<br>Other, another, others, the others<br>Adjective Prepositions Constructions<br>Anything, nothing, something, everything<br>American homophones<br>Pronouns: who, whose, whom, which<br>Some, any, few, little<br>Prepositons Test<br>Past Participle Sentences<br>ESL Prepositions<br>Common English Errors<br>Common Quantity Nouns<br>Using Make and Do (1)<br>Using Prepositions<br>Using Make and Do (2)<br