(34, 13, 15731, 'Singtel Dash', 'singtel-dash', ' <div jsname="C4s9Ed">Singtel Dash is mobile payment designed for life in Singapore. Dash takes you through the day, from your morning coffee to your commute home from work.  You no longer have to fumble with your cards, deal with a wallet full of loose change or run into out of-cash-moments. <p>Singtel Dash is convenient, secure and easy to use. <p>With one app, you can:<p>•	Pay at over 20,000 locations islandwide like FairPrice, Watsons, Food Republic, KFC, 7-Eleven &amp; more<br>•	Pay, check and top up your balance from your phone on buses and trains (enabled with an NFC Transit SIM       <br>        and an NFC-enabled phone)<br>•	Find out about deals near you * <br>•	Top up your app on the go from other bank accounts or via your Singtel bill for instant use<br>•	Enjoy up to 5% Cashback when you pay with Dash<br>•	Top up your Singtel Prepaid number<br>•	Donate any amount to charities from your phone<br>•	Send money to friends locally from mobile to mobile<br>•	Remit money to friends and family overseas<p>*Location services may be disabled to improve battery life</p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/SingTel/mWallet', 'singtel-dash.png', '["singtel-dash-0.png","singtel-dash-1.png","singtel-dash-2.png","singtel-dash-3.png","singtel-dash-4.png","singtel-dash-5.png"]', 0, 0, '', 'com.SingTel.mWallet', 'singtel, friends, money, phone, from your, your singtel, singtel dash', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:13:20', '2016-05-18 01:13:20', 0),
(35, 13, 12616, 'UOB Mighty', 'uob-mighty', ' <div jsname="C4s9Ed">UOB Mighty makes banking, dining and payments effortless. You no longer have to visit a branch for your daily transactions, search through restaurant reviews through multiple mediums, or even carry your wallet with you. We make all these features effortless and readily accessible through your mobile device.<p>Bank. Manage your finances on the go.<p>Dine. Search and book more than 3,200 restaurants in Singapore with reviews based on actual dining experience.<p>Pay. Make a contactless payment at more than 10,000 store terminals.<p>Bank, Dine and Pay. That’s UOB Mighty.<p>Do take note that: <p>The latest version introduces new features and it has been further optimised to provide a better user experience.<p>Pay. You can now digitise your MasterCard credit cards to make a contactless payment at MasterCard PayPass  terminals in store. <p>Dine. It&#39;s now easier to identify restaurants that can be booked through UOB Mighty with &quot;Chope Booking Available&quot; placed below every restaurants listing.</p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/uob/mighty/app', 'uob-mighty.png', '["uob-mighty-0.png","uob-mighty-1.png","uob-mighty-2.png","uob-mighty-3.png","uob-mighty-4.png"]', 0, 0, '', 'com.uob.mighty.app', 'mighty, restaurants, payment, store, uob mighty, contactless payment, more than, experience pay', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:13:24', '2016-05-18 01:13:24', 0),
(36, 13, 15732, 'AXS Payment', 'axs-payment', ' <div jsname="C4s9Ed">Now, you can have your own AXS Station.<p>AXS payment services are now accessible on your mobile device. With AXS m-Station, you can enjoy the freedom, flexibility and convenience of making payments for bills and fines, and telco prepaid top-up anywhere, anytime. <p>Enjoy these additional features with AXS m-Station app:<br>- Receive e-mail receipt (eReceipt) of all your successful transactions.<br>- Activate the Passcode for security and store your bill account details securely under “My Favorites” for easy &amp; quick payment. <br>- Payment history for the last 3 months is kept for your reference upon activating the Passcode. <p>What kinds of bills can you pay?<br>- General (e.g. Utility, Telco, storage) <br>- Credit Cards<br>- Loans<br>- Insurance<br>- Season Parking<br>- Town Councils<br>- Healthcare<br>- Memberships<br>- Condo/Building<p>Fine payment services for the following agencies are also available: <br>- Land Transport Authority (LTA) <br>- Traffic Police<br>- Urban Redevelopment Authority (URA) <br>- State Courts<br>- Housing Development Board (HDB)<br>- National Environment Agency (NEA)<br>- National Parks Board (NParks)<br>- Singapore Customs<p>Top-up services from:<br>- M1 Limited<br>- Singtel<br>- StarHub Ltd<br>- Alipay Purchase Card<p>eServices for:<br>- HDB - Loan Instalments, Upgrading Cost, Rent &amp; Other Charges Payment<br>- HDB - Registered Renovation Contractor Registration Fee &amp; Other Related Fees<br>- HDB - Season Parking Charges<br>- HDB - Parking Fines<br>- HDB - Subletting Admin Fee<br>- LTA - Buy e-Day Licence<br>- LTA - Enquire e-Day Licence<p>Download your own personal AXS Station now. <p>Payment mode: <br>- eNETS<br>- DBS/POSB MasterCard Debit Card<br>- DBS PayLah!, <br>- MasterPass<br>- MasterCard<p>Note: To ensure there is minimal disruption to your payment using MasterPass, it is recommended that your OS version of your mobile device is Kit Kat 4.4 and above.<p>Search keywords: AXS, station, kiosk, bills, fines, payment, Singapore, government, transaction, eNETS, utility, telco, credit card, top-up, sg, eservices, prepaid, paylah, DBS, MasterPass, MasterCard.</p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/axs', 'axs-payment.png', '["axs-payment-0.png","axs-payment-1.png","axs-payment-2.png","axs-payment-3.png","axs-payment-4.png","axs-payment-5.png","axs-payment-6.png"]', 0, 0, '', 'com.axs', 'payment, station, fines, parking, axs station, for the, utility telco, season parking, your mobile device', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:13:29', '2016-05-18 01:13:29', 0),
(37, 14, 6089, 'HIIT - interval training timer', 'hiit-interval-training-timer', ' <div jsname="C4s9Ed">Caynax HIIT - free high intensity interval training timer for workouts like tabata, cardio etc.<p>Have You ever wanted to burn body fat and get perfect abs?<br>Try interval workout to burn belly fat and then Caynax Aerobic Weider Six (A6W) app to form perfect 6 pack.<p>High-intensity interval training (HIIT), also called High-Intensity Intermittent Exercise (HIIE) or sprint interval training, is an enhanced form of interval training, an exercise strategy alternating periods of short intense anaerobic exercise with less-intense recovery periods. HIIT is a form of cardiovascular exercise. Usual HIIT sessions may vary from 9–20 minutes. These short, intense workouts provide improved athletic capacity and condition, improved glucose metabolism, and improved fat burning.<p>HIIT session consists of a warm up period of exercise, followed by six to ten repetitions of high intensity exercise, separated by medium intensity exercise, and ending with a period of cool down exercise. The high intensity exercise should be done at near maximum intensity. The medium exercise should be about 50% intensity. The number of repetitions and length of each depends on the exercise. The goal is to do at least six cycles, and to have the entire HIIT session last at least fifteen minutes and not more than twenty.<p>There is no specific formula to HIIT. Depending on your level cardiovascular development, the moderate-level intensity can be as slow as walking.<br>The original protocol set a 2:1 ratio of work to recovery periods, for example, 30–40 seconds of hard sprinting alternated with 15–20 seconds of jogging or walking.<p>HIIT is considered to be an excellent way to maximize a workout that is limited on time.<p>Because of exercise intensity this type of workout is not intended for everyone. You should consult:<br>- health doctor to determine if You are capable to perform such exercises<br>- professional trainer to create workout schedule for You.<p>You can use this app for workouts like: Tabata, Fartlek, Kettlebell, jumping ropes, meditation, yoga and other fitness workouts that could use timer.<p>Main features:<br>- Enhanced timer<br>- multi view /multi window support<br>- Workout schedule for next 30 days<br>- Workout reminder<br>- Option to change workout time for calendar days<br>- Workouts list with option to create, delete and edit workouts<br>- Workout schedule for whole week<br>- Voice feedback - TTS countdown with option to edit spoken texts (PRO only) - You might need additional TTS software like IVONA Text-to-Speech HQ.<br>- Beeps countdown with option to use built-in beeps or set any sound (PRO only)<br>- Countdown: every second, every &#39;n-th&#39; second, first &#39;n&#39; seconds, last &#39;n&#39; seconds, remaining last &#39;n&#39; seconds (some option available only in PRO version)<br>- TTS/Beep information about workout stage<br>- Rewind backward and forward (PRO only)<br>- Built-in sample workout for Tabata na Fartlek.<p>Used permissions:<br>- READ_PHONE_STATE - used to detect incoming phone call and pause workout. Ad networks use device ID number (that is hashed using SHA-1 algorithm) to identify users.<br>- RECEIVE_BOOT_COMPLETED - to start reminder service after phone start.<br>- ACCESS_NETWORK_STATE, INTERNET - ads, crash reports.<br>- WRITE_EXTERNAL_STORAGE/READ_EXTERNAL_STORAGE - backup/restore workouts list.<br>- WAKE_LOCK - to ensure that workout works when screen is off.</p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/caynax/hiit', 'hiit-interval-training-timer.png', '["hiit-interval-training-timer-0.png","hiit-interval-training-timer-1.png","hiit-interval-training-timer-2.png","hiit-interval-training-timer-3.png","hiit-interval-training-timer-4.png","hiit-interval-training-timer-5.png","hiit-interval-training-timer-6.png"]', 0, 0, '', 'com.caynax.hiit', 'workout, exercise, intensity, workouts, high intensity, interval training, workout schedule, schedule for, high intensity exercise, countdown with option', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:13:36', '2016-05-18 01:13:36', 0),
(38, 14, 15840, 'Safety Savvy', 'safety-savvy', ' <div jsname="C4s9Ed">Safety Savvy<p>Safety Savvy provides timely training safety related information.<p>&quot;CAT 1&quot; tells you which sector you are in. Just call in for CAT weather update. Standard procedures in inclement weather is also available.<p>&quot;Contacts&quot; provides listing of all medical facilities in order of aphabetical or distance from you.<p>&quot;Evac. Route&quot; shows you the map view of medical facilities around you. It shows traffic conditions and provides driving direction.</p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/mindef', 'safety-savvy.png', '["safety-savvy-0.png","safety-savvy-1.png","safety-savvy-2.png"]', 0, 0, '', 'com.mindef', 'provides, shows, facilities, weather, medical facilities', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:13:39', '2016-05-18 01:13:39', 0),
(39, 14, 4213, 'Chest Workout - LumoWell', 'chest-workout-lumowell', ' <div jsname="C4s9Ed">Chest workout at home, best chest exercises without equipment to get sculpted pecs.<p>Pectoral workout divided into 4 difficulty levels, a comprehensive bodyweight exercise program that can be done without tools, wherever you want. <p>The application provides you with a virtual personal trainer who will guide you in the workout by showing you how to perform the exercises correctly and by motivating you. A fun and inexpensive way to effectively train your pecs. <p>To get defined and muscular pecs you need to train consistently, but monotony is one of the major causes of failure. The app will help you to be constant and the virtual coach will make your workouts fun and different. <p>To get sculpted pecs, in addition to training, it’s important to follow a proper diet that provides the energy you need to work out in the best way possible, to ensure adequate protein for muscle growth, and to help you lose excess fat by speeding up your metabolism. For this reason, by unlocking the advanced version, the application will offer you a chance to follow a weekly meal plan.<p>Train harder by testing your limits, and test your progress with the Push Up Challenge, a 30 day chest exercise program to follow day by day. The increasing intensity workout will allow you to gradually increase effort, avoiding stalling muscle phases. At the end of the 30 days your pecs will be stronger, toned and defined. <p>The application is suitable for everyone, men can increase the mass and definition of their pecs, while women can tone and lift the breasts. This is because the GH, a hormone essential for muscle growth, will allow men, who have high levels of it, to maximize hypertrophy whereas in women, who have rather low levels, it will prevent an unsightly swelling of the muscles.<p>In summary, this app provides:<br>- A 4-level program that will guide you along the way by indicating the weekly frequency and the time required to move on to the next level. <br>- Detailed explanation of the exercises with videos and descriptions to avoid mistakes. <br>- Alternative lower intensity exercises for those who want a slower approach <br>- A daily eating plan specifically designed for the muscle definition and development. <br>- The Push up Challange for an even more intense challenge. <br>- Cool-down stretching exercises for the arms and chest during the workout. <br>- Motivational phrases to push you to try your best and achieve your goals.<p>Chest workout application made ​​by Ego360 for the LumoWell / LumoFit project. Material Design inspired.<p>Follow us:<p>- YouTube channel: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://goo.gl/jl3wc1%26sa%3DD%26usg%3DAFQjCNEDfsh1VCoKJZ_iYNlEOYAfYJ_L9w&amp;sa=D&amp;usg=AFQjCNHlv7RL-z-64ZC3_NT1rskO4-GjWg" target="_blank">http://goo.gl/jl3wc1</a><br>- Website: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.lumowell.com/%26sa%3DD%26usg%3DAFQjCNFho1iUGDaX7cflU_GbUi6JZRhfjg&amp;sa=D&amp;usg=AFQjCNHWLEswivUtQ-rlxFREiGprVSdztA" target="_blank">http://www.lumowell.com/</a><br>- Facebook: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://goo.gl/RytPDg%26sa%3DD%26usg%3DAFQjCNHc4QZRH4YbG75jR3Kk59j6rvz8dg&amp;sa=D&amp;usg=AFQjCNFG9B9DYfsZYzpY4i7zoDPHyiLVbQ" target="_blank">http://goo.gl/RytPDg</a><br>- Google+: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://goo.gl/3Q8Tru%26sa%3DD%26usg%3DAFQjCNEFYxPx6uJi6alxJR6VjxWn5gU9qw&amp;sa=D&amp;usg=AFQjCNGlclI02uaPI_XWKD8Dg9BMXFtdqA" target="_blank">http://goo.gl/3Q8Tru</a></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/ego360/chest', 'chest-workout-lumowell.png', '["chest-workout-lumowell-0.png","chest-workout-lumowell-1.png","chest-workout-lumowell-2.png","chest-workout-lumowell-3.png","chest-workout-lumowell-4.png","chest-workout-lumowell-5.png","chest-workout-lumowell-6.png"]', 0, 0, '', 'com.ego360.chest', 'workout, chest, exercises, muscle, for the, the application, http goo, for muscle, for muscle growth, get sculpted pecs', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:13:44', '2016-05-18 01:13:44', 0),
(40, 14, 15841, 'Beauty Tips in Tamil', 'beauty-tips-in-tamil', ' <div jsname="C4s9Ed">This Application contains 200+ Beauty Tips for both men and women<br>Do not need internet after download.<br>Will be updated weekly.</div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/sri/beautytips', 'beauty-tips-in-tamil.png', '["beauty-tips-in-tamil-0.png","beauty-tips-in-tamil-1.png","beauty-tips-in-tamil-2.png"]', 0, 0, '', 'com.sri.beautytips', '', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:13:47', '2016-05-18 01:13:47', 0),
(41, 14, 15842, 'PumpUp — Fitness Community', 'pumpup-fitness-community', ' <div jsname="C4s9Ed">Achieve and celebrate your health goals with the world’s most positive community!<p>PumpUp is a safe and supportive space to share your journey toward a healthy body and healthy mind. Share your challenges and triumphs, track your fitness, and receive unparalleled support from a global community of like-minded people. PumpUp equips you with the tools you need to live a healthy lifestyle in a positive way. With millions of inspiring people cheering you on, it’s never been easier to become the best version of you! <p>Join the 4 million people who have downloaded PumpUp!<p>SHARE YOUR JOURNEY<br>You’re 4x more likely to achieve your goals if you share your progress with the PumpUp community! Snap a pic after a tough workout or before a healthy meal, share it with our amazing community, and start accomplishing your health goals! <p>GET HEALTHY &amp; ACTIVE<br>Whether it’s workouts, weight, or activities, PumpUp has the tools you need to lead a healthy life. Discover the best routines created by members of the community, and get coached through your workout with voice guidance and videos for over 500 exercises. You’ll be equipped with the tools to make your dream a reality!<p>RECEIVE SUPPORT FROM POSITIVE PEOPLE<br>PumpUp is the most positive community on the Internet. With millions of members from over 150 countries cheering you on, any goal is possible. Start sharing your journey and in no time, you’ll have a 24/7 support group that’s always there to keep you motivated!<p>FIND THE PERFECT ROLE MODEL <br>From Olympic athletes, to personal trainers, to certified nutritionists, to people just like you, there’s someone for everyone to look up to. You’ll be sure to discover knowledgeable people who will give you advice, tips, workouts, and encouragement along your health journey! <p>Join millions of positive people in the PumpUp community and take your health journey to the next level!</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/co/pumpup/app', 'pumpup-fitness-community.png', '["pumpup-fitness-community-0.png","pumpup-fitness-community-1.png","pumpup-fitness-community-2.png","pumpup-fitness-community-3.png","pumpup-fitness-community-4.png","pumpup-fitness-community-5.png","pumpup-fitness-community-6.png"]', 0, 0, '', 'co.pumpup.app', 'community, people, healthy, pumpup, your health, with the, share your, the tools, your health journey, the pumpup community', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:13:52', '2016-05-18 01:13:52', 0),
(42, 15, 15843, 'FixIt Mobile', 'fixit-mobile', ' <div jsname="C4s9Ed">Tutoriales en video para arreglar y cambiar la pantalla de móviles o tableta de las marcas Apple, Sony Ericsson, Cubot, Samsung, HTC o LG.</div> <div jsname="WJz9Hc" style="display:none">Video tutorials to fix and change the display of mobile or tablet of Apple brands, Sony Ericsson, Cubot, Samsung, HTC and LG.</div> <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/mobincube/android/sc_38MKNS', 'fixit-mobile.png', '["fixit-mobile-0.png","fixit-mobile-1.png","fixit-mobile-2.png","fixit-mobile-3.png","fixit-mobile-4.png"]', 0, 0, '', 'com.mobincube.android.sc_38MKNS', 'samsung, cubot, ericsson, video, samsung htc, cubot samsung, ericsson cubot, sony ericsson, ericsson cubot samsung, sony ericsson cubot', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:13:58', '2016-05-18 01:13:58', 0),
(43, 15, 15844, 'CommCare', 'commcare', ' <div jsname="C4s9Ed">Used in over 50 countries, CommCare (www.commcarehq.org) is the most widely adopted, technically advanced, and evidence-based mobile platform for low-resource settings. CommCare is easily customizable, open source, and supports frontline workers (FLWs) across 200+ projects in over 50 countries. FLWs use CommCare to track and support their clients with registration forms, checklists, SMS reminders, and multimedia. Mounting evidence indicates that this leads to improved frontline worker performance, better reporting, and better client practices and education. CommCare is the only platform for FLWs that is open source, supports longitudinal client tracking, is specialized for low-literate users, runs on Java and Android phones, runs offline, integrates SMS for performance improvement, and has an application builder designed for non-programmers. CommCare is also used to build rapid diagnostic tools and medical reference libraries, allowing users to flag critical cases to appropriate parties. <p> <br>Features include: <p>    Counseling messages<br>    Supports multiple languages<br>    Data collection<br>    Interactive multimedia<br>    Branching logic<br>    GPS Integration<br>    Runs on Android and Java feature phones<br>    Offline usage and storage<br>    Web-based reporting<br>    SMS-enabled</p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/org/commcare/dalvik', 'commcare.png', '["commcare-0.png","commcare-1.png","commcare-2.png","commcare-3.png"]', 0, 0, '', 'org.commcare.dalvik', 'commcare, supports, client, reporting, open source, for low, platform for', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:14:00', '2016-05-18 01:14:00', 0),
(44, 15, 977, 'Nombres Para Niños', 'nombres-para-ninos', ' <div jsname="C4s9Ed">Más de 100 Nombres de niño ideal para elegir el nombre de tu Bebe, ordenados de forma alfabética de la A-Z.<p>Puedes deslizarte lateralmente para verlos por letra o hacer click directamente en el menú para ir a una letra concreta.<p>Son los nombres más usados este año.</p></p></div> <div jsname="WJz9Hc" style="display:none">Over 100 Names ideal to choose the name of your baby, sorted in alphabetic order of the AZ child.<p>You can slide laterally to them by letter or click directly on the menu to go to a specific letter.<p>The names commonly used this year.</div> <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/makinapps/nombresninos', 'nombres-para-ninos.png', '["nombres-para-ninos-0.png","nombres-para-ninos-1.png","nombres-para-ninos-2.png","nombres-para-ninos-3.png"]', 0, 0, '', 'com.makinapps.nombresninos', 'names, letter, click, letra', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:14:04', '2016-05-18 01:14:04', 0),
(45, 15, 15845, 'NenaMark1', 'nenamark1', ' <div jsname="C4s9Ed">NenaMark is a benchmark/demo of OpenGL ES 2.0, using programmable shaders for graphical effects such as reflections, dynamic shadows, parametric surfaces, particles and different light models to push the GPU to its limits.<br>Enjoy!<p>Note that high-end devices are better served by NenaMark2 as they tend to hit the framerate limit (~60 fps) with NenaMark1.</p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/se/nena/nenamark1', 'nenamark1.png', '["nenamark1-0.png","nenamark1-1.png"]', 0, 0, '', 'se.nena.nenamark1', '', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:14:06', '2016-05-18 01:14:06', 0);
