(49, 16, 15848, 'Live 4D Singapore', 'live-4d-singapore', ' <div jsname="C4s9Ed">This is the Ultimate Live 4D App for Singapore Pools fans. <br>You can watch the result Live at 6:33pm on draws dates. <p>This is also the most feature rich Application for 4D in the whole of Singapore. <p>Features include <br>1) 4D result checks Past result<br>2) Money Box 4D prediction. <br>3) Number history search More than 10 years of past history. <br>4) Reading out of result in various language (Hokkien, English, Mandarin)<br>5) Best of all it is still free<p>In app purchase, allow live result, (free from 6:45pm onwards)<br>Unlimited favorite number and dream analysis  <p>***   This app is developed and provided independent of the involvement of Singapore Pools. To the extent that the reporting of 4D and Toto results may be inaccurate, please note that such inaccuracies are not the responsibility of and should not be attributed to Singapore Pools. ***</p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/live/live4d', 'live-4d-singapore.png', '["live-4d-singapore-0.png","live-4d-singapore-1.png","live-4d-singapore-2.png","live-4d-singapore-3.png","live-4d-singapore-4.png"]', 0, 0, '', 'com.live.live4d', 'singapore, result, pools, history, singapore pools', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:14:16', '2016-05-18 01:14:16', 0),
(50, 16, 15849, 'Deliveroo', 'deliveroo', ' <div jsname="C4s9Ed">Deliveroo lets you order food from the best loved restaurants around you to your door - in an average of 32 minutes.<p>**Available in the UK, France, Ireland, Spain, Belgium, Netherlands, Singapore and Australia on Android!**<p>**We don&#39;t currently deliver to the US or Canada.**<p>- Order from hundreds of restaurants, including names like Busaba Eathai, Carluccio&#39;s, Wagamama, Gourmet Burger Kitchen, MEATliquor, Pho as well as many top quality independents.<p>- Enjoy the best burgers in town, the tastiest sushi in the neighbourhood or the most authentic pizzas around in the comfort of your own four walls.<p>- Get your food just as the chef intended with our super fast deliveries.<br>Featured on the BBC, Wired, TechCrunch, The Independent, Telegraph, Bloomberg and many others.<p>If you’re enjoying Deliveroo, please take a minute to rate us on the Google Play Store. Thanks for your support!</p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/deliveroo/orderapp', 'deliveroo.png', '["deliveroo-0.png","deliveroo-1.png","deliveroo-2.png","deliveroo-3.png","deliveroo-4.png","deliveroo-5.png"]', 0, 0, '', 'com.deliveroo.orderapp', 'restaurants, order, deliveroo, , the best', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:14:19', '2016-05-18 01:14:19', 0),
(51, 16, 15848, 'Live Toto Singapore', 'live-toto-singapore', ' <div jsname="C4s9Ed">This is our Live Toto App, We bring you the results Live at 6:33pm every Monday and Thursday. It is the fastest alternative to find out the Toto Result<p>Features Include <br>1) Past history search <br>2) Past Stats of hit number sorted into 1,3,6, 9 and 12 Months. <br>3) Readout using  of winning number, in English , Mandarin or Hokkien<p>In app purchase (premium member) required for live result from 6:33pm to 6:45pm.<p><br>***   This app is developed and provided independent of the involvement of Singapore Pools.  To the extent that the reporting of 4D and Toto results may be inaccurate, please note that such inaccuracies are not the responsibility of and should not be attributed to Singapore Pools. ***</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/live/livetoto', 'live-toto-singapore.png', '["live-toto-singapore-0.png","live-toto-singapore-1.png","live-toto-singapore-2.png","live-toto-singapore-3.png"]', 0, 0, '', 'live.livetoto', 'pools, singapore, results, , singapore pools', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:14:21', '2016-05-18 01:14:21', 0),
