aratives .<br>　　<br><b>★ Multilayer protection: </b>Fix system vulnerabilities and scan new apps, file systems and websites to ensure your device&#39;s safety and your privacy in real-time. Clean your system and boost your device.<br>　<br><b>★ Fast and handy: </b>Scanning takes just seconds, 500% faster than other paid anti virus scanners. CM Security is also lightweight, taking up half as much phone memory as other antivirus apps . Integrated with the highest rated cleanup and boost features, your device can be lighter, faster and protected.<br> <br><b>★ Compatible with both phone and tablet</b><br>　<br><b>Features of CM Security</b><br> <br><b>★ AppLock &amp; Vault - The fastest &amp; safest applock for android in the world</b><br>Lock your photos, gallery and messages from prying eyes and nosy friends<br>Prevent your children from buying unwanted apps/games<br> <br>　<br><b>★ Find Phone | Anti-Theft (NEW!)</b><br>The best &quot;FREE&quot; find my phone tool.<br>Locate your phone on a map (To control your device remotely, go to <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://findphone.cmcm.com%26sa%3DD%26usg%3DAFQjCNHbHNgGe6UW1SRmiG4GwNDfhFjTnQ&amp;sa=D&amp;usg=AFQjCNHPBzy-FXYk0-xHC5A2cKDkNr2MKQ" target="_blank">https://findphone.cmcm.com</a>)<br>Make the device yell to find it.<br>Lock the device to protect your privacy.<br> <br><b>★ APP &amp; SYSTEM SCANNER</b><br>Scan pre-installed and installed apps and the file system to keep your phone safe from virus, trojan, vulnerability, adware, malware and spyware.<br> <br><b>★ SD CARD SCAN</b><br>Scan external SD cards thoroughly to detect and delete threats.<br> <br><b>★ ON-INSTALL SCAN</b><br>Prevent harm to your device with real-time scanning of new applications and updates.<br> <br><b>★ SCHEDULED SCAN</b><br>Routine automatic scanning allows for passive security.<br> <br><b>★ CALL BLOCKING</b><br>Prevent harassment by blocking unwanted phone calls.<br> <br><b>★ SAFE BROWSING</b><br>Block