(57, 18, 549, 'MX Player', 'mx-player', ' <div jsname="C4s9Ed">MX Player - The best way to enjoy your movies.<p><br>a) HARDWARE ACCELERATION - Hardware acceleration can be applied to more videos with the help of new HW+ decoder.<p>b) MULTI-CORE DECODING - MX Player is the first Android video player which supports multi-core decoding. Test result proved that dual-core device’s performance is up to 70% better than single-core devices.<p>c) PINCH TO ZOOM, ZOOM AND PAN - Easily zoom in and out by pinching and swiping across the screen. Zoom and Pan is also available by option.<p>d) SUBTITLE GESTURES - Scroll forward/backward to move to next/previous text, Up/down to move text up and down, Zoom in/out to change text size.<p>e) KIDS LOCK - Keep your kids entertained without having to worry that they can make calls or touch other apps. (plugin required)<p><br>Subtitle formats:<p>- DVD, DVB, SSA/ASS Subtitle tracks.<br>- SubStation Alpha(.ssa/.ass) with full styling.<br>- SAMI(.smi) with ruby tag support.<br>- SubRip(.srt)<br>- MicroDVD(.sub)<br>- VobSub(.sub/.idx)<br>- SubViewer2.0(.sub)<br>- MPL2(.mpl)<br>- TMPlayer(.txt)<br>- Teletext<br>- PJS(.pjs)<br>- WebVTT(.vtt)<p>******<br>About &quot;Draw over other apps&quot; permission: This permission is required to block system buttons when input blocking is activated on the playback screen.<br>About &quot;Control vibration&quot;, &quot;Prevent phone from sleeping&quot; permissions: These permissions are required for media playback on some devices.<br>******<br>If you are facing &quot;package file is invalid&quot; error, please install it again from product home page (<a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://sites.google.com/site/mxvpen/download%26sa%3DD%26usg%3DAFQjCNFVy6-l6Iow2-l-YwxNChmw6F66Cw&amp;sa=D&amp;usg=AFQjCNGr0975shUpiXfZycayKjh5ST22lQ" target="_blank">https://sites.google.com/site/mxvpen/download</a>)<br>******<p><br>If you have any questions, please visit XDA MX Player forum.<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://forum.xda-developers.com/apps/mx-player%26sa%3DD%26usg%3DAFQjCNGUFBQxEmvOIdAm3TKlz-ZzUb2nzg&amp;sa=D&amp;usg=AFQjCNGsCQorCSmzbyVYl_GO6bUEHXnD9w" target="_blank">http://forum.xda-developers.com/apps/mx-player</a><p>Some of the screens are from the Elephants Dreams licensed under the Creative Commons Attribution 2.5.<br>(c) copyright 2006, Blender Foundation / Netherlands Media Art Institute / www.elephantsdream.org<p>Some of the screens are from the Big Buck Bunny licensed under the Creative Commons Attribution 3.0 Unported.<br>(c) copyright 2008, Blender Foundation / www.bigbuckbunny.org</p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/mxtech/videoplayer/ad', 'mx-player.png', '["mx-player-0.png","mx-player-1.png","mx-player-2.png","mx-player-3.png","mx-player-4.png","mx-player-5.png","mx-player-6.png"]', 0, 0, '', 'com.mxtech.videoplayer.ad', 'player, required, subtitle, licensed, licensed under, from the, are from, under the, creative commons attribution, the creative commons', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:14:48', '2016-05-18 01:14:48', 0),
(58, 18, 560, 'musical.ly', 'musically', ' <div jsname="C4s9Ed">musical.ly is a video community that allows you to create, share, and discover short videos. <p>Highlights:<br>- Shoot, save and share short videos up to 15 seconds long.<br>- Edit videos with creative effects and filters, such as slow motion, time lapse, and hyper speed.<br>- Discover exciting new music and artists.<br>- Record and upload your own original audio tracks for others to use.<br>- Collaborate with friends and people from around the world with the unique duet function.<br>- Share videos directly to Facebook, Instagram, Twitter, Vine, and other social media networks.<br>- Save videos privately so only you can see them.<br>- Use hands free recording to record themselves when no one’s around to help.<p>Any feedback? Contact us at <a href="mailto:info@musical.ly">info@musical.ly</a> or tweet us @musicallyapp<p>*****<br>PLEASE READ BEFORE DOWNLOAD: Android tablets and some Android phone models are NOT fully supported by the current version. There might be some glitches and please report the issues (with your device model) to <a href="mailto:support.android@musical.ly">support.android@musical.ly</a>. We are doing our best to make musical.ly working on all devices ASAP.<br>*****</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/zhiliaoapp/musically', 'musically.png', '["musically-0.png","musically-1.png","musically-2.png","musically-3.png"]', 0, 0, '', 'com.zhiliaoapp.musically', 'videos, share, record, android, short videos', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:14:52', '2016-05-18 01:14:52', 0),
(59, 18, 1102, 'VivaVideo: Free Video Editor', 'vivavideo-free-video-editor', ' <div jsname="C4s9Ed">Powered by Top Developer in Google Play Store, VivaVideo is one of the best video editor &amp; slideshow maker apps in Android market. It has over 150 million people all over the world so far and has been featured in Google Play many times, ranked as No.1 free video editor &amp; movie maker app in 70+ countries. With VivaVideo, you can easily create your video story and share with your friends &amp; family, transforming everyday moments into works of art as you want.<p>2016 Brand new UI design brings you brand new experience and better performance!<p>#VivaVideo Key Features:<p>+ Powerful Video Editor<br>- Easy-to-use professional editing tools<br>- Trim and merge video clips in storyboard editing<br>- Enhance your videos with various texts, fonts, FX, stickers, music, filters, transitions and live subtitles/dubbing.<br>- Slow and fast motion, along with Reverse effect create your own style movies<br>- All editing operations can be instant previewed in WYSIWYG way<p>+ Creative Video Camera Lenses<br>- Support multi capture options: Basic/Selfie/FX/Funny/Music Video/Collage<br>- Exclusive selfie camera with multiple fascinating lenses<br>- Use nine funny lenses to play your “prank skills”<br>- Capture videos especially for Instagram &amp; Vine<p>+ HOT Photo Slideshow Maker<br>- The easiest way to turn your photos into movie masterpiece and create video slideshow in several clicks!<br>- Import your favorite musics/ popluar songs to make perfect slideshow<p>+ All FREE Materials to Download<br>- 200+ special effects including Animated Stickers/Filters/FX/Texts/Fonts/Transitions<br>- Tons of themes to choose including Birthday, Love, Friends, Pets, Travel, Cute<br>- Support GIPHY to use the up-to-date and massive animated stickers/GIFs anytime!<p>+ Unique Video Collage (PIP) Maker<br>- Merge clips into one story with many awesome &amp; fancy collage templates<p>+ Export and Share<br>- Export your videos to the gallery at any time<br>- Share your works to Facebook, Youtube, Instagram, WhatsApp, Vine, Snapchat, Facebook Messenger, Line, kik, Vimeo, email and etc<p>If you have any problems, please feel free to contact us: <a href="mailto:support@vivavideo.tv">support@vivavideo.tv</a><br>Your feedback is welcomed and highly appreciated. Or you can<br>Like us on Facebook:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/vivavideoapp%26sa%3DD%26usg%3DAFQjCNGiDodkkGL5pFo4i0KXinQC9y3ieQ&amp;sa=D&amp;usg=AFQjCNFSCIJ39vKc0HUTBQi_FVF_X8l72w" target="_blank">https://www.facebook.com/vivavideoapp</a><br>Follow us on Twitter:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://twitter.com/vivavideoapp%26sa%3DD%26usg%3DAFQjCNF7HGkh1yG6L1JHWj_FxsUxGl6hZA&amp;sa=D&amp;usg=AFQjCNGJm08y0O3fKDW8N0WilzmmosJtNQ" target="_blank">https://twitter.com/vivavideoapp</a><br>Instagram: @vivavideoapp<br>TAG #Vivavideo for a chance to get featured on SNS &amp; have fun with all of us!</p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/quvideo/xiaoying', 'vivavideo-free-video-editor.png', '["vivavideo-free-video-editor-0.png","vivavideo-free-video-editor-1.png","vivavideo-free-video-editor-2.png","vivavideo-free-video-editor-3.png","vivavideo-free-video-editor-4.png","vivavideo-free-video-editor-5.png","vivavideo-free-video-editor-6.png"]', 0, 0, '', 'com.quvideo.xiaoying', 'video, maker, facebook, slideshow, video editor, your videos, texts fonts, animated stickers, video editor &amp', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:14:57', '2016-05-18 01:14:57', 0),
(60, 18, 2781, 'VLC for Android', 'vlc-for-android', ' <div jsname="C4s9Ed">VLC media player is a free and open source cross-platform multimedia player that plays most multimedia files as well as discs, devices, and network streaming protocols.<p>This is the port of VLC media player to the Android™ platform. VLC for Android can play any video and audio files, as well as network streams and DVD ISOs, like the desktop version of VLC.<p>VLC for Android is a full audio player, with a complete database, an equalizer and filters, playing all weird audio formats.<p>VLC is intended for everyone, is totally free, has no ads, no in-app-purchases, no spying and is developed by passionate volunteers. All the source code is available for free.<p><br>Features<br>––––––––<br>VLC for Android™ plays most local video and audio files, as well as network streams (including adaptive streaming), DVD ISOs, like the desktop version of VLC.<p>All formats are supported, including MKV, MP4, AVI, MOV, Ogg, FLAC, TS, M2TS, Wv and AAC. All codecs are included with no separate downloads. It supports subtitles, Teletext and Closed Captions.<p>VLC for Android has a media library for audio and video files, and allows to browse folders directly.<p>VLC has support for multi-track audio and subtitles. It supports auto-rotation, aspect-ratio adjustments and gestures to control volume, brightness and seeking.<p>It also includes a widget for audio control, supports audio headsets control, cover art and a complete audio media library.<p><br>NOTA BENE<br>–––––––––––<br>This version is for all devices except ARMv6 devices. They will be supported in a future release.<p>Permissions<br>––––––––––––<br>VLC for Android needs access to :<br>• &quot;Photos/Media/Files&quot; to read your all media files :)<br>• &quot;Other&quot; to check network connections and hide the streaming parts when needed.<p>Permission Details :<br>• It needs &quot;read the contents of your USB storage&quot;, in to order to read your media files on it.<br>• It needs &quot;modify or delete the contents of your USB storage&quot;, in order to allow deletion of files.<br>• It needs &quot;full network access&quot;, to open network and internet streams.<br>• It needs &quot;prevent phone from sleeping&quot; in order to prevent... your phone from sleeping when watching a video.<br>• It needs &quot;change your audio settings&quot;, in order to change audio volume.<br>• It needs &quot;modify system settings&quot;, in order to allow you to change your audio ringtone.<br>• It needs &quot;view network connections&quot; in order to monitor whether device is connected or not, to hide the streaming parts.<p>- For Android TV app only:<br>• It needs &quot;to receive the ACTION_BOOT_COMPLETED that is broadcast after the system finishes booting&quot; to set recommendations on Android TV launcher screen.</p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/org/videolan/vlc', 'vlc-for-android.png', '["vlc-for-android-0.png","vlc-for-android-1.png","vlc-for-android-2.png","vlc-for-android-3.png","vlc-for-android-4.png","vlc-for-android-5.png","vlc-for-android-6.png"]', 0, 0, '', 'org.videolan.vlc', 'audio, needs, files, network, for android, media files, vlc for, the streaming, phone from sleeping, change your audio', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:15:03', '2016-05-18 01:15:03', 0),
