(62, 19, 15850, 'Period Calendar, Cycle Tracker', 'period-calendar-cycle-tracker', ' <div jsname="C4s9Ed"><b>Period Calendar - Menstrual Tracker</b><br> <br>Period Calendar is an extremely elegant and easy-to-use application that helps women keep track of periods, cycle, ovulation, and fertile days.  Whether you are concerned about conceiving, birth control, contraception, or regularity of period cycles, Period Calendar can help.<br> <br>Our tracker is easy to use and offers everything you need: Track irregular periods, weight, temperature, moods, blood flow, symptoms and more.<br> <br>Discreet reminders keep you informed and prepared for upcoming periods, ovulation, and fertile days.<br> <br>The calendar is great at predicting fertility, ovulation and periods.  The app adapts to your cycle history and accurately predicts the key days that interest you.<br> <br>See everything you need at a glance on the calendar home page.<br> <br>Period Calendar protects your most private data—the calendar can be password locked, keeping your information hidden from prying eyes.<br> <br>Easy backup and restore of your data to protect against device loss or replacement.<br> <br><i>Key features:</i><br><b>Period tracker, calculator and calendar</b> <br>- Intuitive calendar in which you can visualize non-fertile, fertile, ovulation, expected period and period days<br>- Calendar, cycles and settings can be quickly backed up and restored. Never be afraid to lose your calendar data<br>- Our intuitive health tracker shows vital information at a glance<p><b>Daily period log with detailed tracking</b><br>- The daily calendar planner lets you save information on flow, intercourse, symptoms, moods, temperature, weight, medicine, PMS, other diary notes<br>- Easily move between calendar days<br>- Notifications for upcoming period, fertility windows or ovulation<br>- Protect your period calendar using a unique PIN code<p><b>Always have up-to-date info with the tracker</b><br>- Track period data and ovulation signs on your calendar<br>- Choose from different units of measurement<br>- Reset tracker data to start fresh<br>- Adjust period prediction intervals in the Settings section<br>- Adjust luteal phase length<br>- Track cervical observations <br>- Start the tracker on a custom “first day of week” (Monday or Sunday)<p><b>Period tracker with abstinence mode</b><br>- Hide ovulation, fertility and intercourse related data<br>- Make this calendar the perfect period tracker for girls and teens<p>Elegant and sophisticated, just like you! This highly customizable period tracker and pregnancy planning calendar is perfect for every woman.<p>Download our period calendar free today!<p>Follow us on:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://period-tracker.com/%26sa%3DD%26usg%3DAFQjCNFuHfGch5dajflzxBJWtvISoj-MUA&amp;sa=D&amp;usg=AFQjCNFZqs90IaKYeoVa-QUxsxYi5jCc4A" target="_blank">http://period-tracker.com/</a><br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/pages/Period-Calendar/971814886201938%26sa%3DD%26usg%3DAFQjCNECr1ABMvpPJZ1aF8OqT_rzdbOulg&amp;sa=D&amp;usg=AFQjCNF19driHsk6J62biXFiw1NyXNijWQ" target="_blank">https://www.facebook.com/pages/Period-Calendar/971814886201938</a><br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://twitter.com/MenstrualTrack%26sa%3DD%26usg%3DAFQjCNH7v0MP208b3cdTwM2GZNlmwS80kg&amp;sa=D&amp;usg=AFQjCNHWtqrI_M3ffO10bolYx8R3Aw21rQ" target="_blank">https://twitter.com/MenstrualTrack</a></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/lbrc/PeriodCalendar', 'period-calendar-cycle-tracker.png', '["period-calendar-cycle-tracker-0.png","period-calendar-cycle-tracker-1.png","period-calendar-cycle-tracker-2.png","period-calendar-cycle-tracker-3.png","period-calendar-cycle-tracker-4.png","period-calendar-cycle-tracker-5.png","period-calendar-cycle-tracker-6.png"]', 0, 0, '', 'com.lbrc.PeriodCalendar', 'period, calendar, tracker, ovulation, period calendar, period tracker, ovulation and, the calendar, and fertile days', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:15:13', '2016-05-18 01:15:13', 0),
(63, 19, 15738, 'Pregnancy +', 'pregnancy', ' <div jsname="C4s9Ed">Pregnant? Get the worldwide No.1 Pregnancy App.<p>Want to see beautiful, interactive images for every week of pregnancy? Join more than 7 million users who already use this Pregnancy App to follow their pregnancies. <p>Our Pregnancy+ App can also be personalized for dads, grandparents and other family members. <p>Everything you need in one Pregnancy App!<p>- DAILY pregnancy info <br>- Color and scan images <br>- Personal diary<br>- Personal weight log<br>- Doctor appointment log<br>- Diet, exercise and labor info <br>- Kick counter<br>- Contraction timer <br>- Baby shopping list <br>- 1000s of Baby names<br>- Baby size guide <br>- Pregnancy week by week info <br>- And much more … <p>Recommended by healthcare providers and pediatricians, Pregnancy+ was created with the help of leaders in the fields of healthcare, childbirth and parenting to provide you with the most up-to-date information.<p>This App is not intended for medical use, or to replace the advice of a trained medical doctor. Health &amp; Parenting Ltd disclaims any liability for the use or misuse you make based on the App, which is provided to you on a general information basis only and not as a substitute for personalized medical advice. If you have any concerns about your pregnancy, consult with your doctor or midwife immediately.<p>The Health &amp; Parenting team wishes you a healthy, full-term pregnancy and a safe delivery.</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/hp/pregnancy/lite', 'pregnancy.png', '["pregnancy-0.png","pregnancy-1.png","pregnancy-2.png","pregnancy-3.png","pregnancy-4.png","pregnancy-5.png","pregnancy-6.png"]', 0, 0, '', 'com.hp.pregnancy.lite', 'pregnancy, parenting, doctor, medical, pregnancy app, &amp parenting, with the, health &amp, health &amp parenting', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:15:17', '2016-05-18 01:15:17', 0);
