(64, 19, 4433, 'Lybrate - Consult a Doctor', 'lybrate-consult-a-doctor', ' <div jsname="C4s9Ed">✪ Among the World&#39;s Most Innovative Companies of 2016 in Healthcare by FastCompany ✪<br>✯ Most Promising Start Up of the Year at VCCircle Healthcare Awards 2015 ✯<br>✪ Innovative Start Up of the Year at Entrepreneur India Awards 2015 ✪<br>★ Lybrate is Indian Medical Association&#39;s Digital Partner ★<p>Lybrate has revolutionized the way people in India take care of their health. We have more than 100,000 doctors registered with us from all over the country to help you lead a healthy and happy life. Be it about managing diabetes of your parents living in a different city, or finding solutions to various pediatric problems of your kids, or dealing with your own stress, or any lifestyle or infectious disease, now you have a doctor for everything just a tap away. Chat with top doctors of India, find valuable health tips from them, get opinions from multiple trusted doctors, reach out to the top doctors from different cities, and find and book appointments with the best doctors in your own city.<p>Features:<br>\\ Find Doctors: Find and book appointments online with doctors. Find doctor online in Delhi NCR, Mumbai, Chennai, Kolkata, Pune, Bangalore, Hyderabad, Chandigarh, and other major cities of India.<br>\\ Ask Health Questions: Ask doctor your health-related questions anonymously in an open forum or privately to the trusted doctor of your choice. Get answers to your ask doctor your health queries from qualified doctors.<br>\\ Get Multiple Opinions: Post your health-related questions in an open forum and get many trusted doctors from the concerned specialty answer those. <br>\\ Virtual Consultation: Discuss your health issues privately with the doctor of your choice. You can also add your doctor here and do routine stuff like showing medical reports, asking for diet plans, and other consultation right from the cozy comfort of your home. You can pay from here and get the right consultation whenever you need it. <br>\\ Daily Health Tips: Get precious health tips and suggestions on a wide range of health issues from trusted doctors. <br>\\ Know About Trends: Learn about the prevalent diseases and endemics in your area and the world over and ways of avoiding those from doctors.<br>\\ Personalized Plans from Doctors: Get disease-specific healing tips from your doctor to heal better at home. A feature extremely useful for pregnant women, people undergone some kind of surgery, physiotherapy patients, and the likes in which every day care is critical.<br>\\ Manage Medical Records: You don’t need to manage those messy paper records anymore. Click a photo and upload your documents on the cloud to access those anytime anywhere.<br>\\ Connect with Doctors: Connect with top doctors from all over India on various issues. Learn about diseases and conditions, and ask your health-related queries.<br>\\ Do this all for FREE.<p>DOWNLOAD THE FREE APP NOW <p>Find Doctors in the following Specialties:<br>Ear Nose and Tongue<br>Ayurveda<br>General Physician<br>Pediatrician<br>Dentist<br>Physiotherapist<br>Gastroenterologist<br>Cardiologist<br>Dietitian-Nutritionist<br>Endocrinologist<br>Opthalmologist<br>Dermatologist<br>Gynaecologist<br>Sexologist<br>And More<p>Testimonies From Our Users:<br>★★★★★ “Helpful in health problems It is a better app for cunsulting your health problems” - Prduyumna Kumar  <br>★★★★★ “Great app! I got my doubts solved in half a day. I got clear answer from a good doctor. I am satisfied.” – Nagaraj bhat <p>Lybrate is also available on the web: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.lybrate.com%26sa%3DD%26usg%3DAFQjCNFUmb-zfGbZ7jWN0IP7x-KFnJL5jw&amp;sa=D&amp;usg=AFQjCNEhWKElVQzHNeT2iDZa6Pn8PMKkkw" target="_blank">https://www.lybrate.com</a>;<br>We’d love to hear from you. Questions, comments or ideas on how to improve the app? Drop us a line at <a href="mailto:hello@lybrate.com">hello@lybrate.com</a> or @Lybrate.<br>Lybrate doctor discovery service is currently only available for doctors in India. We’re growing quickly – so if we’re not in your country yet, check back soon!</p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/lybrate/phoenix', 'lybrate-consult-a-doctor.png', '["lybrate-consult-a-doctor-0.png","lybrate-consult-a-doctor-1.png","lybrate-consult-a-doctor-2.png","lybrate-consult-a-doctor-3.png","lybrate-consult-a-doctor-4.png","lybrate-consult-a-doctor-5.png","lybrate-consult-a-doctor-6.png"]', 0, 0, '', 'com.lybrate.phoenix', 'doctors, health, doctor, india, your health, health tips, doctors from, health related, your health related, health related questions', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:15:20', '2016-05-18 01:15:20', 0),
(65, 19, 3422, 'Ear Spy: Super Hearing', 'ear-spy-super-hearing', ' <div jsname="C4s9Ed">Ear Spy attempts to improve your hearing with the power of Android.  Depending on how good your phone is, it can become a high-powered listening device (like a hearing aid or a super Spy App).  It is the Ultimate Eavesdropping Tool -- the latest in personal espionage.<p>Click on the center button, and you can hear the world around you.  Use it to observe your surroundings and monitor what is going on.<p>Whether you want to eavesdrop on conversations or just hear the TV better, Ear Spy aims to give you super hearing and improve what you hear.  There&#39;s more going on around you than you might realize.  It&#39;s time to hear it. <p>HEADPHONES REQUIRED.  Failure to use headphones will result in awful audio feedback.  You have been warned!<p>NOTE ON REVIEWS:  Please review the app if you try it.  But I know you hate leaving reviews . . . because I hate leaving reviews.  So, if you can think of nothing to say . . .just leave a review saying &quot;Rad&quot; if you love it or &quot;Bogus&quot; if you hate it.  Or, just say &quot;Eh&quot; if you have no opinion.  However, I love full and honest reviews as they really help us . . . but anything is good.  Five stars would be awesome.  Now, back to what the app does . . . .<p>Ear Spy is a &quot;Super Spy&quot; application which gives you super-hearing and the ability to eavesdrop on those around you.  With some bluetooth headsets, you can eavesdrop from the next room (tested with the Motorola HT820 Headset).<p>Ear Spy amplifies sound coming through your phone microphone straight to your earphones.  To fine-tune the incoming signal, use the graphic audio equalizer to tactically tune in to your surrounding environment.<p>Perfect for the inquisitive spy within you who wants to snoop or overhear things.  But also perfect for those who are hard of hearing or suffer hearing loss (many people use it as a hearing aid).  It’s not just used to listen in on what others are saying.<p>Upgrade to the pro version for some great added benefits:<br>  --An extended Graphic Equalizer (more than 5 bands if your phone permits it)<br>  --Echo Cancellation (AEC)<br>  --Noise Suppression (NS)<br>  --Virtualizer (Android 4.1 and above)<br>  --Automatic Gain Control (AGC)<br>  --Bass-Boost (Bass)<br>  --MP3 Recording<br>  --Home Screen Widget<br>  --Ad-Free Spying!<p>Learn more about Ear Spy by going to <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.earspyapp.com/%26sa%3DD%26usg%3DAFQjCNFXpNGFy9VyXAatE-Ts9bJIrrZp6w&amp;sa=D&amp;usg=AFQjCNEaoQDFfzdj18lWqtJlk9A5CXCtyA" target="_blank">http://www.earspyapp.com/</a>.  <p>To find out how to use Ear Spy, here is a tutorial on Youtube: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.youtube.com/watch?v%253Dk4AdynDFD0A%26sa%3DD%26usg%3DAFQjCNGkMMjP09s6hvuNY_JiPyU6o-ZyyA&amp;sa=D&amp;usg=AFQjCNHW2Nm3fc9li5Ru4KRdh48U77h0qA" target="_blank">https://www.youtube.com/watch?v=k4AdynDFD0A</a><p>Are you a blogger?  We&#39;d love for you to tell your readers about our apps.  You can download images and resources at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.overpass.co.uk/app/ear-spy/%26sa%3DD%26usg%3DAFQjCNGxoquY0v3CtshlUxnNmJM_E_vnvg&amp;sa=D&amp;usg=AFQjCNEtG_iz7Yh0feFWp4jz-0JR_tXNYA" target="_blank">http://www.overpass.co.uk/app/ear-spy/</a> or contact us at <a href="mailto:info@overpass.co.uk">info@overpass.co.uk</a> for any other information you might need.<p>Concerned about Security?  Ear Spy is perfectly safe to use.  But make sure you get the official version from Google Play (and not a file sharing site): https://play.google.com/store/apps/details?id=com.microphone.earspy<p>Privacy Notice<p>This is a &quot;spy&quot; application, but we do not spy on you.<p>We do not collect or store any information about the users of this application.  Once you download it, it runs on your phone and never communicates with our servers.<p>If you are curious about how we make money, it is from Ads and sales only.  We do not collect any information about you.  We use Google Analytics which provides us with anonymous data.  We also develop apps for clients (at www.overpass.co.uk).<p>We are not NSA agents or intelligence spooks.  We created a very cool tool that was inspired by the undercover secret agent movies we watched when we were young.<p>We&#39;ve created a video explaining how safe Ear Spy is on Youtube here: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.youtube.com/watch?v%253D7sWlEmwVD_Q%2526feature%253Dyoutu.be%26sa%3DD%26usg%3DAFQjCNHYBMCLB3hqsrjGYVQWaZGv2ag_IQ&amp;sa=D&amp;usg=AFQjCNH6A_4qN6ARe3jc39Ceg1DnHIUkSg" target="_blank">https://www.youtube.com/watch?v=7sWlEmwVD_Q&amp;feature=youtu.be</a><p>Disclaimer<p>We do not condone using Ear Spy to break laws or intrude on private conversations.  Please use Ear Spy responsibly.  Check to see what is legal in your country before using it.<p>Ear Spy is not wiretap and cannot be used to tap anyones phone.  It does not violate the privacy of anyone else’s phone.  It simply allows you to hear better.</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/microphone/earspy', 'ear-spy-super-hearing.png', '["ear-spy-super-hearing-0.png","ear-spy-super-hearing-1.png","ear-spy-super-hearing-2.png","ear-spy-super-hearing-3.png","ear-spy-super-hearing-4.png","ear-spy-super-hearing-5.png","ear-spy-super-hearing-6.png"]', 0, 0, '', 'com.microphone.earspy', 'hearing, phone, youtube, super, ear spy, your phone, you can, around you, any information about, hate leaving reviews', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:15:23', '2016-05-18 01:15:23', 0),
(66, 19, 5790, '1mg-Save on Medicine/LabTests', '1mg-save-on-medicinelabtests', ' <div jsname="C4s9Ed">1mg is your health app that tells you about your medicines, their substitutes and side effects. We give you regular health tips, let you order medicines find the best doctor near you and book lab tests with sample pickup from your home.<br><b>Features:</b><br>- Substitutes: Just type in the medicine name and we show you cheaper substitutes. Some may be 90% cheaper than what you’re prescribed.<br>- Information: You get personal, useful health tips written by expert doctors that help you lead a healthier life.<br>- Side effects: Know about a medicine&#39;s impact on pregnancy, lactation and its effect on your body if you consume it with alcohol. 100,000+ Medicines listed!<br>- Ordering: Just upload your prescription and order Allopathic medicines, Homeopathic pills, Cancer and other Speciality drugs. Earn upto 15% discounts. Available in Delhi, Faridabad, Ghaziabad, Noida.<br>- Book Lab Tests: Book blood tests, thyroid tests through the app, and save upto 30%<br>- Find best doctors and book appointments in Delhi/NCR, Mumbai, Bengaluru and Chennai. We&#39;re adding other major cities soon.<br>- Know important details like Doctor&#39;s Reviews, Feedback, Consultation Fees, Clinic Address, among other important factors. Find doctors from all specialties including Gynaecologists, Dermatologists, Orthopaedists, General Physicians, Neurologists, just to name a few.<br>- Get second opinion on Cancer from expert trusted specialists.<br><b>Awards &amp; Recognition:</b><br>- Rated one of the best “Made in India” apps by Apple in 2014.<br>- Recognized by the Government of India - Ministry of Health and Family Welfare as a m-health initiative that consumers can use<br>- Ranked Top App in Medical Category in India - Android &amp; iOS<br>- Frost &amp; Sullivan Award for &quot;Innovative Healthcare Service Delivery Model of the Year” <br>- VC Circle Award for the &quot;Most promisi