(70, 20, 15851, 'Dailyhunt (NewsHunt) News', 'dailyhunt-newshunt-news', ' <div jsname="C4s9Ed">Dailyhunt (Formerly NewsHunt) app provides latest news, study materials for competitive exam preparation &amp; books. Stay updated with breaking news, current events &amp; daily news headlines on politics, business, technology, bollywood, sports, live cricket score &amp; more for India &amp; World. Read news in Hindi, Malayalam, Kannada, Tamil, Telugu, Marathi, Bangla, Gujarati, Urdu, Oriya &amp; Punjabi. Prepare for exams with study materials, question banks &amp; mock tests for IBPS, UPSC, SSC, UGC NET, IAS, LIC, Railways &amp; many more in an exclusive new section on Dailyhunt. Also, read magazines &amp; free books from a wide range of authors across all genres.<p><br>Dailyhunt is available for India, Srilanka, Bangladesh, UAE, Africa. It has been redesigned with a beautiful interface making experience of reading lighter, content more personalized &amp; better performance in an application loved by more than 90 million users.<br>★ Top 10 Consumer Mobile Apps in India - Nielsen Consumer Rankings ★<br>★ Must Have App - Live Mint ★<br>★ World Class app from Indian App Developer - Next Big What ★<br>★ Winner GSMA Mobile Award for Best Mobile Publishing Product ★<br>★ Winner mBillionth Award for News &amp; Journalism ★<p>REGIONAL NEWS ON DAILYHUNT<p>• Hindi (हिन्दी समाचार पत्र) – Live Hindustan, Aajtak, Patrika, Amar Ujala, Rajasthan Patrika, Oneindia Hindi, Outlook Hindi<br>• Malayalam – Malayala Manorama, Mathrubhumi, Marunadan Malayali, Asianet News, Mangalam<br>• Kannada – Kannada Duniya, Kannada Prabha, Suvarnanews TV, Oneindia Kannada, Vijayavani, Prajavani<br>• Tamil – Dinamalar, Dinakaran, Dinamani, Vikatan, Oneindia Tamil, Nakkheeran<br>• Telugu – Sakshi, Eenadu, AP Herald, Oneindia Telugu, AndhraJyothy<br>• Marathi (मराठी वृत्तपत्रे) – Lokmat, Loksatta, Saamana, Tarun Bharat, Marathimati<br>• Bangla – AnandaBazar Patrika, Hindusthan Samachar Bangla<br>• Gujarati – Gujarat Samachar, Sandesh, GSTV, Vishwa Gujarat<br>• Oriya (Odia) – Orissa Sambad, Odisha Samachar<br>• Punjabi – Ajit Jalandhar, Doaba Headlines, Rozana Spokesman<p>DAILYHUNT NEWS FEATURES<p>• Newsreader presents aggregated headlines personalized through a recommended stream of news &amp; videos<br>• Read News from National &amp; Regional Newspapers &amp; Websites<br>• Browse by topics - add to favorite will appear in your personalized stream <br>• Support for 15 languages even if your phone doesn&#39;t support the language &amp; font <br>• Get Local News from Indian districts &amp; towns, world news, weather, horoscopes &amp; stock updates<br>• Opt in to get notifications of Breaking News<br>• Set text size &amp; background color as per your preference<br>• Share News over SMS, Whatsapp, Email, Facebook or any other app you have installed<br>• Hundreds of licensed partners<p>DAILYHUNT EXAM PREPARATIONS<p>• Exam Preparation provides mock tests, solved papers &amp; study material for government exams in India - IBPS, SSC, UPSC, UGC NET, IAS, LIC, Railways, Defense, Judicial services, Teaching &amp; more<br>• Stay updated on current affairs &amp; Government job openings<br>• Study various subjects like English, General Knowledge, Reasoning (verbal &amp; non-verbal), Numerical Ability, Computers, Marketing &amp; more<br>• Helps you prepare efficiently by providing real-time analysis of your answers &amp; ranks you against others who are aiming to prepare for exams<br>• Exam content provided by publishing houses such as Upkar Prakashan, Mock Bank, Arihant, Jiwan, Mockbank, Kiran Publications &amp; Cosmos Bookhive<p>DAILYHUNT BOOK STORE/READER FEATURES<p>• Browse, download &amp; read the largest collection of English &amp; regional language books<br>• Choose from thousands of free ebooks<br>• Buy individual chapters for select books instead of full book<br>• Read magazines &amp; magazine singles (single articles) like Saras Salil, Caravan, Stardust, Champak, Grihshobha &amp; Manohar Kahaniya<br>• Pay using mobile phone in addition to your credit/debit cards - Buy eBook using your mobile operator (for Indian customers only)<p>REACH US<br>Report any issues or share feedback &amp; tell us how we can improve - write to <a href="mailto:YourFriends@dailyhunt.in">YourFriends@dailyhunt.in</a></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/eterno', 'dailyhunt-newshunt-news.png', '["dailyhunt-newshunt-news-0.png","dailyhunt-newshunt-news-1.png","dailyhunt-newshunt-news-2.png","dailyhunt-newshunt-news-3.png","dailyhunt-newshunt-news-4.png","dailyhunt-newshunt-news-5.png","dailyhunt-newshunt-news-6.png"]', 0, 0, '', 'com.eterno', 'mobile, ★★, oneindia, kannada, ★★ winner, from indian, award for, news &amp', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:15:43', '2016-05-18 01:15:43', 0),
(71, 20, 10800, '联合早报', '', ' <div jsname="C4s9Ed">在华文媒体世界享有卓越声誉的《联合早报》推出手机app为读者带来阅读新体验。  <p>《联合早报》手机app让读者能够阅读《联合早报》原汁原味的新闻内容和报纸版面,获知每天发生的国内外大事。  <p>《联合早报》手机app提供的新闻内容包括:即时新闻、新加坡新闻、中国新闻、财经新闻、东南亚新闻、国际新闻、言论、体育新闻、副刊。  <p>《联合早报》由新加坡报业控股公司出版,属新加坡主要华文综合性日报,前身是1923年创刊的《南洋商报》和1929年创刊的《星洲日报》。1983年,这两家历史悠久的报章合并,共同出版了《南洋·星洲联合早报》,简称《联合早报》。  <p>《联合早报》被公认是一份素质高、负责任、报道客观、言论公正、可信度高的报纸,对中国和区域的发展采取积极、客观的报道态度,在华人世界中享有崇高的信誉。  <p>订户可享有以下服务：  <br>• 通过手机app浏览当日（新加坡时间凌晨6点30分）发布的PDF格式（电子报）《联合早报》印刷版内容；  <br>• 每天从上午7时到晚上9时之间不断更新的“即时报道”；  <br>• 过去七天的早报报纸新闻存档；  <br>• 重大突发新闻发生时进行推送提醒；    <p>如有疑问或反馈，请电邮到<a href="mailto:zbocs@sph.com.sg">zbocs@sph.com.sg</a>  <p><br>Subscribers get full access to:  <br>• Lianhe Zaobao as published every morning (6.30am Singapore Time) via the Android PDF edition  <br>• Updated news from 7am to 9pm daily with the &quot;Breaking News&quot; section  <br>• 7 days archive PDF for Android Edition  <br>• Push Notifications for the &quot;Breaking News&quot;  <p>Have questions or feedback on the iPhone Lianhe Zaobao App? Email us at <a href="mailto:zbocs@sph.com.sg">zbocs@sph.com.sg</a></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/zb/sph/zaobaosingapore', '.png', '["-0.png","-1.png","-2.png","-3.png","-4.png","-5.png","-6.png"]', 0, 0, '', 'com.zb.sph.zaobaosingapore', 'breaking, edition', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:15:46', '2016-05-18 01:15:46', 0),
