(75, 21, 673, 'ZEDGE™ Ringtones &amp; Wallpapers', 'zedge-ringtones-amp-wallpapers', ' <div jsname="C4s9Ed">ZEDGE™ is a <b>Google Play Best of 2015</b> app that offers free wallpapers, ringtones, app icons and notification sounds to easily customize your device. <p>Features available in ZEDGE™ include:<br>• NEW FEATURE:  Save your favorites in personal lists and access them from any device via Facebook Connect. Create personal collections so you can enjoy faves when you move from your old phone to a new in the New Year!<br>• Each wallpaper offered is perfectly matched to your device for the best experience <br>• Search with suggestions <br>• Categories with sort options including special selections for holiday like Valentines Day, Mothers Day and more as well as favorites like music, sports, comedy, landscapes and more.<br>• Set ringtones and notification sounds from within the ZEDGE™ app, including individual contact ringtones<br>• Quickly set wallpapers from within the app<br>•  App icons will complete your phone&#39;s home screen personalization and compliment your wallpaper with even more personality<br>• Add favorites without downloading - and when you create a log in you can save your favorites to use from any device at any time!<br>• Settings for automatically changing wallpapers<br>• Multiple options for sharing ZEDGE™ content with other apps and people<br>• Widget for quickly changing wallpapers<br>• Widget for quickly launching your favorite games<br>• Easy to set, mix and match custom home screen icons for your favorite Apps and games - replace the boring and predictable with app icons that say who you are<br>• Special limited edition holiday personalizations for every occasion from a birthday or anniversary to Valentines Day and Mothers Day.</p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/net/zedge/android', 'zedge-ringtones-amp-wallpapers.png', '["zedge-ringtones-amp-wallpapers-0.png","zedge-ringtones-amp-wallpapers-1.png