(77, 22, 15852, 'Photo Editor', 'photo-editor', ' <div jsname="C4s9Ed">Photo Editor is a simple and easy application for photo manipulation.<br>Adjust color, add effects, rotate, crop, resize, frame, clone, and draw on your photos. Color adjustment options include hue, saturation, contrast, and brightness. Additionally, Photo Editor offers many effects for your photos including gamma correction, auto contrast, auto tone, blur, sharpen, oil paint, sketch, black &amp; white high contrast, sepia, and more.<p>Features<br> * Adjust color, add effects, frame, clone and draw on your photos<br> * Curves interface that allows fine-tuning of colors<br> * Drawing mode, adding text or images<br> * Easy rotation, crop or resize of photos<br> * Perspective, red-eye, and backlight corrections<br> * Easily edit with the touch and pinch-to-zoom interface<br> * Use photos from your gallery and camera<br> * Save images in JPEG, PNG, GIF, WebP and PDF. Flexible control of JPEG quality.<br> * View, edit, or delete Metadata (EXIF, IPTC, XMP)<br> * Save your final result to your gallery, as wallpaper, or on your SD card<br> * Share photos via e-mail, Picasa, Facebook, Twitter, etc.<br> * Crop(Puzzle), Compress to ZIP, Create PDF, Animated GIF<br> * Webpage Capture, Video Capture(ICS+)<br> * Ad-free option is available (Settings -&gt; Purchase Items)<p>*** Links<br>Google+: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://plus.google.com/%252BDevMacgyver%26sa%3DD%26usg%3DAFQjCNHoaFwrDFVYuANw8b-YWb_9yiL5zA&amp;sa=D&amp;usg=AFQjCNFVTBH1nT8rz1FFXOROJmz7FGzA1Q" target="_blank">https://plus.google.com/+DevMacgyver</a><br>Homepage: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://photoeditor.iudesk.com%26sa%3DD%26usg%3DAFQjCNHdFrAoyegRwxj1lXbH1bhtDb4GKw&amp;sa=D&amp;usg=AFQjCNEwdS1kiYB8pKqOKCq_N48sZcm-QQ" target="_blank">http://photoeditor.iudesk.com</a><br>Tutorials: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://photoeditor.iudesk.com/p/tutorials.html%26sa%3DD%26usg%3DAFQjCNGd168UfsIJ8yrLDkB1jF-Z9CDd7Q&amp;sa=D&amp;usg=AFQjCNHGoWfPbOmUCO5uJbRJDQFKiPUJIQ" target="_blank">http://photoeditor.iudesk.com/p/tutorials.html</a><p>*** PHOTO EDITOR IS NOT SPYWARE/VIRUS!!!<br>Photo Editor does not contain virus or malicious code.<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://photoeditor.iudesk.com/p/security-report.html%26sa%3DD%26usg%3DAFQjCNGWsU58tei-nOLvEhvIxdWvzMbNHA&amp;sa=D&amp;usg=AFQjCNHTEa6OtG7mxS8wjV4SME1izppJ_A" target="_blank">http://photoeditor.iudesk.com/p/security-report.html</a><p>*** Language Support: English, Korean, Russian, Spanish, Dutch, Finnish, German, French, Japanese, Portuguese(Brazil), Italian, Catalan, Traditional Chinese, Hebrew, Simplified Chinese, Czech, Romanian, Polish, Hungarian, Swedish, Greek, Arabic, Turkish, Bengali, Indonesian, Persian, Vietnamese, Malay, Azerbaijani, Hindi<br>If you would like to participate in the translation, please contact me.</p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/iudesk/android/photo/editor', 'photo-editor.png', '["photo-editor-0.png","photo-editor-1.png","photo-editor-2.png","photo-editor-3.png","photo-editor-4.png","photo-editor-5.png","photo-editor-6.png"]', 0, 0, '', 'com.iudesk.android.photo.editor', 'photos, photo, editor, iudesk, photo editor, http photoeditor, photoeditor iudesk, your photos, http photoeditor iudesk', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:16:12', '2016-05-18 01:16:12', 0),
(78, 22, 5474, 'Insta Square Size - No Crop', 'insta-square-size-no-crop', ' <div jsname="C4s9Ed">With Insta Square Size - No Crop, post entire photos to instagram, make square photos without cropping and resize photos to fit instagram.<br>Emojis tags and smileys, Add reminder tags and emojis, smiles and make your photo more stylish.<br>40+ filters, overlays and text captions to your photos.<br>Unique filters, overlays and typography to your photos. <br>Over 100 background patterns or background colors.<br>200+ fun stickers ready for your square photos.<br>Create collage photos. <br>More than 100 special collage layouts.<br>Light leak feature, add light leak effect, turn your photos into art.<p><br>Get Insta Square Size - No Crop  now, it is the best app  to post entire photos on Instagram without cropping.</p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/lyrebirdstudio/instasquare', 'insta-square-size-no-crop.png', '["insta-square-size-no-crop-0.png","insta-square-size-no-crop-1.png","insta-square-size-no-crop-2.png","insta-square-size-no-crop-3.png","insta-square-size-no-crop-4.png","insta-square-size-no-crop-5.png","insta-square-size-no-crop-6.png"]', 0, 0, '', 'com.lyrebirdstudio.instasquare', 'photos, square, instagram, background, your photos, filters overlays, overlays and, tags and, post entire photos, insta square size', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:16:17', '2016-05-18 01:16:17', 0),
(79, 22, 6594, 'MomentCam Cartoons &amp; Stickers', 'momentcam-cartoons-amp-stickers', ' <div jsname="C4s9Ed">MomentCam allows you to create funny Cartoons and Emoticons from your photos.<p>Just choose between Comics and Emoticons and select a picture from your Albums or Facebook photos. You can then pick one of our backgrounds from thousands available, customize your avatar entirely (hair, glasses, beard and many more) and share it with your friends!<p>With backgrounds updated daily and for every occasion, region, cultural and pop reference, MomentCam will keep you wanting to come back for more.<p>Create your own personalized emoticons to express your mood in the funniest or cutest possible way!<p><b>FEATURES:</b><br>► CREATE your own PERSONALIZED cartoons and animated emoticons.<br>► PERSONALIZE your background with our latest feature!<br>► ENGAGE in activities to win prizes by sharing your creations with the MomentCam community.<p><b>CONTACT US </b><br>We are always trying to improve MomentCam and are happy to listen to your opinion.<br>For feedback, contact us at <a href="mailto:android@manboker.cn">android@manboker.cn</a> or visit our website at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.momentcamofficial.com/en/Home.aspx%26sa%3DD%26usg%3DAFQjCNFKv9QFZGsUDYh8TiHm8D136ZRvnQ&amp;sa=D&amp;usg=AFQjCNG41_KGArxOkmRfEHjjCma2xdGjXA" target="_blank">http://www.momentcamofficial.com/en/Home.aspx</a></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/manboker/headportrait', 'momentcam-cartoons-amp-stickers.png', '["momentcam-cartoons-amp-stickers-0.png","momentcam-cartoons-amp-stickers-1.png","momentcam-cartoons-amp-stickers-2.png","momentcam-cartoons-amp-stickers-3.png","momentcam-cartoons-amp-stickers-4.png","momentcam-cartoons-amp-stickers-5.png","momentcam-cartoons-amp-stickers-6.png"]', 0, 0, '', 'com.manboker.headportrait', 'momentcam, emoticons, create, contact, your own, own pers