(106, 28, 861, 'Uber', 'uber', ' <div jsname="C4s9Ed">Get a reliable ride in minutes with the Uber app—no reservations or waiting in taxi lines. <p>From low-cost to premium, every ride option feels like an upgrade to the everyday.<p>Create your account using a credit card, PayPal, or Android Pay - your fare will be charged automatically at the end of your ride. You can also pay with cash in select cities. After your trip, we’ll email you a receipt.<p>See if Uber is available in your city at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.uber.com/cities%26sa%3DD%26usg%3DAFQjCNHyADEf9VzJGgSaxUa0gmU-aheYDg&amp;sa=D&amp;usg=AFQjCNFiXsxF4bo_qvudvs_sLgXAoT43dQ" target="_blank">https://www.uber.com/cities</a><br>Find the details about our Android permissions at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.uber.com/android/permissions%26sa%3DD%26usg%3DAFQjCNG-Hal2x3Ndka0q0WHNKunJK5CzbA&amp;sa=D&amp;usg=AFQjCNEyImlZUjLrBwzVX7Snai_J_2x2GA" target="_blank">https://www.uber.com/android/permissions</a><br>Follow us on Twitter at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://twitter.com/uber%26sa%3DD%26usg%3DAFQjCNH5TW1P_NJKL_j0xV2ewFVWpva7rQ&amp;sa=D&amp;usg=AFQjCNHGlot93NOah5zfHVbSJc4YFH6QsA" target="_blank">https://twitter.com/uber</a><br>Like us on Facebook at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/uber%26sa%3DD%26usg%3DAFQjCNENAgoQJVM0uiaY2ZeuRoiGEpqjrw&amp;sa=D&amp;usg=AFQjCNF2T34ph-j8FEFGpBF2F-3fv8zbcA" target="_blank">https://www.facebook.com/uber</a><p>Have a question? Check out uber.com/help<p>If you’re interested in shaping the Uber experience and getting early access to new features, sign up to be a beta tester directly at https://play.google.com/apps/testing/com.ubercab. Find out more about our beta program at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://newsroom.uber.com/join-our-uber-android-beta-program/%26sa%3DD%26usg%3DAFQjCNGrr_IglZ-RgJAPQGQGzG0DjNCMBw&amp;sa=D&amp;usg=AFQjCNEdBArXo6BPYMYHK0dkuPVFoU8w3w" target="_blank">https://newsroom.uber.com/join-our-uber-android-beta-program/</a></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/ubercab', 'uber.png', '["uber-0.png","uber-1.png","uber-2.png","uber-3.png","uber-4.png"]', 0, 0, '', 'com.ubercab', 'https, android, program, twitter, uber com, https www, about our, beta program', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:03', '2016-05-18 01:19:03', 0),
(107, 28, 6278, 'Grab', 'grab', ' <div jsname="C4s9Ed">Get a safe and reliable ride in minutes with Grab (formerly GrabTaxi/ MyTeksi). With the largest pool of drivers in Southeast Asia, Grab offers the fastest transport booking service for cabs, private cars, motorbikes and more. With Grab, you’ll find a service for every price point and transport need:<p>GrabTaxi : Book a budget or premium cab from Southeast Asia’s largest network of cab drivers.<br>GrabCar: Travel in comfort in a private car. Only GrabCar offers fixed fares that are agreed upon upfront.<br>*GrabBike: Get around the city in the quickest way possible.<br>*GrabExpress: Deliver your parcels and documents with a delivery service you can trust.<br>*GrabHitch: Hitch a ride or give someone a lift with our carpooling community.<br>(*Only available in selected countries.)<p>Whether it’s with GrabTaxi, GrabCar or any of our other services, travel with confidence knowing that Grab invests heavily in safety training for drivers, offline driver screenings, safety features like personal accident insurance coverage, and safety education and partnerships with the government. This makes Grab one of the best ways to travel in Southeast Asia!<p>Make your booking with cash, credit card or soon, with a mobile wallet - the choice is yours. You’ll also get an email receipt immediately after your ride. <p>How to Grab:<br>1. Download the app for free and register your account<br>2. Start booking! The app auto-detects your location for pick-up. Choose your destination.<br>3. Confirm a driver and track them as they make their way to you<p>Find out more about us at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.grab.com%26sa%3DD%26usg%3DAFQjCNEWVXbiqNKiB6VajSEWeF_8eYX_QA&amp;sa=D&amp;usg=AFQjCNFuR6DyWX5snxR7PIH9nf11W0t0og" target="_blank">http://www.grab.com</a><br>Like us on Facebook at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/grab%26sa%3DD%26usg%3DAFQjCNHt0DPkBykxdcrjt6PKqInIk8m55A&amp;sa=D&amp;usg=AFQjCNErH8keSwSEyQvm_wdzMnBo5XSjPQ" target="_blank">https://www.facebook.com/grab</a></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/grabtaxi/passenger', 'grab.png', '["grab-0.png","grab-1.png","grab-2.png","grab-3.png","grab-4.png"]', 0, 0, '', 'com.grabtaxi.passenger', 'grabtaxi, grabcar, travel, safety, the app, service for, southeast asia, with the', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:07', '2016-05-18 01:19:07', 0),
(108, 28, 15745, 'SG BusLeh: With Bus Location!', 'sg-busleh-with-bus-location', ' <div jsname="C4s9Ed">A SG Bus Arrival App for both SBS and SMRT bus arrival timing that Singapore Truly Deserves!<p>This is the BEST Bus Arrival App in SG. Just see the reviews that users have been leaving!<br>-------------<p>Please know that we have no direct control over the accuracy of the bus timing data.<p>Please don&#39;t penalize us for it!!! :( :( We are just fellow Singaporeans like you who take bus to work and home daily.<p>-------------<br>Top Features <p>1. The only Bus Arrival Timing App that tells you where the bus is!<br>Simply tap on a bus arrival timing to view the location of the bus on a map!<p>2. Shows up to 3 bus timings instead of 2! <br>Now you can plan your journey in SG on SMRT or SBS buses before even leaving your home or office!<p>3. Got seats? No seat? You will know at a glance!<br>The only SG Bus App that presents SBS and SMRT bus capacity as simple bars!<p>4. Magical Unified Search<br>You can search for anything! These includes bus numbers, postal codes, buildings, road names or even bus-stop ids! Anything would work! No other bus-app comes close.<p>5. Favourites!!! <br>All new Favourites feature - simply long-press on any bus-stop to add to Favourites. If you wish to, you may be your own government and rename bus-stops when adding them to Favourites!<p>6. Bus Routes!<br>Tap on Bus service number to see bus-routes!<p>7. Don&#39;t waste time on a bus app!<br>This app is optimized for speed. We have crafted a mechanism to store the latest timing from LTA on our high-speed servers so there&#39;s no lag!<p>8. Now available on Android Wear<br>BusLeh is now available on your Android Wear smartwatches! This feature is only available for paid users.<p>9. Bus Intervals<br>BusLeh now shows you the interval between the previous and upcoming bus so that you can better predict if your bus will be crowded by the time it reaches your stop!<p>10. Notifications!<br>Let BusLeh monitor your buses for you so you don&#39;t have to. BusLeh will automatically notify you when the bus you want is arriving!<p>------------<br>Featured on Straits Times, Yahoo, Vulcanpost, Buyfromwhere and Motherhood Magazine (October 2015 Issue)!<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://sg.news.yahoo.com/battle-singapore-bus-apps-sg-040219470.html%26sa%3DD%26usg%3DAFQjCNFPU8Ssfy82qN-lRl-Qp0qWWXLZWQ&amp;sa=D&amp;usg=AFQjCNFqmTDnTS0odc49SAiH-mzIfydMCQ" target="_blank">https://sg.news.yahoo.com/battle-singapore-bus-apps-sg-040219470.html</a><br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://vulcanpost.com/238831/sg-busleh-sg-buses-singapore-bus-apps/%26sa%3DD%26usg%3DAFQjCNHh8W0cM5FRVA2rZWXnMe3zS2-4Mw&amp;sa=D&amp;usg=AFQjCNHdB7TYv7psFUqaBkSXWXP5sb5_uA" target="_blank">https://vulcanpost.com/238831/sg-busleh-sg-buses-singapore-bus-apps/</a><br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.buyfromwhere.com/sg-busleh-review-how-all-bus-apps-should-look-like/%26sa%3DD%26usg%3DAFQjCNF_Jqm7RXNHfxIFA7W5Kx2uLu4bKg&amp;sa=D&amp;usg=AFQjCNGCVwn5m1VQjhW-RvQf2UJhmXNXyQ" target="_blank">https://www.buyfromwhere.com/sg-busleh-review-how-all-bus-apps-should-look-like/</a><p>--------------<br>IMPORTANT NOTE WHEN GIVING REVIEWS:<br>What is within our control is improving the app experience. What we CAN&#39;T do is to make the timing more accurate. Instead of giving us one star (which simply just makes everybody unhappy and accomplish nothing, really), tell us exactly what time, which bus-stop and which bus service you experience problem via email so that we can send the feedback to LTA.<p>REVIEW FROM A USER<p>Seriously... this SG BusLeh app is reaally awesome. Once it launches, it very quickly determines your location and the bus-stops available nearby. When you tap on the bus-stop you choose, the buses available, their arrival times (3 arrival times!), seat availability etc are immediately revealed through a very intuitive drop-down menu. I am uitably impressed impressed, and highly recommend this for all bus users!<p>--------------<br>SUPPORT LOCAL STARTUP!<br>SG BusLeh is created by a young Singapore startup. We are all passionate programmers who would like to make your life a little better. Support us! SG BusLeh contain a small banner ad at the bottom.<p>------------<br>Note on App Permissions<p>The app permission system on Android is really broken. As long as we request for any permission within any permission group, Android would display a permission warning for the entire permission group, which can be confusing. <p>For example, we request for permission to generate custom bitmap. This permission belongs to the same group as SD card permission, leading to Android warning you about SD card access. Please trust us, we are not so bo liao to be interested in your personal data.</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/originally/us/buses', 'sg-busleh-with-bus-location.png', '["sg-busleh-with-bus-location-0.png","sg-busleh-with-bus-location-1.png","sg-busleh-with-bus-location-2.png","sg-busleh-with-bus-location-3.png","sg-busleh-with-bus-location-4.png","sg-busleh-with-bus-location-5.png","sg-busleh-with-bus-location-6.png"]', 0, 0, '', 'originally.us.buses', 'permission, busleh, arrival, timing, the bus, bus arrival, bus stop, bus app, bus arrival timing', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:13', '2016-05-18 01:19:13', 0),
(109, 28, 12094, 'Singapore MRT Map', 'singapore-mrt-map', ' <div jsname="C4s9Ed">High Resolution Singapore MRT &amp; LRT map. This app works without internet connection and is excellent for people who travel in Singapore MRT &amp; LRT on North South, East West, North East, Circle Line, Downtown Line, Thomson Line and all LRT networks.<p>Exclusive features:<br>* Deep Zoom<br>* Extreme High Resolution<br>* No-Ads<br>* No Roaming Cost<br>* Updated Stations and Lines (Regards to LTA Singapore)<br>* Landscape Mode<br>* Move to SD Card<br>* Free of Charge<p>Note:<br>This application is not official application of SMRT (Singapore Mass Rapid Transit), LTA (Land Transport Authority) and other authorities.<br>Currently only Map will be available. We will add more features soon.<br>New version will be released as soon as we get updated data.<p>Thanks for all comments, feedback and direct messages. <p>Credit to Zaw Thurein Tun</p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/icampus/sg/mrt', 'singapore-mrt-map.png', '["singapore-mrt-map-0.png","singapore-mrt-map-1.png","singapore-mrt-map-2.png","singapore-mrt-map-3.png"]', 0, 0, '', 'com.icampus.sg.mrt', 'singapore, application, updated, features, &amp lrt, mrt &amp, singapore mrt', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:17', '2016-05-18 01:19:17', 0),
(110, 28, 15746, 'ComfortDelGro Taxi Booking App', 'comfortdelgro-taxi-booking-app', ' <div jsname="C4s9Ed">The ComfortDelGro Taxi Booking Application is the ideal taxi booking application for individuals on the go. This user-friendly application offers convenience by allowing users to pre-set their favourite locations and journeys for their taxi bookings.  It even allows users to book a taxi at their current location, determined by their phones’ GPS.<p>What’s more? The users can also access and book from a list of 10 completed trips for ease of convenience.  eReceipt can also be easily viewed and emailed for each of the completed trips.<br>Why wait? Download the application now!<p><br>Functionalities Available <p>New Booking<br>-  Booking of current and advance jobs are available.<br>-  Automatically detect current location using GPS as pick-up address.<br>-  Add notes to driver.<p>Favourites<br>-  Location: Preset and retrieve favourite locations for booking.<br>-  Journey: Preset and retrieve your favourite journeys with trip details (pick-up and destination addresses) for booking.<p>Booking Status<br>-  In-app push notification for all taxi bookings.<br>-  Location tracking for confirmed taxi booking (immediate tracking available for current bookings and tracking available 10 mins before pickup time for advance bookings).<br>-  Check taxi status or cancel taxi bookings regardless of the channels. <br>For example, user may book a taxi using SMS channel and subsequently check the status of the booking using this booking application.<br>-  Suggested journey route. <br>-  Estimated taxi fare. <br>-  Share trip details.<p>History &amp; eReceipt<br>-  A list of 10 completed bookings for the past 30 days is available for reference. <br>-  Rebook from your previous trips.<br>-  eReceipt available for each completed trip.<p>Rate Driver<br>-  In-app push notification to rate our driver after each completed trip. <p>Survey &amp; Feedback<br>-  Share your taxi experience with us via the survey and feedback feature.<p>News &amp; Announcements<br>-  Be updated with the latest News &amp; Announcements from ComfortDelGro Taxis.<p>System Requirements<br>ComfortDelGro Taxi Booking application runs on Android 4.0 and above.<br>Features of this application may vary according to different versions of operating system and the phone models.<p><br>About ComfortDelGro<br>ComfortDelGro is one of largest land transport companies in the world with a global workforce, a global shareholder base and a global outlook. ComfortDelGro’s businesses include bus, taxi, rail, car rental &amp; leasing, automotive engineering services, inspection and testing services, driving centres, insurance broking services, outdoor advertising and car dealership. Headquartered in Singapore, the Group also has operations in China, the United Kingdom, Ireland, Australia, Vietnam and Malaysia. In Singapore, it operates a fleet size of close to 17,000 taxis.</p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/codigo/comfort', 'comfortdelgro-taxi-booking-app.png', '["comfortdelgro-taxi-booking-app-0.png","comfortdelgro-taxi-booking-app-1.png","comfortdelgro-taxi-booking-app-2.png","comfortdelgro-taxi-booking-app-3.png","comfortdelgro-taxi-booking-app-4.png","comfortdelgro-taxi-booking-app-5.png","comfortdelgro-taxi-booking-app-6.png"]', 0, 0, '', 'com.codigo.comfort', 'booking, application, bookings, available, taxi booking, booking application, available for, taxi bookings, taxi booking application, news &amp announcements', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:21', '2016-05-18 01:19:21', 0),
(111, 29, 866, 'Waze - GPS, Maps &amp; Traffic', 'waze-gps-maps-amp-traffic', ' <div jsname="C4s9Ed">Waze is the world&#39;s largest community-based traffic and navigation app. Join drivers in your area who share real-time traffic &amp; road info to save time, gas money, and improve daily commuting for all.<p>Just by driving with Waze open, you&#39;re already contributing tons of real-time traffic information to your local community. You can also actively report accidents, police traps and other hazards you see on the road. Get road alerts along your route and find the cheapest gas prices around you shared by the community. Plus, you can add friends, send locations or keep others posted on your arrival time.<p>- Live routing based on community driven, real-time traffic &amp; road info<br>- Community reported alerts including accidents, hazards, police traps, road closures, and more<br>- Turn-by-turn voice guided navigation<br>- Live maps, consistently edited and updated by Waze community map editors<br>- Automatic rerouting as conditions change on the road <br>- Send your ETA &amp; real-time drive to update those you’re meeting<br>- Learns your frequent destinations, commuting hours, and preferred routes<br>- Find the cheapest gas station on your route <br>- Add information on local places and businesses<br>- Add Facebook friends and sync Contacts<br>- See friends’ ETA when driving to the same destination<br>- One tap navigation to Facebook &amp; Calendar events<br>- Earn points as you contribute road info and climb the ranks in your community <p>Waze is all about contributing to and benefiting from the common good, so hop on board and get involved! <p>Note: Continued use of GPS running in the background can dramatically decrease battery life. Waze will automatically shut down if you run it in the background and haven&#39;t driven for a while.<p>Learn more about the Waze privacy policy, including what information is accessed and how it is used. With Waze, you have full control over your privacy settings. <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.waze.com/legal/privacy/%26sa%3DD%26usg%3DAFQjCNGz-MY66FhenGAE4UT9CEAQUpS9Cg&amp;sa=D&amp;usg=AFQjCNFl43h1FZyRLk00TgpSHXI99wZgZA" target="_blank">http://www.waze.com/legal/privacy/</a></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/waze', 'waze-gps-maps-amp-traffic.png', '["waze-gps-maps-amp-traffic-0.png","waze-gps-maps-amp-traffic-1.png","waze-gps-maps-amp-traffic-2.png","waze-gps-maps-amp-traffic-3.png","waze-gps-maps-amp-traffic-4.png","waze-gps-maps-amp-traffic-5.png","waze-gps-maps-amp-traffic-6.png"]', 0, 0, '', 'com.waze', 'community, traffic, information, navigation, real time, road info, time traffic, find the, real time traffic, &amp road info', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:25', '2016-05-18 01:19:25', 0),
(112, 29, 15747, 'MyTransport Singapore', 'mytransport-singapore', ' <div jsname="C4s9Ed">Be empowered for an all new travelling experience <p>MyTransport.SG Mobile, an award winning app, is a content-rich service offering a wide range of information for all modes of land transportation – empowering commuters, motorists and cyclists in Singapore to make informed decisions and better plan their journey, with these features: <p>• Personalise your favourite services with MyConcierge <br>• Search and locate nearby bus stops and service number with bus route details <br>• Get real-time island-wide bus arrival information <br>• Search and locate nearby taxi stands and quick dial for taxi booking services <br>• Report road defects via Snap &amp; Send <p>• Get real-time parking lots availability for popular locations <br>• Plan route with Traffic News and ERP Gantries on Traffic Smart <br>• View live traffic images along all expressways round the island <br>• Receive notification on expressways traffic news during peak hours and train service delay information <br>• Explore cycling towns, routes, and parking facilities <br>• Find out lifestyle events and promotions nearby <p>This app is proud to be a multiple local and international awards winners in: <p>• 2014 Best Global m-Government Service Award, Dubai<br>• 2013 Singapore infocomm Technology Federation (SiTF) Awards, Gold Winner in Most Popular Mobile Apps category and Silver Winner in Mobile Applications category <br>• 2013 UiTP Grow with Public Transport International Awards, Integrated Mobility category <br>• 2013 eGov Excellence Awards, Distinguished Winner in mServices category <br>• 2013 Singapore Mobile Excellence Awards, Gold Winner in Best App/Content by Government/Community category <br>• 2012 Summit Emerging Media Awards, Visionary Award in Navigation App category <br>• 2012 W3 Awards, Silver Award in Maps and Navigation mobile app category <p>For the full suite of land transport information and e-Services, please visit: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.mytransport.sg%26sa%3DD%26usg%3DAFQjCNEuZOU8otAyChpoyqboQFLwEe0-xw&amp;sa=D&amp;usg=AFQjCNGsK0kiX5EnbcIabW0uq1ZGbW_uIw" target="_blank">http://www.mytransport.sg</a> <p>To help us improve this app, you are welcome to email us at: <a href="mailto:LTA-MyTransport@lta.gov.sg">LTA-MyTransport@lta.gov.sg</a></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/sg/gov/lta/mytransport', 'mytransport-singapore.png', '["mytransport-singapore-0.png","mytransport-singapore-1.png","mytransport-singapore-2.png","mytransport-singapore-3.png"]', 0, 0, '', 'sg.gov.lta.mytransport', 'awards, category, mobile, traffic, category •, • 2013, awards gold, 2013 singapore, awards gold winner, get real time', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:27', '2016-05-18 01:19:27', 0),
(113, 29, 15749, 'trivago - The Hotel Search', 'trivago-the-hotel-search', ' <div jsname="C4s9Ed">As the world’s largest hotel search, trivago compares over 900,000 deals from more than 250 booking sites daily on our mission to be and remain the travellers’ first and independent source for finding the ideal hotel at the lowest rates.<p>No matter where in the world you are looking, trivago is your partner in locating an optimal home away from home, no matter your budget, even at the very last minute.<p>Get it now, get it on the go – download our app for free today.<p>Top Price:<br>- Cheapest deals filtered out every time<br>- Our database is constantly updating itself – great last-minute deals and discounts found in the search results<br>- We compare several prices for the same room to find you the cheapest one to fit your budget and get you the best value for your money<p>Top Filtering Options:<br>- Our online comparison finds exactly what you’re looking for, no matter when you travel, where you travel, what your itinerary is or how your budget stands<br>- Filter by price - set the maximum price you want to pay and we will locate the best hotel for this value<br>- Search by location – compare accommodation in whatever part of the world you need to book, and we will show you the best choices in our extensive comparison<br>- Filter by POI and attractions - find the best location in proximity to what you want to see.  Perfect for setting your travel itinerary<br>- Filter accommodation immediately for Wifi, pool, beach, spa and design<p>Top Clarity:<br>- The trivago Rating Index (tRI) is a fair and accurate rating score which is actually an aggregation of all available rating scores on the web<br>- An integrated map function takes you directly to the door, no matter where you are travelling from <br>Top Interface:<br>- The sleek, simple design makes booking on the go a fun and easy experience<p>Top Brand:<br>- Voted as one of The Guardian’s “10 best money-saving apps”<br>- Ranked on Independent.ie as one of the “best money-saving apps”<p>Hotel? trivago!</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/trivago', 'trivago-the-hotel-search.png', '["trivago-the-hotel-search-0.png","trivago-the-hotel-search-1.png","trivago-the-hotel-search-2.png","trivago-the-hotel-search-3.png","trivago-the-hotel-search-4.png","trivago-the-hotel-search-5.png","trivago-the-hotel-search-6.png"]', 0, 0, '', 'com.trivago', 'trivago, matter, hotel, travel, the best, you the, your budget, you travel', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:31', '2016-05-18 01:19:31', 0),
(114, 29, 15748, 'SG Buses', 'sg-buses', ' <div jsname="C4s9Ed">SG Buses is a Bus Guide for Singapore Android users with estimated arrival time<p>Features:<br>- load arrival time for SBS and SMRT buses<br>- show nearby bus stops<br>- show bus routes<br>- show bus stops in map<br>- search buses, roads, bus stops and bus stop no<br>- bookmark buses and bus stops<p>The app is FREE &amp; supported by advertisements. <p>For bugs report, <br>twitter.com/honcheng</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/iridianstudio/sgbuses', 'sg-buses.png', '["sg-buses-0.png","sg-buses-1.png","sg-buses-2.png"]', 0, 0, '', 'com.iridianstudio.sgbuses', 'buses, stops, arrival, , bus stops, and bus, show bus', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:33', '2016-05-18 01:19:33', 0),
(115, 29, 4383, 'Airbnb', 'airbnb', ' <div jsname="C4s9Ed">Make travel planning as mobile as you are with the Airbnb Android App! Airbnb opens the door to the world’s most interesting places to stay and is the simplest way to earn money from your extra space. With over 2 million listings in more than 34,000 cities, Airbnb connects you with the experience that’s right for you. <p>Message hosts and guests, gush over your itinerary, explore fairytale destinations, and add unforgettable digs to your Wish List. Make that penthouse, yurt, or treehouse your next home...or open up your own space to travelers. <p>For travelers: <p>Download the Airbnb Android App and start traveling the world with a few simple taps. <p>Super powers: <p>• Discover thousands of places to stay in more than 34,000 cities <br>• Book one-of-a-kind accommodations and find rooms for rent directly from your Android phone or Tablet <br>• Search for last-minute accommodations anywhere in the world <br>• Find long-term sublets in thousands of cities <br>• Access your itinerary, message your host, and get directions to your listing <br>• Explore legendary properties, vacation homes, and apartments, and add them to your Wish List to share with your friends <p>For hosts: <p>Manage your listing and connect with guests wherever you are in the world. <p>Super powers: <p>• List your space and manage your listing directly from your phone <br>• Get acquainted with potential guests before you say yes <br>• Accept, decline, pre-approve, and send special offers to guests on the go <br>• Manage your inquiries, respond to messages, and check off your To-Dos from your Host Home <br>• Visit our Hospitality Standards to learn what guests expect before they arrive <br>• Update your calendar availability with ease <br>• Access Groups to connect with your host community <p>A note about permissions: We use the READ_PHONE_STATE permission to make your life easier while verifying your phone number to create an Airbnb profile. <p>Join our beta community to provide feedback, and gain early access to new features: https://play.google.com/apps/testing/com.airbnb.android<p>Download the Airbnb App now! <br>Discover us on Twitter: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://twitter.com/airbnb%26sa%3DD%26usg%3DAFQjCNGSHk17X8wSbN62VCvc9XVFLRcQkw&amp;sa=D&amp;usg=AFQjCNGOGUEpwuvozbf0lRK9RFIt48mPaw" target="_blank">http://twitter.com/airbnb</a> <br>Get to know Airbnb and the Airbnb App: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://airbnb.com/mobile%26sa%3DD%26usg%3DAFQjCNEmQCx7t6EqQl5aRBd7fZzKDYmCIw&amp;sa=D&amp;usg=AFQjCNFfnIM2Wn7XgpUo-98zzlmAPdW8rA" target="_blank">http://airbnb.com/mobile</a></p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/airbnb/android', 'airbnb.png', '["airbnb-0.png","airbnb-1.png","airbnb-2.png","airbnb-3.png","airbnb-4.png","airbnb-5.png","airbnb-6.png"]', 0, 0, '', 'com.airbnb.android', 'airbnb, guests, phone, access, from your, the airbnb, your host, your listing, manage your listing, directly from your', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:36', '2016-05-18 01:19:36', 0),
(116, 30, 13931, 'Arcus Weather (with Radar)', 'arcus-weather-with-radar', ' <div jsname="C4s9Ed">Arcus hyper-local weather forecasts gives you the most precise up to the minute weather forecast available.<p>&quot;Heavy rain starting in 4 minutes, for the next 35 minutes&quot;.<p>Arcus uses the new Forecast.io API to get the most accurate, and most current weather information. <p>&quot;Forecast.io is backed by a wide range of data sources, which are aggregated together statistically to provide the most accurate forecast possible for a given location.&quot;<p><br>***** Included in AppStorms 10 Beautiful Weather Apps *****<p>&quot;Arcus Weather’s style is simple, sleek and monochromatic. Temperature and rain are the main areas of focus in Arcus Weather, and the combination of simple icons and clear, text-based information makes for both a highly practical, and visually appealing design.&quot;<p>***********************************************************************<p>Features include:<p>- Material Design<br>- Homescreen widget with customizable data points<br>- Fully usable without location services<br>- Notification Bar Weather<br>- Severe weather alerts<br>- Vibrate for precipitation<br>- Radar Map (US Only)<br>- Works great with Android Wear!<p>Pro Features available via In-App Purchases:<br> - No Ads<br> - Up to 10 Custom Locations (free version - 2)<br> - Widget Interval Options (free version ~ 4 hours)<br> - Touch to refresh from widget<p><br>Notes:<br>- This is not an official port from the Dark Sky company. Please visit <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://forecast.io%26sa%3DD%26usg%3DAFQjCNE_eddzUGAQd9QXkj_fyX6Gt7yrDQ&amp;sa=D&amp;usg=AFQjCNGtYqp8Rg2DuTit0Ezraoho-bi8HQ" target="_blank">http://forecast.io</a> for the official web version.<br>- Based on the concept and implementation of the service, this app works best with GPS enabled, or latitude/longitude for a particular location.<br>- Please note that &#39;up to the minute&#39; weather conditions are only available in certain countries.<p>Questions, comments and suggestions? follow @arcusweather</p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/arcusweather/darksky', 'arcus-weather-with-radar.png', '["arcus-weather-with-radar-0.png","arcus-weather-with-radar-1.png","arcus-weather-with-radar-2.png","arcus-weather-with-radar-3.png","arcus-weather-with-radar-4.png","arcus-weather-with-radar-5.png","arcus-weather-with-radar-6.png"]', 0, 0, '', 'com.arcusweather.darksky', 'weather, forecast, arcus, version, the most, free version, for the, most accurate, the most accurate', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:39', '2016-05-18 01:19:39', 0),
(117, 30, 869, 'Sense V2 Flip Clock &amp; Weather', 'sense-v2-flip-clock-amp-weather', ' <div jsname="C4s9Ed">Sense V2 Flip Clock &amp; Weather is a full featured digital clock and weather forecast application<p>The application features the following:<p>- 3 widget size, 4x2 and 4x3. 5x2<br>- Flip animation<br>- Several widget skins to choose from<br>- Different weather icon skins<br>- Different fonts for the time<br>- Display the next alarm and week number on the widget (optional)<br>- Several widget hotspots (most of them can be user defined to launch specific applications)<br>- Automatic location (from cell/wifi or GPS) or manual<br>- Automatic weather update interval (15 min, 30 min, 1, 2, 4, 6, 8 hours) or manual<br>- Hour change notification option<br>- Detailed current weather forecast display that includes the following:<br>- Local time (for current location)<br>- Sunrise and sunset time for current location<br>- Humidity, pressure, chance of rain, dew point, visibility, UV index and wind conditions<br>- Current condition, temperature, low and high temperatures<br>- Last weather update time<br>- Background according to the weather condition and day/night<br>- Optional display of the current moon phase<br>- 24 hourly weather forecast<br>- 24 hourly wind forecast<br>- 7 day future forecast<br>- 30 day moon phase calendar<br>- Future forecast details (sunrise, sunset, moon phase, wind, humidity and chance of rain<br>- World weather: Choose to display weather information for any number of different locations worldwide<p>The application is localized in the following languages:<p>Afrikaans, ‎العربية‎, български, Bahasa Indonesia, বাংলা, Català, 中文 (简体), 中文 (繁體), Hrvatski, Čeština, Dansk, Nederlands, Suomi, Français, Deutsch, Ελληνικά, , ‎עברית‎, Magyar, Italiano, 한국어, Lietuvių, македонски, Norsk, Polski, Português (Brazil), Português (Portugal), Română, русский, Српски (Ћирилица), Srpski (Latinica), Slovenčina, Slovenščina, Español (Spain), Svenska, ไทย, Türkçe, Українська, Tiếng Việt<p>Please report any problems, suggestions or requests via e-mail</p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/droid27/sensev2flipclockweather', 'sense-v2-flip-clock-amp-weather.png', '["sense-v2-flip-clock-amp-weather-0.png","sense-v2-flip-clock-amp-weather-1.png","sense-v2-flip-clock-amp-weather-2.png","sense-v2-flip-clock-amp-weather-3.png","sense-v2-flip-clock-amp-weather-4.png","sense-v2-flip-clock-amp-weather-5.png","sense-v2-flip-clock-amp-weather-6.png"]', 0, 0, '', 'com.droid27.sensev2flipclockweather', 'weather, forecast, current, display, weather forecast, the following, moon phase, future forecast, for current location', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:43', '2016-05-18 01:19:43', 0),
(118, 30, 15860, 'Sunny@SG', 'sunnysg', ' <div jsname="C4s9Ed">Ultraviolet (UV) radiation is part of the electromagnetic spectrum emitted by the sun.  Some ultraviolet (UV) exposure is important for health functions such as Vitamin D production in the body and treating diseases like jaundice in babies or psoriasis and rickets in adults.<p>However, exposure to strong UV radiation is harmful. Excessive exposure may cause the following problems:<br>- Skin cancer<br>- Cataracts<br>- Suppression of the immune system<br>- Premature ageing of the skin<p>Sunny@SG is a useful utility that allows you to check the hourly UV index (UVI) on the go.<p>Features include:<br>- Access to hourly UV index reading from Meteorological Service Singapore (MSS) on the go.<br>- Notification when UV index reaches high level.  Notification can be turned on and off as per your preference.<br>- Share the current UV index with your friends and family and keep them informed and safe!<p>Note:<br>This app is developed without any involvement of MSS. Any inaccuracies found are not the responsibility of and should not be attributed to MSS.</p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/hosay/sunnysg', 'sunnysg.png', '["sunnysg-0.png","sunnysg-1.png","sunnysg-2.png","sunnysg-3.png","sunnysg-4.png","sunnysg-5.png","sunnysg-6.png"]', 0, 0, '', 'com.hosay.sunnysg', 'index, exposure, notification, radiation', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:48', '2016-05-18 01:19:48', 0),
(119, 30, 15860, 'MyWeather@SG', 'myweathersg', ' <div jsname="C4s9Ed">MyWeather@SG is a unique weather app that presents the 3 hours weather forecast in Singapore in a lighthearted manner.  <p>- Sick of the boring weather symbol?  See the weather come alive with our cute and vivid weather animations.<br>- Tired of screening through the list of locations in NEA Nowcast just to find the location you are interested in?  Now you can bookmark up to 4 weather condition of the places you truly care about.<br>- Display the current local temperature range in celsius.<br>- Gorgeous Retina graphics.<br>- Full universal app with iPad support.<p>It&#39;s the weather app like you have never seen it before.<p>Note: INSERT INTO `apps` (`id`, `cat_id`, `developer_id`, `name`, `slug`, `content`, `path`, `image`, `thumbs`, `numDownloads`, `views`, `link`, `com`, `keyword`, `description`, `varieswithdevice`, `rate_value`, `rate_count`, `featured`, `jobs`, `jobs2`, `created_at`, `updated_at`, `noupdate`) VALUES
(120, 30, 1528, 'HD Transparent Weather Clock', 'hd-transparent-weather-clock', ' <div jsname="C4s9Ed">Enlighten your home screen with this HD transparent weather clock widget.<br>The widget of super realistic design is simple &amp; classy, reminding you of our awesome earth.<p>NOTICE:<br>This is NOT a standalone application! To use this widget, you need to install Amber Weather first.<br>After installing Amber Weather and placing a widget on your home screen, you can choose to apply different widget skins.<p>This transparent widget features the following:<br>√Accurate Weather and Time Info<br>Super realistic style with current temperature and time <br>Basic live weather information (temperature, general conditions of the day) and local time are shown on the widget<br>Multiple weather data sources to choose from, including Weather Underground and Open Weather Map<br>You can choose between automatic location detection and manual location addition<p>√Extended Weather Forecast<br>By tapping the widget, you can get 7 day forecast and hourly forecast in Amber Weather<br>In addition, you can also get a detailed weather report from Amber Weather like current temperature, wind speed and direction, humidity, visibility, atmospheric pressure, dew point and UV index.<p><br>√Highly Customizable<br>Distinctive live weather icon packs are available to be applied to the widget.<br>Different fonts available for the time.<br>Different units available: Fahrenheit and Celcius<br>World weather: ability to change locations, so you can get weather info of any city in the world: London weather,  NYC weather, Houston weather and so on<p><br>√Quick Action:<br>There are different clickable hotspot on the widget.<br>With a simple click on different areas, users can conduct a series of operations: setting alarm clock, calendar event, changing widget skins, reading detailed daily weather report and check 7 day forecast and hourly forecast.<p>√Multiple language support:<br>This HD weather clock widget supports English,中文（简体）,中文（繁體）,français，Deutsche, italiano, 日语, 한국어,português, русский, Español, Català, hrvatska, čeština, danske, nederlandse, Ολλανδικά, magyar, Bahasa Indonesia, Norsk, Polskie, român, Српски, slovenský, turečtina, Ukranian, Tiếng Việt, Arabic, and Hebrew. <p>√Lightweight and battery-saving: <br>This transparent weather widget will not drain the battery of your phone or occupy much of the internal storage.<p><p>Note:<br>If you have difficulty applying the widget to your home screen, please watch the video: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.youtube.com/watch?v%253Dv5nXvM_6QR4%26sa%3DD%26usg%3DAFQjCNFWSIIEJn85M4-MPBEpQlOfZzs5IA&amp;sa=D&amp;usg=AFQjCNHr33Aw_dPCrfZWKmkzdip3NETglQ" target="_blank">https://www.youtube.com/watch?v=v5nXvM_6QR4</a>. <p>If the clock in the widget stops working, please check whether you have turned on the service guard. What&#39;s more, apps like Task Killer, Service Manager, Battery Saver, Clean Master or Game Booster may prevent the widget from working properly. Please add our app to the White/ Ignore List to keep widgets in sync. In this method doesn&#39;t work, please email us: <a href="mailto:support@amberweather.com">support@amberweather.com</a></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/mobi/infolife/ezweather/widget/surrealistic', 'hd-transparent-weather-clock.png', '["hd-transparent-weather-clock-0.png","hd-transparent-weather-clock-1.png","hd-transparent-weather-clock-2.png","hd-transparent-weather-clock-3.png","hd-transparent-weather-clock-4.png","hd-transparent-weather-clock-5.png"]', 0, 0, '', 'mobi.infolife.ezweather.widget.surrealistic', 'weather, widget, different, amber, the widget, you can, weather and, amber weather, your home screen, and hourly forecast', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:19:55', '2016-05-18 01:19:55', 0),
(121, 31, 4126, 'MobiTV - Watch TV Live', 'mobitv-watch-tv-live', ' <div jsname="C4s9Ed">Take your TV with you.<br>With MobiTV, you can now watch TV channels from all around the world on your phone. <p>Enjoy your favorite live or recorded programs anytime, anywhere. <p>Features: <br>* Watch Live TV<br>* Take your TV with you and enjoy watching all of your favorite sports, news, TV shows<br>* Integrated user interface makes it fast and easy to find the shows and movies you want to watch.<p>Schedule DVR Recordings <br>* Schedule DVR recordings from anywhere. <br>* One-touch recording- simply choose to record one event, all events, or only new events.<p>Browse and Search the Program Guide, On Demand DVR <br>* Search for shows by title, genre, network, keyword, or actor. <br>* View graphics and posters of your favorite shows and movies.<br>* Use DNLA and Chromecast to watch on your tv.<br>* Social TV<br>* Watch LIVE local TV for free! <br>* Watch over 300 LIVE TV Channels for free in SD<br>* Watch over 600 VOD Channels for free in SD<br>* We host over 45,000 video on demand titles that have been cleared for worldwide distribution. We refresh these shows every few seconds which include hit titles such as Entertainment Tonight, TMZ Live, The Best of UFC, The Soup providers like CNN and many more.<p>MHL stands for Mobile High-Definition Link technology which allows you to display your smartphone’s content to a larger screen, all while charging your smartphone. TV mobile app stream HD movies and TV shows from your mobile phone to any big screen TV or monitor for the total kick back and relax experience. MHL also allows you to play mobile games with no lag, work from any location, stream TV and movies in HD, and experience your favorite music with immersive surround sound<p>• Watch Network USA, UK, German, French, Asian, African, Arabic, Canadian, Russian channels live!<br>• No need to pay any charge<br>• No need to have “Adobe Flash Player”<br>• No sign-up required<br>• Updating channels automatically<br>• Easy to use interface<br>• Wide range of channel list<br>• Use any network - Wi-Fi, 3G or 4G<br>• No need to use satellites<br>• Just use your android device, mobile phone, tablet, etc.<br>• Also, you can connect these devices to TV sets so as to watch the channels on TV<p>For any questions please contact: <a href="mailto:support@undertap.com">support@undertap.com</a></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/undertap/watchlivetv', 'mobitv-watch-tv-live.png', '["mobitv-watch-tv-live-0.png","mobitv-watch-tv-live-1.png","mobitv-watch-tv-live-2.png","mobitv-watch-tv-live-3.png"]', 0, 0, '', 'com.undertap.watchlivetv', 'watch, channels, shows, mobile, your favorite, for free, and movies, watch over', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:01', '2016-05-18 01:20:01', 0),
(122, 31, 4618, 'High-Powered Flashlight', 'high-powered-flashlight', ' <div jsname="C4s9Ed">Bright. Fast. Simple. The most elegant and functional LED flashlight app, ever! And it&#39;s the ONLY flashlight app that goes with a compass, giving you the direction in the darkness. Don&#39;t miss it!<p>Features:<br>• Brightest LED Flashlight instantly ON<br>• Always-On compass<br>• Strobe mode with 10 different frequencies<br>• Built-in SOS signal<br>• Intuitive and elegant UI design<p>What we‘ve found in reviews：<br>— “Great App , Simple to use this application is very useful it is way more powerful than the default flashlight programmed on my phone. ”<p>—“Awesome.app!!! This is a great app to have if your out in the woods camping, the light is very bright and the compass works great do you don‘t get lost…….”<p>—“Best flashlight app! This is bright, simple and has some added extras that u can either take our leave depending on if they benefit our lifestyle! Great job! ”<p>—“The one and only best I have tried other apps but I am most impressed by this one. I recommend this to everyone its. The one and only best!!! GREAT APP!!!”<p>—“This app is awesome the light is bright and even has an SOS and a compass which is really cool. ”<p>—“Excellent a great application does everything it says. Helps me at night finding the right key.”</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/ihandysoft/ledflashlight/mini', 'high-powered-flashlight.png', '["high-powered-flashlight-0.png","high-powered-flashlight-1.png","high-powered-flashlight-2.png","high-powered-flashlight-3.png"]', 0, 0, '', 'com.ihandysoft.ledflashlight.mini', 'flashlight, bright, simple, compass, flashlight app, one and, and only, only best, and only best', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:04', '2016-05-18 01:20:04', 0),
(123, 31, 2418, 'Nike+ Running', 'nike-running', ' <div jsname="C4s9Ed">The Nike+ Running App tracks your runs and helps you reach your goals -- whether it’s running your first race, or setting a new personal record. From first-time runners to marathon veterans, you&#39;ll get the measurement and motivation you need to run farther and faster than ever before. Welcome to the world’s greatest running community.      <br> <br>TRACK YOUR PROGRESS<br>Stay on track, no matter where you are. On the trail, treadmill, or streets, MotionX® combines your phone’s GPS and accelerometer for the most accurate tracking of your of your distance, pace and time. Measure your progress every mile with in-run audio feedback.<br> <br>STAY MOTIVATED<br>Share your runs and let your friends keep you going with cheers along the way. Show off your Nike+ level color and amp things up with a PowerSong at the press of a button.<br> <br>COMPARE AND COMPETE<br>Nothing&#39;s as motivating as a little friendly competition. Compete with your friends for the top leaderboard spot, or go toe-to-toe against them in a Nike+ Challenge. Just set a distance. Invite your friends. And race to the finish. <p>GUIDANCE AND TRAINING<br>Whether you’re looking to take on your first 5K or smash your marathon PR, Nike+ Coach gives you a training program, coaching expertise and daily workouts to get you race ready.<p>- Need help? Get support at nikeplus.com/support.<p><br>Nike+ Running Handsets - Verified <br>* Motorola Droid2 Global<br>* HTC ThunderBolt, Incredible2, My Touch 4G Slide, One Max<br>* Samsung Galaxy Nexus, S, SII, S III, S4, S5, Note, Note II, Note III, S4, S5, Mega<br>* Motorola Droid RAZR, Moto X<br>* Google Nexus 5</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/nike/plusgps', 'nike-running.png', '["nike-running-0.png","nike-running-1.png","nike-running-2.png","nike-running-3.png","nike-running-4.png","nike-running-5.png","nike-running-6.png"]', 0, 0, '', 'com.nike.plusgps', 'running, friends, first, nexus, your friends, for the, your first, runs and', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:08', '2016-05-18 01:20:08', 0),
(124, 31, 15861, 'MixerBox: Unified Music Player', 'mixerbox-unified-music-player', ' <div jsname="C4s9Ed">MixerBox is a compliant 3rd-party API client that lets you play music &amp; videos from YouTube, SoundCloud &amp; MP3s all within one app! (This is NOT a MP3 / video downloader app)<p>***DISCLAIMER***<br>This is NOT an official app from the various media services, and this is only an unofficial 3rd-party client that complies with their 3rd party API terms of service. This app is NOT an affiliated nor related product of those services. Per their API developer terms:<p>   * <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://developers.google.com/youtube/branding_guidelines%26sa%3DD%26usg%3DAFQjCNFNKpBxSlI4Ur0NbE7y4-G6Ro-VDw&amp;sa=D&amp;usg=AFQjCNFFUU2iG1sG1wjF5MJz-lO_kY4GUQ" target="_blank">https://developers.google.com/youtube/branding_guidelines</a> - &quot;You do not need special approval to use YouTube APIs or to promote API functionality in your application&quot; provided that the guidelines are followed. <p>   * <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://developers.soundcloud.com/docs/api/terms-of-use%26sa%3DD%26usg%3DAFQjCNHiIIrXkDDcGQbTn4C_fPvmhDXCCw&amp;sa=D&amp;usg=AFQjCNGYujxpeZnweYT028WkoZ8yEmABhg" target="_blank">https://developers.soundcloud.com/docs/api/terms-of-use</a> - &quot;Provided you comply with these API Terms of Use and the User Terms, you are permitted to use certain SoundCloud Marks for certain limited purposes related to your app...&quot;<p>==============================<p>Number 1 music app in 12 countries! Top 25 music app in 100+ countries! <p>► AUTOMATIC PLAYLIST - Instant personalized playlist from your Facebook Likes and Shares <p>► FRIENDS&#39; MUSIC DISCOVERY - Discover, play and subscribe to the top playlists among your Facebook friends <p>► CONTINUOUS PLAY - Play music and videos from various services non-stop, all within one app! <p>► PLAYLIST-OF-THE-DAY - A new playlist in your pocket, everyday <p>► MILLIONS OF MUSIC VIDEOS - Easily access millions of music videos worldwide, and even performances of unsigned singers <p>► SYNCHRONIZATION - Automatically sync playlists across all of your devices <p>***COPYRIGHT INFORMATION***<br>All videos and audios are provided by public third-party media services YouTube and SoundCloud. All trademarks and copyrights belong to their respective owners and are used here under the terms of Fair Use and the Digital Millennium Copyrights Act (DMCA).<p>Since MixerBox simply links to content on those services via their 3rd Party Developer API, MixerBox does not have any direct control of their content. If there are any content that may infringe upon anyone&#39;s copyrights, the following links can be used to report the content:<p>    <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.youtube.com/t/dmca_policy%26sa%3DD%26usg%3DAFQjCNERse9q2qL5qm2ksheZGQjD6Ws8mA&amp;sa=D&amp;usg=AFQjCNF57QC39xpEu-6_zehetcnu4xUofw" target="_blank">http://www.youtube.com/t/dmca_policy</a><br>    <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://soundcloud.com/pages/dmca_policy%26sa%3DD%26usg%3DAFQjCNFxJsbRU8v-KD41vTBzb9Dk7qA4Wg&amp;sa=D&amp;usg=AFQjCNFsvSIPl--cdE_2S68J7fP_PoG91A" target="_blank">https://soundcloud.com/pages/dmca_policy</a><p>If you have any further questions, please feel free to contact us at: <a href="mailto:support@mixerbox.com">support@mixerbox.com</a><p>© MixerBox Inc. Palo Alto, California, USA.</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/mbinc12/mb32', 'mixerbox-unified-music-player.png', '["mixerbox-unified-music-player-0.png","mixerbox-unified-music-player-1.png","mixerbox-unified-music-player-2.png","mixerbox-unified-music-player-3.png","mixerbox-unified-music-player-4.png"]', 0, 0, '', 'mbinc12.mb32', 'music, terms, soundcloud, services, 3rd party, api terms, soundcloud com, use and', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:12', '2016-05-18 01:20:12', 0),
(125, 31, 11508, 'Easy Voice Recorder', 'easy-voice-recorder', ' <div jsname="C4s9Ed">Easy Voice Recorder is a fun, simple and easy to use audio &amp; voice recorder. Use it to reliably record your meetings, personal notes, classes, songs, and more, with no time limits!<p><b>Main features</b><p>★ Record to high-quality PCM and AAC, or use AMR to save space.<br>★ Share and manage your recordings easily, and transfer them to your computer.<br>★ Record in the background and control the recorder with a home screen widget.<p>You can also use powerful audio filters on supported devices, rename and delete your recordings, save them as a ringtone, integrate with Tasker and Locale, and much more.<p><b>Pro features</b><p>The pro version offers additional power and control. Here are just some of the additional features, available on supported devices:<p>★ Record in stereo.<br>★ Record with a Bluetooth microphone.<br>★ Boost input volume with microphone software gain.<br>★ Skip silent parts.<br>★ Manage and organize your recordings with folders, and save recordings to your SD card.<br>★ Control the recorder from anywhere using the status bar. Recordings can also be pinned to the status bar.<p>With many more enhancements and additions, and more to come in the future.<p><b>Support</b><p>Please test using the free version before upgrading to pro. If there are any problems, please contact us and we can troubleshoot the problem together.<p>Please note that Easy Voice Recorder cannot record phone calls on most phones. Some devices have known issues or may be incompatible, and recording quality varies between devices. On some devices, Bluetooth is supported only for phone calls, and not for application audio. If the app force-closes after an install or upgrade, your firmware may have corrupted the install. Please uninstall and reinstall if this happens.<p>For more information, please see the help ( <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.digipom.com/easy-voice-recorder-help/%26sa%3DD%26usg%3DAFQjCNEOg1dlsWzGM_-Ek4evn-YWJU6Lvg&amp;sa=D&amp;usg=AFQjCNEdB1LMz9IRu_bjzRuUe-v40S-Fxw" target="_blank">http://www.digipom.com/easy-voice-recorder-help/</a> ). If there are any problems, please contact us and we can troubleshoot the problem together.<p><b>Additional Info</b><p>Terms of Use: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.digipom.com/end-user-license-agreement-for-applications/%26sa%3DD%26usg%3DAFQjCNG_yoUgQK_kov-MdTikDAxfY6aLFg&amp;sa=D&amp;usg=AFQjCNHV2nrW_5Vd9NB4odlKrQ91L50oNA" target="_blank">http://www.digipom.com/end-user-license-agreement-for-applications/</a><br>Privacy Policy: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.digipom.com/privacy-policy-for-applications/%26sa%3DD%26usg%3DAFQjCNHl0TzJLGJriSA6_JYK75Zz8pMI5Q&amp;sa=D&amp;usg=AFQjCNFovDr6rDOkiSLYP3Ku_AhEMSWzBA" target="_blank">http://www.digipom.com/privacy-policy-for-applications/</a><p>If you would like to help translate Easy Voice Recorder into your language, we would love to see you over at the translation project ( <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://crowdin.net/project/easy-voice-recorder%26sa%3DD%26usg%3DAFQjCNF1PSnQlXsZcML9el5Li0XOI_gwgg&amp;sa=D&amp;usg=AFQjCNF-rQFoApGsgGiH57744Z49FuviKA" target="_blank">http://crowdin.net/project/easy-voice-recorder</a> ). We also have a test group for alpha and beta testers ( <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://groups.google.com/forum/?fromgroups%2523!forum/easy-voice-recorder-testing%26sa%3DD%26usg%3DAFQjCNGTEZU4qnGrg8ZUR1iIpP1xLhkIsA&amp;sa=D&amp;usg=AFQjCNG5YsDxGtf67Ngo6b5n9BGrYCzqPg" target="_blank">https://groups.google.com/forum/?fromgroups#!forum/easy-voice-recorder-testing</a> ).<p><b>Permission details</b><p>Photos/Media/Files - Save recordings to your external storage.<br>Microphone - Record audio from your microphone.</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/coffeebeanventures/easyvoicerecorder', 'easy-voice-recorder.png', '["easy-voice-recorder-0.png","easy-voice-recorder-1.png","easy-voice-recorder-2.png","easy-voice-recorder-3.png","easy-voice-recorder-4.png","easy-voice-recorder-5.png","easy-voice-recorder-6.png"]', 0, 0, '', 'com.coffeebeanventures.easyvoicerecorder', 'recorder, record, voice, recordings, voice recorder, easy voice, www digipom, digipom com, easy voice recorder, the problem together', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:16', '2016-05-18 01:20:16', 0),
(126, 32, 15813, 'slither.io', 'slitherio', ' <div jsname="C4s9Ed">Play against other people online! Can you become the longest player?<p>Watch out - if your head touches another player, you will explode and then it&#39;s game over. But if you get others to run into YOU, then THEY will explode and you can eat their remains!<p>In slither.io, you have a fighting chance even if you&#39;re tiny! If you&#39;re a nimble navigator, you can swerve in front of a much larger player to defeat them - no matter what size you are!<p>The longest player of the day gets to set a victory message that the ENTIRE WORLD will see!</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/air/com/hypah/io/slither', 'slitherio.png', '["slitherio-0.png","slitherio-1.png","slitherio-2.png","slitherio-3.png","slitherio-4.png","slitherio-5.png","slitherio-6.png"]', 0, 0, '', 'air.com.hypah.io.slither', 'player, explode, longest, , you can, explode and, will explode, longest player, the longest player', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:18', '2016-05-18 01:20:18', 0),
(127, 32, 624, 'Hungry Shark World', 'hungry-shark-world', ' <div jsname="C4s9Ed">The stunning sequel to Hungry Shark™ Evolution is here! The Sharks are back, and this time they are taking on the entire WORLD! <br>Take control of a very Hungry Shark in this action packed aquatic adventure. Survive as long as possible by eating everything that gets in your way! <br>FGOL boasts over 285 million downloads for the number one shark arcade series on mobile, guaranteeing you the best simulated aquatic feed frenzy out there!<br>***THIS GAME IS ONLY COMPATIBLE WITH devices running on Android 4.2 Jelly Bean or above.***<br>FEATURES :<br>Console quality, 3D graphics<br>17 shark species in 7 different size tiers to collect. Play as sharks spanning the nimble Hammerhead shark, up to the iconic Great White Shark!<br>Rise through the ranks of the food chain and level up your jawsome pal to bite harder, swim faster and grow HUNGRY…er!<br>3 beautiful, huge free-roaming worlds to explore: Pacific Island, a lush, sun-drenched tourist hot spot. Arctic Ocean, a frozen wasteland, home to a secret military base and heavily guarded testing facility. And the Arabian Sea, a rich and vibrant, if not, industrial landscape.<br>20 different mission types to master including high scores, specific prey hunts and survival! <br>100’s of enemies and prey to consume: whales, submarines and locals, BEWARE!<br>Equip your sharks with stylish Accessories and special Gadgets; no shark is complete without headphones, umbrella and a freakin’ laser beam! <br>Unlock a variety of Pets to boost your predatory powers. baby sharks, octopus and even a feisty turtle are all happy to help in your adventure. <br>Combo bonuses, Gold rush and MEGA GOLD RUSH to boost your hi-scores.<br>Find all Hungry Letters to trigger the insane Super Size PowerUp! <br>Google Play Leaderboards and Achievements enabled. <br>Capture and share great videos with Everyplay.<br>Use Facebook to synchronise your progress across devices.<br>Hungry Shark World is regularly updated with new features, content and challenges to keep you coming back for more!<br>This app contains In-App Purchases which allow you to buy Gems and Gold currency which can be spent on upgrades and accessories. Gems and Gold can also be collected in game without requiring purchases.<br>Hungry Shark World is available in English, French, Italian, German, Spanish, Brazilian-Portuguese, Turkish, Russian, Korean, Japanese.<br>This game contains advertising.<br>Advertising is disabled if you make any purchase.<br>Like the game on Facebook for the latest news: www.facebook.com/HungrySharkWorld<br>Follow us on Twitter: @Hungry_Shark<br>Or Youtube: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://youtube.com/FutureGamesOfLondon%26sa%3DD%26usg%3DAFQjCNEy20-MIuTY0QLmLpDGYYTpzgOgiw&amp;sa=D&amp;usg=AFQjCNEZLb-PwBp1hD3ckg3wu7UPZ0jcjw" target="_blank">http://youtube.com/FutureGamesOfLondon</a><br>And join our community!<br>Facebook <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://facebook.com/UbisoftMobileGames%26sa%3DD%26usg%3DAFQjCNFr2V9OM5Z8NmnquJEXWD-rmorqlg&amp;sa=D&amp;usg=AFQjCNHN0jknDE2vNinpTTYCBsA5vBnRTg" target="_blank">http://facebook.com/UbisoftMobileGames</a><br>Twitter <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://twitter.com/ubisoftmobile%26sa%3DD%26usg%3DAFQjCNGCGNbszjIPSWW27s74d7IE3oXzhQ&amp;sa=D&amp;usg=AFQjCNFSn4glBxrDercFI_EF0mITe2_mjQ" target="_blank">http://twitter.com/ubisoftmobile</a><br>Youtube <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://youtube.com/user/Ubisoft%26sa%3DD%26usg%3DAFQjCNFy99JucASyYZVYlqkH5w0lzp6MnQ&amp;sa=D&amp;usg=AFQjCNHQTG6v9Rw8cWc4a7JpMgDEitNE1g" target="_blank">http://youtube.com/user/Ubisoft</a><br>Any Feedback? email: <a href="mailto:feedback@fgol.co.uk">feedback@fgol.co.uk</a><br>Need support? Contact: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://support.ubi.com%26sa%3DD%26usg%3DAFQjCNGZEux6a_2DLh5g4KMjZ2MOUwl0jg&amp;sa=D&amp;usg=AFQjCNHIcUIPrBOe7EYJR1LdEjPkJbjdbA" target="_blank">http://support.ubi.com</a></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/ubisoft/hungrysharkworld', 'hungry-shark-world.png', '["hungry-shark-world-0.png","hungry-shark-world-1.png","hungry-shark-world-2.png","hungry-shark-world-3.png","hungry-shark-world-4.png","hungry-shark-world-5.png","hungry-shark-world-6.png"]', 0, 0, '', 'com.ubisoft.hungrysharkworld', 'shark, hungry, facebook, sharks, hungry shark, facebook com, http youtube, youtube com, hungry shark world', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:21', '2016-05-18 01:20:21', 0),
(128, 32, 13417, 'Color Switch', 'color-switch', ' <div jsname="C4s9Ed">Over 50,000,000 downloads worldwide!<br>Play now the #1 addictive game of the year!<p>Tap the ball carefully through each obstacle and your ball will switch color with some powerups.<br>You must follow the color pattern on each obstacle to cross it ! <p>Be careful not to pass through the wrong color, or you’ll have to start again.</p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/fortafygames/colorswitch', 'color-switch.png', '["color-switch-0.png","color-switch-1.png","color-switch-2.png","color-switch-3.png","color-switch-4.png","color-switch-5.png","color-switch-6.png"]', 0, 0, '', 'com.fortafygames.colorswitch', 'color, obstacle, , each obstacle', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:24', '2016-05-18 01:20:24', 0),
(129, 32, 4491, 'Bushido Bear', 'bushido-bear', ' <div jsname="C4s9Ed">What&#39;s more dangerous than an angry bear? Or a sword-wielding ninja? An angry, sword-wielding ninja bear of course!<p>Bushido Bear is an original action game by Spry Fox, the developer of the award-winning games Triple Town, Steambirds &amp; Alphabear. Defend your forest against endless waves of evil demons by hacking and slashing through your foes with two giant swords! Slice and dice the invaders for as long as you can survive.<p>As you play Bushido Bear, you&#39;ll unlock new ninja characters and upgrade your existing characters, which will change the way you play the game. Lone Cub is slow but can slip past enemies thanks to his tiny size. Smoky Bear can teleport anywhere instantly. Neo Bear slows down time as he plans his attacks. You&#39;ll want to collect and experience all the bears!</p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/spryfox/GiantSword', 'bushido-bear.png', '["bushido-bear-0.png","bushido-bear-1.png","bushido-bear-2.png","bushido-bear-3.png","bushido-bear-4.png","bushido-bear-5.png","bushido-bear-6.png"]', 0, 0, '', 'com.spryfox.GiantSword', 'ninja, characters, bushido, sword, you play, bushido bear, wielding ninja, sword wielding, sword wielding ninja', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:27', '2016-05-18 01:20:27', 0),
(130, 32, 15814, 'Pocket MapleStorySEA', 'pocket-maplestorysea', ' <div jsname="C4s9Ed">TRAVEL through the vast world of MapleStory and EXPERIENCE endless compelling game-play!<p>- PLAY your FAVOURITE MapleStory characters!<br>- PARTY with your friends to enjoy MapleStory ANYWHERE, ANYTIME!<br>- COLLECT vast amounts of epic and legendary equipment!<br>- CUSTOMIZE your character with thousands of costumes, pets and mounts!<br>- ENJOY a blast from the past with classic MapleStory elements!<br>- EXPERIENCE hundreds of hours of immersive game-play!<p>Pocket MapleStory SEA consists of Premium Add-ons available via In-App Purchases from the Shop.        <br>        <br>Facebook Page: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/PlayparkPocketMapleStory%26sa%3DD%26usg%3DAFQjCNFftDJ4_xXsXUGSmgLu6xpaTzDkFQ&amp;sa=D&amp;usg=AFQjCNEp5hpXidaju85u5QxsBUK1cD8UBQ" target="_blank">https://www.facebook.com/PlayparkPocketMapleStory</a><br>Youtube: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.youtube.com/watch?v%253DAmI4DLzlFhU%26sa%3DD%26usg%3DAFQjCNHNbYkS19Mik61kdgxq6LJlNvGi0w&amp;sa=D&amp;usg=AFQjCNEEphFaopsHEWVzBvchst_ft_euhQ" target="_blank">https://www.youtube.com/watch?v=AmI4DLzlFhU</a></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/playpark/pocketmaplestory/a', 'pocket-maplestorysea.png', '["pocket-maplestorysea-0.png","pocket-maplestorysea-1.png","pocket-maplestorysea-2.png","pocket-maplestorysea-3.png","pocket-maplestorysea-4.png","pocket-maplestorysea-5.png","pocket-maplestorysea-6.png"]', 0, 0, '', 'com.playpark.pocketmaplestory.a', 'maplestory, https, experience, facebook, https www, from the, game play', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:30', '2016-05-18 01:20:30', 0),
(131, 33, 15755, 'MARVEL Avengers Academy', 'marvel-avengers-academy', ' <div jsname="C4s9Ed">Civil War has begun at Avengers Academy for a special limited-time event! Captain America and Iron Man face off in this battle-packed new update! As the divided heroes build their own headquarters and recruit allies to their teams, the real danger of Red Skull and Madame Hydra arrive and threatens the entire Academy. New Super Heroes, like Black Panther and Winter Soldier, join the fight too. Play now, build a team and help defeat Hydra in an epic showdown between two ultimate Super Hero teams! <br>__________<p>Experience the MARVEL Avengers as you’ve never seen them before!<br>Build the ultimate Super Hero academy, and play as your favorite Avengers characters reimagined as students developing their superpowers. Enroll today and become a hero! <p>DISCOVER A NEW MARVEL AVENGERS WORLD<br>- Experience your favorite MARVEL Avengers heroes and villains as young adults<br>- Play as Iron Man, Thor, Black Widow, Hulk, Loki, Wasp, Captain America and more!<br>- Featuring an All-Star Voice Cast with John Cena, A$AP Rocky, Alison Brie, Dave Franco, Priyanka Chopra and More!<p>BATTLE EPIC MARVEL VILLAINS  <br>- Power-up your team and send them to combat!<br>- Develop your hero’s and villain’s iconic powers at Super Hero academy<br>- Strengthen your MARVEL Avengers team and upgrade their powers<p>EMBARK ON NEW ADVENTURES<br>- Go on exciting missions and battle epic foes <br>- Interact with other characters from the MARVEL universe<br>- Participate in events and updates that introduce thrilling new storylines and quests<p>BUILD YOUR DREAM ACADEMY<br>- Create the ultimate Super Hero campus<br>- Construct dorms, classrooms and labs for your MARVEL Avengers <br>- Fill your campus with training facilities, sports stadiums and more<p>Like us on Facebook: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/AvengersAcademy%26sa%3DD%26usg%3DAFQjCNGF1k78_sVRt09NJ0N30iHLOxemiw&amp;sa=D&amp;usg=AFQjCNElD66vdLUDR91oRzAiH14WSOBpvQ" target="_blank">http://www.facebook.com/AvengersAcademy</a><br>Follow us on Twitter: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.twitter.com/AvengersAcademy%26sa%3DD%26usg%3DAFQjCNE0SOWOxNiVOSlGB6m1iC9PElE_Ww&amp;sa=D&amp;usg=AFQjCNE3s8boELkPfrioyJsClH-M9CRXNw" target="_blank">http://www.twitter.com/AvengersAcademy</a><br>Visit our website: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.AvengersAcademy.com%26sa%3DD%26usg%3DAFQjCNGfoayXHrdO3XEep9XcN_KOakidig&amp;sa=D&amp;usg=AFQjCNGQhj8VL_0WwxmgT6gAEMEfiibyzQ" target="_blank">http://www.AvengersAcademy.com</a><p>MARVEL Avengers Academy is free to download and play, however some game items can also be purchased for real money. If you do not want to use this feature, please setup password protection for purchases in your settings.<p>Terms of Use: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://tinyco.com/websitetermsofuse.htm%26sa%3DD%26usg%3DAFQjCNEq-Iw7Bm9O2bqFph1OSt0pTr66xw&amp;sa=D&amp;usg=AFQjCNHwV_WuEA8sfUTUq8SfHWZ_oxVRYQ" target="_blank">http://tinyco.com/websitetermsofuse.htm</a><br>Privacy Policy: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://tinyco.com/privacypolicy.htm%26sa%3DD%26usg%3DAFQjCNHxGalBQph6r_q3oX3KYj4hL4_W8g&amp;sa=D&amp;usg=AFQjCNFI9Gk4e64dTNvQGMYyO4ne4lGDNw" target="_blank">http://tinyco.com/privacypolicy.htm</a><p>© 2016 MARVEL. All rights reserved. © 2016 TinyCo. All rights reserved. Avengers Academy © developed by TinyCo.</p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/tinyco/avengers', 'marvel-avengers-academy.png', '["marvel-avengers-academy-0.png","marvel-avengers-academy-1.png","marvel-avengers-academy-2.png","marvel-avengers-academy-3.png","marvel-avengers-academy-4.png","marvel-avengers-academy-5.png","marvel-avengers-academy-6.png"]', 0, 0, '', 'com.tinyco.avengers', 'avengers, marvel, academy, super, marvel avengers, super hero, avengers academy, ultimate super, ultimate super hero, all rights reserved', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:34', '2016-05-18 01:20:34', 0),
(132, 33, 718, 'ROBLOX', 'roblox', ' <div jsname="C4s9Ed">Welcome to the ultimate virtual universe powered by imagination.  Join the largest user-generated gaming community where over 20 million visitors come each month to explore amazing 3D virtual worlds with friends.<p>GAME EXAMPLES<br>- Play paintball with your friends<br>- Run a pizza shop<br>- Explore other galaxies<br>- Outmaneuver enemy jets<br>- Battle pirates<br>- Race opponents through obstacle courses<br>- Combat zombies<br>- Star in a fashion show<br>- Hang out with your friends in a virtual club<p>FEATURES<br>- Massive multi-player gaming platform<br>- Thousands of games to choose from<br>- Customizable characters<br>- Enabled message and chat features<br>- Free to download, with in-app purchases<p><br>PLEASE NOTE<br>ROBLOX is free to download and install. However, some game items can also be purchased with real money. A network connection is required to play and ROBLOX games work best over wifi. The ROBLOX ESRB rating applies only to the app, not to any user generated content included within the app, which is unrated.<p>ALREADY A HAVE AN ACCOUNT?<br>Login to your existing Roblox account and play on the go!<p>SUPPORT<br>Help: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://en.help.roblox.com/hc/en-us%26sa%3DD%26usg%3DAFQjCNFfjGt2gA1OyyBPiWQmCvsxO22zWg&amp;sa=D&amp;usg=AFQjCNE5-t0RiydJh2lRtWi1IPsODR9HUw" target="_blank">https://en.help.roblox.com/hc/en-us</a><br>ROBLOX Corporate Site: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://corp.roblox.com/contact-us-3%26sa%3DD%26usg%3DAFQjCNHfTPFO5sE4XuE-jZB6J6vDxIDZew&amp;sa=D&amp;usg=AFQjCNGmUd6WdAN7IjwnojKqnIetn9qD1Q" target="_blank">http://corp.roblox.com/contact-us-3</a><p>PRIVACY POLICY<br>ROBLOX Corporate Site: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.roblox.com/Info/Privacy.aspx%26sa%3DD%26usg%3DAFQjCNHWubNTaE9zAmGUzAjeV1P5l1I35A&amp;sa=D&amp;usg=AFQjCNEQbJCE4tEriCI_hFefUgTtHhQymQ" target="_blank">http://www.roblox.com/Info/Privacy.aspx</a><p>PARENT’S GUIDE<br>ROBLOX Corporate Site: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://corp.roblox.com/parents%26sa%3DD%26usg%3DAFQjCNHAWGbAWbW5QtnC5E082Enos0TrvQ&amp;sa=D&amp;usg=AFQjCNFJEIuZr28HgFkIyGx9o0XtoWfoeA" target="_blank">http://corp.roblox.com/parents</a></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/roblox/client', 'roblox.png', '["roblox-0.png","roblox-1.png","roblox-2.png","roblox-3.png","roblox-4.png","roblox-5.png","roblox-6.png"]', 0, 1, '', 'com.roblox.client', 'roblox, corporate, virtual, friends, roblox com, corporate site, site http, corp roblox, corporate site http, http corp roblox', '', 0, '5.0', 1, 0, 0, 0, '2016-05-18 01:20:36', '2016-05-19 06:46:57', 0),
(133, 33, 15756, 'Crab War', 'crab-war', ' <div jsname="C4s9Ed">Giant reptiles invaded their lands and drove the crabs underground. Centuries later, infused with the power of crystals, they are ready to exact their revenge! Raise the swarm and resurface with a vengeance. Grow your army of crabs, evolve them and drive the scaly beasts out of your homeland! <p>• Evolve more than 80 beautifully designed crabs<br>• Spawn 30 unique queens to lead your swarm<br>• Unleash 6 powerful abilities and customize them with up to 18 different talents<br>• Hunt over 50 uniquely dangerous reptiles<br>• Ecdysis and be reborn with powerful mutations<br>• Slay the Wildebeast and claim legendary rewards<br>• Call upon the help of powerful allies such as the killer crab and golden ray<p>The fight for your home has begun. Are you ready for WAR?</p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/appxplore/crabwar', 'crab-war.png', '["crab-war-0.png","crab-war-1.png","crab-war-2.png","crab-war-3.png","crab-war-4.png","crab-war-5.png","crab-war-6.png"]', 0, 1, '', 'com.appxplore.crabwar', 'powerful, evolve, ready, crabs', '', 0, '5.0', 1, 0, 0, 0, '2016-05-18 01:20:39', '2016-05-20 05:53:39', 0),
(134, 33, 624, 'Sandstorm: Pirate Wars', 'sandstorm-pirate-wars', ' <div jsname="C4s9Ed">Discover a sci-fi action RPG set in a post-apocalyptic desert world inhabited by fearsome pirates and mutant scavengers. <p>“The combat is suitably fun, strategic, and tense, and the world is a genuine joy to explore. There&#39;s a Fallout mixed with Pirates aesthetic here, and it really draws you in.”<br>-Pocket Gamer<br>As the Captain of a flying Sand-Cruiser battleship, you are a bold survivor in lands ruined by war, pollution and nuclear fallout. <br>Sandstorm: Pirate Wars features an epic single player story set in the not-so-distant future, an online PvP battle arena, a formidable arsenal of weapons, and a fleet of hover ships armored like tanks!<p>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~<br>Fight Real-Time Pirate Arena Battles<br>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~<p>• Defeat pirates from around the world on Local and Global Leaderboards<br>• Plunder defeated enemies to find resources to customize and upgrade your fleet <br>• Complete daily Pirate Arena missions for extra loot<br>• Invite your friends and crush them in PvP battle<br>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~<br>Create and Modify Powerful War Machines<br>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~<p> <br>• Choose from a huge variety of weapons including Lasers, Drones, Mini-Guns and Cannons<br>• Strategically select combat systems to destroy your opponents tactically<br>• Upgrade your weaponry with materials obtained from exploration and salvage<br>• Customize your Ship by swapping out pieces and changing skins<p><p>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~<br>Survive Desert Wastelands<br>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~<p><br>• Journey through arid desert space, gritty suburbs, ruined cities, and more<br>• Encounter treacherous enemies and mysterious allies of different factions<br>• Complete smuggler missions to earn resources to improve your flying Sand-Cruiser<br>• Loot and plunder fallen shipwrecks and discover rare combat Systems<p>Join our Community of Pirates!<br>Facebook - facebook.com/sandstormpiratewars<br>Twitter - twitter.com/sandstormpirate<br>Official Forums - bit.ly/ss-forums<p>***AWARD: The Best Music and Sound  2015 from the  Spanish Interactive Arts &amp; Sciences Academy ***<p>Internet connection required for play. Strong Wi-Fi connection recommended for best performance.<p>Game availabe in: English, French, Italian, German, Spanish, Brazilian Portuguese, Russian, Korean, Japanese, Simplified Chinese</p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/ubisoft/sandstormpiratewars', 'sandstorm-pirate-wars.png', '["sandstorm-pirate-wars-0.png","sandstorm-pirate-wars-1.png","sandstorm-pirate-wars-2.png","sandstorm-pirate-wars-3.png","sandstorm-pirate-wars-4.png","sandstorm-pirate-wars-5.png","sandstorm-pirate-wars-6.png"]', 0, 0, '', 'com.ubisoft.sandstormpiratewars', 'pirates, pirate, arena, combat, upgrade your, pirate arena, flying sand, the world', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:42', '2016-05-18 01:20:42', 0),
(135, 33, 15757, 'Growtopia', 'growtopia', ' <div jsname="C4s9Ed">BE AWARE! This is a game about collecting and protecting items while playing with actual human beings from all around the world.  Your items CAN and WILL be stolen if you don&#39;t keep them safe.  That is part of the gameplay, and stolen items will not be restored.  All of the items necessary to prevent theft are available in the game.  USE THEM WISELY!<p>PARENTS:  There is a Parental Controls area in the Options menu - it allows you to disable buying Gems and Tapjoy Offer Wall options as well as block chat with other players.<p>Growtopia is a creative sandbox platformer MMO where you can:<p>* BUILD anything you can imagine – houses, dungeons, song, artwork, puzzles, etc<br>* COLLABORATE with real people - there have been over 13 million player accounts created, all in the same universe, no sharding!<br>* PLAY mini-games - parkour, surgery, quizzes, PVP battles, CTF, races, and more<br>* PROTECT items using an innovative lock system which allows you to give access to friends<br>* PLANT seeds to grow trees<br>* SPLICE seeds to discover hundreds of amazing items, with new items added constantly<br>* TRADE items in our secure trading system<br>* EXPLORE a universe of over 300 MILLION user-created worlds, all persistent and connected to each other<br>* COMMUNICATE using a full chat and messaging system<br>* EARN a single in-game currency entirely through gameplay<br>* See classic pixel graphics, optimized for small and large screens<br>* Hear the original soundtrack by Cory Mollenhour<br>* Your account is usable with clients on all platforms (Android, iOS, Win, and Mac)<p>Didn&#39;t get your gems or having a problem?  Email us at <a href="mailto:support@growtopiagame.com">support@growtopiagame.com</a>, we&#39;d love to help!<p>Growtopia is a collaboration between old school indie game developers Seth A. Robinson and Mike Hommel.<p>CAN&#39;T TYPE?  Tap ENG to toggle to the English keyboard!  If that doesn&#39;t work, try changing keyboards. (Requires standard ascii input)  <p>WARNING: This app allows Gem purchases using Google&#39;s In App Billing system.  Be sure to disable purchases or set a pin-number in the play store if kids use your device.</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/rtsoft/growtopia', 'growtopia.png', '["growtopia-0.png","growtopia-1.png","growtopia-2.png","growtopia-3.png","growtopia-4.png","growtopia-5.png"]', 0, 0, '', 'com.rtsoft.growtopia', 'items, using, allows, purchases, you can, allows you', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:44', '2016-05-18 01:20:44', 0),
(136, 34, 15862, 'The Impossible Quiz', 'the-impossible-quiz', ' <div jsname="C4s9Ed">It is not impossible, but you might dig for your brains through your ear. Give it your best shot and try not to get shot.</div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/rules/atmes/idv/m', 'the-impossible-quiz.png', '["the-impossible-quiz-0.png","the-impossible-quiz-1.png","the-impossible-quiz-2.png"]', 0, 0, '', 'com.rules.atmes.idv.m', '', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:50', '2016-05-18 01:20:50', 0),
(137, 34, 15504, 'Grabatron', 'grabatron', ' <div jsname="C4s9Ed">&quot;Crazy high replay value, Future Games Of London has delivered one of the best action games in the AppStore&quot; - App Shack 4.5/5<br>&quot;This game makes me laugh the whole time I am playing.&quot; - AndroidRundown.com 10/10 PERFECT!<p>+ 5 Ships: Scout, Mustax, Hornet, Talonator and XenoClaw!<br>+ 5 Landing Zones!<br>+ Ship Upgrades: Speed, Shield, Crystal Attraction!<br>+ Extra Lives!<br>Grabatron is the latest massively addictive game from the makers of Hungry Shark.<br>Take control of a UFO with a retractable claw and destroy the puny humans! <br>Terrorise them anyway you like: Toss them, crush them, abduct them - it&#39;s up to you.<br>Explore a huge and varied environment with hours of action packed gameplay.<br>* Beautiful Graphics <br>* Realistic Physics <br>* Huge world to explore<br>* Over 30 different missions <br>* Both Tilt and Touch controls available<br>Grabatron - where being evil has never been so much fun...<p>Please note that we no longer support in-app purchases on this title. This means you can no longer purchase the weapon “Missile Launcher.” Terribly sorry for any inconvenience caused.<p>Check out - Brett Domino Trio: Earthquake (Labrinth Cover) ft. Grabatron<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.youtube.com/watch?v%253DaTfbKW6_nxc%26sa%3DD%26usg%3DAFQjCNHPlS6RchlZV92pvOd7V1SnBtvZQw&amp;sa=D&amp;usg=AFQjCNFn4t_VqWkW_FRIalvsNbVaxyaZSA" target="_blank">http://www.youtube.com/watch?v=aTfbKW6_nxc</a><p>NOTE:<br>HTC Desire, Nexus One, Galaxy Ace users: Pause and resume the game if you experience slowdown issues 5-10mins into gameplay.</p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/fgol/grabatron1', 'grabatron.png', '["grabatron-0.png","grabatron-1.png","grabatron-2.png","grabatron-3.png","grabatron-4.png","grabatron-5.png","grabatron-6.png"]', 0, 0, '', 'com.fgol.grabatron1', 'longer, gameplay, action, games', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:55', '2016-05-18 01:20:55', 0),
(138, 34, 15863, 'City Survival - Multiplayer', 'city-survival-multiplayer', ' <div jsname="C4s9Ed">Main FEATURES: <br>- multiplayer<br>- play with your friends all around the world; <br>- drive cool cars, flight via jet pack and helicopter; <br>- participate great assault with tanks, and military helicopters! <br>- variety of weapons! <br>- several incredible missions!</div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/ttgame/survival', 'city-survival-multiplayer.png', '["city-survival-multiplayer-0.png","city-survival-multiplayer-1.png"]', 0, 0, '', 'com.ttgame.survival', '', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:20:58', '2016-05-18 01:20:58', 0),
(139, 34, 1856, 'Sonic 4 Episode II LITE', 'sonic-4-episode-ii-lite', ' <div jsname="C4s9Ed">Take Sonic and Tails for a spin in this Lite version of Sonic The Hedgehog™ 4 Episode II!<p>The Sonic 4 Saga continues in Episode II with the return of a beloved side kick and fan-favorite villains!<p>Following the events of Episode I, Metal Sonic has returned to form a formidable alliance with Dr. Eggman! To face this new evil, Sonic will have to call upon an old friend to help him save the day! Now joined by Tails, race across four brand new Zones and take down fearsome new badniks with deadly combination moves in order to put an end to this dastardly duo’s plans!<p>New and Improved<br>Episode II features an all-new engine; bringing you gameplay with updated physics and Zones in stunning HD graphics.<p>Collaborative Play<br>Team up with a friend via Bluetooth and take control of Sonic and Tails as they battle against Dr. Eggman and Metal Sonic!<p>Lock-on with Episode Metal<br>Users who own both Episodes I &amp; II will unlock an exclusive scenario featuring Metal Sonic! Explore four Acts across four reworked Zones from Episode I and experience the story of Metal Sonic&#39;s revival after his defeat in Sonic CD!<p>- - - - -<br>Privacy Policy: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.sega.com/mprivacy%26sa%3DD%26usg%3DAFQjCNEYWPx7IY1QoFhDncCxWN_XnKCngQ&amp;sa=D&amp;usg=AFQjCNGmESyedMo787ALuRIqoc2qlerkQg" target="_blank">http://www.sega.com/mprivacy</a><br>Terms of Use: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.sega.com/terms%26sa%3DD%26usg%3DAFQjCNELzheBeVSL4nsLtTOJNYch0jBKmw&amp;sa=D&amp;usg=AFQjCNFwAoYtFRLc3gcdWe3vg40fEnLBcw" target="_blank">http://www.sega.com/terms</a><p>SEGA, the SEGA logo, SONIC THE HEDGEHOG and SONIC 4 EPISODE II are either registered trade marks or trade marks of SEGA Holdings Co., Ltd. or its affiliates. All rights reserved.</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/sega/sonic4ep2lite', 'sonic-4-episode-ii-lite.png', '["sonic-4-episode-ii-lite-0.png","sonic-4-episode-ii-lite-1.png","sonic-4-episode-ii-lite-2.png","sonic-4-episode-ii-lite-3.png","sonic-4-episode-ii-lite-4.png","sonic-4-episode-ii-lite-5.png","sonic-4-episode-ii-lite-6.png"]', 0, 0, '', 'com.sega.sonic4ep2lite', 'sonic, episode, metal, zones, metal sonic, www sega, sega com, trade marks', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:21:03', '2016-05-18 01:21:03', 0);
