(140, 34, 10467, 'Fruits Burst', 'fruits-burst', ' <div jsname="C4s9Ed">Fruits Burst is a very addictive juicy action-style casual game!<p>Swipe your finger to connect the fruits, and enjoy the sweet tasty fruit juicy with every success connects!<p>Fruits Burst Features:<br>1. Many interesting game modes<br>2. Brilliant special effects, juice scattered, the impact breaking, fruit blasting, etc...<br>3. Hundreds of levels, compete with worldwide players<br>4. Constantly updated, each update has a surprise.<p>Free download and enjoy it, let&#39;s start!</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/nextstep/fruitburstline', 'fruits-burst.png', '["fruits-burst-0.png","fruits-burst-1.png","fruits-burst-2.png","fruits-burst-3.png","fruits-burst-4.png","fruits-burst-5.png","fruits-burst-6.png"]', 0, 0, '', 'com.nextstep.fruitburstline', 'fruits, fruit, burst, juicy, and enjoy, fruits burst', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:21:07', '2016-05-18 01:21:07', 0),
(141, 35, 1070, 'Disney Magical Dice', 'disney-magical-dice', ' <div jsname="C4s9Ed">*Authorization for the external storage will only be used to save game data. <br>*User information will be only used for adding in-game friends who play around. All data will be encrypted for your security <p>Disney’s 1st mobile board game is here!<p>Join a cast of Disney Characters in Disney Magical Dice! Embark on an epic adventure! COLLECT cards and ROLL the magic dice to journey across fantastic Disney worlds!<p>CREATE your avatar and choose from a variety of Classic Disney costumes! This property trading board game will allow you to explore your dream Disney world. <p>Play with your friends anywhere, anytime!<p>Features:<br>* Disney landmarks: Cinderella castle, Peter Pan&#39;s Jolly Roger, Daisy&#39;s garden... collect them all! <br>* Costume cards for your avatars: Cinderella, Maleficent, Snow White, Aladdin, Peter Pan, Woody, Buzz, Rapunzel, and more! The more you play the more costume cards you get! <br>* Card collection and power-ups: expand your collection of Disney costume card avatars and strengthen them through power-ups and fusion to be the best at the game!<br>* Play modes: Multiplayer games of up to 4 players playing at the same time using Bluetooth or the internet<p>* Global competition via rankings: COMPETE with international players as well as your friends. EARN rewards for winning!<p>Please note! Disney Magical Dice is free to play. However, some game items can also be purchased for real money. If you do not wish to use this feature, you can simply disable in-app purchases in your device&#39;s settings. A network connection is required to play.<br> <br>Minimum system requirements : CPU Dualcore 1.2GHz, Ram 1GB<br>Terms of Service: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://help.netmarble.com/policy/terms_of_service.asp%26sa%3DD%26usg%3DAFQjCNFxcd-19272goD3DcZuulqOdFYt_A&amp;sa=D&amp;usg=AFQjCNGkBeK4VjC4gB5kz_hiy_3X7Wk4Jg" target="_blank">http://help.netmarble.com/policy/terms_of_service.asp</a><br>Privacy Policy:  <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://help.netmarble.com/policy/privacy_policy.asp?locale%253Den%26sa%3DD%26usg%3DAFQjCNEewtjNCHuC3_h78YoEVOXYmKER7g&amp;sa=D&amp;usg=AFQjCNGNwEZ786tulaoa7hZKow2Oh6f2Iw" target="_blank">http://help.netmarble.com/policy/privacy_policy.asp?locale=en</a><br>Tablet Mode Available</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/netmarble/momag', 'disney-magical-dice.png', '["disney-magical-dice-0.png","disney-magical-dice-1.png","disney-magical-dice-2.png","disney-magical-dice-3.png","disney-magical-dice-4.png","disney-magical-dice-5.png","disney-magical-dice-6.png"]', 0, 0, '', 'com.netmarble.momag', 'disney, policy, costume, friends, http help, power ups, help netmarble, netmarble com, http help netmarble, disney magical dice', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:21:10', '2016-05-18 01:21:10', 0),
(142, 35, 14989, 'Hong Kong Style Mahjong - Free', 'hong-kong-style-mahjong-free', ' <div jsname="C4s9Ed">Mahjong is a game that originated in China. It is commonly played by four players. The game and its regional variants are widely played throughout Eastern and South Eastern Asia and have a small following in Western countries.  Mahjong is similar to the Western card games like rummy, mahjong is a game of skill, strategy, and calculation and involves a degree of chance.<p>This is a 13 tile implementation of Mahjong based upon Hong Kong or Cantonese rules.    <p>This version of mahjong has the most advanced, responsive and intuitive touch interface for any mahjong app on the market.<p>Full details for Hong Kong Style rules can be found here <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://en.wikipedia.org/wiki/Hong_Kong_Mahjong_scoring_rules%26sa%3DD%26usg%3DAFQjCNGcjBUywyqVWxG2Paxr1mKADBhL9Q&amp;sa=D&amp;usg=AFQjCNEvwF3Dbs9iCia-eYlHS4LszTlZog" target="_blank">https://en.wikipedia.org/wiki/Hong_Kong_Mahjong_scoring_rules</a><p>NEW: Additional Tile Sets and Optional Special Hong Kong Style Hands and Achievements.<p>Be prepared for fast paced Mahjong action.  Incorporating traditional Hong Kong rules with many options to customise your playing experience, including:<br>* Minimum level setting<br>* Flowers and Seasons<br>* Resume mode<br>* Demo mode<br>* Traditional or English Tiles<br>* Fast or Slow mode* <br>* Google Play Achievements <br>* High Definition Tile images thanks to <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.martinpersson.org/%26sa%3DD%26usg%3DAFQjCNEbazZcjd94vxjR488EnGOTGvKZsQ&amp;sa=D&amp;usg=AFQjCNF2yfeY5gQLujsJBCiZbfMBjs_4cw" target="_blank">http://www.martinpersson.org/</a> <p>Shape the future development of this application and chat with other users on facebook, or just like us at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/hksmahjong%26sa%3DD%26usg%3DAFQjCNFlXEBs79enaMqrkGzE5P-ZOMuBLg&amp;sa=D&amp;usg=AFQjCNE7wfAQ5uf-JjXUYUhy8BmGJaMcgw" target="_blank">https://www.facebook.com/hksmahjong</a>.  We do listen to our facebook users and respond to their suggestion improvements where they make sense.<p>NOTE: Some slower devices do not work well with animation. Go to the settings and disable animation and you should still be able to play.  <p>Feel free to email comments or bug reports to <a href="mailto:pvella@gmail.com">pvella@gmail.com</a>. I do respond.  Special thank you to those that have emailed bugs and screen shots.    <p>COMING SOON:<br>* Multiplayer</p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/pvella/mahjong', 'hong-kong-style-mahjong-free.png', '["hong-kong-style-mahjong-free-0.png","hong-kong-style-mahjong-free-1.png","hong-kong-style-mahjong-free-2.png","hong-kong-style-mahjong-free-3.png","hong-kong-style-mahjong-free-4.png","hong-kong-style-mahjong-free-5.png"]', 0, 0, '', 'com.pvella.mahjong', 'mahjong, mode*, rules, facebook, hong kong, kong style, , hong kong style', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:21:14', '2016-05-18 01:21:14', 0),
(143, 35, 1485, 'Game of Dice', 'game-of-dice', ' <div jsname="C4s9Ed">Takeover cities, collect tolls and out-wealth other players around the world!!<br>Play as various characters in the world of Game of Dice, ranging from telekinetic master to contract killer!<br>You can also use skill cards such as counter-attack, ambush, high jump, and many more to turn the tide of the match.<p>◆ Welcoming Event!<br>1. Enter coupon code [GAMEOFDICE] for $50 worth of FREE items!<br>2. Hot Time Event : Free gifts everyday at 12pm, and 6pm! <br>3. Daily Login Event : Login and receive gifts daily! The more you login, the better gifts you get! <p>◆ Game Features<br>- Collect dice fragments to create a dice with unique abilities<br>- Each character will have different statistics, use the one that fits best with your play style<br>- Skill cards have distinct in-game effects, try to use the ones that suits your strategy<br>- Compete with other players worldwide in real-time<br>- Team-up or play in singles match in 4 different tournament modes, from Rookie to Grand Slam<br>- You can also use the chatting system and emoticons to talk with friends around the world<br>- Game of Dice supports 7 languages (English, 한국어, 日本語, 中文简体, 中文繁體, ภาษาไทย, Bahasa Indonesia)<p>◆ Community<br>Follow us on our official communities to receive latest news and updates!<br>- Forum : <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://forums.joycity.com/m/%26sa%3DD%26usg%3DAFQjCNGrDjnPQBx8FM8bO5-8DDl97INqog&amp;sa=D&amp;usg=AFQjCNHBIlnwE0bKnuNNMSKQ13x2VQ-t0g" target="_blank">http://forums.joycity.com/m/</a><br>- Facebook : <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/gameofdice.eng%26sa%3DD%26usg%3DAFQjCNHev-tSLTGPQXBJArUgZbk-Q2utBw&amp;sa=D&amp;usg=AFQjCNFrmt4tUtmn4SBepEo-885wDvozYw" target="_blank">http://www.facebook.com/gameofdice.eng</a><br>- Twitter : <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://twitter.com/GameofDice_EN%26sa%3DD%26usg%3DAFQjCNFqsrhbgxXxb-WxB2xdEb6tnqc0mA&amp;sa=D&amp;usg=AFQjCNE4NgRwSLlHMIfweJ5vrgY4__qSCw" target="_blank">https://twitter.com/GameofDice_EN</a><p>◆ Customer Support<br>Please contact our customer support(<a href="mailto:gameofdice@joycity.com">gameofdice@joycity.com</a>) for any inquiries or comments<p>※ Game of Dice requires network connection for real-time matching.<br>※ This game is free to play, but you can choose to pay real money for some in-game items. Please note that some paid items may not be refundable depending on the type of the items.</p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/joycity/god', 'game-of-dice.png', '["game-of-dice-0.png","game-of-dice-1.png","game-of-dice-2.png","game-of-dice-3.png","game-of-dice-4.png","game-of-dice-5.png","game-of-dice-6.png"]', 0, 0, '', 'com.joycity.god', 'items, event, gameofdice, login, use the, you can, the world, com gameofdice', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:21:19', '2016-05-18 01:21:19', 0),
(144, 35, 1038, 'Rolling Sky', 'rolling-sky', ' <div jsname="C4s9Ed">Rolling sky is an adventurous game to challenge your limits to it&#39;s fullest.  Rolling Sky offers fantastic stereo and visual effects with strong rhythm, great background music and awesome sound effects.  Stylized worlds with various levels of challenges, are you ready for the impossible mission?  Do you have what it takes?<p><b>Features:</b><br>• One-touch control with simple operations<br>• Stunning 3D worlds and effects<br>• Rich scenes (including Massif, Cosmos, Forest, Snowfield, Inferno and lots more!)<br>• A challenge to test your ultimate speed and fast reflexes!<p><b>How to play?</b><br>Drag the ball left or right to avoid all obstacles and try not to fall off the track!  Challenge your speed with the rhythm of the music and try your best to win each round!<p><b>Follow and contact us:</b><br>It’s always pleasant to receive your valuable suggestions.We invite you to suggest game improvements, bugs or general feedback! Contact us! <br><b><a href="mailto:rollingskyfeedback@conew.com">rollingskyfeedback@conew.com</a></b><p>Privacy Policy ：<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.cmcm.com/protocol/site/privacy.html%26sa%3DD%26usg%3DAFQjCNEapMFkkxDWMCLD_jX8zfM3e1Fhiw&amp;sa=D&amp;usg=AFQjCNENKoEk-8767IfYnzEUoW9btuU70g" target="_blank">http://www.cmcm.com/protocol/site/privacy.html</a></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/turbochilli/rollingsky', 'rolling-sky.png', '["rolling-sky-0.png","rolling-sky-1.png","rolling-sky-2.png","rolling-sky-3.png","rolling-sky-4.png","rolling-sky-5.png","rolling-sky-6.png"]', 0, 0, '', 'com.turbochilli.rollingsky', 'challenge, speed, contact, worlds, and try, music and, challenge your, rolling sky', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:21:22', '2016-05-18 01:21:22', 0),
(145, 35, 1463, 'Snakes &amp; Ladders King', 'snakes-amp-ladders-king', ' <div jsname="C4s9Ed">Through a simple board game with dice game rules <br>The game to do battle for who first to arrival 100 steps. <p>[Features] <br>- Survival Mode: The Games add fun of arcade on classic board game. <br>- Vs Computer Mode: You can enjoy with artificial intelligence. <br>- Multiplayer: You can compete with other player by online<br>- 2P, 3P, 4P: Enjoy the 2-4 player game offline with friends. <br>- Invite a friend, leaderboards, achievements support <br>- Tablet devices support<p>Homepage:<br>https://play.google.com/store/apps/dev?id=4864673505117639552<p>Facebook: <br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/mobirixplayen%26sa%3DD%26usg%3DAFQjCNEMzTG_gnstyk5vDi71YyAYtKdFpA&amp;sa=D&amp;usg=AFQjCNGf_4NxSxCyTZ4_n1LCJbSAKLZReA" target="_blank">https://www.facebook.com/mobirixplayen</a></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/mobirix/SnakeGame', 'snakes-amp-ladders-king.png', '["snakes-amp-ladders-king-0.png","snakes-amp-ladders-king-1.png","snakes-amp-ladders-king-2.png","snakes-amp-ladders-king-3.png","snakes-amp-ladders-king-4.png","snakes-amp-ladders-king-5.png","snakes-amp-ladders-king-6.png"]', 0, 0, '', 'com.mobirix.SnakeGame', 'https, player, board, , you can, board game', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:21:25', '2016-05-18 01:21:25', 0),
(146, 36, 2295, 'Hearthstone Heroes of Warcraft', 'hearthstone-heroes-of-warcraft', ' <div jsname="C4s9Ed">DECEPTIVELY SIMPLE.  INSANELY FUN.<p>Pick up your cards and throw down the gauntlet! In Hearthstone, you play the hero in a fast-paced, whimsical card game of cunning strategy.  In minutes, you’ll be unleashing powerful cards to sling spells, summon minions, and seize control of an ever-shifting battlefield.  Whether it’s your first card game or you’re an experienced pro, the depth and charm of Hearthstone will draw you in.<br> <br>JUMP RIGHT IN: Fun introductory missions bring you into the world of Hearthstone’s intuitive gameplay.<br> <br>BUILD YOUR DECK:  With hundreds of additional cards to win and craft - your collection grows with you.<p>HONE YOUR SKILLS:  Play in practice matches against computer-controlled heroes of the Warcraft universe.  Thrall, Uther, Gul’dan - they’re all here!<br> <br>COLLECTION TRAVELS WITH YOU: Your card collection is linked to your Battle.net account - enabling you to switch your play between tablet and desktop with ease. <br> <br>AND FIGHT FOR GLORY:  When you’re ready, step into the Arena and duel other players for the chance to win awesome prizes!<p><br>Post feedback about the game in our forums: <br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://us.battle.net/hearthstone/en/forum/13619661/%26sa%3DD%26usg%3DAFQjCNEmG8a4-xbflVlanVlWhaqvZFlx0g&amp;sa=D&amp;usg=AFQjCNHHkTjtrv2bn_kHqAphSdv8_lQZdw" target="_blank">http://us.battle.net/hearthstone/en/forum/13619661/</a><p>Languages Supported: <br>* English <br>* Français <br>* Deutsch <br>* Español (Latinoamérica) <br>* Español (Europa) <br>* Italiano <br>* Português <br>* Polski<br>* Русский <br>* 한국어 (Korean) <br>* 简体中文 (Simplified Chinese) <br>* 繁體中文 (Traditional Chinese) <br>* 日本語 (Japanese)<br>* ไทย (Thai)<p>©2016 Blizzard Entertainment, Inc. All rights reserved. Hearthstone and Heroes of Warcraft are trademarks, and Battle.net and Blizzard Entertainment are trademarks or registered trademarks of Blizzard Entertainment, Inc., in the U.S., and/or other countries.</p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/blizzard/wtcg/hearthstone', 'hearthstone-heroes-of-warcraft.png', '["hearthstone-heroes-of-warcraft-0.png","hearthstone-heroes-of-warcraft-1.png","hearthstone-heroes-of-warcraft-2.png","hearthstone-heroes-of-warcraft-3.png","hearthstone-heroes-of-warcraft-4.png","hearthstone-heroes-of-warcraft-5.png","hearthstone-heroes-of-warcraft-6.png"]', 0, 0, '', 'com.blizzard.wtcg.hearthstone', 'hearthstone, battle, blizzard, cards, blizzard entertainment, battle net, are trademarks, entertainment inc', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:21:30', '2016-05-18 01:21:30', 0),
(147, 36, 897, 'UNO ™ &amp; Friends', 'uno-amp-friends', ' <div jsname="C4s9Ed">UNO™ &amp; Friends: Fast Fun for Everyone!<p>UNO™, the world&#39;s most beloved card game, introduces a new free social experience!<p>Playing UNO™ with friends, family, and the millions of fans worldwide has never been easier! Join one of the largest mobile gaming communities and enjoy a free multiplayer experience, brand-new game modes and tournaments that let you shout &quot;&quot;UNO!&quot;&quot; on a whole new level!<p>GAME FEATURES:<p>√ Easy to learn, difficult to put down!<br>√ Play in Tournaments and become an UNO champion!<br>√ Team up for the win in 2vs2 UNO!<br>√ Use Boosts &amp; Companions to diversify your strategy!<br>√ Level up your UNO Companions and unleash their powers!<br>√ Create custom games and invite your friends to play!<br>√ Challenge millions of UNO fans worldwide!<p>_____________________________________________<p>You can download and play this game for free. Please be informed that it also allows you to play using virtual currency, which can be acquired as you progress through the game, or by deciding to watch certain advertisements, or by paying with real money. Purchases of virtual currency using real money are performed using a credit card, or other form of payment associated with your account, and are activated when you input your Google Play account password, without the need to re-enter your credit card number or PIN. <br>In-app purchases can be restricted by adjusting the authentication settings within your Play Store settings (Google Play Store Home &gt; Settings &gt; Require authentication for purchases) and setting up a password for each purchase / Every 30 minutes or Never. <br>Disabling password protection may result in unauthorized purchases. We strongly encourage you to keep password protection turned on if you have children or if others could have access to your device.<br>This game contains advertising for Gameloft’s products or some third parties which will redirect you to a third-party site. You can disable your device’s ad identifier being used for interest-based advertising in the settings menu of your device. This option can be found in the Settings app &gt; Accounts (Personal) &gt; Google &gt; Ads (Settings and Privacy) &gt; Opt out of interest-based ads.<br>Certain aspects of this game will require the player to connect to the Internet. <br>___________________________________<p>Visit our official site at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.gameloft.com%26sa%3DD%26usg%3DAFQjCNFOno-W4PPHCTPGS8zVxRADxn5Z-g&amp;sa=D&amp;usg=AFQjCNGNA_F3ZwhRWkuoHptzZVJ6uy71jA" target="_blank">http://www.gameloft.com</a><br>Follow us on Twitter at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://glft.co/GameloftonTwitter%26sa%3DD%26usg%3DAFQjCNG23NaE--bEDs5Hv4pqipLlfXwwrA&amp;sa=D&amp;usg=AFQjCNE3i2Atob3gNsQHwla2H-Y1ARGVwA" target="_blank">http://glft.co/GameloftonTwitter</a> or like us on Facebook at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://facebook.com/Gameloft%26sa%3DD%26usg%3DAFQjCNGGkNgB8PZiTiUAr8P1tkoMl6FiAQ&amp;sa=D&amp;usg=AFQjCNHGlkULRWnmH7ObJNOsVj_hH5JFCA" target="_blank">http://facebook.com/Gameloft</a> to get more info about all our upcoming titles.<br>Check out our videos and game trailers on <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.youtube.com/Gameloft%26sa%3DD%26usg%3DAFQjCNENVViATcH9LF20wh3TCdW9cKXGCQ&amp;sa=D&amp;usg=AFQjCNEIa2cFx_dqqfKnzKX5c_OoeEqcWg" target="_blank">http://www.youtube.com/Gameloft</a> <br>Discover our blog at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://glft.co/Gameloft_Official_Blog%26sa%3DD%26usg%3DAFQjCNFd_2BLjj4DQdTBFPtn8nvbIn2XMw&amp;sa=D&amp;usg=AFQjCNHGagTsiDGMD5RRI9WKMO7wJEzqSA" target="_blank">http://glft.co/Gameloft_Official_Blog</a> for the inside scoop on everything Gameloft.<p>Privacy Policy: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.gameloft.com/privacy-notice/%26sa%3DD%26usg%3DAFQjCNGX3aQPRQ30ew0bAf31IqNsPjF4eQ&amp;sa=D&amp;usg=AFQjCNHsVDNQ756_8g85YsrA_S4cOglBWA" target="_blank">http://www.gameloft.com/privacy-notice/</a><br>Terms of Use: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.gameloft.com/conditions/%26sa%3DD%26usg%3DAFQjCNEVX52Np_7-l9gslOlHHMvmqpM5qA&amp;sa=D&amp;usg=AFQjCNFlFJ8xWF74VxdwaUV3RaXRNyj9Ng" target="_blank">http://www.gameloft.com/conditions/</a><br>End-User License Agreement: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.gameloft.com/eula/?lang%253Den%26sa%3DD%26usg%3DAFQjCNG6PVmX3hc8wO13CBDJeK0NwZb3Rg&amp;sa=D&amp;usg=AFQjCNETKdprfhn49yEPi3LiQ_s2omUbsQ" target="_blank">http://www.gameloft.com/eula/?lang=en</a></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/gameloft/android/ANMP/GloftUOHM', 'uno-amp-friends.png', '["uno-amp-friends-0.png","uno-amp-friends-1.png","uno-amp-friends-2.png","uno-amp-friends-3.png","uno-amp-friends-4.png","uno-amp-friends-5.png","uno-amp-friends-6.png"]', 0, 0, '', 'com.gameloft.android.ANMP.GloftUOHM', 'gameloft, settings, password, purchases, http www, www gameloft, this game, gameloft com, your device this', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:21:33', '2016-05-18 01:21:33', 0),
