(156, 38, 10926, 'Fair Story Bubble Shooter', 'fair-story-bubble-shooter', ' <div jsname="C4s9Ed">Ronald ran back to the fair to save all of his doll friends!<br>Win different levels with different goals at the bubble shooting stall to progress.<br>★  Over 500 hand-crafted puzzle levels!<br>★ Drag your finger to aim, Lift to shoot!<br>★ Pop bubbles by making sequences of 3 or more bubbles.<br>★ Pop 7 in a row for a dragon fire ball!<br>★ Drop more than 10 bubbles in 1 shot for an explosive cotton candy!<br>★ 6 Wonderful fair episodes<br>★ Fun special bubbles and power ups<br>★ Beat your friends&#39; scores!<br>★ Free the captured dolls, enjoy the ropes and pop slimed bubbles!<br>★ Amazing soundtrack and exciting animations!<br>★ Read the notes in the tutorial to understand the game play<p>★ Bubble types:<br>Dual bubbles can function like both of its colors.<br>Rock bubbles can be dropped or destroyed with a rifle / bomb / fire bubble<br>Diamond bubbles can only be dropped<br>Magic bubble appears after popping a sequence of 5 bubbles. It pops bubbles around it.<br>Wrapped bubbles are 2-3 layers bubbles.<br>Tied bubbles are connected with a rope.<br>Slime bubble prevents popping if the bubble you shoot only touches the slime bubble.<br>Water bubble spreads each turn you don&#39;t pop any bubble. Pop the water layer.<br>____________________________________________________________________<br>The game is free but you can purchase coins.<br>_____________________________________________________________________</p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/fair/story/bubble', 'fair-story-bubble-shooter.png', '["fair-story-bubble-shooter-0.png","fair-story-bubble-shooter-1.png","fair-story-bubble-shooter-2.png","fair-story-bubble-shooter-3.png","fair-story-bubble-shooter-4.png","fair-story-bubble-shooter-5.png","fair-story-bubble-shooter-6.png"]', 0, 0, '', 'fair.story.bubble', 'bubbles, bubble, water, slime, bubbles can, bubbles are, slime 