(157, 38, 5949, 'Mandala - adults coloring book', 'mandala-adults-coloring-book', ' <div jsname="C4s9Ed">Mandala - relaxing coloring book for adults and kids for FREE!<p>We would like to present our anti stress coloring book for adults. This application can be used by parents and kids, everybody will find something interesting in multiple coloring categories. You can choose pictures to paint in one of the following themes:<br>✔ Mandala<br>✔ Floral<br>✔ Animals<br>✔ Orient<br>✔ Africa<br>✔ Asia<br>✔ Butterflies <br>✔ Fairy tale<br>✔ Sea world<br>✔ Muisic instruments<br>✔ Japan<br>✔ More anti-stress coloring pages coming soon<p>Use now our coloring therapy on Android device, you don&#39;t have to bring paper and pencils any more when you have troubles to fall a sleep. It is enough to have tablet or phone and just start a trip to calmness.<br>Application has zoom and pan options - don&#39;t worry about filling with color small shapes, it is really easy :)<br>Thanks to paint and draw future you can tune pictures as you wish, you can also save a picture and go back to editing later.<br>When picture is done share it with your friends, maybe you will help them to handle stress as well? Stress relief therapy for adults is just a few taps away. Take care of your mind in a relaxation exercise with the best coloring book for adults app. <br>What colors do you like? What mood are you today? We&#39;ve prepared for you many different color palettes with spring, summer, autumn and winter colors. Coloring mandala and florals application has 3 undo steps , if you made a mistake, just tap a button in right bottom corner and last change will be undone.<p>User comments:<p>⍟⍟⍟⍟⍟<br>&quot;Tried several other apps including Colorfy and this app is in my opinion by far THE BEST! I can actually enjoy the app without having to &quot;PURCHASE&quot; pics or colors! Ya&#39;ll ROCK&quot;<p>⍟⍟⍟⍟⍟<br>&quot;Freaking Amazing LOVE this way more than Colorfy!  Hoping you will be adding to it.  Great pictures and a fun way to relax and pass the time!&quot;<p>Our coloring page mandala:<br>✔ develops imagination (creative education)<br>✔ helps in attention and concentration,<br>✔ allows you to express feelings, fears and thoughts.<br>✔ develops eye-hand coordination,<br>✔ helps to calm down and relax<br>✔ go into zen and relax<br>✔ has very good quality of pictures - HD quality<p>Download and rate our games for adults today! Have fun with coloring book for adults!<br>This also coloring page for parents not only kids, draw and paint and fell how your stress goes away. Feel zen and have calm mind.<p><br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/pages/Kids-Coloring/1489911931226963?ref%253Dbookmarks%26sa%3DD%26usg%3DAFQjCNEesjTBwQAyCWLrn6NolHiilFngFg&amp;sa=D&amp;usg=AFQjCNHzmNL3JkKoEte0MWlIqpIT-lh0bQ" target="_blank">https://www.facebook.com/pages/Kids-Coloring/1489911931226963?ref=bookmarks</a><br>G +:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://plus.google.com/114293037815350905016/posts%26sa%3DD%26usg%3DAFQjCNH65bfbdnsjt0saidlBAGNAJtJKTQ&amp;sa=D&amp;usg=AFQjCNGWt27tX5AmWWJt6z0QglIsV0saTQ" target="_blank">https://plus.google.com/114293037815350905016/posts</a><br>Twitter:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://twitter.com/goodsofttech%26sa%3DD%26usg%3DAFQjCNEg3xjE_312GgtwXLyP7IK5xGxC2g&amp;sa=D&amp;usg=AFQjCNGsTtsRkT_H172A4KjPVcLgGdEosA" target="_blank">https://twitter.com/goodsofttech</a><br>Web:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.goodsofttech.com%26sa%3DD%26usg%3DAFQjCNGZE2_FbddMQGet8mTQi5n83XBXHA&amp;sa=D&amp;usg=AFQjCNFMYd8bEgzvQlZmctLIozJI8pDLLA" target="_blank">http://www.goodsofttech.com</a></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/goodsofttech/coloringforadults', 'mandala-adults-coloring-book.png', '["mandala-adults-coloring-book-0.png","mandala-adults-coloring-book-1.png","mandala-adults-coloring-book-2.png","mandala-adults-coloring-book-3.png","mandala-adults-coloring-book-4.png","mandala-adults-coloring-book-5.png","mandala-adults-coloring-book-6.png"]', 0, 0, '', 'com.goodsofttech.coloringforadults', 'coloring, adults, stress, pictures, for adults, coloring book, book for, you can, for adults this, anti stress coloring', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:22:06', '2016-05-18 01:22:06', 0),
(158, 38, 15865, 'UnderWater Bubble Story', 'underwater-bubble-story', ' <div jsname="C4s9Ed">This is an Underwater Bubble Story about beautiful and brave mermaid that goes for a mysterious journey in the amazing wild ocean to rescue cute and colorful underwater pets who were trapped in a blocked gem bubbles. You have to shoot, to blast, crush and pop all gem bubbles in this aqua bubble shooter to help to the generous mermaid to rescue the gold fish, jellyfish, starfish, walrus and other charming and innocent animals. <br>Underwater Bubble Story is a brand new and addictive bubble shooting game with two special game modes which were developed for the first time: Puzzle Mode and  Endless Mode. Based on the new great bubble shooting algorithm, very cleverly created levels, unique high quality graphics and very smooth and friendly game play that will take you to the highest fun and excitment levels of FREE bubble shooter game ever. Our Bubble Story game here to give the players a big pleasure on their free time. The game tests all your skills and commitment to solve the bubble puzzles to release the sweet animals from the trap.<p>Choose your favorite game mode and prepare yourself to bubble rescue action.<br>The Puzzle mode brings you 120 intelligent, interesting and challenging levels that were created relying on the desires of the addicted players to Free fun bubble shooter games. You need to pass 4 different ocean worlds on your way to win all levels, powerful bubbles like rainbow bubble and bomb bubble will help you to win faster.<br>The Endless mode presents to you endless deluxe bubble shoot game where animated bubbles keep coming to the bottom of the ocean without stop. You need to be fast and sharp to blast the bubbles before they will cross the limit line. You think you are a master? Lets check it with Endless mode.<br>Shoot to match at least 3 pet water bubbles of the same color.<br>Simply press the screen on the place that you want to shoot the bubble, and immidiately you will see a guideline that will make you be very accurate and efficient on your way to the success.<p>No matter what game mode you will choose, you certainly will enjoy from hours of fun.</p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/creativevisionapps/underwaterbubblestory', 'underwater-bubble-story.png', '["underwater-bubble-story-0.png","underwater-bubble-story-1.png","underwater-bubble-story-2.png","underwater-bubble-story-3.png","underwater-bubble-story-4.png","underwater-bubble-story-5.png","underwater-bubble-story-6.png"]', 0, 0, '', 'com.creativevisionapps.underwaterbubblestory', 'bubble, bubbles, shoot, levels, bubble shooter, endless mode, bubble story, you need, underwater bubble story', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:22:10', '2016-05-18 01:22:10', 0),
(159, 38, 3320, 'Hotel Transylvania 2', 'hotel-transylvania-2', ' <div jsname="C4s9Ed">Build your own monster hotel with Drac and all your favorite monsters from HOTEL TRANSYLVANIA 2! Customize your city, enjoy adventure-filled quests, decorate your own monster hotel, and play fun mini games in the official game for the HOTEL TRANSYLVANIA 2 movie from Sony Pictures Animation. Play with Dracula, Mavis, Mummy, Frankenstein, Zombies and super cool monsters! Bleh bleh bleh!<p>DRAC’s PACK IS BACK! <br>Experience a roster of monsters like never before. Unlock Dennis, Frank, Mavis, Murray, Wayne, Blobby, Griffin, Zombie Bellhop, The Skeleton Mariachi band and meet the grandparents Linda and Vlad.<p>MONSTER OF A GOOD TIME, GUARANTEED! <br>Create your monster world and Rock the monstrous party. Enjoy action packed adventures while transforming into a bat, conjuring a sandstorm, eating scream cheese, doing the Vamp Dance, all while winning bountiful gold, collectibles, decorations and rewards to help you on your way!<p>CUSTOMIZE YOUR MONSTERLAND<br>Make your own unique haunted village. Create The Graveyard, Quasimodo’s Kitchen, Jump Tower and more to unravel monsters and adventure activities.<p>SPIN THE TERROR WHEEL<br>Give yourself a pleasant surprise in this fun mini game and win bountiful gold, collectibles, decorations and other exciting rewards.<p>COFFINS OPEN TO THE WORLD<br>For the first time in hundreds of years, invite humans from all over the world to your Hotel Transylvania! AWOOOO! Things are gonna get batty! <p>JOIN THE EXCLUSIVE CLUB OF HOTEL TRANSYLVANIA FANS<p>Enjoy regular news on game updates, characters, features, views, video tips and more for Free.<p>*Also optimized for tablet devices<p>Visit us: www.hotelt2game.com <br>Like us on facebook: www.facebook.com/HotelT2Game<br>Follow us on twitter: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.twitter.com/reliancegames%26sa%3DD%26usg%3DAFQjCNFi3fC6doUiyUD3_QmUbwQmn-7YMw&amp;sa=D&amp;usg=AFQjCNHjc4smRTm83ZD6w3s5rHGHLZs3Hw" target="_blank">http://www.twitter.com/reliancegames</a> <br>Watch us on youtube: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.youtube.com/reliancegames%26sa%3DD%26usg%3DAFQjCNG3p9jyuHZJ453-YJ0L0XT6DGGDdw&amp;sa=D&amp;usg=AFQjCNGbTdniAbNsTdIY8U8_ofwHYaeA-A" target="_blank">http://www.youtube.com/reliancegames</a><p>* Permission:<br>- ACCESS_COARSE_LOCATION: To determine your location for region based offers<p>This game is completely free to download and play. However, some game items can be purchased with real money within the game. You can restrict in-app purchases in your store’s settings.</p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/reliancegames/hoteltran2', 'hotel-transylvania-2.png', '["hotel-transylvania-2-0.png","hotel-transylvania-2-1.png","hotel-transylvania-2-2.png","hotel-transylvania-2-3.png","hotel-transylvania-2-4.png","hotel-transylvania-2-5.png","hotel-transylvania-2-6.png"]', 0, 0, '', 'com.reliancegames.hoteltran2', 'hotel, monster, transylvania, monsters, hotel transylvania, your own, gold collectibles, collectibles decorations, gold collectibles decorations, bountiful gold collectibles', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:22:14', '2016-05-18 01:22:14', 0),
(160, 38, 712, 'Bitcoin Billionaire', 'bitcoin-billionaire', ' <div jsname="C4s9Ed">Quick! Sit down and start tapping!<br> <br>Bitcoin Billionaire is an idle clicker that&#39;s all about raking in bitcoins and building up a massive fortune! You start with almost nothing: a run-down office, a rickety old desk, a crummy computer. By tapping the screen you can mine virtual bitcoins and slowly increase your wealth. Spend digital dough to upgrade that awful furniture into swanky things like entertainment centers and priceless works of art. If you&#39;re smart (which, you are!), you&#39;ll spend some of that money on investments to help you earn while you&#39;re away. And don&#39;t worry, investments aren&#39;t as boring as in real life. How could robot butlers, virtual reality, and holographic dating be anything but awesome?<p>Oh, and one more thing: there&#39;s time travel. When your tapping skills reach a critical point, you can actually rip through the fabric of space and time, jumping to a new era where you&#39;ll earn all new upgrades, unlock new achievements, and experience the thrills of bitcoin mining from a whole new perspective. If you thought tapping was fun in a comfy modern day office chair, just wait &#39;til you park your posterior in a finely crafted stone seat from prehistoric times!<br> <br>Features:<br>- Supremely satisfying bitcoin tapping action!<br>- Upgrade investments to earn bitcoins while offline.<br>- Grab bonuses from special delivery drones.<br>- Customize your character to mine in style.<br>- Unlock achievements by being awesome.<br>- Adopt a kitty! Or a robot! Or a T-Rex! Or something else, maybe!</p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/noodlecake/bitcoin', 'bitcoin-billionaire.png', '["bitcoin-billionaire-0.png","bitcoin-billionaire-1.png","bitcoin-billionaire-2.png","bitcoin-billionaire-3.png","bitcoin-billionaire-4.png","bitcoin-billionaire-5.png","bitcoin-billionaire-6.png"]', 0, 0, '', 'com.noodlecake.bitcoin', 'tapping, investments, bitcoins, bitcoin, you can, bitcoins and', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:22:18', '2016-05-18 01:22:18', 0),
(161, 39, 3866, 'Kids Garden', 'kids-garden', ' <div jsname="C4s9Ed">Learning and educational games for kids - Hippo Garden.<br>In this game, Baby Hippo with friends will harvest in the garden. In the farm, grow various fruits and vegetables that need to collect and spread the three baskets. One basket for fruits, one for vegetables and one for the weeds. Watch out for weeds, they consume foods that grow in the neighborhood.<p>Rules of the game:<br>Baby Hippopotamus must determine that grows in the grounds, fruits, vegetables, or weeds, harvest and move it in the right basket.<p>You must help Baby Hippo to solve these simple logical tasks - harvest. Sort the items on the basket. Try to do it as quickly as possible. And do not forget about weeds.<p>- Colorful kids farm game;<br>- Excellent sound design;<br>- Funny atmosphere;<br>- Favorite characters Baby Hippo;<br>- 3 levels of difficult.<p>Enjoy the new educational farm game</p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/psvn/KidsGarden', 'kids-garden.png', '["kids-garden-0.png","kids-garden-1.png","kids-garden-2.png","kids-garden-3.png","kids-garden-4.png","kids-garden-5.png","kids-garden-6.png"]', 0, 0, '', 'com.psvn.KidsGarden', 'weeds, hippo, basket, vegetables, baby hippo, farm game, one for, game baby', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:22:27', '2016-05-18 01:22:27', 0),
(162, 39, 5208, 'All World Capitals - City Quiz', 'all-world-capitals-city-quiz', ' <div jsname="C4s9Ed">Do you know that the capital of Canada is Ottawa? Do you know that Canberra is the capital of Australia? What is the capital of New Zealand?<p>Guess the capital cities of all 197 countries in the world! Give 50 correct answers in the first easy level to get an access to the second level with the capitals of more exotic countries. Choose the game mode and find the capital of your country: <br>* Spelling quizzes (easy and hard)<br>* Multiple-choice quizzes - &quot;challenges&quot; (also easy and hard)<br>* Time game (give the most answers in 1 minute)<p>Guess the Capital City of Your State!<p>* This app is translated into English, German, French, Spanish, Portuguese, Italian, Russian, Swedish, and Dutch languages.</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/asmolgam/capitals', 'all-world-capitals-city-quiz.png', '["all-world-capitals-city-quiz-0.png","all-world-capitals-city-quiz-1.png","all-world-capitals-city-quiz-2.png","all-world-capitals-city-quiz-3.png","all-world-capitals-city-quiz-4.png","all-world-capitals-city-quiz-5.png","all-world-capitals-city-quiz-6.png"]', 0, 0, '', 'com.asmolgam.capitals', 'capital, quizzes, level, answers, the capital, and hard, easy and, guess the, you know that', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:22:30', '2016-05-18 01:22:30', 0),
(163, 39, 1055, 'School Lunch Maker', 'school-lunch-maker', ' <div jsname="C4s9Ed">School Lunch Maker is a delicious app that lets you decorate your school lunch tray with your favorite foods! <p>Grab some sandwiches, hamburgers, and grilled cheese and more as your main dish! Then snag some healthy fruit options like apples, berries, and pineapple and more!! Then add some side dishes like french fries, potato chips, and other yummy finger foods! Top it off with some delicious desserts like cookies, and cupcakes, then add your favorite drink like Milk or Orange Juice! <p>Then head over to the sticker lab and add your favorite stickers to your lunch tray!! Snap a picture of it, and send it to a friend! Great fun for kids, and fun for the whole family!! <p>School lunch is a fun, easy to play game for all ages!! <p>Features Include: <p>Tons of food options including hamburgers and sandwiches, fruit, french fries, and finger foods, chips, and french fries, drinks, and last but not least, desserts including chocolates, cookies and cupcakes!! <p>Tons of Backgrounds with various colored trays to choose from! <p>Sticker lab where you can choose over 80 stickers to decorate your lunch tray with! <p>Save to Gallery - snap a pic of your creation, and show it to your friends! <p>Endless mix and match fun with tons of food options and stickers to make your best school lunch ever!</p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/beansprites/schoollunchmaker', 'school-lunch-maker.png', '["school-lunch-maker-0.png","school-lunch-maker-1.png","school-lunch-maker-2.png","school-lunch-maker-3.png","school-lunch-maker-4.png","school-lunch-maker-5.png","school-lunch-maker-6.png"]', 0, 0, '', 'com.beansprites.schoollunchmaker', 'lunch, school, french, stickers, school lunch, your favorite, french fries, lunch tray, your lunch tray, add your favorite', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:22:36', '2016-05-18 01:22:36', 0),
(164, 39, 8334, 'Papermaking - Free for kids', 'papermaking-free-for-kids', ' <div jsname="C4s9Ed">It is time to trace back to the invention of paper right to its origin. Learn the steps and join the fun. Start the paper making process using an ancient method. Experience a part of history! Play now this cute skill game!<p>Fun features:<br>- 5 easy steps to paper making<br>   - Gathering<br>   - Cleaning<br>   - Steaming<br>   - Pulping<br>   - And drying<br>- Use paper in fine arts and crafts<br>- Fun activities for your preschoolers!<p>Paper making is a task that children can enjoy and relate to. Make a sheet of paper and turn it into a lantern, a waxed umbrella and more. Time to get the work started! <p>-- -- -- <br> <br>Design concepts:<br>We focus on inspirational learning<br>We focus on skill-building<br>We focus on bringing fun contents to our young audience<br>Take the baby bus for an unique learning experience!<p>The series introduction:<br>BabyBus is the first trusted brand in early childhood educational software. The mobile applications are designed and developed specifically for preschoolers, and they are divided into two groups by age, the Starter Group for toddlers between the ages of 1 and 3 and the Prodigy Group for children between the ages of 3 and 6. <p>The educational series in the Prodigy Group combines the main concepts of early childhood education to meet the needs of mastering different learning categories. The applications are aimed at the comprehensive and the analytic development in preschoolers.<p>Tips: In the search bar, enter &quot;BabyBus&quot; to find all of our products.<p>Contact us:<br>Facebook: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/BabyBusENGLISH%26sa%3DD%26usg%3DAFQjCNGTdHclhFYbJoO2eRYehOgFGL1q8w&amp;sa=D&amp;usg=AFQjCNFzxdgbMLSEueDTRIp9PBsil1XUMw" target="_blank">https://www.facebook.com/BabyBusENGLISH</a><br>E-mail: <a href="mailto:en@babybus.com">en@babybus.com</a><br>Website: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.babybus.com%26sa%3DD%26usg%3DAFQjCNH9dIql_69N2RjdyqJXCQ7Qz_0DMg&amp;sa=D&amp;usg=AFQjCNGBnU6EYxvHM4YmfoNNRoZfhB6z4g" target="_blank">http://www.babybus.com</a></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/sinyee/babybus/papermaking', 'papermaking-free-for-kids.png', '["papermaking-free-for-kids-0.png","papermaking-free-for-kids-1.png","papermaking-free-for-kids-2.png","papermaking-free-for-kids-3.png","papermaking-free-for-kids-4.png","papermaking-free-for-kids-5.png","papermaking-free-for-kids-6.png"]', 0, 0, '', 'com.sinyee.babybus.papermaking', 'paper, babybus, group, preschoolers, paper making, and the, the prodigy, prodigy group, the prodigy group', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:22:41', '2016-05-18 01:22:41', 0),
(165, 39, 1134, 'Kids Learn Shapes 2 Lite', 'kids-learn-shapes-2-lite', ' <div jsname="C4s9Ed">Kids Shapes 2, which follows our Kids Shapes game, teaches about basic geometrical shapes to small children (ages 3-5). The game shows how the world has many familiar objects that are shaped as a circle, a triangle, a rectangle, a square and an oval.<p>This lite version has the first two out of the five activities (see below):<p>Learn – Kids put the shapes inside a robot who converts them into real-life objects.<p>Identify – By identifying the correct shape of the object on the train, kids make the train move.<p>Find – In a toy room filled with various objects, kids need to find objects that have a specific shape.<p>Match – In this card game, kids need to find a card and its match – a card that has an image of a shape and a card that has an object which corresponds to that shape.<p>Sort – Kids load objects into the right cars of a Ferris Wheel. Each car has an image of a shape and the objective is to find an object that belongs in that car.<p>With Shapes 2 your children will have fun learning about shapes and understanding how many real-life objects have basic geometrical shapes.</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/intellijoy/shapes2/lite', 'kids-learn-shapes-2-lite.png', '["kids-learn-shapes-2-lite-0.png","kids-learn-shapes-2-lite-1.png","kids-learn-shapes-2-lite-2.png","kids-learn-shapes-2-lite-3.png","kids-learn-shapes-2-lite-4.png","kids-learn-shapes-2-lite-5.png","kids-learn-shapes-2-lite-6.png"]', 0, 0, '', 'com.intellijoy.shapes2.lite', 'shapes, objects, shape, object, match –, kids need, card that, that has, real life objects, basic geometrical shapes', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:22:48', '2016-05-18 01:22:48', 0),
(166, 40, 15866, 'Zyon RhythmGame', 'zyon-rhythmgame', ' <div jsname="C4s9Ed">The award-winning Music/Rhythm game Zyon is now in Android!<br>Unique and stunning music game experience with large amount of original and VOCALOID song libraries.<br>Official VOCALOID Characters and songs support.<br>------------------------------------------------------<br>*Features*<p>- First official Japanese and Chinese VOCALOID licensed rhythm game.<p>- Stunning visual effect and gorgeous design. <p>- More than 70 original songs from famous musicians all around the world.<p>- 30 songs FREE to PLAY immediately.New songs keeps adding each month.<p>- Original songs by famous game musicians such as Nhato,t+pazolite,sakuzyo,Junk,LV.4,3R2,Akira Complex,hoskey and etc.<p>- Three creative performance modes suitable for both casual and hardcore rhythm gamers.Suitable for both phone and tablet experience.<p>- Touch/press the note when the circle judge line pass through.<p>- More than 500 various patterns and music chart.<p>- Various music genres:TRANCE,POP,HARDCORE,DRUM’N BASS,DUBSTEP,ARTCORE.<p>- Course mode for official approve your skill ranking.<p>- Google Play leaderboards and achievements.<p>- Twitter/Facebook support! Share with your friends.<p>Zyon FACEBOOK <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/aquatraxzyon%26sa%3DD%26usg%3DAFQjCNHhDcmBgWRgNrDdaQhtlKa-zvBRoA&amp;sa=D&amp;usg=AFQjCNFU3XrDtwWy1oDgTEP3dhi_DdCL_w" target="_blank">https://www.facebook.com/aquatraxzyon</a><p>Zyon TWITTER <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://twitter.com/Zyon_RhythmGame%26sa%3DD%26usg%3DAFQjCNGOD1P5JZ5I_GeHud80AtlIn-6XFA&amp;sa=D&amp;usg=AFQjCNHnb3mYvBAFEA-2qO4MTzrRXIcy-w" target="_blank">https://twitter.com/Zyon_RhythmGame</a></p></p></p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/aquatrax/zyon', 'zyon-rhythmgame.png', '["zyon-rhythmgame-0.png","zyon-rhythmgame-1.png","zyon-rhythmgame-2.png","zyon-rhythmgame-3.png","zyon-rhythmgame-4.png","zyon-rhythmgame-5.png","zyon-rhythmgame-6.png"]', 0, 0, '', 'com.aquatrax.zyon', 'songs, music, rhythm, twitter, for both, suitable for, original songs, more than', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:22:52', '2016-05-18 01:22:52', 0),
(167, 40, 750, 'Perfect Piano', 'perfect-piano', ' <div jsname="C4s9Ed">Perfect Piano is an intelligent piano simulator design for Android phones and tablets. With in-built genuine piano timbre, this app can teach you how to play piano and amuse you at the same time! <p><b>[ Intelligent Keyboard ]</b><br>• 88-key piano keyboard <br>• Single-row mode; Double-row mode; Double players; Chords mode<br>• Multitouch screen support <br>• Force touch <br>• Keyboard width adjustment <br>• Multiple in-built sound effect: Grand piano, Bright Piano, Music Box, Pipe Organ, Rhodes, Synthesizer<br>• MIDI and ACC audio recording <br>• Metronome <br>• Direct sharing of recording file or set as ringtone<br>• OpenSL ES low latency audio support(beta)<p><b>[ Learn to Play ]</b> <br>• Learn thousands of popular music scores <br>• Three guidance patterns: falling note, waterfall, stave <br>• Three play modes: auto play, semi-auto play, note pause <br>• Left &amp; right hand setup <br>• A-&gt;B loop <br>• Speed adjustment <br>• Difficulty adjustment<p><b>[ Multiplayer Connection &amp; Competition ]</b> <br>• Play the piano with other players from all over the world <br>• Make friends <br>• Real-time on-line chatting<br>• Weekly new song challenge ranking <br>• Create guilds<p><b>[ Support USB MIDI Keyboard ]</b> <br>• Support standard General MIDI protocol and allow the connection of MIDI keyboard (such as YAMAHA P105, Roland F-120, Xkey, etc.) through USB interface <br>• Perfectly control the piano, play, recording and competition via external MIDI keyboard <br>• Note: this function is only available for Android 3.1 or higher version and supports USB Host with the connection of USB OTG lines. <p><b>[ Support Timbre Plug-ins ]</b> <br>• Timbre plug-ins are free for downloading and installing, such as bass, electric guitar, wooden guitar, flute, saxophone, electronic keyboard, violin, chord, xylophone and harp. <p><b>[ Piano Widget ]</b> <br>• A small piano widget for your home screen. You can play music anytime without open App.<p>If you have any question regarding the use of app, please contact us:<br>  • Email: <a href="mailto:revontuletstudio@gmail.com">revontuletstudio@gmail.com</a><br>  • Facebook: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/PerfectPiano%26sa%3DD%26usg%3DAFQjCNElIfcvugC7xSfQgZVlURpsBLnvuQ&amp;sa=D&amp;usg=AFQjCNHefcXirOhfhZRzkIBks15EUfyKrQ" target="_blank">https://www.facebook.com/PerfectPiano</a><p>Let&#39;s rock and roll!</p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/gamestar/perfectpiano', 'perfect-piano.png', '["perfect-piano-0.png","perfect-piano-1.png","perfect-piano-2.png","perfect-piano-3.png","perfect-piano-4.png","perfect-piano-5.png","perfect-piano-6.png"]', 0, 0, '', 'com.gamestar.perfectpiano', 'piano, keyboard, support, recording, keyboard •, midi keyboard, the connection, timbre plug, row mode double', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:22:56', '2016-05-18 01:22:56', 0),
(168, 40, 1463, 'Music &amp; Beat (O2Jam)', 'music-amp-beat-o2jam', ' <div jsname="C4s9Ed">Enjoy the new classic rhythm game for everyone!<p>- Perfect Single Play<br>We have focused on heightening the most important qualities of music games, by taking into consideration the feedback from game enthusiasts,<br>from sync to note angles, note size, note and background color, as well as types of categorized judgment criteria.<p>- Compete Against the Globally Renowned<br>There is not only a graph which enables you to view the player’s skills in a glance, a social feature which gives you a chance to boast to your friends<br>but also an opportunity to challenge the top players of music games from a global ranking to 1:1 online battle with a song chosen in random.<p> - New Skin System Full of Individuality<br>A strong customizing system is supported where separate skin patches can be fused or a completed set is available.<br>Enjoy &#39;Music&amp;Beat (O2Jam)&#39; on your own personalized play screen.<br>Don&#39;t miss out the fun changing appearances of each skin type as you level up &#39;Fever&#39; stages.<p> - Best Song Selection System Taking Consideration of the Users&#39; Convenience<br>Which song should we play? You don’t have to worry, from fun basic songs full of individuality with<br>3 key, 4 key, and 5 key levels of difficulty to M&amp;B recommended classic songs, you can know in a glance what new song the player wants.<p> - Offline Mode Where You Can Play Anywhere, Anytime<br>A feature where you can play freely disregarding the network connection has been added.<br>The best rhythm game available where you can play anywhere, anytime, such as the bus, subway, or even on the airplane.<p> - The Latest of O2Jam Series<br>Continued from the times of PC online games with 50 million global users and containing over 1,000 various music sources, O2Jam has joined Mobirix for this latest series production.<br>Notes with a completely new design to suit the newest work is scheduled to be sequentially updated<br>and there are tailored songs produced solely for ‘Music &amp; Beat (O2Jam)’ so please stay tuned.<p>※ ※ Music &amp; Beat (O2Jam) Special Features ※ ※<br> - Original sound best suited for rhythm games<br> - Over 240 songs including 27 most hot songs of diverse genres<br> - Level selection of Easy, Normal, Hard, 3Key, 4Key, 5Key play per song<br> - Short notes and long notes differentiated by light taps and prolonged touches respectively<br> - Touch &amp; Drag features supported<br> - Judgment results: Perfect, Great, Good, Bad, Miss<br> - Combo and 4 level fever system<br> - Result Rank Levels STAR, SSS, SS, S, A, B, C, D, E 9<br> - Multiplay ranking and song ranking available<br> - Customize the skin according to your taste<br> - Song sample available depending on user&#39;s selection<br> - 1:1 Multiplay supported<br> - Available in multiple languages<p>Android 6.0 OS or higher user Notification<br>If you want to use SD card to transfer or save. Apps Management-&gt; Music &amp; Beat (O2Jam) -&gt; Permissions -&gt; allow<p>※ ※ Other Information ※ ※<br> - There is additional data to be downloaded after downloading of Music &amp; Beat (O2Jam) is complete.<br>   Wi-Fi connection is recommended when downloading data.<br>   Depending on the network connection, the download time may vary.<br> - Music &amp; Beat (O2Jam) is a game where offline play is available, <br>   however, you can only enjoy the full content with network connection due to the game attributes.<br> - Earphones and headphones are recommended when playing Music&amp;Beat (O2Jam).<br> - Please send any inquiries you may have to: <a href="mailto:help@mobirix.com">help@mobirix.com</a><br> - Official Facebook page: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/mobirixplayen%26sa%3DD%26usg%3DAFQjCNEMzTG_gnstyk5vDi71YyAYtKdFpA&amp;sa=D&amp;usg=AFQjCNGf_4NxSxCyTZ4_n1LCJbSAKLZReA" target="_blank">https://www.facebook.com/mobirixplayen</a></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/mobirix/musicbeato2jam', 'music-amp-beat-o2jam.png', '["music-amp-beat-o2jam-0.png","music-amp-beat-o2jam-1.png","music-amp-beat-o2jam-2.png","music-amp-beat-o2jam-3.png","music-amp-beat-o2jam-4.png","music-amp-beat-o2jam-5.png","music-amp-beat-o2jam-6.png"]', 0, 0, '', 'com.mobirix.musicbeato2jam', 'o2jam, music, available, songs, beat o2jam, you can, &amp beat, music &amp, &amp beat o2jam, music &amp beat', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:22:59', '2016-05-18 01:22:59', 0),
(169, 40, 15867, 'BEAT MP3 for YouTube', 'beat-mp3-for-youtube', ' <div jsname="C4s9Ed">It is really easy to use.<br>Search for YouTube videos you want to play using the search button.<br>You can enjoy a rhythm game with that video.<p>Features of BEATMP3 for YouTube<br>A music game with which you can now enjoy your favorite movies and music as you please!<br>BEATMP3 the representative of music games that has been played by more than 10 million with which you can now play music game together with the videos of YouTube!!!<br>Let&#39;s play rhythm games with videos of YouTube and music stored in your mobile phone by simple operation!<p>■ Let&#39;s play all the videos in YouTube!!!<br>   Videos on YouTube will become the game!!!<br>   Infinite movies that you can play and infinite fun!<p>■ Let&#39;s play songs that are in your smart phone!<br>    You can play songs which are stored in your smart phone.<br>    Notes are all the same. It&#39;s not funny now.<br>    Let&#39;s enjoy the same song differently with automatic generation of notes!<p>■ Let&#39;s save favorite notes after playing!<br>    You can save the notes which you like among those automatically generated.<p>BEATMP3, BEAT3, BIT3, BIT MP3, beat mp3, beatmp3, beat3, bit3, bit mp3</p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/studio7775/BeatMP3WU', 'beat-mp3-for-youtube.png', '["beat-mp3-for-youtube-0.png","beat-mp3-for-youtube-1.png","beat-mp3-for-youtube-2.png","beat-mp3-for-youtube-3.png","beat-mp3-for-youtube-4.png","beat-mp3-for-youtube-5.png","beat-mp3-for-youtube-6.png"]', 0, 0, '', 'com.studio7775.BeatMP3WU', 'youtube, music, beatmp3, videos, you can, which you, ■ let&, ', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:05', '2016-05-18 01:23:05', 0),
(170, 40, 15867, 'BEAT MP3 2.0 - Rhythm Game', 'beat-mp3-20-rhythm-game', ' <div jsname="C4s9Ed">Including MP3 file, moreover whole of extension of music file can be supported.<br>You can enjoyed this awesome rhythm game with your OWN music library in your smartphone.<br>Hit the notes at the correct time to get the highest score then share your score with your friends,<br>And challenging to world record.<p>Feature of BEAT MP3. <br>- This game includes exclusive music analysis system, makes perfect beat timing looks like which song writers made it. <br>- It also has random beat system which makes different kind of game even with the same song.<br>- You can enjoy the game without loading after 1st precision song analysis.<br>- It’s cozy, fantastic graphic and effect, especially fever mode will make you immersed in this game. <br>- Adding ranking system with global competitor.<br>- Adding search function of the song on your phone.<p>Various options.<br>- Linearly adjustment for difficulty<br>- 9 steps speed ( 1x to 5x with 0.5 step)<br>- Long note on/off function<br>- Slide note on/off function<br>- Beat sound on/off function<br>- Support four different language(Korean,Japanese,English,Chinese)<p>Provides guitar, drum, and music games.<br>BEATMP3</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/studio7775/BeatMP3v2', 'beat-mp3-20-rhythm-game.png', '["beat-mp3-20-rhythm-game-0.png","beat-mp3-20-rhythm-game-1.png","beat-mp3-20-rhythm-game-2.png","beat-mp3-20-rhythm-game-3.png","beat-mp3-20-rhythm-game-4.png","beat-mp3-20-rhythm-game-5.png","beat-mp3-20-rhythm-game-6.png"]', 0, 0, '', 'com.studio7775.BeatMP3v2', 'function, music, system, score, off function, this game, with your, you can', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:08', '2016-05-18 01:23:08', 0),
(171, 41, 5501, '100 Doors Seasons 2', '100-doors-seasons-2', ' <div jsname="C4s9Ed">You were already on summer holidays in the village? And on the sea? - No? Then welcome, you are waiting a exciting mini puzzles! Escape to nature!<p>&quot;Bonbeart has done an amazing job with the sequel to the first 100 Doors Seasons and it still retains the challenging puzzles and features amazing graphics on top of that.&quot; - freeappgg.com<p>It&#39;s free collection of escape puzzle that boost your brain!<br>Amazing fun picture game made in the best style of: 100 Floors, 100 Rooms, Escape and Hidden Objects!<br>You must to enable your brain to open the door, and escape to the next floor.<p>Receive achievements for found escapes and compete with your friends for the first place on the open Door League.<p><br>↗ 100 FREE Floors!<br>↗ Find the Hidden Objects<br>↗ Solve a mini puzzles<br>↗ Open the different worlds<br>↗ Every new room has amazing fun graphics<br>↗ Hints for the first doors<br>↗ Skip difficult doors<br>↗ It supports the Russian language!<p>     Just try it! Solve all the puzzles! Boost your brain! ;)</p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/bonbeart/doorsseasons/part2', '100-doors-seasons-2.png', '["100-doors-seasons-2-0.png","100-doors-seasons-2-1.png","100-doors-seasons-2-2.png","100-doors-seasons-2-3.png","100-doors-seasons-2-4.png","100-doors-seasons-2-5.png","100-doors-seasons-2-6.png"]', 0, 0, '', 'com.bonbeart.doorsseasons.part2', 'amazing, escape, brain, puzzles, the first, your brain, for the, open the, boost your brain', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:13', '2016-05-18 01:23:13', 0),
(172, 41, 13495, 'Animals memory game for kids', 'animals-memory-game-for-kids', ' <div jsname="C4s9Ed">* Animals memory game for kids is the classic board game, which help develop memory skills of children.<br>* Playing this animals matching game with your kids will help them improve their recognition while having fun.<br>* Kids memory game contains very cute images of animals as lion, cat, dog, elephant, etc., which are on memory cards. <br>* Animals memory game is a game for children of all ages, babies, preschoolers, school children and teens. Both, boys and girls will love this game.<br>* It has been recently scientifically proven that regular mental and concentration exercise can greatly improve memory of kids.<p><br>How to play animals game for kids:<br>For each level, player is required to tap the square buttons and need to memorize what is behind it in order to match its couple. Players are required to complete a level in minimum finger taps to match all animals.<p><br>Features of animals memory games for kids:<br>- Three different levels of game play: easy (2 x 3 puzzles), medium (3 x 4 puzzles) &amp; hard (4 x 5 puzzles)<br>- Memory game develops recognition, concentration and motor skills of kid<br>- Matching games has cute sounds for kids<br>- Colorful HD graphic designed for toddlers<br>- Sound settings to adjust or even on/off game sounds and music<br>- Visual memory training<br>- Matching game has highscore (paid feature)<br>- Vibrant, beautiful and colorful recognizable images of animals like wolf, tiger, lion, crocodile, fox, dog, cat, etc.<br>- It helps kids to recognize and teach different animals<br>- Matching game is designed and structured according to kid&#39;s mentality <br>- Application may contains ads to keep it free<p> <br>* Simple and intuitive interface which is easy to use and easy to play, specially designed for children.<br>* Animals memory games for kids is also optimized for tablets (provide HD pictures).<br>* This free animals memory game for kids will keep your children quiet and entertained in car, in a restaurant or everywhere.<p><br>Have fun to play with our matching game!</p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/developandroid/android/animals', 'animals-memory-game-for-kids.png', '["animals-memory-game-for-kids-0.png","animals-memory-game-for-kids-1.png","animals-memory-game-for-kids-2.png","animals-memory-game-for-kids-3.png","animals-memory-game-for-kids-4.png","animals-memory-game-for-kids-5.png"]', 0, 0, '', 'com.developandroid.android.animals', 'animals, memory, matching, children, for kids, animals memory, memory game, matching game, animals memory game, animals memory games', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:16', '2016-05-18 01:23:16', 0),
(173, 41, 13386, 'Dino Puzzle Games for Kids', 'dino-puzzle-games-for-kids', ' <div jsname="C4s9Ed">Play 24 Lovely puzzles for kids and toddlers with Dinosaur theme and create your own puzzles too!<p>Meet Dino, our lovely dinosaur! A Must have for every kid who loves Dinosaurs!   <br>Develop your child mind, spatial skills, self- esteem, sagacity and memory skills.<p>Dino Puzzle is a great puzzle game for kids and toddlers<br>Explore through 24 predefined puzzles! <br>Create your own puzzles! Infinite possibilities!<br>Select the level of difficulty fit for your kids! <br>Aimed for kids the ages 1-8 <p>Your kids will just love these wonderfully drawn dino puzzles and will improve their spatial skills while having fun! <br>Our educational games are specifically tailored to fit preschool-aged kids, and encourage them to learn from each activity. We specialise in fun educational games. <p>What&#39;s in the game? <br>* 24 Predefined Puzzles, from 6 pieces for the first puzzle up to 16 pieces for the last ones. Each puzzle in the game is unique<br>* Create your very own puzzles - Draw and Paint activity<br>* Four different activities - Jigsaw Puzzle, Scratch Card, Shuffle Puzzle, Colour Card.  <br>* Record your voice and have it played<br>* Wide range of difficulty levels - from 2 pieces for starters to 30 pieces for preschool kids and first graders! <br>* Funny and Lovable animals, beautifully drawn in vivid HD Graphics <br>* Easy to learn and control, even for small kids <br>* Interactive animals sound effects, Positive and pleasant feedback. <br>* Multiple side games for in between puzzle solving - pop balloons, bubbles and more. <br>* Control puzzle settings, game music, and sound effects from the settings menu <br>* Positive and pleasant feedback for each action your kid makes - sounds and effects<br>* Fun and engaging pieces, either complete shape pieces or traditional looking puzzle pieces<br>* Large pieces, easy for children to pick and move <br>* Increasing difficulty level as your kid advances from puzzle to puzzle<br>* Child safe buttons to prevent accidental entry to parent related pages<p><br>Note, this is the lite version. The first 3 puzzles are open for free. If you like this game and would like to unlock the rest of the activities, you can unlock the complete game with a single in-app purchase. <p>Thanks for your support!<p>What makes our games work?<br>* Educational games for young children is our focus. Our kids&#39; ideas are behind many of our games and they are our first happy players for every game we make. <br>* In Tiltan Games, we know that educating children can be fun! We aim to give children just the right balance between education and fun<br>* Our games are easy to grasp and control on one hand but challenging enough to provide a significant learning experience.<p>What will my kids learn? <br>Dino puzzles aims to help build kids shape and pattern recognition, fine motor skills, cognitive skills and visual spatial skills. <p>Have Fun!<br>Tiltan Games<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://tiltangames.com%26sa%3DD%26usg%3DAFQjCNFMGg6fWnAojE4mj1dtW85WH21oFA&amp;sa=D&amp;usg=AFQjCNGWUxgVq3GKqw2JayYwBq5EmjfDHQ" target="_blank">http://tiltangames.com</a></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/tiltangames/dinopuzzle', 'dino-puzzle-games-for-kids.png', '["dino-puzzle-games-for-kids-0.png","dino-puzzle-games-for-kids-1.png","dino-puzzle-games-for-kids-2.png","dino-puzzle-games-for-kids-3.png","dino-puzzle-games-for-kids-4.png","dino-puzzle-games-for-kids-5.png","dino-puzzle-games-for-kids-6.png"]', 0, 0, '', 'com.tiltangames.dinopuzzle', 'puzzle, puzzles, games, pieces, pieces for, kids and, spatial skills, for kids, and pleasant feedback', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:19', '2016-05-18 01:23:19', 0),
(174, 41, 1627, 'Pet Link', 'pet-link', ' <div jsname="C4s9Ed">Play the newest line-link puzzle game from the makers of the super hit apps, Garden Mania and Bubble Bird Rescue!<p>Pet Link is a fun puzzle game full of love. You need to connect colorful lines of Pet to compete challenging levels in this puzzle adventure. Come on, let&#39;s get the most fun out of Pet Land!<p>☆☆☆☆☆ Highlighted Features ☆☆☆☆☆<br>★ Well-designed levels - each one is unique and full of fun and amazing challenges!<br>★ EASY TO LEARN - hard to master! Can you score high enough to earn 3 stars on every level?<br>★ Lovely Pets - You’ll be addicted to them from the first hit!<br>★ No time limits - play at your own pace!<br>★ UNLOCK powerful boosts to help with challenging levels!<br>★ Facebook Connect - sync your progresses and beat your friends’ scores!<br>★ Fresh and beautiful style, bright and vivid graphics &amp; effects!<p>Become a fan of Ezjoy on Facebook:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/ezjoygame%26sa%3DD%26usg%3DAFQjCNHbMSvhcjJoaxL4LmXIR-0HvVZ6vQ&amp;sa=D&amp;usg=AFQjCNHhIwPS8sbS3y9SK6CiylxyKRmsgA" target="_blank">http://www.facebook.com/ezjoygame</a></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/ezjoynetwork/petlink', 'pet-link.png', '["pet-link-0.png","pet-link-1.png","pet-link-2.png","pet-link-3.png","pet-link-4.png","pet-link-5.png","pet-link-6.png"]', 0, 0, '', 'com.ezjoynetwork.petlink', 'puzzle, facebook, levels, challenging, challenging levels, from the, puzzle game', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:22', '2016-05-18 01:23:22', 0);
