(175, 41, 15476, 'Numbers Addict™', 'numbers-addict', ' <div jsname="C4s9Ed">★ CAUTION - EXTREMELY ADDICTIVE GAME! ★<br>★ PURE, INSTANT FUN ★<br> INSERT INTO `apps` (`id`, `cat_id`, `developer_id`, `name`, `slug`, `content`, `path`, `image`, `thumbs`, `numDownloads`, `views`, `link`, `com`, `keyword`, `description`, `varieswithdevice`, `rate_value`, `rate_count`, `featured`, `jobs`, `jobs2`, `created_at`, `updated_at`, `noupdate`) VALUES
(194, 45, 3147, 'Skateboard Party 2 Lite', 'skateboard-party-2-lite', ' <div jsname="C4s9Ed">Skateboard Party 2 brings all the fun of skateboarding to your mobile device allowing you to ride in 8 completely unique locations. Jump on your board, learn new moves and improve your skateboarding skills to land sick combos.   <p>Play with your friends using the new online multiplayer mode or challenge skaters from all over the world using the online leaderboards. Complete achievements, gain experience and upgrade your favorite skater. You can also customize your outfits, boards, trucks and wheels with real brands.  <p>HIGH DEFINITION <br>Skateboard Party 2 includes next generation 3D graphics specially optimized for your mobile hardware to provide you with the best skateboarding experience.<p>CAREER MODE <br>Complete over 40 achievements to unlock new items and locations. Gain experience to upgrade your favorite skater’s attributes to perform better and achieve higher scores. <p>FREE SKATE <br>Practice and improve your skateboarding skills without any time constraints. <p>ONLINE MULTIPLAYER <br>Challenge your friends to a skateboard battle and let’s see who can land the baddest tricks! Share and brag your results with your friends on Twitter. <p>MASSIVE SELECTION <br>Select between 9 characters and customize each of them to your preference choosing your favorite gear. A massive collection of boards, trucks and wheels are available including items from Powell &amp; Peralta, Bones, Golden Dragon and Tork Trux. <p>LEARN TO SKATE <br>Over 40 unique tricks to master and hundreds of combinations. Follow the tutorial to get started and progress as you go. Execute the craziest combos and trick sequences to rack up some impressive high scores, gain experience and make a name for yourself. <p>GAME CONTROLLER<br>Compatible with most game controllers available.<p>CUSTOMIZABLE CONTROLS <br>New fully customizable control system to configure your own button layout. Use the right or left handed control mode, select a control preset or create your own. Use the analog stick or accelerometer option as you wish. Adjust your truck tightness to change your steering sensitivity. <p>LOADED WITH FEATURES <br>•Supports all the latest generation devices and optimized for high resolution displays.<br>•Online multiplayer mode to play against your friends or other skaters online.<br>•New fully customizable control system. You can adjust everything! <br>•Learn over 40 unique tricks and create hundreds of combinations. <br>•Massive skateboard locations to ride including a trailer park, army base, shopping mall, ski resort, campus, funfair beach and a big open city. <br>•Customize your skater or board with tons of exclusive content including outfits, boards, trucks and wheels from licensed brands. <br>•Play often to gain experience and upgrade your skater’s attributes. <br>•Share your results with your friends on Twitter. <br>•Extended Soundtrack featuring songs from Voice of Addiction, Sink Alaska, Beta, Hitplay!, Moovalya, We Outspoken and Melodic in Fusion.<br>•Ability to purchase experience points using in-app purchases. <br>•Available in the following languages: English, French, German, Italian, Spanish, Russian, Japanese, Korean, Portuguese and Chinese  <p>SUPPORT: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://en.ratrodstudio.com/support/%26sa%3DD%26usg%3DAFQjCNHQZyg5fKx97KHKpLj9wUj0l04W_Q&amp;sa=D&amp;usg=AFQjCNFOLnpu-kXyEDEx2D0epcMbtjkuuw" target="_blank">http://en.ratrodstudio.com/support/</a> <br>VISIT US: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://ratrodstudio.com%26sa%3DD%26usg%3DAFQjCNGZSiFUirOj4OAazzwCmMCf9-Z5oA&amp;sa=D&amp;usg=AFQjCNH6USm5jkxa6FUmqfSFCpD5gkwpAA" target="_blank">http://ratrodstudio.com</a>   <br>FOLLOW US: twitter.com/ratrodstudio</p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/ratrodstudio/skateparty2lite', 'skateboard-party-2-lite.png', '["skateboard-party-2-lite-0.png","skateboard-party-2-lite-1.png","skateboard-party-2-lite-2.png","skateboard-party-2-lite-3.png","skateboard-party-2-lite-4.png","skateboard-party-2-lite-5.png","skateboard-party-2-lite-6.png"]', 0, 0, '', 'com.ratrodstudio.skateparty2lite', 'experience, friends, skateboard, online, your friends, gain experience, upgrade your, experience and, with your friends, results with your', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:24:55', '2016-05-18 01:24:55', 0),
(195, 45, 10031, 'Project Parkour', 'project-parkour', ' <div jsname="C4s9Ed">Project Parkour is a secret organization where scientists are trying to push human physical abilities to the limit by using specially design levels and challenges.<p>First and original Parkour inspired FPS experience on Android devices. Stunning 3D graphics and smart level designs are fun to play for hours.<br>Jump, slide, run and climb - use combos to polish your skills to be the best parkour runner. Smartly developed controller buttons makes gameplay enjoyable and smooth.<p>IMPORTANT:<br>If the game does not start correctly or hangs while loading levels. Please clear game cache via Settings/Applications/Project Parkour and Clear Cache and then restart your device!<p>FEATURES:<p>- Stunning 3D graphics<br>- Comfortable controls<br>- Movement combos<br>- Top-notch designed levels<br>- Ongoing updates to deliver new features and content<br>- Online highscores<p><br>FEATURES WE ARE WORKING ON:<p>- Multiplayer<br>- More Levels<br>- Perk Boost Drinks<br>- More tricks and combos</p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/tworobotsstudio/projectparkour', 'project-parkour.png', '["project-parkour-0.png","project-parkour-1.png","project-parkour-2.png","project-parkour-3.png","project-parkour-4.png","project-parkour-5.png","project-parkour-6.png"]', 0, 0, '', 'com.tworobotsstudio.projectparkour', 'parkour, levels, combos, cache, project parkour', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:25:01', '2016-05-18 01:25:01', 0),
(196, 46, 738, 'Clash Royale', 'clash-royale', ' <div jsname="C4s9Ed">Enter the Arena! From the creators of Clash of Clans comes a real-time multiplayer game starring the Royales, your favorite Clash characters and much, much more.<p>Collect and upgrade dozens of cards featuring the Clash of Clans troops, spells and defenses you know and love, as well as the Royales: Princes, Knights, Baby Dragons and more. Knock the enemy King and Princesses from their towers to defeat your opponents and win Trophies, Crowns and glory in the Arena. Form a Clan to share cards and build your very own battle community.<p>Lead the Clash Royale Family to victory!<p>PLEASE NOTE! Clash Royale is free to download and play, however, some game items can also be purchased for real money.If you do not want to use this feature, please set up password protection for purchases in the settings of your Google Play Store app. Also, under our Terms of Service and Privacy Policy, you must be at least 13 years of age to play or download Clash Royale.<p>A network connection is also required.<p>FEATURES<br>● Duel players from around the world in real-time and take their Trophies<br>● Earn chests to unlock rewards, collect powerful new cards and upgrade existing ones<br>● Destroy opponent’s towers and win Crowns to earn epic Crown chests<br>● Build and upgrade your card collection with the Clash Royale Family along with dozens of your favorite Clash troops, spells and defenses<br>● Construct your ultimate Battle Deck to defeat your opponents<br>● Progress through multiple Arenas all the way to the top<br>● Form a Clan to share cards and build your very own battle community<br>● Challenge your Clanmates and friends to a private duel<br>● Learn different battle tactics by watching the best duels on TV Royale<p><br>Support<br>Are you having problems? Visit <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://supercell.helpshift.com/a/clash-royale/%26sa%3DD%26usg%3DAFQjCNEcjDY02MgHR333A8cRg06Wix3jsA&amp;sa=D&amp;usg=AFQjCNHLnu55u4bLQWkn_yBhTTgzERJVjA" target="_blank">http://supercell.helpshift.com/a/clash-royale/</a> or <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://supr.cl/ClashRoyaleForum%26sa%3DD%26usg%3DAFQjCNHWCEI76PrvF-ZiuFQawXULwPp4lA&amp;sa=D&amp;usg=AFQjCNElFvSWWMLduwwIVPfHYJ7qi5EIUQ" target="_blank">http://supr.cl/ClashRoyaleForum</a> or contact us in game by going to Settings &gt; Help and Support.<p>Privacy Policy: <br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://supercell.com/en/privacy-policy/%26sa%3DD%26usg%3DAFQjCNHD7RGryPBOWW4qVeBgOBlVXAO3HQ&amp;sa=D&amp;usg=AFQjCNGuhaDrkaX1ofsy1sZ-RoMp7LRvdg" target="_blank">http://supercell.com/en/privacy-policy/</a><p>Terms of Service:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://supercell.com/en/terms-of-service/%26sa%3DD%26usg%3DAFQjCNETE1lgpuER9dM5665riW7Q34AzyQ&amp;sa=D&amp;usg=AFQjCNHCxSyrf4CgJADHjx1WIi2u3wri-A" target="_blank">http://supercell.com/en/terms-of-service/</a><p>Parent’s Guide:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://supercell.com/en/parents/%26sa%3DD%26usg%3DAFQjCNGH33AJ6vYi-mPG8z3DtpEU1I2C5w&amp;sa=D&amp;usg=AFQjCNHg3xi1wpn-77cis_xGThAml_lhEQ" target="_blank">http://supercell.com/en/parents/</a></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/supercell/clashroyale', 'clash-royale.png', '["clash-royale-0.png","clash-royale-1.png","clash-royale-2.png","clash-royale-3.png","clash-royale-4.png","clash-royale-5.png","clash-royale-6.png"]', 0, 0, '', 'com.supercell.clashroyale', 'clash, royale, cards, supercell, clash royale, http supercell, cards and, and upgrade, clash royale family, the clash royale', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:25:07', '2016-05-18 01:25:07', 0),
(197, 46, 738, 'Clash of Clans', 'clash-of-clans', ' <div jsname="C4s9Ed">From rage-­filled Barbarians with glorious mustaches to pyromaniac wizards, raise your own army and lead your clan to victory! Build your village to fend off raiders, battle against millions of players worldwide, and forge a powerful clan with others to destroy enemy clans.<p>PLEASE NOTE! Clash of Clans is free to download and play, however some game items can also be purchased for real money. If you do not want to use this feature, please set up password protection for purchases in the settings of your Google Play Store app. Also, under our Terms of Service and Privacy Policy, you must be at least 13 years of age to play or download Clash of Clans.<p>A network connection is also required.<p>FEATURES<br>●	Build your village into an unbeatable fortress <br>●	Raise your own army of Barbarians, Archers, Hog Riders, Wizards, Dragons and other mighty fighters<br>●	Battle with players worldwide and take their Trophies<br>●	Join together with other players to form the ultimate Clan<br>●	Fight against rival Clans in epic Clan Wars <br>●	Build 20 unique units with multiple levels of upgrades<br>●	Discover your favorite attacking army from countless combinations of troops, spells, Heroes and Clan reinforcements <br>●	Defend your village with a multitude of Cannons, Towers, Mortars, Bombs, Traps  and Walls<br>●	Fight against the Goblin King in a campaign through the realm<p><br>PLAYER REVIEWS <br>Clash of Clans proudly announces over five million five star reviews on Google Play.<p><br>SUPPORT<br>Chief, are you having problems?  Visit <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://supercell.helpshift.com/a/clash-of-clans/%26sa%3DD%26usg%3DAFQjCNFcI_matDwefmbD0Azk46RfAf9Hag&amp;sa=D&amp;usg=AFQjCNGLcnaeSn0xKHVDqHJBxA6mgGV4bw" target="_blank">http://supercell.helpshift.com/a/clash-of-clans/</a> or <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://supr.cl/ClashForum%26sa%3DD%26usg%3DAFQjCNFs87w9K1PX6EdX0ZmlIdQMSRBq-w&amp;sa=D&amp;usg=AFQjCNF_8XXsl7-5P8ZSfJm5iHnCQzlF6A" target="_blank">http://supr.cl/ClashForum</a> or contact us in game by going to Settings &gt; Help and Support.<p>Privacy Policy:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.supercell.net/privacy-policy/%26sa%3DD%26usg%3DAFQjCNE162UdtDT8ylD_gazuKA46Tekurw&amp;sa=D&amp;usg=AFQjCNGWOhhjZ6azrErucAsezl89cg5DlA" target="_blank">http://www.supercell.net/privacy-policy/</a><p>Terms of Service:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.supercell.net/terms-of-service/%26sa%3DD%26usg%3DAFQjCNFw6_0AxQO-3dlnZ9MNUFbEZbKmSw&amp;sa=D&amp;usg=AFQjCNHRV2r21GY5LM1zbP1tVt1Yblcd9g" target="_blank">http://www.supercell.net/terms-of-service/</a><p>Parent’s Guide:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.supercell.net/parents%26sa%3DD%26usg%3DAFQjCNEzFcZDU63BKr8NHhTEc9cxqC-6Bg&amp;sa=D&amp;usg=AFQjCNGHiPzKy3g0EPtaX5tTxXQPeSAC7Q" target="_blank">http://www.supercell.net/parents</a></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/supercell/clashofclans', 'clash-of-clans.png', '["clash-of-clans-0.png","clash-of-clans-1.png","clash-of-clans-2.png","clash-of-clans-3.png","clash-of-clans-4.png","clash-of-clans-5.png","clash-of-clans-6.png"]', 0, 0, '', 'com.supercell.clashofclans', 'clans, clash, supercell, policy, privacy policy, your village, http www, supercell net, build your village', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:25:10', '2016-05-18 01:25:10', 0),
(198, 46, 4696, 'Mobile Strike', 'mobile-strike', ' <div jsname="C4s9Ed">Become an action hero like Arnold Schwarzenegger in the new game of modern war -  Mobile Strike! Build a base, control the action, and test your elite troops against enemies on the battlefield! With cutting-edge assault vehicles in your arsenal this worldwide MMO game tests your ability to wage a tactical and intelligent war. <p>It&#39;s not whose arsenal is bigger, it&#39;s whose arsenal is best! Design a customized base to reflect the kind of hero you want to be. Amass defenses to protect your base, or manufacture an arsenal unrivaled on the battlefield! In true MMO fashion you can join an alliance and bring to bear the benefits of a multilateral force as you dominate the action and become the Head of State in an entirely new kind of action game!<p>✔Join with millions of players from around the world<br>✔ Forge powerful alliances with elite players against formidable enemies<br>✔ Build and customize your base<br>✔ Engage with rogue war machines on the battlefield to collect items and experience<br>✔Train, level up and supply your commander with superior firepower<br>✔Use modern combat vehicles, artillery, and strategic units<br>✔Command 4 military tiers consisting of 16 troop types<p>Check out the elite new MMO Mobile Strike, a war game to end all war games!<p><b>Privacy Policy</b>: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://epicwar-online.com/privacypolicy.html%26sa%3DD%26usg%3DAFQjCNEe53i-Kv0Z0MVGO-0dBetNS7wtew&amp;sa=D&amp;usg=AFQjCNEQ2J3PHfWAQ0PWx5zidrzyjdIYYg" target="_blank">http://epicwar-online.com/privacypolicy.html</a><br><b>Terms of Service</b>: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://epicwar-online.com/termsofservice.html%26sa%3DD%26usg%3DAFQjCNHghH-WUTu52MELIAlh4LqKQD10iA&amp;sa=D&amp;usg=AFQjCNHH2VYtMdIvizcfoLMgEvq_9Lu9PA" target="_blank">http://epicwar-online.com/termsofservice.html</a><br><b>Game Page</b>: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://epicwar-online.com%26sa%3DD%26usg%3DAFQjCNF_CYgzXRdsel3GRzrKiE0qMlLpWA&amp;sa=D&amp;usg=AFQjCNH__PWQtydgA-1QFGnApyJnO1EWXg" target="_blank">http://epicwar-online.com</a></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/epicwaronline/ms', 'mobile-strike.png', '["mobile-strike-0.png","mobile-strike-1.png","mobile-strike-2.png","mobile-strike-3.png","mobile-strike-4.png","mobile-strike-5.png","mobile-strike-6.png"]', 0, 0, '', 'com.epicwaronline.ms', 'action, arsenal, online, epicwar, epicwar online, the battlefield, online com, http epicwar, http epicwar online', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:25:14', '2016-05-18 01:25:14', 0),
(199, 46, 1058, 'Vlogger Go Viral - Clicker', 'vlogger-go-viral-clicker', ' <div jsname="C4s9Ed">Get ready to become the next Internet sensation in Vlogger Go Viral, the idle clicker game where every tap takes your channel one step closer to the top. Begin with only a dream in your head and a camera in your hands, and climb your way to stardom. Do you have what it takes?<p>Produce videos, manage your channel, gain millions of subscribers and views, grow billionaire and upgrade your sweet equipment and studio to reach the skies!<p>Follow the comments on your channel to discover what’s trending. Produce a video with a trending topic and watch it go viral! Master all the topics on your journey to become rich and famous, all that without ever leaving your bedroom. Okay, maybe just for toilet breaks.<p>HIGHLIGHTS<br>• Tons of upgrades for your equipment and home studio<br>• Lots of topics to choose from: cats, dogs, food, games, music, movies, geek and many more!<br>• Manage your channel: upvote your fans, downvote your haters (just like in real life)<br>• Actually watch the videos you make!<br>• Hats! Yes, you heard it right.<p>AND LAST BUT NOT LEAST<br>Pugs with ties, robot parrots, walking pineapples, last-year’s console and comfy armchairs! What else could a world famous vlogger possibly want?<p>All right, now that’s a wrap! Download Vlogger Go Viral and start filming now!<p>Please note! This game is free to play, but it contains items that can be purchased for real money. Some features and extras mentioned in the description may also have to be purchased for real money.</p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/br/com/tapps/vloggergoviral', 'vlogger-go-viral-clicker.png', '["vlogger-go-viral-clicker-0.png","vlogger-go-viral-clicker-1.png","vlogger-go-viral-clicker-2.png","vlogger-go-viral-clicker-3.png","vlogger-go-viral-clicker-4.png","vlogger-go-viral-clicker-5.png","vlogger-go-viral-clicker-6.png"]', 0, 0, '', 'br.com.tapps.vloggergoviral', 'channel, vlogger, viral, topics, your channel, real money, for real, equipment and, for real money, manage your channel', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:25:19', '2016-05-18 01:25:19', 0),
(200, 46, 925, 'Plants vs. Zombies FREE', 'plants-vs-zombies-free', ' <div jsname="C4s9Ed">Get ready to soil your plants as a mob of fun-loving zombies is about to invade your home. Use your arsenal of 49 zombie-zapping plants — peashooters, wall-nuts, cherry bombs and more — to mulchify 26 types of zombies before they break down your door. <p>This app offers in-app purchases. You may disable in-app purchasing using your device settings<p>WINNER OF OVER 30 GAME OF THE YEAR AWARDS*<p>50 FUN-DEAD LEVELS<br>Conquer all 50 levels of Adventure mode — through day, night, fog, in a swimming pool, on the rooftop and more. Plus fend off a continual wave of zombies as long as you can with Survival mode!<p>NOT GARDEN-VARIETY GHOULS<br>Battle zombie pole-vaulters, snorkelers, bucketheads and 26 more fun-dead zombies. Each has its own special skills, so you&#39;ll need to think fast and plant faster to combat them all.<p>SMARTER THAN YOUR AVERAGE ZOMBIE<br>Be careful how you use your limited supply of greens and seeds. Zombies love brains so much they&#39;ll jump, run, dance, swim and even eat plants to get into your house. Open the Almanac to learn more about all the zombies and plants to help plan your strategy. <p>FIGHT LONGER, GET STRONGER<br>Earn 49 powerful perennials as you progress and collect coins to buy a pet snail, power-ups and more.<p>GROW WITH YOUR GAME<br>Show off your zombie-zapping prowess by earning 46 awesome achievements and show off your zombie-zapping prowess.<p>COIN PACKS<br>Need coins for great new stuff? Buy up to 600,000 coins right from the Main Menu.<p>*Original Mac/PC downloadable game.<p>Be the first to know! Get inside EA info on great deals, plus the latest game updates, tips &amp; more…<br>VISIT US: eamobile.com <br>FOLLOW US: twitter.com/eamobile<br>LIKE US: facebook.com/eamobile<br>WATCH US: youtube.com/eamobilegames<p>Terms of Service : <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.ea.com/terms-of-service%26s