(201, 47, 6376, 'Quiz: Logo game', 'quiz-logo-game', ' <div jsname="C4s9Ed">Do you like logo quiz, trivia games? Do you think you know companies from all over the world? Quiz: Logo game is just for you! Find out just how much do you know!<p>* guess 2175 brands from all over the world<br>* all American brands. Also Canadian and many more<br>* special American levels<br>* complete 69 engaging unique levels<br>* with increasing difficulty as you play along<br>* collect 44 achievements in Google Play Games<br>* compete with your friends and players from all over the world on two unique leaderboards<br>* use 6 cool unique hints to complete levels<br>* keep a track of your stats and progress<br>* complete picture appears when you guess the logo<br>* and all of that absolutely free<p>Updates with more levels and hundreds of brands coming soon.<p>In this trivia game you may find every brand category you love including cars, fashion, movies and games. In this logo quiz you can guess companies from all over the world as well as all American companies. Can you guess every brand you hold dear?<p>In our logo game you will find many more brands and hints not available in other games. All free.<p>All logos shown or represented in this game are copyright and/or trademark of their respective corporations. The use of low resolution images in this trivia app for use of identification in a informational context qualify as fair use under copyright law.</p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/lemmingsatwork/quiz', 'quiz-logo-game.png', '["quiz-logo-game-0.png","quiz-logo-game-1.png","quiz-logo-game-2.png","quiz-logo-game-3.png","quiz-logo-game-4.png","quiz-logo-game-5.png","quiz-logo-game-6.png"]', 0, 0, '', 'lemmingsatwork.quiz', 'brands, levels*, complete, unique, all over, over the, from all, the world', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:25:31', '2016-05-18 01:25:31', 0),
(202, 47, 6372, 'QuizUp', 'quizup', ' <div jsname="C4s9Ed">QuizUp is a free, award-winning multiplayer trivia game. Challenge friends and meet new people who share your interests. Join a community of millions already playing the biggest trivia game in the world!<p>◆ The Game<br>Challenge friends in any topic for a quick, real-time match or randomly play other people from around the world. Climb the ranks and claim your titles.<p>◆ Topic Communities<br>Participate in vibrant communities around topics you are passionate about and easily discover new topics that match your interests. Each topic has a unique community where you can play, post and interact with other people.<p>Enjoy QuizUp on the web: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.quizup.com%26sa%3DD%26usg%3DAFQjCNFMrWCXWzrSG1PZK_xk7CL8gww91Q&amp;sa=D&amp;usg=AFQjCNHJRUGfZUN9XccF1B7vyfD43BXq_w" target="_blank">http://www.quizup.com</a><br>And don’t forget to follow us:<br>Twitter: @QuizUp</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/quizup/core', 'quizup.png', '["quizup-0.png","quizup-1.png","quizup-2.png","quizup-3.png","quizup-4.png","quizup-5.png"]', 0, 0, '', 'com.quizup.core', 'quizup, topic, people, match, other people, the world, your interests, trivia game', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:25:35', '2016-05-18 01:25:35', 0),
(203, 47, 1058, 'The Perfectionist - Crazy Game', 'the-perfectionist-crazy-game', ' <div jsname="C4s9Ed">Let’s come clean: you’re not really a control freak, but if there’s a right way to do or set something, then WHY NOT JUST DO IT ALREADY?! Finally put all your observation skills to good use in The Perfectionist! Or maybe prepare yourself for a sort of stress test... Are you ready?<p>In The Perfectionist game you will satisfy your anger for organization by fixing and rearranging misplaced items in a sequence of minigames such as shuffled tiles, opened windows, unbuttoned buttons, untied shoelaces, light switches, missing tooth, and many other annoying things that are inexplicably out of order!<p>Did we mention you have company? The Perfectionist Dudes will thrill for every good hit you score, but also cry and go bananas whenever you make a mistake.<p>HOW TO PLAY<br>• Use the given time to beat the greatest amount of minigames you can<br>• Tap what’s wrong or needs to be corrected and win extra time<br>• Miss what should be repaired and you lose time<p>HIGHLIGHTS<br>• Meet the Perfectionist Dudes! The funniest and craziest friends you&#39;ll ever meet<br>• Non-stop fun with simple and easy one touch gameplay<br>• Play hard and get into FEVER MODE to double your score<br>• Get the missing puzzles pieces and unlock new minigames!<p>If you have ever felt deeply bothered by interrupted sequences or by an item disrupting an order, well, yes, you might as well have a bit of craziness in you! Get ready for lots of fun -- or maybe not so much -- with The Perfectionist.<p>Admit it: you’re already dying to fix the crooked square from this game’s icon, aren’t you?<p>Please note! This game is free to play, but it contains items that can be purchased for real money. Some features and extras mentioned in the description may also have to be purchased for real money.</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/br/com/tapps/theperfectionist', 'the-perfectionist-crazy-game.png', '["the-perfectionist-crazy-game-0.png","the-perfectionist-crazy-game-1.png","the-perfectionist-crazy-game-2.png","the-perfectionist-crazy-game-3.png","the-perfectionist-crazy-game-4.png","the-perfectionist-crazy-game-5.png","the-perfectionist-crazy-game-6.png"]', 0, 0, '', 'br.com.tapps.theperfectionist', 'perfectionist, minigames, dudes, purchased, the perfectionist, real money, for real, perfectionist dudes, for real money, the perfectionist dudes', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:25:38', '2016-05-18 01:25:38', 0),
(204, 47, 1152, '94%', '94', ' <div jsname="C4s9Ed">If I say &quot;Something you eat with your hands,&quot; what comes to mind first? Hamburger? Corn on the cob? Ribs? In 94%, the object of the game is simple: find 94% of the given answers!<p>Try the third app from Scimob, the creaters of 94 Seconds and 94 Degrees with more than 25 million players worldwide!<p>Examples of questions:<br>The first thing you do in the morning<br>Something you don&#39;t have time to do<br>Animals hatched from an egg<br>Something that is often out of order<p>Download 94% today to discover hundreds of questions based on words, expressions and images!</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/scimob/ninetyfour/percent', '94.png', '["94-0.png","94-1.png","94-2.png","94-3.png","94-4.png","94-5.png","94-6.png"]', 0, 0, '', 'com.scimob.ninetyfour.percent', 'questions, first', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:25:41', '2016-05-18 01:25:41', 0),
(205, 47, 15771, 'Soccer Clubs Logo Quiz', 'soccer-clubs-logo-quiz', ' <div jsname="C4s9Ed">Our app is designed for all fans of the most popular sport in the world. Do you know much about soccer clubs? This is probably the best logo quiz. Prove your ability with this game. Only 1% of players have managed to finish the game! If you like soccer trivia quiz, this app is for you. If you success guess team name you will get coins reward. You can use 4 kinds of help.<p>Features help:<br>1. discover 1st letter - cost 1 hint<br>2. remove unnecessary letters - cost 1 hint<br>3. show 1/2 name team - cost 1 hint<br>4. show correct answer - cost 2 hints<br> <br>Features app:<br>★ logos of 360 soccer teams<br>★ 12 levels<br>★ 5 hints<br>★ hints system<br>★ 4 kinds of help<br>★ every 5 guessable logos = + 1 hint<br>★ you can exchange 50 coins to 1 hint<br>★ confortable keyboard<br>★ frequent updates<br>★ source of knowledge:<br>    - official Facebook page<br>    - Transfermarkt profile<br>    - website<br>    - Wikipedia<br>★ great fun<br>★ soccer trivia<p>Our application contains more than 30 leagues:<br>★ German Bundesliga<br>★ English Premier League<br>★ English Championship<br>★ Spanish La Liga<br>★ American MLS<br>★ Brazilian Serie A<br>★ French Ligue 1<br>★ Argentinian Primera Division<br>★ Japanese J1 League<br>★ Italian Serie A<br>★ Italian Serie B<br>★ Mexican Liga MX<br>★ Chinese Super League<br>★ Australian A-League<br>★ Dutch Eredivisie<br>★ South Korean K-League Classic<br>★ and others <p>What&#39;s your favourite team? Real Madrid, FC Barcelona, Atletico Madrid, Bayern Munich, Borussia Dortmund, Chelsea, Manchester City, Arsenal, Boca Juniors, Santos, Ajax, AC Milan or Juventus? You will find all in this game.<p>Test your skills!<p>Follow us:<br>Facebook: facebook.com/mtappspl<br>Website: mtapps.pl<br>Twitter: twitter.com/MTapps_pl<p>DISCLAIMER:<br>All logos shown or represented in this game are protected by copyright and/or are trademark of theirs respective corporations. The use of low-resolution images in this application for the use of logos identifying qualifies as &quot;fair use&quot; under copyright law USA.</p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/mtapps/quiz/football_clubs_quiz', 'soccer-clubs-logo-quiz.png', '["soccer-clubs-logo-quiz-0.png","soccer-clubs-logo-quiz-1.png","soccer-clubs-logo-quiz-2.png","soccer-clubs-logo-quiz-3.png","soccer-clubs-logo-quiz-4.png","soccer-clubs-logo-quiz-5.png","soccer-clubs-logo-quiz-6.png"]', 0, 0, '', 'com.mtapps.quiz.football_clubs_quiz', 'league★, logos, soccer, serie, this game, the use, italian serie, you can', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:25:46', '2016-05-18 01:25:46', 0),
(206, 48, 1404, 'MASH', 'mash', ' <div jsname="C4s9Ed">MASH the game! What will your High School story be like? Who will you marry?  How many kids will you have? Where will you go to college?   Let our MASH game predict your future!  MASH is the classic grade school game done right!  Fun for girls, boys, and kids of all ages, middle school, high school, adults!  Fun to play solo or with groups of friends!<p>MASH - Mansion, Apartment, Shack, House - is like your having your own personal fortune teller or a magic 8 ball in your pocket.<p>Features:<br>- Classic MASH story!<br>- Downloads TONS of new stories to MASH<br>- Get Social! Share your stories with friends on Facebook or by Email<br>- Save stories to show your friends<p>Play our classic MASH story!  Who will you marry?  Where will you live?  How many kids will you have?  Where will you go to college?  What kind of car will you drive?  What kind of pet will you have? Will you live in a Mansion, Apartment, or Shack, or House?!  Every game is like opening a fortune cookie!<p>Downloadable content! Get TONS of new stories to MASH!  The Mad Libs like experience will have you and your friends laughing out loud! Learn your secret super power with MASH Superhero - flight, mind-reading, x-ray vision!  Find your celebrity dream date with Celebrity Date - will it be Justin Bieber, one of the Jonas Brothers, Robert Pattinson or Taylor Lautner from Twilight?!  Find out where you&#39;ll work with MASH My Average Life - will it be a pet shop, a salon, a dress shop, a cake bakery?!<p>And tons more, Including Daily Fortune, MASH wedding, Dear Diary, First Meeting, Secret Admirer, and A Strange Encounter just to name a few!<p>Get social with Facebook integration!  There&#39;s no better way to be at the top of your social circle than to share stories with friends on Facebook!  Whether you&#39;re on a girl or a boy, you can&#39;t go wrong with MASH!<p>Our MASH was listed in the New &amp; Noteworthy and is frequently feature in What&#39;s Hot on Apple iTunes App store for iPhone, iPod and iPad (iOS). We&#39;re in the top 10 Word games and are currently the highest-rated MASH game on Apple&#39;s App Store!<p>What does MASH stand for? Mansion. Apartment. Shack. House.<br>What are some MASH categories? Who will you marry. Where will you live. What kind of car you will drive. Tons of categories!<br>How to play mash - <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.mashthega.me/index.php/how_to_play_mash%26sa%3DD%26usg%3DAFQjCNHDVmFqdLsScvFxiL1guTpX93f_sA&amp;sa=D&amp;usg=AFQjCNEcFcSQmv9G63xTRKaAoYrcTfsx2w" target="_blank">http://www.mashthega.me/index.php/how_to_play_mash</a><p>Check out our Facebook page - see what our fans have to say about MASH!<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://facebook.com/mashmyaveragelife%26sa%3DD%26usg%3DAFQjCNEGtPqSegDmmqdv1B0KOn2wDtXznQ&amp;sa=D&amp;usg=AFQjCNFh6dK4xDm9MYyn_1J6UAlA58Jg-g" target="_blank">http://facebook.com/mashmyaveragelife</a><br>Play MASH Game for Facebook on your desktop computer (requires Flash):<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://apps.facebook.com/mashthegame%26sa%3DD%26usg%3DAFQjCNFX9KX21fdCqUdTnVmUmDmYzifBeA&amp;sa=D&amp;usg=AFQjCNHrbyyBRTYKBlwKN9W6VXTGkODgcA" target="_blank">http://apps.facebook.com/mashthegame</a><br>Play a quick pick-up game (lite version) online:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.mashthega.me%26sa%3DD%26usg%3DAFQjCNGFVIKifHi6-s0ulxWn40O9S_BNhw&amp;sa=D&amp;usg=AFQjCNFMYMKRwWxLQ51ZzeQrxIM7zBO5Pg" target="_blank">http://www.mashthega.me</a></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/mmmsnap/mash_lite', 'mash.png', '["mash-0.png","mash-1.png","mash-2.png","mash-3.png","mash-4.png","mash-5.png","mash-6.png"]', 0, 0, '', 'com.mmmsnap.mash_lite', 'facebook, stories, friends, school, will you, where will, what kind, you have, classic mash story, stories with friends', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:25:52', '2016-05-18 01:25:52', 0),
(207, 48, 3444, 'Word Twist', 'word-twist', ' <div jsname="C4s9Ed">Word Twist is a word puzzle game that improve your vocabulary.<p>Arrange jumbled letters to form a word before time runs out.<p>Click letters to place them in the solution slots. <br>Click the last one in the solution slots to remove a letter.<br>Click Clear button to remove letters all.<p>You can click Twist button to rearrange the letters to help you guess words. <br>When you&#39;re ready to submit a word,click Enter button.</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/myGame/wordtwist', 'word-twist.png', '["word-twist-0.png","word-twist-1.png","word-twist-2.png"]', 0, 0, '', 'com.myGame.wordtwist', 'click, letters, button, remove, solution slots, the solution, , the solution slots', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:25:54', '2016-05-18 01:25:54', 0),
(208, 48, 15870, 'TS Korean Talk Game', 'ts-korean-talk-game', ' <div jsname="C4s9Ed">Let&#39;s enjoy studying Korean conversation!<br>sentences now become your knowledge just complete them by ordering their words simply in proper positions.<p>● Learn the word order of sentences! <br>- This is a game to complete a sentence, by clicking its component words in proper sequence. You can learn the expressions of conversations as you complete them. <br>● Convenient review! <br>- You can read and listen to your cleared sentences again whenever you want at Favorites.<br>● Check your score and level growing higher! <br>- You can check your current score and level growth in various graphs.<br>● Compete with people around the world NOW!<br>- Support the World Ranking List for each language, so you can check how high your ranking is among the people around world. Let’s challenge to be the NO 1 in all languages. <br>● Do not worry about language exams!<br>- You may improve your scores of Korean exam.<p>★ Main Features <br>- Language sentence completion game. <br>- Support Talk Game by category (Basic, Daily life, Business).<br>- Support 5,000+ Korean sentence. <br>- Support the native speaker’s voice in all languages. <br>- Totally 250 game stages and provide special stages per five stages.<br>- Support Favorites to review cleared sentences easily. <br>- Support World Ranking Service, and various graphs for checking user’s skill growth.</p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/tss21/talk/korean/google', 'ts-korean-talk-game.png', '["ts-korean-talk-game-0.png","ts-korean-talk-game-1.png","ts-korean-talk-game-2.png","ts-korean-talk-game-3.png","ts-korean-talk-game-4.png"]', 0, 0, '', 'com.tss21.talk.korean.google', 'support, world, sentences, ranking, you can, the world, people around, support the', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:25:59', '2016-05-18 01:25:59', 0),
(209, 48, 5224, 'WordMania - Guess the Word!', 'wordmania-guess-the-word', ' <div jsname="C4s9Ed">WordMania - Guess the Word is a fast, fun and addictive word game!<p>Its simple to play! Just find the words hidden in the grid, but be careful - order is important!<p>It may sound easy but you progress quickly to some killer grids!<p>  ★ 600 puzzles! 30 level packs! 3,000 words!<br>  ★ Search for hidden bronze, silver and gold letters on each board!<br>  ★ Find out what bonus prizes are waiting!<br>  ★ Themes for each level pack!<br>  ★ Great brain exercise!<p>ALL LEVELS ARE SOLVABLE! If you can&#39;t solve at first, try using the words in a new order or a different letter sequence.<p>Will you become a word genius and make it to the final level?!!</p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/slide/wordMania', 'wordmania-guess-the-word.png', '["wordmania-guess-the-word-0.png","wordmania-guess-the-word-1.png","wordmania-guess-the-word-2.png","wordmania-guess-the-word-3.png","wordmania-guess-the-word-4.png"]', 0, 0, '', 'slide.wordMania', 'words, level, hidden, order, the words', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:26:03', '2016-05-18 01:26:03', 0),
(210, 48, 1078, 'Quick Logic Puzzles', 'quick-logic-puzzles', ' <div jsname="C4s9Ed">A logic grid puzzle with a twist! Small logic problems use the same principles as larger puzzles, but are faster to complete and work well on phone screens. One free puzzle every day, or buy a volume of puzzles if you can&#39;t wait! No ads, no popus, no nags, no interruptions.<p>Great for new players and children, or seasoned players who want a quick game. As well as a free puzzle every day, this fully functioning version has 10 graded puzzles and no ads. As always, there is no guessing required, just logic.  Smart Hints suggest a new square and explain which clue applies and why, based on your current solution (internet access required).<p>★★★★★ by Lindsay H Great interface I really like the design and structure of this app - everything is easy to see and use, and it makes doing the puzzles very clear. <p>★★★★★ by Customer. I have always been a fan of grid based logic puzzles and always used to buy the books that were just a collection of them. This app fits the bill of what I was looking for. Over all, I enjoyed this app quite a bit. The puzzles were hard enough to be challenging, but short enough to finish one whenever I had a free moment.<p>Solve these puzzles to keep your brain sharp! Logic Puzzles are popular preparation for the GMAT Logical Reasoning sections and similar deductive exams. <p>Optimized for screens instead of paper, this modern solver has smart hints, multi-level Undo and Auto-X features to make it easier and quicker to focus on the logic. Keep short notes along with the puzzle to help you make your way to the solution.  If you&#39;re completely stuck, you have the ability to check the grid for errors or get a hint.<p>There are ten puzzles included at two different sizes to get you started. Each logic puzzle includes statistics for its average completion time. See how your time compares! Every five puzzles are grouped together with their own background story. Each group has a range of puzzles that get progressively harder. Additional volumes are available for in-app purchase and more will be added regularly.<p>Quality software by Egghead Games. Contact us with questions at:<p>Facebook: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/EggheadGames%26sa%3DD%26usg%3DAFQjCNG-z4Zmc_cHjobAYwdhkd_PWwVSeQ&amp;sa=D&amp;usg=AFQjCNEFn41BB3sf_GFOjSheslvlT1WPMg" target="_blank">https://www.facebook.com/EggheadGames</a><br>Email: <a href="mailto:support@eggheadgames.com">support@eggheadgames.com</a>.<p>All the puzzles have validated difficulty levels and times aggregated from the popular Puzzle Baron websites. His family of web sites have served millions and millions of puzzle enthusiasts since 2006.</p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/eggheadgames/quicklogicproblems', 'quick-logic-puzzles.png', '["quick-logic-puzzles-0.png","quick-logic-puzzles-1.png","quick-logic-puzzles-2.png","quick-logic-puzzles-3.png","quick-logic-puzzles-4.png","quick-logic-puzzles-5.png","quick-logic-puzzles-6.png"]', 0, 0, '', 'com.eggheadgames.quicklogicproblems', 'puzzles, puzzle, logic, short, this app, the puzzles, puzzles are, logic puzzles, free puzzle every', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:26:07', '2016-05-18 01:26:07', 0),
(211, 49, 8166, 'Sing! Karaoke by Smule', 'sing-karaoke-by-smule', ' <div jsname="C4s9Ed">Sing your favorite hits with audio effects. Sing video duets with featured artists like Jessie J, Jason Derulo, and Linkin Park. Share your covers with our 50M+ global audience and get fans! <br>Featured by Google Play as Best Apps 2014.<p>-----------<br>Features<br>- Self-recording option with video**<br>- Sing like a star with audio effects! <br>- Share on our global platform - get discovered! <br>- Duet with featured pop artists - Jessie J, Jason Derulo, Kylie Minogue, X Ambassadors, OMI, Carly Rae Jepsen, Charlie Puth, Silento and many more<p>**Video availability on different Android devices will be incremental over several weeks. When available on your device model, video option will appear with no additional update required. Please see the Sing! Android FAQ for the initial list of devices that offer video. <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.smule.com/support/sing%2523android%26sa%3DD%26usg%3DAFQjCNG4yKwuoHII6hu3nojH35n6p0D7SQ&amp;sa=D&amp;usg=AFQjCNH-0dyNTrf8u8G6VQizRGDcxPbmLA" target="_blank">http://www.smule.com/support/sing#android</a><br>-----------------------------------------------------<br>New songs added every day. Current most popular on Sing!:<p>** All of Me - John Legend<br>** Flashlight - Jessie J (from Pitch Perfect 2)<br>** I&#39;m Not the Only One - Sam Smith<br>** Like I&#39;m Gonna Lose You - Meghan Trainor, ft. John Legend<br>** All I Want For Christmas is You - Mariah Carey<br>** I&#39;m Yours - Jason Mraz<br>** Thinking Out Loud - Ed Sheeran<br>** Dear Future Husband - Meghan Trainor<br>** When I Was Your Man - Bruno Mars<br>** Let It Go - Idina Menzel (from Frozen by Disney)<br>** Cups (&quot;When I&#39;m Gone&quot;) - Anna Kendrick<br>** Stay - Rihanna ft. Mikky Ekko <br>** Love me Like You Do - Ellie Goulding<br>** The Way, Break Free - Ariana Grande<br>** Anaconda, Pound the Alarm - Nicki Minaj <br>** I Won’t Give Up, I’m Yours – Jason Mraz <br>** Happy - Pharrell Williams<br>** Eye of the Tiger - Survivor <p>Want a song that&#39;s not yet available? Suggest songs on Smule’s Facebook page: www.facebook.com/smule<p>Want a song that&#39;s not yet available? Suggest songs on Smule’s Facebook page: www.facebook.com/smule <p>CONNECTING THE WORLD THROUGH MUSIC™ - JOIN THE KARAOKE PARTY<br>Find and follow your friends in Sing!, and meet incredible singers from all over the world. Sing your heart out on Solo songs, or join up with others in Duets or Group songs. Keep up with your friends and favorite singers, and love and comment on performances to show your support. <p>BE DISCOVERED!  GET FANS!<br>Lots of talents get discovered through our Sing! Karaoke platform.  Show off your talent in front of 50M+ global audience and get fans<p>SOUND LIKE A STAR<br>Sound amazing every time with Sing!’s voice enhancement technology. Use special voice filters to spice up your performance even more. Sing! is a supportive, joyful community where music-making at all levels is encouraged and appreciated. <p><br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.smule.com%26sa%3DD%26usg%3DAFQjCNGe8bwca1SDHb5-IBAVbwxUi88T1g&amp;sa=D&amp;usg=AFQjCNHzIFrzh3F-P7pB2SMfmiNBqUtCDA" target="_blank">http://www.smule.com</a><br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://plus.google.com/%252Bsmule%26sa%3DD%26usg%3DAFQjCNEmUeCIX6-s0b-Bu0PHYb_2WMp9gg&amp;sa=D&amp;usg=AFQjCNFeUuwuRa7NKTyYLh1D7enaw5MErQ" target="_blank">http://plus.google.com/+smule</a><br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/smule%26sa%3DD%26usg%3DAFQjCNGni9eZEGFcuThW1P0qY1mCvpB0vA&amp;sa=D&amp;usg=AFQjCNHAWGJIF7xG1Bv-jcRcPogLle8AXw" target="_blank">http://www.facebook.com/smule</a><br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.youtube.com/smule%26sa%3DD%26usg%3DAFQjCNHeUpj5jxgSyooeXvwwnbnzkUtv9A&amp;sa=D&amp;usg=AFQjCNELN7BqGJRKWDBRPU8P2F_6NMA1WQ" target="_blank">http://www.youtube.com/smule</a><br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.twitter.com/smule%26sa%3DD%26usg%3DAFQjCNFvMIQ1bJoJkSqwyw-jV9q4mjoz_A&amp;sa=D&amp;usg=AFQjCNEJyiq-QdTes775cKNEJaC0GRuexw" target="_blank">http://www.twitter.com/smule</a><p>Have questions on a particular permission?  <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.smule.com/support/sing%2523android%26sa%3DD%26usg%3DAFQjCNG4yKwuoHII6hu3nojH35n6p0D7SQ&amp;sa=D&amp;usg=AFQjCNH-0dyNTrf8u8G6VQizRGDcxPbmLA" target="_blank">http://www.smule.com/support/sing#android</a></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/smule/singandroid', 'sing-karaoke-by-smule.png', '["sing-karaoke-by-smule-0.png","sing-karaoke-by-smule-1.png","sing-karaoke-by-smule-2.png","sing-karaoke-by-smule-3.png","sing-karaoke-by-smule-4.png","sing-karaoke-by-smule-5.png","sing-karaoke-by-smule-6.png"]', 0, 0, '', 'com.smule.singandroid', 'songs, facebook, smule, jason, sing android, facebook com, www facebook, www smule, available suggest songs, smule’s facebook page', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:26:15', '2016-05-18 01:26:15', 0);
