(212, 49, 1028, 'Spotify Music', 'spotify-music', ' <div jsname="C4s9Ed">Spotify is now free on mobile and tablet. Listen to the right music, wherever you are. <p>With Spotify, you have access to a world of music.  You can listen to artists and albums, or create your own playlist of your favorite songs.  Want to discover new music?  Choose a ready-made playlist that suits your mood or get personalized recommendations.<p>Listen for free on mobile<br>• Play any artist, album, or playlist on shuffle mode<p>Listen for free on tablet<br>• Play any song, any time<p>Spotify Premium features<br>• Play any song, any time on any device--mobile, tablet, or your computer<br>• Download music for offline listening.<br>• Enjoy amazing sound quality.<br>• No ads – just uninterrupted music.<br>• No commitment - cancel any time you like.<p><br>Love Spotify? <br>Like us on Facebook: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/spotify%26sa%3DD%26usg%3DAFQjCNEakTyyu6UqjBl4kt_OTdlvVao6MQ&amp;sa=D&amp;usg=AFQjCNGD387DD6bt5d-twRujr2tahBXFpg" target="_blank">http://www.facebook.com/spotify</a> <br>Follow us on Twitter: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://twitter.com/spotify%26sa%3DD%26usg%3DAFQjCNF09N-_GFwQBKFJ-n0i_EAI3aAk4g&amp;sa=D&amp;usg=AFQjCNEb9ucF6tBSsrEw9ocYrUH4b1CMGg" target="_blank">http://twitter.com/spotify</a><p><br>Please note: This app features Nielsen’s audience measurement software which will allow you to contribute to market research, such as Nielsen’s Audio Measurement. If you don&#39;t want to participate, you can opt-out within the app settings. To learn more about our digital audience measurement products and your choices in regard to them, please visit <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.nielsen.com/digitalprivacy%26sa%3DD%26usg%3DAFQjCNHnrE93yrJdDNQ2o1BNCLn3dgTytg&amp;sa=D&amp;usg=AFQjCNH6_GM7a-hB7GjXxO-Z9Gqw7W9LwA" target="_blank">http://www.nielsen.com/digitalprivacy</a> for more information.</p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/spotify/music', 'spotify-music.png', '["spotify-music-0.png","spotify-music-1.png","spotify-music-2.png","spotify-music-3.png","spotify-music-4.png","spotify-music-5.png","spotify-music-6.png"]', 0, 0, '', 'com.spotify.music', 'music, spotify, measurement, playlist, play any, http www, audience measurement, any time', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:26:18', '2016-05-18 01:26:18', 0),
