(214, 49, 15181, 'Music Downloader', 'music-downloader', ' <div jsname="C4s9Ed">Music Downloader — is a powerful app where you can play and download free music from indie artists around the world. Explore more than 50 genres or just search to find the music you like. Once you found your favorite artist you can browse and download all his tracks.<br>All the music published under Creative Commons — «Attribution» license which means you are free to play music, download it and share with your friends.<p>Music Downloader highlights:<br>• More than 30000 tracks available for download<br>• More than 50 music genres<br>• Mixtapes, remixes, samples and original tracks<br>• High quality MP3 files<br>• Fast music downloads<br>• All for free!<p>It&#39;s recommended for you to use WiFi for faster music downloads. If you have any questions or suggestion please don&#39;t hasistate to contact me.<p>If you like some artist feel free to find him at ccmixter.org and donate.<p>Creative Commons — «Attribution» license: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://creativecommons.org/licenses/by/4.0/%26sa%3DD%26usg%3DAFQjCNEq0HWCP8KI3SFC_f4aL3xq1AGqcw&amp;sa=D&amp;usg=AFQjCNHitN3QXCw4Su7eKbxufMFkKI289w" target="_blank">https://creativecommons.org/licenses/by/4.0/</a></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/music/downloader/mixtapes', 'music-downloader.png', '["music-downloader-0.png","music-downloader-1.png","music-downloader-2.png","music-downloader-3.png"]', 0, 0, '', 'com.music.downloader.mixtapes', 'music, download, license, ', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:26:22', '2016-05-18 01:26:22', 0),
(215, 49, 3843, 'Music Player', 'music-player', ' <div jsname="C4s9Ed">Music Player with powerful equalizer, Quick search all music files, custom background skin, free to get this perfect audio player and media player.<p>The best music player and audio player! <p>Music player is not only based on artists or albums, but also based on the folder structure. Music Player will guide you find all the music files in seconds. <br>Replaceable background skin make the Music Player extraordinarily brilliant.<br>The unique equalizer make your music sounds more professional. You are free to control the music style now.<p>Key Features:<br>* Support all the most popular music file formats.<br>* Browse and play your music by albums, artists, songs, playlists, folders.<br>* Powerful equalizer. More than 22+ pre-set music tone styles for your choice(Normal, Classic, Dance, Folk, Heavy, Hip hop, Jazz,  Pop, Rock...)<br>* Custom tone music style and manually adjust the equalizer. <br>* 3 home screen WIDGETS (4x1,2x2,4x1).<br>* Support Lyric files. Automatic scanning all the lyric files , and matching. <br>* Replaceable background skin, 22+ Gorgeous background skins for your choice. You also can set your gallery photo as background. <br>* Support notification status: show album artwork, play/pause, skip forward in notification status.<br>* SHAKE phone to change playing music : give your phone a shake to play next/previous song<br>* Free to re-edit album and artist name.<br>* Headset support. <br>* Easy SEARCH. Find all your local music files never been so easy.<br>* Custom your Playlist<br>* Headset/Bluetooth Controls<p>Hope everybody can enjoy the different music play experience.</p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/media/audioplayer/musicplayer', 'music-player.png', '["music-player-0.png","music-player-1.png","music-player-2.png","music-player-3.png","music-player-4.png","music-player-5.png","music-player-6.png"]', 0, 0, '', 'media.audioplayer.musicplayer', 'music, player, files, background, music player, the music, background skin, all the, for your choice, replaceable background skin', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:26:24', '2016-05-18 01:26:24', 0),
(216, 50, 947, 'Temple Run', 'temple-run', ' <div jsname="C4s9Ed">The addictive mega-hit Temple Run is now out for Android! All your friends are playing it - can you beat their high scores?!<p>You&#39;ve stolen the cursed idol from the temple, and now you have to run for your life to escape the Evil Demon Monkeys nipping at your heels. Test your reflexes as you race down ancient temple walls and along sheer cliffs. Swipe to turn, jump and slide to avoid obstacles, collect coins and buy power ups, unlock new characters, and see how far you can run! <p>&quot;In every treasure hunting adventure movie there’s one scene in which the plucky hero finally gets his hands on the treasure but then has to navigate a maze of booby traps in order to get out alive. Temple Run is this scene and nothing else. And it’s amazing.&quot; - SlideToPlay.com<p><br>REVIEWS<p>★ &quot;Most thrilling and fun running game in a while, possibly ever.&quot; - TheAppera.com<p>★ &quot;A fast and frenzied experience.&quot; - IGN.com<p>★ &quot;Very addicting… definitely a very different running game.&quot; - Appolicious.com<p>★ Voted by TouchArcade Forums as Game of the Week<p>★ One of TouchArcade&#39;s Best Games of the Month<p>★ Over 50 MILLION players worldwide!</p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/imangi/templerun', 'temple-run.png', '["temple-run-0.png","temple-run-1.png","temple-run-2.png","temple-run-3.png","temple-run-4.png","temple-run-5.png","temple-run-6.png"]', 0, 0, '', 'com.imangi.templerun', 'temple, com★, running, scene, running game, temple run', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:26:28', '2016-05-18 01:26:28', 0),
(217, 50, 5259, 'Chibi Maruko Chan Dream Stage', 'chibi-maruko-chan-dream-stage', ' <div jsname="C4s9Ed">Maruko-chan wants to make it big on TV! Join her and her friends as she strives to learn new talents and earn new items to impress the judges. She&#39;ll do whatever it takes to win this contest, so mix and match various talents and put on a spectacular show!<p>*** KEEP THOSE COMBOS COMING ***<br>String orbs together in fast-paced talent shows!<p>*** PUT ON A JAW-DROPPING PERFORMANCE ***<br>Impress the judges with tons of cool tools and talents!<p>*** ALL YOUR FAVORITE CHARACTERS ***<br>Unlock 21 beloved characters from the series!<p>*** FAMILIAR FACES RETURN AS JUDGES ***<br>30 characters from the TV series will judge your performance!<p>*** CUTE &amp; SIMPLE GRAPHICS ***<br>Adorable art design based on the TV series!<p>*** EASY &amp; FUN, FOR ALL AGES ***<br>Anyone will have a good time, no matter the age!<p>Do you have what it takes to be a star? Pick your talent and show those judges what you&#39;re made of!<p><br>** Please note that while the app is free, please be aware that it contains paid content for real money that can be purchased upon users&#39; wish to enhance their gaming experience.You may control in-app purchases made within this app using password protection which can be enabled from the setting page of the Google Play Store app. **</p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/animocabrands/google/chibiMarukoTVShow', 'chibi-maruko-chan-dream-stage.png', '["chibi-maruko-chan-dream-stage-0.png","chibi-maruko-chan-dream-stage-1.png","chibi-maruko-chan-dream-stage-2.png","chibi-maruko-chan-dream-stage-3.png","chibi-maruko-chan-dream-stage-4.png","chibi-maruko-chan-dream-stage-5.png","chibi-maruko-chan-dream-stage-6.png"]', 0, 0, '', 'com.animocabrands.google.chibiMarukoTVShow', 'judges, talents, series, characters, from the, series ***, characters from, the judges', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:26:30', '2016-05-18 01:26:30', 0),
(218, 50, 4836, 'Mandala Coloring Pages', 'mandala-coloring-pages', ' <div jsname="C4s9Ed">100 Mandala coloring pages for adults and kids. Both easy and complex mandala&#39;s for everyone.  <br>Become relaxed and zen!<p>Tip: Use a large screen with high resolution for the best results.<br>Tip: Use a tablet pen for filling small areas<p>This app offers:<br>* 100 Mandala&#39;s<br>* Easy to play<br>* Share your artwork<br>* Save and load your work<br>* Undo button<p>Have fun and a creative moment!</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/color/mandala', 'mandala-coloring-pages.png', '["mandala-coloring-pages-0.png","mandala-coloring-pages-1.png","mandala-coloring-pages-2.png","mandala-coloring-pages-3.png","mandala-coloring-pages-4.png","mandala-coloring-pages-5.png","mandala-coloring-pages-6.png"]', 0, 0, '', 'com.color.mandala', 'mandala&, , tip use', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:26:33', '2016-05-18 01:26:33', 0),
(219, 50, 753, 'Angry Birds POP Bubble Shooter', 'angry-birds-pop-bubble-shooter', ' <div jsname="C4s9Ed">Angry Birds meets bubble shooter in an all-new and super-addictive puzzler! Use your slingshot to match and burst colorful bubbles, save exotic critters, and topple the piggies. Strategic and intuitive gameplay make for a challenging and satisfying bubble popping experience!<p>POP BUBBLES!<br>- Match and pop bubbles to save critters, stop piggies and score big<br>- Special Pops - a six-match streak unlocks a superpowered bubble<br>- Unlock boosts for added bubble popping power<p>EXCITING PUZZLES!<br>- Action-packed gameplay - get out your slingshot and start popping<br>- Loads of addictive puzzles like Drop the Pigs, Beat the Clock and many more<br>- Master your bubble flinging and use strategy to crack tricky levels<p>STELLAR STUFF!<br>- Explore the Golden Island map with beautiful graphics and enchanting music<br>- Challenge friends and see their progress by connecting to Facebook<br>- Sync your progress across mobile and tablet<p>-----------------------------<p>Follow Stella:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://twitter.com/stellafriends%26sa%3DD%26usg%3DAFQjCNFBnKLBPP7OqysLgToZ7tz-8n97JA&amp;sa=D&amp;usg=AFQjCNEtcI_cnGyB2v-oFN1o3oWmnEhR8g" target="_blank">https://twitter.com/stellafriends</a><p>-----------------------------<p>Angry Birds Stella Pop! is completely free to play, but there are optional in-app purchases available. Either way, it’s tons of fun!<p>Terms of Use: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.rovio.com/eula%26sa%3DD%26usg%3DAFQjCNEgtLJ08RdZefh3AxPrT6BLABUqPA&amp;sa=D&amp;usg=AFQjCNHjrwdzQgE6LXvUb9Pa_s8Xi4_jpA" target="_blank">http://www.rovio.com/eula</a><br>Privacy Policy: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.rovio.com/privacy%26sa%3DD%26usg%3DAFQjCNGt5frM4xE8I2NzBoydDHFuFHGA3g&amp;sa=D&amp;usg=AFQjCNE-3bLvZTo6iHFNlNujbZa_6ZKeYw" target="_blank">http://www.rovio.com/privacy</a></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/rovio/ABstellapop', 'angry-birds-pop-bubble-shooter.png', '["angry-birds-pop-bubble-shooter-0.png","angry-birds-pop-bubble-shooter-1.png","angry-birds-pop-bubble-shooter-2.png","angry-birds-pop-bubble-shooter-3.png","angry-birds-pop-bubble-shooter-4.png","angry-birds-pop-bubble-shooter-5.png","angry-birds-pop-bubble-shooter-6.png"]', 0, 0, '', 'com.rovio.ABstellapop', 'bubble, popping, bubbles, match, http www, www rovio, rovio com, pop bubbles', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:26:35', '2016-05-18 01:26:35', 0),
(220, 50, 925, 'FIFA 15 Ultimate Team', 'fifa-15-ultimate-team', ' <div jsname="C4s9Ed">FIFA 15 Ultimate Team by EA SPORTS features over 10,000 players from over 500 licensed teams. Plus, over 30 real leagues and stadiums! Build a dream squad of footballers and put them to the test. From the English Premier League, La Liga, and MLS, to the German Bundesliga and beyond. Take the thrills with you wherever you are with the most authentic soccer game on Google Play.<p>This app offers in-app purchases.  You may disable in-app purchasing using your device settings.<p>** This game has superior graphics and is packed with tons of real football leagues, teams, and players. Please make sure you have at least 1.35GB of free space on your device. **<p>BUILD YOUR ULTIMATE TEAM<br>Earn, trade, and collect superstars like Lionel Messi and Eden Hazard to create your own fantasy team. Choose your play style, formation, kits, and more.<p>PLAY IN QUICK SIMULATION MODE<br>Put your management skills to the test with new Quick Simulations. Set up your squad, start the match, and watch it unfold. Make smart subs, tactical tweaks, and gauge team effort along the way. Your match results depend entirely on your ability to manage player skills and chemistry – taking authenticity to the next level.<p>OR TAKE IT TO THE PITCH! <br>If you’re new to FIFA on mobile, try out our “Casual Controls”, with elegantly simple buttons like “shoot”, “pass”, or “sprint”. Once you’re feeling comfortable, move on to “Classic Controls”, which let you add either “through passes” or “skill moves” to your gaming arsenal. Or, you can interact with your team directly, tapping on players to pass the ball and swiping towards the net to shoot. Plus, if you have an external controller – don’t miss the chance to use it on the pitch for the first time<p>REAL WORLD MATCH UPS<br>Play your favorite team’s next fixture, plus 3 other major match-ups happening around the world – every week!<br>Jump into the action and feel the passion of your favorite sport with FIFA 15 Ultimate Team!<br>NOTES:<p>Terms of Service: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.ea.com/terms-of-service%26sa%3DD%26usg%3DAFQjCNEmDOJlNgFrLyebXgdth3qsCaJA1Q&amp;sa=D&amp;usg=AFQjCNHg74TpJRtGAFHkvQauj4fQ5mLNFg" target="_blank">http://www.ea.com/terms-of-service</a><br>Privacy &amp; Cookie Policy:  <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.ea.com/privacy-policy%26sa%3DD%26usg%3DAFQjCNE97o3wXT0SW8AoyOZ4SJsE1841xQ&amp;sa=D&amp;usg=AFQjCNEnvrPp6toK-geij6xEvn1BxUkeqw" target="_blank">http://www.ea.com/privacy-policy</a><br>Game EULA: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://tos.ea.com/legalapp/mobileeula/US/en/OTHER/%26sa%3DD%26usg%3DAFQjCNFB15SLObBqVLZMjUqWyXObNOhE-Q&amp;sa=D&amp;usg=AFQjCNHRLm9kvmsxDmOJeWg1VM0sYviMIw" target="_blank">http://tos.ea.com/legalapp/mobileeula/US/en/OTHER/</a><br>Visit <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://help.ea.com/%26sa%3DD%26usg%3DAFQjCNGJtFhhKZ2izQ3xjgxZdv8uhc6evg&amp;sa=D&amp;usg=AFQjCNFylF1MBXik8QoY8aPQXY0vPrMSyg" target="_blank">https://help.ea.com/</a> for assistance or inquiries.<br> <br>EA may retire online features and services after 30 days’ notice posted on www.ea.com/1/service-updates<p>Important Consumer Information:  This app:  Requires acceptance of EA’s Privacy &amp; Cookie Policy, TOS and EULA; Includes in-game advertising; Collects data through third party ad serving and analytics technology (See Privacy &amp; Cookie Policy for details); Contains direct links to the internet and social networking sites intended for an audience over 13.</p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/ea/game/fifa15_row', 'fifa-15-ultimate-team.png', '["fifa-15-ultimate-team-0.png","fifa-15-ultimate-team-1.png","fifa-15-ultimate-team-2.png","fifa-15-ultimate-team-3.png","fifa-15-ultimate-team-4.png","fifa-15-ultimate-team-5.png","fifa-15-ultimate-team-6.png"]', 0, 0, '', 'com.ea.game.fifa15_row', 'match, ultimate, policy, cookie, &amp cookie, cookie policy, http www, privacy &amp, &amp cookie policy, privacy &amp cookie', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:26:37', '2016-05-18 01:26:37', 0);
