(24, '4.0.0', 'singtel-dash-4-0-0', 34, '  <div class="recent-change">mWallet has been enhanced with a new and improved payment experience, and will now be known as Singtel Dash.</div><div class="recent-change">You will now be able to:</div><div class="recent-change">• Pay at over 20,000 locations islandwide like FairPrice, Watsons, Food Republic, KFC, 7-Eleven and more</div><div class="recent-change">• Enjoy a fuss-free way to pay on taxis with no admin fees</div><div class="recent-change">• Top up dash on the go from other bank accounts</div><div class="recent-change">Remittance customers can continue to remit overseas directly from their phone and enjoy additional benefit of sending money to their friends locally.</div>  <div>     </div> ', '2.3.3', 0, 0, 0, 0, '2016-05-17 10:36:37', '0000-00-00 00:00:00', '2016-05-08 16:00:00'),
