(28, 'Chirag Patel', 'chiragpatel.all@gmail.com', 3, 'Get my Application Published', 'Hello,\r\nI am Chirag Patel and i am a application developer with ebizzinfotech software company. Auto Date and Time stamp on Photo application created by me which is related to photography. App details mention bellow.\r\n\r\nTitle:-\r\n\r\nAuto Date and Time Stamp on Photo\r\n\r\nShort Desc:-\r\n\r\nCapture Images with current Date and Time on it through "DEFAULT CAMERA" Only\r\n\r\nMedium Desc:-\r\n\r\nWhile viewing Photos in a Particular Album, many a times you face situation like you want to know the date or time on which a particular photo was snapped and you start pressuring your Brain. But now don''t worry because with the help of "Auto Date and Time Stamp on Photo" Application, your Pictures will always be stamped with Date and Time.\r\n\r\nCheck out some Exciting Features of this Application:-\r\n\r\n1) Manual On/Off Functionality\r\n\r\nSet Date and Time Stamp only on the Photos you wish with the help of "Stamp Toggle On/Off" Functionality.\r\n\r\n2) Use of Default Camera\r\n\r\nNo need to open up the Application and click images to stamp date and time instead use your Smartphone''s inbuilt Camera with all its functionalities.\r\n\r\n3) Adjustable Stamp Format\r\n\r\nYou can adjust the format of Date and Time Stamp according to your choice from many options available.\r\n\r\n4) Varieties in Font Format (After PRO)\r\n\r\nChoose which Font you want to display in your Image as Date and Time Stamp.\r\n\r\n5) Stamp position where you want (After PRO)\r\n\r\nSelect the position where you want to stamp the date and time in a Picture.\r\n\r\n6) Manual Selection of Stamp Color (After PRO)\r\n\r\nIn accordance to the Background of the image, you can choose custom color for Date and Time Stamp.\r\n\r\nIn other Applications, you need to open up the App and then click images through their inbuilt Camera to stamp date and time which does not allow you to use your inbuilt Camera''s Features. But this Application is completely different and what you need to do is just install this Application and set preferences according to your convenience.\r\n\r\nThat''s it. Then click images as you do normally through your Default Camera and date and time stamp will be automatically inserted into it. The main benefit of using this Application is that you can click images with all the features of your Default Camera.\r\n\r\nDownload the Application Now to stamp Authority on your Images.\r\n\r\nPlay Store URL:-\r\n\r\nhttps://play.google.com/store/apps/details?id=com.ebizzinfotech.datetimestampphoto\r\n\r\nApk Url :- \r\n\r\nhttp://ul.to/uot4p7xz\r\nhttp://www10.zippyshare.com/v/KrZSrcm9/file.html\r\nhttps://my.pcloud.com/publink/show?code=XZfq2YZSz6S37C47uzsjGWBFuT6B4XSaFyX\r\nhttps://userscloud.com/42831ikk8kcc\r\n\r\nThanks and Regards\r\nChirag Patel\r\n', '2016-05-02 05:22:20', '2016-05-02 05:22:20'),
(29, 'Chirag Patel', 'chiragpatel.all@gmail.com', 3, 'Get my Application Published', 'Hello,\r\nI am Chirag Patel and i am a application developer with ebizzinfotech software company. Janva Jevu in Gujarati application created by my company Greencom Ebizzinfotech which is related to world news in gujarati .App details mention bellow.\r\n\r\nTitle:\r\n\r\nJanva Jevu In Gujarati\r\n\r\nShort Desc:\r\n\r\nWorld''s interesting news in your phone with Janva Jevu app.\r\n\r\nLong Desc:\r\n\r\nAre you interested in Reading all the Amazing Articles related to Technology, Entertainment, Jokes, Health Tips, etc. in Gujarati? Then this is the Best Application you can find. Because each and everything written in it is in "Shuddh Gujarati Language".\r\n\r\nBest Features of this Application:-\r\n\r\n1) Only in Gujarati\r\nAll the Information and Features are in Gujarati Language\r\n\r\n2)Interesting Informational Articles\r\nOnly Best Interesting Articles are selected and posted.\r\n\r\n3)Amazing Gujarati Quotes\r\nYou will get exclusive Gujarati Quotes here well described on relevant image.\r\n\r\n4)WhatsApp Functionality (NEW)\r\nThis is the best functionality you will ever see in any Applications. \r\nYou can send your own Messages as well as view others Messages\r\n\r\n5)Bookmark Favorite Articles\r\nBookmark the Articles that you Like to read it again anytime easily.\r\n\r\n6)Upload you Own Stories\r\nIf you have you own good news, cooking recipes, etc. stuff than you can upload it. If Approved it will be displayed with your Name.\r\n\r\nAll in all there is each and everything in this Application that will make you say WOW... With Janva Jevu, each and every Gujarati will be able to Read all the information that he cannot Read due to lack of English Communication Skills. And the main concept of this Application is to connect Gujarati People with their Mother Language Gujarati and make sure that Gujarati remains the Pride of Gujarat.\r\n\r\nFrom Design to Development to Features we have left no stone unturned in getting this Application on Par with some of the Best News Apps in English. It is absolutely perfect for everyone who knows Gujarati Language. In short, Everything that''s interesting in the World will be displayed inside Janva Jevu.\r\n\r\nBelow mentioned are the Categories that you will find in Janva Jevu.\r\n\r\nTalent:- Interesting hidden talents updates from Worldwide in Gujarati.\r\n\r\nTechnology:- All the latest technological news and updates in Gujarati.\r\n\r\nSports:- Up to date news related to Cricket, Football, Hockey, etc. in Gujarati.\r\n\r\nCooking:- Top Recipes for Cooking Delicious Food by Top Cooks from the World in Gujarati.\r\n\r\nHealth:- Check how to stay fit.\r\n\r\nSpiritual:- Stay connected with your Religion and God.\r\n\r\nVideo:- Funny, Interesting, Learning Video Updates.\r\n\r\nLaughter:- You will Die Laughing.\r\n\r\nTourism:- Check out the Best Traveling Spots across Gujarat.\r\n\r\nGallery(Quotes):- Daily images with an Inspirational Quote on it. (Instant WhatsApp Share)\r\n\r\nIn all the Categories, you will get only Interesting Articles as we only "Choose the Best from the Rest". Make sure that you do Download this Wonderful Application and Enjoy all the Features and Functionalities.\r\n\r\nPlay Store:\r\n\r\nhttps://play.google.com/store/apps/details?id=com.ebizzinfotech.janvajevuingujarati\r\n\r\nApk Links:\r\nhttps://userscloud.com/zh48dobsz47m\r\nhttp://www18.zippyshare.com/v/FIBHi4Kx/file.html\r\nhttps://my.pcloud.com/publink/show?code=XZk62YZLuUolvuuooXIN8FQKLYsI4xR9Qry\r\nhttp://ul.to/hoj7gq8x\r\n\r\nThanks and Regards\r\nChirag Patel\r\n', '2016-05-02 05:22:41', '2016-05-02 05:22:41');
