INSERT INTO `pages` (`id`, `title`, `slug`, `content`, `created_at`, `updated_at`) VALUES
(2, 'Terms Of Use', 'terms-of-use', '<p>All downloads are for personal use only, this site is not responsible\r\n for the contents of them. All downloads are freeware, trial or ad \r\nsupported, if not, write a mail to communicate the technical-problem and\r\n the file will be deleted immediately. The author intended not to use \r\nany copyrighted material for the publication or, if not possible, to \r\nindicate the copyright of the respective object.</p><p><strong>APKearn.Com</strong>\r\n will not be held liable for any damages as a result of the free apps \r\nyou download. We do our best to ensure the safety of our members, that’s\r\n why we scan all the apps with different Antivirus programs before \r\npublishing to make sure that files are 100% safe & secure. If there \r\nis any problem with this download, aside from functionality or usage of \r\nthe work, please report this file to webmaster for review. The author \r\nreserves the right not to be responsible for the topicality, \r\ncorrectness, completeness or quality of the information provided. \r\nLiability claims regarding damage caused by the use of any information \r\nprovided, including any kind of information which is incomplete or \r\nincorrect, will therefore be rejected.</p><p><strong><strong>APKearn</strong>.Com</strong> does\r\n not Warrant, Guarantee or make any representation regarding the use, or\r\n the results of the use, of applications in terms of Correctness, \r\nAccuracy, Reliability, Correctness or otherwise. The entire risk as to \r\nthe results and performance of the downloads is assumed by the end user.<strong> </strong>APKearn.com shall not be liable to end user for any consequential or \r\nincidental damages arising from these free Apps provided on our site. \r\nYou are downloading Applications at your own free will, and that you \r\nassume any and all responsibilities incorporated in doing so.</p><p><strong>Application Removal :</strong><br>\r\n If you are the publisher, developer or author of an app and you wish to\r\n have it removed from EtcAndroid, please send us a message via our <a href="http://apkearn.com/contact-us"><strong><a target="_blank" data-mce-href="http://www.etcandroid.com/contact-us/">Contact form</a></strong></a>\r\n including, your name, company, job title, the title of the software, \r\nand the reason for the take-down request. We will then contact you \r\nwithin 48 hours to verify your identity.</p><p><br></p>', '2015-08-09 19:34:48', '2015-10-12 14:12:48'),
(3, 'Privacy Policy', 'privacy-policy', '<p>The following information is regarding APKearn.Com''s commitment to\r\n protect your privacy. Your privacy is important to APKearn.Com.</p><p><strong>Collection of Personal Information : </strong><br>\r\n Like most standard Web site servers we use log files. This includes \r\ninternet protocol (IP) addresses, browser type, internet service \r\nprovider (ISP), referring/exit pages, platform type, date/time stamp, \r\nand number of clicks to analyze trends, administer the site, track users\r\n movement in the aggregate, and gather broad demographic information for\r\n aggregate use. IP addresses, etc. are not linked to personally \r\nidentifiable information.</p><p><strong>Cookies :</strong><br> Google, \r\nas a third party vendor, uses cookies to serve ads on your site. \r\nGoogle’s use of the DART cookie enables it to serve ads to your users \r\nbased on their visit to your sites and other sites on the Internet. \r\nUsers may opt out of the use of the DART cookie by visiting the <a href="http://www.google.com/privacy_ads.html" target="_blank" data-mce-href="http://www.google.com/privacy_ads.html">Google ad and content network privacy policy</a>.</p><p><strong>Links to third party Websites :</strong><br>\r\n We have included links on this site for your use and reference. We are \r\nnot responsible for the privacy policies on these websites. You should \r\nbe aware that the privacy policies of these sites may differ from our \r\nown.</p><p><strong>Children’s Online Privacy Protection Act Compliance</strong></p><p>We\r\n are in compliance with the requirements of COPPA (Children’s Online \r\nPrivacy Protection Act), we do not collect any information from anyone \r\nunder 13 years of age. Our website, products and services are all \r\ndirected to people who are at least 13 years old or older.</p><p><strong>Changes to this Privacy Statement</strong><br> The contents of this statement may be altered at any time, at our discretion. This policy was last modified on 04/11/2015</p><p><br></p><p><br></p>', '2015-08-09 19:35:09', '2015-10-12 14:10:39'),
(4, ' DMCA Policy', 'dmca-policy', '<p>All the content on APKearn.Com is readily available in various \r\nplaces on the Internet and believed to be in public domain. Content \r\n(including images and videos) posted are believed to be posted within \r\nour rights according to the U.S. Copyright Fair Use Act (Title 17, U.S. \r\nCode.)</p><p><em><strong>Notification of Copyright Infringement</strong></em></p><p>APKearn.com\r\n is in compliance with 17 U.S.C. § 512 and the Digital Millennium \r\nCopyright Act (“DMCA”). It is our policy to respond to any infringement \r\nnotices and take appropriate actions under the Digital Millennium \r\nCopyright Act (“DMCA”) and other applicable intellectual property laws.</p><p>If\r\n your copyrighted material has been posted on APKearn.com or if links\r\n to your copyrighted material are returned through any search engine and\r\n you want this material removed, you must provide a written \r\ncommunication that details the information listed in the following \r\nsection. Please be aware that you will be liable for damages (including \r\ncosts and attorneys’ fees) if you misrepresent information listed on our\r\n site that is infringing on your copyrights. We suggest that you first \r\ncontact an attorney for legal assistance on this matter.</p><p><em><strong>The following elements must be included in your copyright infringement claim:</strong></em></p><ul><li>Provide evidence of the authorized person to act on behalf of the owner of an exclusive right that is allegedly infringed.</li><li>Provide sufficient contact information so that we may contact you. You must also include a valid email address.</li><li>You\r\n must identify in sufficient detail the copyrighted work claimed to have\r\n been infringed and including at least one search term under which the \r\nmaterial appears in APKearn.com search results.</li><li>A statement \r\nthat the complaining party has a good faith belief that use of the \r\nmaterial in the manner complained of is not authorized by the copyright \r\nowner, its agent, or the law.</li><li>A statement that the information \r\nin the notification is accurate, and under penalty of perjury, that the \r\ncomplaining party is authorized to act on behalf of the owner of an \r\nexclusive right that is allegedly infringed.</li></ul><p>Must be signed by the authorized person to act on behalf of the owner of an exclusive right that is allegedly being infringed.</p><p>Send the infringement notice at: <a href="http://apkearn.com/contact-us" data-mce-href="http://etcandroid.com/contact-us/">Contact Us</a><br data-mce-bogus="1"></p><p>Please\r\n allow us a week or two for an email response. Note that emailing your \r\ncomplaint to other parties such as our Internet Service Provider will \r\nnot expedite your request and may result in a delayed response due the \r\ncomplaint not properly being filed. Thanks!</p><p><br></p>', '2015-08-09 19:35:31', '2015-10-12 14:08:59'),
(5, 'About Us', 'about-us', '<p>APKearn.Com is a APK Repository service for the best Android apps & games.</p>\r\n<p>APKearn is dedicated to discovering the newest, featured, or useful \r\napps and games for you. It also give you an entry to download the APK \r\nfile of a free app. With the APK file, you could install it by copying \r\nthe APK file to your SD card of your Android devices.</p>\r\n<p><b>Important Notice</b></p>\r\n<p>Please be aware that <b>APKEARN.COM ONLY SHARE THE ORIGINAL APK FILE FOR FREE APPS</b>. ALL THE APK FILE IS THE SAME AS IN GOOGLE PLAY WITHOUT ANY CHEAT, UNLIMITED GOLD PATCH OR ANY OTHER MODIFICATIONS.</p>\r\n<p><b>Business Cooperation</b></p>\r\n<p>If you are an Android app developer, we can start a business \r\ncooperation by adding and promoting your apps on APKearn.com. Want to \r\npublish or remove your apps on APKearn? Just <a target="_blank" href="http://apkearn.com/contact-us">Contact Us<a target="_blank"> </a></a>now.</p><br><p><b>Disclaimer</b></p>\r\n<ul><li>APKearncom is NOT associated or affiliated with Google, Google Play or Android in any way.</li><li>All the apps & games are property and trademark of their respective developer or publisher.</li><li>All the apps & games in APKearn.com are for HOME or PERSONAL use ONLY.</li><li>The materials on APKearn.com''s web site are provided "as is". APKearn.com makes no warranties, expressed or implied, and hereby \r\ndisclaims and negates all other warranties, including without \r\nlimitation, implied warranties or conditions of merchantability, fitness\r\n for a particular purpose, or non-infringement of intellectual property \r\nor other violation of rights.</li><li>Further, APKearn.com does not warrant or make any representations \r\nconcerning the accuracy, likely results, or reliability of the use of \r\nthe materials on its Internet web site or otherwise relating to such \r\nmaterials or on any sites linked to this site.</li></ul>', '2015-10-02 09:39:22', '2015-10-12 14:17:19');
