(8, 8, 3679, 'Tiny Scanner - PDF Scanner App', 'tiny-scanner-pdf-scanner-app', ' <div jsname="C4s9Ed">Tiny Scanner is a little scanner app that turns android device into a portable document scanner and scan everything as images or PDFs.<p>With this pdf document scanner app you can scan documents, photos, receipts, reports, or just about anything. This pdf document scanner app is lightning fast and gorgeously designed for both phone and tablet.<p>IS THAT A SCANNER IN YOUR POCKET?<p>Tiny Scanner is a pdf document scanner app that turns your mobile into a portable scanner. Scans are saved to your device as images or PDFs. Name and organize your scans into folders, or share them by:<p>- Email<br>- Dropbox, Evernote, Google Drive, OneDrive or Box<br>- Wifi directly to your computer<br>- Send fax from phone via Tiny Fax app<p>This document scanner app has all the BIG features you need:<p>* Scan in color, grayscale, or black &amp; white<br>* Can be used in office, school, home and anywhere else you want<br>* Page edges are detected automatically<br>* 5 levels of contrast for crisp monochrome texts<br>* Set page sizes for PDF (Letter, Legal, A4, and more)<br>* Thumbnail or list view, sort scans by date or title<br>* Tiny Scanner is optimized to run very fast.<br>* Quick search by document title<br>* Protect your documents with a passcode<br>* Universal – a single app that works on phone and tablet too!<p>GOT QUESTIONS? CAN&#39;T FIGURE OUT HOW TO DO SOMETHING?<br>If you have any problem about this scanner app please email us at <a href="mailto:tinyscan.a@appxy.com">tinyscan.a@appxy.com</a>, and we’ll help you figure it out.<p>Follow us on Twitter: @Appxy_official<br>Like us on Facebook: Appxy<br>Follow us on Google+: Appxy</p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/appxy/tinyscanner', 'tiny-scanner-pdf-scanner-app.png', '["tiny-scanner-pdf-scanner-app-0.png","tiny-scanner-pdf-scanner-app-1.png","tiny-scanner-pdf-scanner-app-2.png","tiny-scanner-pdf-scanner-app-3.png","tiny-scanner-pdf-scanner-app-4.png","tiny-scanner-pdf-scanner-app-5.png","tiny-scanner-pdf-scanner-app-6.png"]', 0, 0, '', 'com.appxy.tinyscanner', 'scanner, document, scans, phone, scanner app, document scanner, pdf document, app that, pdf document scanner, app that turns', '', 0, '0.0', 0, 0, 0, 0, '2016-05-17 09:22:23', '2016-05-17 09:22:23', 0),
(9, 8, 3587, 'OfficeSuite + PDF Editor', 'officesuite-pdf-editor', ' <div jsname="C4s9Ed"><b>The latest OfficeSuite is our fastest ever, with drastically improved speed across the entire app and a refreshed design that makes it easier to use than ever!</b><p> • The most downloaded office app on Google Play<br> • Delivers the most exclusive features over any other office app<br> • Installed on 200 million devices in 205 countries and growing<br> • Over 50 million downloads alongside 55,000 daily activations<p>OfficeSuite lets you easily view, edit, and create Word, Excel, and PowerPoint documents, convert to/from PDF, and manage your files all with the most feature-rich mobile office solution available on Android.<br>Preloaded by top manufacturers including Sony, Amazon, Acer, Alcatel, Toshiba, Sharp, YotaPhone, Kyocera and more.<p><b>GOOGLE PLAY EDITORS’ CHOICE</b><br><b>INFOWORLD&#39;S TOP MOBILE OFFICE</b><br><b>LIFEHACKER BEST ANDROID OFFICE APP</b><br><b>PCMAG EDITORS’ CHOICE AWARD </b><p><b>THE LATEST OFFICESUITE IS SPECIALLY DESIGNED AROUND ANDROID M:</b><br> • Create a profile and save your app settings and personalizations across devices<br> • Open multiple documents simultaneously<br> • Create custom headers, footers, and page number options for Word documents<br> • Add freehand drawings over PowerPoint slides<br> • Protect individual sheets and cells in Excel for extra security<br> • Cast presentations across multiple devices on the same network with Share Cast<br> • Use Quick Sign to easily sign a PDF using your digital signature<p><b>KEY FEATURES:</b><br> • View, create and edit complex office documents all from a familiar desktop-style interface<br> • Full compatibility with Microsoft formats including DOC, DOCX, DOCM, XLS, XLSX, XLSM, PPT, PPTX, PPS, PPSX, PPTM, PPSM<br> • Support for PDF files including PDF camera scanning and Export to PDF<br> • Additional support for common formats like RTF, TXT, LOG, CSV, EML, ZIP; (Open Office - ODT, ODS and ODP - support available as in-app purchase)<br> • Integrated with File Commander for quick and easy access to both local and remote files including Recent files, My Documents folders and document templates<br> • Sharing via cloud services like Box, DropBox, Google Drive, OneDrive, Amazon Cloud Drive and SugarSync, as well as over email, Bluetooth and Wi-Fi Direct<br> • PDF security and editing features including digital signatures support, permissions management, text to PDF, and annotations<br> • Available in 56 languages<p><b>ALSO AVAILABLE AS PART OF OFFICESUITE PREMIUM: </b><br> • Security features - work with password protected files<br> • Export PDF to Word, Excel, or ePub and convert any file to PDF<br> • Track changes with multiple author support<br> • <b>QuickPDF Scanner</b> - easily scan documents and images with your camera<br> • <b>PhotoSuite Professional</b> - MobiSystems&#39; powerful photo editing app<br> • <b>QuickWrite predictive keyboard</b> - quicken your typing based on usage patterns<br> • <b>Microsoft Compatibility Font Pack</b> - view documents the way they&#39;re meant to be seen<br> • <b>Spell check</b> - make sure your important documents are error free<br> • Look up words with the Oxford dictionary of English add-on<br> • Legacy Microsoft document formats support (.DOC, .XLS, .PPT) along with .ODF formats<p>OfficeSuite granted permissions- <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.mobisystems.com/android_office/full-features.html%2523permissions%26sa%3DD%26usg%3DAFQjCNEIvCHBNYI7BXGFayNyJRihOs5s9A&amp;sa=D&amp;usg=AFQjCNEgxKux8l9IOTEeASMSljylaBCrGw" target="_blank">http://www.mobisystems.com/android_office/full-features.html#permissions</a><br>Extension for Sony SmartBand, SmartWatch 2, SmartWatch 3.<br>Control presentations in OfficeSuite from your SONY SMARTWATCH 2/3 by sliding left and right to move between slides.<br>Manage OfficeSuite presentations with SONY SMARTBAND.<br>SMARTBAND TALK: Use volume up/down to change slides, tap on touch screen to display animations. Slide notes will display on screen.<br>Chromecast dual screen support</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/mobisystems/office', 'officesuite-pdf-editor.png', '["officesuite-pdf-editor-0.png","officesuite-pdf-editor-1.png","officesuite-pdf-editor-2.png","officesuite-pdf-editor-3.png","officesuite-pdf-editor-4.png","officesuite-pdf-editor-5.png","officesuite-pdf-editor-6.png"]', 0, 2, '', 'com.mobisystems.office', 'office, documents, support, including, the most, support for, files including, android office, the latest officesuite', '', 1, '4.5', 2, 0, 0, 0, '2016-05-17 09:22:31', '2016-05-19 06:47:37', 0),
(10, 8, 15830, 'JobStreet', 'jobstreet', ' <div jsname="C4s9Ed">With over 230,000+ employers across Singapore, Malaysia, Philippines, Indonesia, and Vietnam in our database, you can search, apply to and get notified on your dream job opening anytime, anywhere!<p>Key features:<br>• Never miss better career opportunities<br>  - Get ahead of your competition on new job openings with LiNa Job Matches’ mobile notification<br>  - Be updated with personalized job matches even while on the go<br>• Find jobs that match your preferred location and salary<br>• Apply to the job vacancy you want instantly<br>• Stay updated with your job applications<br>  - Get notified when employers start reviewing your application<br>  - Respond to interview invites quickly<br>• Create and update resume easily</p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/jobstreet/jobstreet', 'jobstreet.png', '["jobstreet-0.png","jobstreet-1.png","jobstreet-2.png","jobstreet-3.png","jobstreet-4.png"]', 0, 0, '', 'com.jobstreet.jobstreet', 'updated, notified, apply, employers, updated with, get notified', '', 0, '0.0', 0, 0, 0, 0, '2016-05-17 09:22:35', '2016-05-17 09:22:35', 0),
