(14, 9, 4544, 'Spottoon -Webtoon/Anime Viewer', 'spottoon-webtoonanime-viewer', ' <div jsname="C4s9Ed">Stop, Spot and Scroll! <p>Fans of Webtoons, online comics, anime, manga and e-books have found a new home with Spottoon where the best online stories can be found!<p>Read ‘CAT AND DOG’ by Hee-Jung Park to find out if an arranged marriage between a country girl and a famous actor can last! Wanna find out more romance stories? We recommend ‘MY BEAUTIFUL WORLD’, and ‘SHALL WE HAVE DINNER TONIGHT.’<p>Ever wondered what happens to the creatures you kill in massive multiplayer online games (MMO or MMOG)? Find out the answer from ‘I AM MOB’ by Zephy<p>Into mystery? See how a young boy and a girl are torn apart due to secrets, death and betrayal in THE PALE HORSE! <p>Cats are always wise! Learn life lessons from the sassy but lovable cat, Gill from ‘THE HOUSE CAT’ which was recently made into a Korean Drama. <p>Find out about imaginative fantasy worlds in the SOCK MONSTER, MYOJIN TALES and HONGDO! <br>Or how about ‘HE IS A HIGHSCHOOL GIRL’ if you love comedies. <p><br>Don’t miss out on any of the most thrilling and heart-racing stories by downloading the free app where all these stories are collected all in one place, giving you instant access to thousands of episodes on iOS devices or on the web.    <br> <br>ARE YOU READY FOR THE ADRENALINE RUSH?<br> <br>Connect with us:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/spottoon%26sa%3DD%26usg%3DAFQjCNG6hNXR7z74jp0G2dDdLAWC0jAQvQ&amp;sa=D&amp;usg=AFQjCNGkPhA6VeS-XE9XIGcUYsMQLe4kOA" target="_blank">https://www.facebook.com/spottoon</a><br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://spottoon.tumblr.com/%26sa%3DD%26usg%3DAFQjCNHYaRCe_WTSwKwaCG_KJMB6F9TY7A&amp;sa=D&amp;usg=AFQjCNE-Y01BHPfJlPICEaOO6oymJ12DUg" target="_blank">http://spottoon.tumblr.com/</a></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/rollingstory/spottoon', 'spottoon-webtoonanime-viewer.png', '["spottoon-webtoonanime-viewer-0.png","spottoon-webtoonanime-viewer-1.png","spottoon-webtoonanime-viewer-2.png","spottoon-webtoonanime-viewer-3.png","spottoon-webtoonanime-viewer-4.png"]', 0, 0, '', 'com.rollingstory.spottoon', 'stories, online, found, spottoon, find out', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:11:48', '2016-05-18 01:11:48', 0),
(15, 9, 3077, 'LINE WEBTOON - FREE Comics', 'line-webtoon-free-comics', ' <div jsname="C4s9Ed">LINE WEBTOON - A New Way To Enjoy Comics on Mobile <br> <br>LINE Webtoon service is a fun digital content service in which readers can view new content scheduled to be revealed every day of the week for free and conveniently enjoy webtoons on mobile devices.<p>Download LINE Webtoon and get started right away! <br> <br>Main Features:<p>Scheduled publishing: Seven(7) to ten(10) webtoons are serially-updated every day of the week.<br> <br>Mobile-optimized view (scroll-view mode):<br>- All webtoons are provided in a pageless format to fit better on mobile phones and tablets.<br>- You can scroll down at the speed as you want. You have total control over the speed of reading.<p>Language option: The content is offered in five(5) language options, English, Chinese (traditional, simplified), Thai and Indonesian.<p>Minimal data use: You can download webtoons to read them later offline (without an internet connection).<br> <br>Push notification: Receive notifications of new releases or updates for your subscriptions.<br>Share &amp; comment: Share your favorite webtoons via social media (Facebook, Twitter, LINE) and leave comments.<br> <br> If any problems are found, please report them to our Customer Service ( <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://me2.do/F7OPdSTJ%26sa%3DD%26usg%3DAFQjCNGeVDNreenrOVGiJ7fTTm_JOeV4WA&amp;sa=D&amp;usg=AFQjCNFVLVnsHwQuLtSKkDR3SOp_yMi18A" target="_blank">http://me2.do/F7OPdSTJ</a> ).<br>We might not be able to respond promptly to customer reviews.</p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/naver/linewebtoon', 'line-webtoon-free-comics.png', '["line-webtoon-free-comics-0.png","line-webtoon-free-comics-1.png","line-webtoon-free-comics-2.png","line-webtoon-free-comics-3.png","line-webtoon-free-comics-4.png","line-webtoon-free-comics-5.png","line-webtoon-free-comics-6.png"]', 0, 0, '', 'com.naver.linewebtoon', 'webtoons, webtoon, mobile, content, you can, the speed, webtoons are, the week', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:11:52', '2016-05-18 01:11:52', 0),
(16, 9, 2368, 'Marvel Comics', 'marvel-comics', ' <div jsname="C4s9Ed">Introducing the MARVEL COMICS app on Android, featuring the world’s most popular super heroes! Download hundreds of comic books featuring your favorite characters -— including Iron Man, Thor, Captain America, Spider-Man, Wolverine and more -- on your mobile device or tablet with the touch of a button. You’ll experience Marvel’s greatest series and stories like never before, with your choice of guided view (an animated, panel-by-panel path through the comic), or by using regular device controls to zoom and pan your way through pages of sizzling story and amazing artwork!<p>Each of your downloads will be protected and backed up when you use your Marvel.Com account, meaning the next time you lose or upgrade your device you’ll find your comics waiting to be read again!<p>Not convinced? Check out our free downloads! Take the Marvel Universe with you anytime &amp; anywhere!<p>+ Access to over 13,500 comics featuring the world&#39;s most popular super heroes!<br>+ Free comics for download, updated weekly!<br>+ Customizable reading experience -- choose between panel to panel, full page display, and more!</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/marvel/comics', 'marvel-comics.png', '["marvel-comics-0.png","marvel-comics-1.png","marvel-comics-2.png","marvel-comics-3.png","marvel-comics-4.png","marvel-comics-5.png","marvel-comics-6.png"]', 0, 0, '', 'com.marvel.comics', 'panel, comics, device, featuring, super heroes, and more, popular super, most popular, popular super heroes, most popular super', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:11:55', '2016-05-18 01:11:55', 0),
(17, 10, 638, 'WhatsApp Messenger', 'whatsapp-messenger', ' <div jsname="C4s9Ed">WhatsApp Messenger is a FREE messaging app available for Android and other smartphones. WhatsApp uses your phone&#39;s Internet connection (4G/3G/2G/EDGE or Wi-Fi, as available) to let you message and call friends and family. Switch from SMS to WhatsApp to send and receive messages, calls, photos, videos, documents, and Voice Messages. <p>WHY USE WHATSAPP: <p>• NO FEES: WhatsApp uses your phone&#39;s Internet connection (4G/3G/2G/EDGE or Wi-Fi, as available) to let you message and call friends and family, so you don&#39;t have to pay for every message or call.* There are no subscription fees to use WhatsApp.<p>• MULTIMEDIA: Send and receive photos, videos, documents, and Voice Messages.<p>• FREE CALLS: Call your friends and family for free with WhatsApp Calling, even if they&#39;re in another country.* WhatsApp calls use your phone&#39;s Internet connection rather than your cellular plan&#39;s voice minutes. (Note: Data charges may apply. Contact your provider for details. Also, you can&#39;t access 911 and other emergency service numbers through WhatsApp). <p>• GROUP CHAT: Enjoy group chats with your contacts so you can easily stay in touch with your friends or family.<p>• WHATSAPP WEB: You can also send and receive WhatsApp messages right from your computer&#39;s browser.<p>• NO INTERNATIONAL CHARGES: There&#39;s no extra charge to send WhatsApp messages internationally. Chat with your friends around the world and avoid international SMS charges.* <p>• SAY NO TO USERNAMES AND PINS: Why bother having to remember yet another username or PIN? WhatsApp works with your phone number, just like SMS, and integrates seamlessly with your phone&#39;s existing address book. <p>• ALWAYS LOGGED IN: With WhatsApp, you&#39;re always logged in so you don&#39;t miss messages. No more confusion about whether you&#39;re logged in or logged out. <p>• QUICKLY CONNECT WITH YOUR CONTACTS: Your address book is used to quickly and easily connect you with your contacts who have WhatsApp so there&#39;s no need to add hard-to-remember usernames.<p>• OFFLINE MESSAGES: Even if you miss your notifications or turn off your phone, WhatsApp will save your recent messages until the next time you use the app.<p>• AND MUCH MORE: Share your location, exchange contacts, set custom wallpapers and notification sounds, email chat history, broadcast messages to multiple contacts at once, and more!<p>*Data charges may apply. Contact your provider for details. <p>--------------------------------------------------------- <br>We&#39;re always excited to hear from you! If you have any feedback, questions, or concerns, please email us at: <p><a href="mailto:android-support@whatsapp.com">android-support@whatsapp.com</a> <p>or follow us on twitter: <p><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://twitter.com/WhatsApp%26sa%3DD%26usg%3DAFQjCNGBaaHUeDzDvSx0kIT_i3yFZ-nz7A&amp;sa=D&amp;usg=AFQjCNGpEeecjHyrd6wazu_nagnIrMHkbw" target="_blank">http://twitter.com/WhatsApp</a><br>@WhatsApp<br>---------------------------------------------------------</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/whatsapp', 'whatsapp-messenger.png', '["whatsapp-messenger-0.png","whatsapp-messenger-1.png","whatsapp-messenger-2.png","whatsapp-messenger-3.png","whatsapp-messenger-4.png","whatsapp-messenger-5.png","whatsapp-messenger-6.png"]', 0, 0, '', 'com.whatsapp', 'whatsapp, messages, friends, contacts, with your, your phone&, friends and, your friends, with your contacts, apply contact your', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:12:02', '2016-05-18 01:12:02', 0),
(18, 10, 555, 'Messenger', 'messenger', ' <div jsname="C4s9Ed">Instantly reach the people in your life—for free. Messenger is just like texting, but you don&#39;t have to pay for every message (it works with your data plan).<p>Not just for Facebook friends: Message people in your phone book and just enter a phone number to add a new contact.<p>Group chats: Create groups for the people you message most. Name them, set group photos and keep them all in one place.<p>Photos and videos: Shoot videos and snap selfies or other photos right from the app and send them with one tap.<p>Chat heads: Keep the conversation going while you use other apps. <p>Free calls: Talk as long as you want, even with people in other countries. (Calls are free over Wi-Fi. Otherwise, standard data charges apply.)<p>Even more ways to message: <br>Bring your conversations to life with stickers. <br>Preview your gallery photos and videos without leaving the conversation--then choose the perfect ones to send.<br>Record voice messages when you have more to say.<p>Extra features:<br>Know when people have seen your messages.<br>Forward messages or photos to people who weren&#39;t in the conversation.<br>Search for people and groups to quickly get back to them.<br>Turn on location to let people know when you&#39;re nearby.<br>See who&#39;s available on Messenger and who&#39;s active on Facebook. <br>Create shortcuts to get to any conversation right from your home screen.<br>Turn off notifications when you&#39;re working, sleeping or just need a break.<br>Stay logged in so you never miss a message.</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/facebook/orca', 'messenger.png', '["messenger-0.png","messenger-1.png","messenger-2.png","messenger-3.png","messenger-4.png","messenger-5.png","messenger-6.png"]', 0, 0, '', 'com.facebook.orca', 'people, photos, message, conversation, the conversation, photos and, know when, when you&', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:12:07', '2016-05-18 01:12:07', 0),
(19, 10, 6172, 'imo free video calls and chat', 'imo-free-video-calls-and-chat', ' <div jsname="C4s9Ed">Message and video chat with your friends and family for free, no matter what device they are on!<p>- Send unlimited messages and make free video and voice calls over your 2G, 3G, 4G or Wi-Fi connection*<br>- Make high-quality video and voice calls<br>- Group chat with friends, family, roommates and others<br>- Share photos and videos<br>- Express yourself with hundreds of free stickers!<br>- Encrypted chats and calls<br>- Optimized for Android tablets<br>- Avoid SMS and phone call charges<p>*Data charges may apply. Contact your provider for details.</p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/imo/android/imoim', 'imo-free-video-calls-and-chat.png', '["imo-free-video-calls-and-chat-0.png","imo-free-video-calls-and-chat-1.png"]', 0, 0, '', 'com.imo.android.imoim', 'video, calls, voice, family, voice calls, and voice, video and, chat with, and voice calls', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:12:10', '2016-05-18 01:12:10', 0),
(20, 10, 8176, 'WeChat', 'wechat', ' <div jsname="C4s9Ed">&quot;Much better, much more popular, much more user-friendly” - USA Today<br>&quot;Simple enough that anyone can use it, versatile enough that everyone has some use for it&quot; - Wired<p>WeChat is a messaging and calling app that allows you to easily connect with family &amp; friends across countries. It&#39;s the all-in-one communications app for text (SMS/MMS), voice and video calls, Moments, photo sharing, and games.<p>WHY USE WECHAT:<br>• NEW! WECHAT OUT CALLS: Make calls to landlines and mobile around the globe at low rates (in certain regions only).<br>• MULTIMEDIA MESSAGING: Send video, image, text, and voice messages.<br>• GROUP CHAT &amp; CALLS: Create group chats with up to 500 people and group video calls up to 9 people.<br>• FREE VOICE &amp; VIDEO CALLS: High-quality free calls to anywhere in the world.<br>• STICKER GALLERY: Hundreds of free, fun, animated stickers to express your feelings from some of your favorite cartoons and movies.<br>• MOMENTS: Share your best moments on your personal photo stream.<br>• BETTER PRIVACY: WeChat gives you the highest level of control over your privacy. It&#39;s the only messaging app to be certified by TRUSTe.<br>• MEET NEW FRIENDS: Use “Friend Radar”, “People Nearby” and “Shake” to meet others. <br>• REALTIME LOCATION: Instead of having to tell others where you are, just use real-time location sharing.<br>• LANGUAGE SUPPORT: Localized in 20 different languages and can translate messages to any language.<br>• AND MORE: Desktop app, custom wallpapers, custom notifications, and Official Accounts.</p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/tencent/mm', 'wechat.png', '["wechat-0.png","wechat-1.png","wechat-2.png","wechat-3.png","wechat-4.png","wechat-5.png","wechat-6.png"]', 0, 0, '', 'com.tencent.mm', 'calls, video, messaging, group, video calls, enough that, much more', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:12:16'