<p>Enjoy!</p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/surpax/ledflashlight/panel', 'super-bright-led-flashlight.png', '["super-bright-led-flashlight-0.png","super-bright-led-flashlight-1.png","super-bright-led-flashlight-2.png","super-bright-led-flashlight-3.png"]', 0, 0, '', 'com.surpax.ledflashlight.panel', 'flashlight, bright, blinking, supported, blinking mode, strobe blinking, bright flashlight, super bright, strobe blinking mode', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:16:40', '2016-05-18 01:16:40', 0),
(83, 23, 535, 'Google Docs', 'google-docs', ' <div jsname="C4s9Ed">Create, edit, and collaborate with others on documents from your Android phone or tablet with the free Google Docs app. With Google Docs you can:<p>- Create new documents or edit any that were created on the web or on another device.<br>- Share documents and work together with others in the same document at the same time.<br>- Open, edit, and save Microsoft Word documents.<br>- Get stuff done anytime -- even without an internet connection.<br>- Add and respond to comments.<br>- Never worry about losing your work -- everything is automatically saved as you type.</p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/google/android/apps/docs/editors/docs', 'google-docs.png', '["google-docs-0.png","google-docs-1.png","google-docs-2.png","google-docs-3.png","google-docs-4.png","google-docs-5.png"]', 0, 0, '', 'com.google.android.apps.docs.editors.docs', 'documents, google, others, create, the same, google docs, with others, edit and', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:16:44', '2016-05-18 01:16:44', 0),
(84, 23, 535, 'Google Sheets', 'google-sheets', ' <div jsname="C4s9Ed">Create, edit, and collaborate with others on spreadsheets from your Android phone or tablet with the free Google Sheets app. With Google Sheets you can:<p>- Create new spreadsheets or edit any that were created on the web or on another device.<br>- Share spreadsheets and work together with others in the same spreadsheet at the same time.<br>- Open, edit, and save Microsoft Excel files.<br>- Get stuff done anytime -- even without an internet connection.<br>- Format cells, enter/sort data, view charts, insert formulas, use find/replace, and more.<br>- Never worry about losing your work -- everything is automatically saved as you type.</p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/google/android/apps/docs/editors/sheets', 'google-sheets.png', '["google-sheets-0.png","google-sheets-1.png","google-sheets-2.png","google-sheets-3.png","google-sheets-4.png"]', 0, 0, '', 'com.google.android.apps.docs.editors.sheets', 'spreadsheets, sheets, google, create, the same, google sheets, with others, edit and', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:16:48', '2016-05-18 01:16:48', 0),
(85, 23, 584, 'Microsoft Outlook', 'microsoft-outlook', ' <div jsname="C4s9Ed">“Its Outlook app for iOS and Android is the best mobile email app, no matter what phone you’re using. It’s better than Mail, better than Gmail.” - WIRED<p><br>Meet Outlook for Android, the app that helps millions of users connect all their email accounts, calendars and files in one convenient spot. Newly redesigned, Outlook for Android lets you do more from one powerful inbox. <p>See what matters most first with the Focused inbox that keeps the important messages on top. Switch between your emails and calendar to schedule your next meeting or share your availability with just a few taps. Or grab a document from your Files list and attach it to an email seamlessly. <p>With everything you need only a tap away, managing your busy days is now easier than ever. <p>Outlook for Android works with Microsoft Exchange, Office 365, Outlook.com, Gmail and Yahoo Mail.<p>------------------------------<p>Here’s what you’ll love about Outlook for Android:<p>•	Seamless inbox management with a focused inbox that displays your most important messages first, swipe gestures and smart filters. <p>•	Easy access to calendar and files right from your inbox. <p>•	Features to work on the go, like Word, Excel and PowerPoint integrations.</p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/microsoft/office/outlook', 'microsoft-outlook.png', '["microsoft-outlook-0.png","microsoft-outlook-1.png","microsoft-outlook-2.png","microsoft-outlook-3.png","microsoft-outlook-4.png","microsoft-outlook-5.png","microsoft-outlook-6.png"]', 0, 0, '', 'com.microsoft.office.outlook', 'outlook, inbox, android, email, outlook for, for android, important messages, from your, focused inbox that', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:16:53', '2016-05-18 01:16:53', 0),
(86, 24, 15854, 'Maki-San', 'maki-san', ' <div jsname="C4s9Ed">Maki-San is your VIP pass to delicious food without waiting in lines at your favorite restaurant. The app will geo-locate the restaurant near you so you can order ahead, pay in advance and skip those annoying lines at your favorite restaurant. Maki-San is powered by TabSquare, and allows you to place take-away orders at a nearby Maki-San restaurant in just a matter of seconds. <p><br>Some of the cool features of Maki-San <p>-Easily locate the Maki-San restaurant near you <p>-Order ahead your favourite items and cut the Queues <p>- Make secure transactions using your Credit or Debit Card<p>Why you&#39;ll love it:   <p>· Avoid lines!</p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/tabsquare/makisan', 'maki-san.png', '["maki-san-0.png","maki-san-1.png"]', 0, 0, '', 'com.tabsquare.makisan', 'restaurant, lines, ahead, order, maki san, order ahead, san restaurant, near you, your favorite restaurant', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:17:09', '2016-05-18 01:17:09', 0),
(87, 24, 6864, 'OLX Arabia', 'olx-arabia', ' <div jsname="C4s9Ed">- dubizzle is now OLX!<br>- Sell your unwanted items quickly and easily straight from your phone.<br>- Manage or edit your ads while on the move.<br>- Customize your searches with our advanced searches.<br>- Share your ads directly with your friends on Facebook and Twitter.<br>- Find local ads in your city or neighborhood and call or email the seller instantly.<br>- Awesomeness – unconfirmed sources have reported that the OLX app has antidepressant properties, let’s you walk on water and type double as fast but we’ll get back to you on that. <p>Need to find something on the move? No worries, buying and selling is now at your fingertips with the OLX app! Download the number one classifieds website app to buy a house, sell a car or find a job in Egypt, Saudi Arabia, Qatar, Oman, Lebanon, Jordan, Tunisia, Algeria, Bahrain and Kuwait.<br>Classifieds:<br>Declutter by selling your unused home furniture or buy new furniture to revamp your place! Find the latest electronics, smartphones and iPads or browse thousands of ads for collectibles, books, sporting gear and fashion items!<br>Apartments/Villas:<br>Look for an apartment or a villa in your favorite neighborhood with our property finder – sit back while we identify the newest homes and properties for rent and for sale that match your search criteria.<br>Cars:<br>Need to buy a new ride? If so, check our Motors section to find new or used cars for sale that make your heart go ‘vroom vroom’!<br>Jobs:<br>Thinking about a career change? Find jobs in Egypt, Saudi Arabia, Qatar, Oman, Lebanon, Jordan, Tunisia, Algeria, Bahrain and Kuwait and apply today for free! Search for the latest job offers and vacancies and find what suits your expertise.</p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/olxmena/horizontal', 'olx-arabia.png', '["olx-arabia-0.png","olx-arabia-1.png","olx-arabia-2.png","olx-arabia-3.png","olx-arabia-4.png"]'