(88, 24, 6416, 'Myntra Online Shopping App', 'myntra-online-shopping-app', ' <div jsname="C4s9Ed">Swipe, select and shop! It’s fashion on the go with the all-new Myntra mobile app. Take the world of online shopping with you everywhere you go and get all your favorite fashion merchandise by top brands.<p>Browse through 2,30,000+ product styles from 1600+ brands instantly on the Myntra shopping app <p>Discover the latest trends in lifestyle and shop for clothes, Kurtis, sarees, shoes, T-shirts, jackets, jeans, bags, skirts, dresses, jewelry, watches, wallets, footwear, home furniture and much more. With the app, you have access to free styling tips from our fashion experts, and hot offers and deals on all your favorite products.<p>Get the best online shopping experience with Myntra’s cool new app that offers you FREE Shipping , 30-day hassle-free returns guarantee, and a convenient cash-on-delivery option. <p>The online collection of products across categories includes:<p>•Men&#39;s shopping - FastTrack watches, suits, shoes for men, watch, puma shoes, Casio watches, lee cooper shoes, watches for men, t-shirts for men, t-shirts for men, shirts for men<p>• Women&#39;s shopping - saree, sari, lehenga saree, Anarkali dresses, ladies watches, jumpsuit, watches for women, sarees online, kurti, tops, handbags online, online saree shopping. <p>• Kid&#39;s shopping - tops for girls, earrings for girls, sandals for girls, girls tops, kids dresses, shoes for girls, bracelets for girls, bags for girls,  online shopping for kids, kids shoes, girls dresses, girls watches<p>• Home furniture - Bedsheets, cushion covers, blankets, towels, curtains, cushions, pillow covers, bath rugs, swayam, spaces, raymond, portico.<p>APP FEATURES:<p>• Find products you love: Choose from a vast collection of clothes, dresses, shoes, and fashion accessories for men, women, teens and kids.<br>• Refine your search based on popularity, discount, prices, colors, sizes and more using sort and filter features.<br>• Avail massive discounts: Easily add your Myntra coupon code directly in the app. Also, get notifications on best deals and offers.<br>• Shop for premium, designer, and international brands<br>• Fast and Secure Checkout: Pay by cash-on-delivery, net-banking, or credit and debit cards options.<br>• View detailed product information with rich images and style notes from our fashion editors<br>• Log in seamlessly using Facebook and Google<br>• Promise of timely delivery backed by Flipkart&#39;s delivery network<br>• Wishlist &amp; Collections: Save stuff for later by adding to your wishlist straight from the app.<br>• Sharing made easy: Get style suggestions from your friends by sharing on WhatsApp, Facebook, Twitter, and email.<br>• Post shots of how cool you look, and get the community to express their likes<p>IMPORTANT NOTE REGARDING PERMISSIONS:<p>Please note that Myntra requires following permissions to enable specific features and give you the right experience:<br>•	Accounts: Account permissions are used for integration with Facebook and Google+ you have connected to your device to allow quick login<br>•	Receive/ Read SMS: To auto fill OTP for a frictionless mobile transaction<br>•	Contacts: To help you build your own fashion network by finding your friends and family on Myntra<br>•	Location: To serve you geo-targeted content &amp; offers<p><br>PRODUCT DESCRIPTION<br>Get the best online shopping experience with Myntra’s cool new app that offers you FREE Shipping, 30-day hassle-free returns guarantee, and a convenient cash-on-delivery option.<br>Browse through 2,50,000+ product styles from 2000+ brands instantly on the Myntra shopping app. Discover the latest trends in lifestyle and shop for clothes, Kurtis, sarees, shoes, t-shirts, jackets, jeans, bags, skirts, dresses and much more. <br>With the app, you have access to free styling tips from our fashion experts, and hot offers and deals on all your favorite products.<p>Feedback is always welcome. Drop us a line at <a href="mailto:appfeedback@myntra.com">appfeedback@myntra.com</a><br>If you face any issues in installing/ upgrading the app, head here: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.myntra.com/faqs%2523installUpdateQueries%26sa%3DD%26usg%3DAFQjCNFywkwvGNgqzyTKVgM6WHY2BDGL8w&amp;sa=D&amp;usg=AFQjCNHWV5byTdjKBniJU4q6Lt52N_unIg" target="_blank">http://www.myntra.com/faqs#installUpdateQueries</a></p></p></p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/myntra/android', 'myntra-online-shopping-app.png', '["myntra-online-shopping-app-0.png","myntra-online-shopping-app-1.png","myntra-online-shopping-app-2.png","myntra-online-shopping-app-3.png","myntra-online-shopping-app-4.png","myntra-online-shopping-app-5.png","myntra-online-shopping-app-6.png"]', 0, 0, '', 'com.myntra.android', 'shopping, girls, online, shoes, for girls, the app, for men, online shopping, all your favorite, best online shopping', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:17:14', '2016-05-18 01:17:14', 0),
