(91, 25, 1338, 'Live Map Caller Locator', 'live-map-caller-locator', ' <div jsname="C4s9Ed">Are you get frustrated with unknown callers? Sometimes you talk to anyone on mobile and you do not know from where the person was or you want to track the caller location. Here is Out of the Box solution for you.<p>Now track each and every call on your mobile on google maps. And its offline, no internet required to track.<p>App tracks all numbers for USA, India, Indonesia, Thailand, Saudi Arabia, Pakistan, Bangladesh &amp; Myanmar<p>★★Features★★<br>- Enter any phone number and get the information about who is calling you including location, service provider, GSM or CDMA etc.<br>- Content used in such a way that you can get information offline , its a total win win solution for you.<br>- Get number directly from your call logs and phonebook contacts<br>- Check the location on Google map<br>- GOOD NEWS: No internet connection required to fetch caller information but to check on map internet will be required. Only phone information is shown offline map works in online mode, Obviously :)<br>- Caller Number and Name speaker<br>- Most of the content already stored in database.<br>- SMS with caller detail announcer<br>- Caller location, caller name, service provider is shown on call incoming screen on each call.<br>- No social media involvement. But if you want like us on social media to encourage us, please go ahead.<br>- Its a guru of all tracking app.<br> <br>Version 3.0<br>* Caller Information Tracker: App tracks caller information and location on every incoming call and show it on calling screen with caller name, location, service provider etc so you can decide if you want to pick the call and not<br>* Call Speaker: App speaks caller number or name on every incoming call. If you are busy then you can listen who is calling and pick it if its urgent.<br>* SMS Speaker: App announce complete sms and its sender name.<br>* Direct database content - whenever call comes, app ping the db and show you the mobile number location and service provider.<p>Version 2.0<br>* A fast calling feature introduced. It shows all you frequent calls on top in green color so you can immediate call or text those friends or relatives.<br>* Designed completely changed and easy to use<p>Version 1.1<br>- BLOCK: Now you can block spam callers or anyone who is disturbing you. Its really interesting feature.<br>- Calls and text sms both can be blocked<p>Please do not forget to rate us if you find the app useful for you and make it the guru of all tracking apps.</p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/iplay/mobiletracker/location/livemap', 'live-map-caller-locator.png', '["live-map-caller-locator-0.png","live-map-caller-locator-1.png","live-map-caller-locator-2.png","live-map-caller-locator-3.png","live-map-caller-locator-4.png","live-map-caller-locator-5.png","live-map-caller-locator-6.png"]', 0, 0, '', 'iplay.mobiletracker.location.livemap', 'caller, location, information, calling, you can, service provider, you want, for you, every incoming call, location service provider', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:17:28', '2016-05-18 01:17:28', 0),
(92, 25, 15855, 'Fridae - LGBT Asia', 'fridae-lgbt-asia', ' <div jsname="C4s9Ed">The Fridae Mobile Dating App - Empowering LGBT Asia<p>The Fridae App, for the Asian Lesbian, Gay, Bi and Trans Community all over the world.<p>Founded in 2002, Fridae was one of the first Asian LGBT dating services available online. The Fridae Android app allows members to:<p>Find people close to you - Listing 100 members for free<br>Filter results based on a number of different criteria including Age, Location and Interests.<br>Send and receive unlimited chat messages<br>Send A Heart to start the conversation<br>Upload multiple pictures<br>See the last 20 message history per person.<br>Record Favourites - Up to 20 members<br>Block Members - Up to 20 members<br>Record your Hot List - Up to 20 members<br>See tracks from the last 24 hours<p>Perks membership is available for one week, one month, 3 months, 6 months and one year. Upgrade your membership to “Perks”  and be able to:<br>See more profiles - up to 200 members<br>Save more hearts - Up to 100<br>Hide your tracks<br>Browse in invisible mode<br>Upload pictures to a private vault - Give selected members access<br>Have unlimited Favourites and Hot List Members<br>Block unlimited number of profiles<br>See tracks from the last 6 Days.<p>The Fridae Android app is updated on a regular basis and new functionality is constantly being added. Check back soon and see what new features are available.<p>Fridae App is developed by DragonStack www.dragonstack.com</p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/dragonstack/fridae', 'fridae-lgbt-asia.png', '["fridae-lgbt-asia-0.png","fridae-lgbt-asia-1.png","fridae-lgbt-asia-2.png","fridae-lgbt-asia-3.png","fridae-lgbt-asia-4.png","fridae-lgbt-asia-5.png","fridae-lgbt-asia-6.png"]', 0, 0, '', 'com.dragonstack.fridae', 'fridae, members, available, unlimited, the last, the fridae, tracks from, from the, the fridae android', '', 0, '0.0', 0, 0, 0, 