(99, 26, 14621, 'Cricbuzz Cricket Scores &amp; News', 'cricbuzz-cricket-scores-amp-news', ' <div jsname="C4s9Ed">Welcome to the most preferred destination to follow Live Cricket Scores and everything else related to Cricket.<p>Trending Now: IPL 2016. (Indian Premier League)<p><br>Introduction:<p>- The No. 1 Sports App on Google Play.<br>- Most highly rated Sports App on Google Play<br>- Complete coverage of all International cricket, ICC World Cup, ICC World T20, IPL, Champions League T20, Big Bash, CPL, Natwest T20 Blast and other major cricket tournaments. Tons of domestic cricket coverage too. <br>- If you would like to follow cricket in Indian Languages (Hindi, Tamil, Kannada, Telugu, Marathi and Bengali are currently supported), please check out our new App &quot;Cricbuzz - In Indian Languages&quot;.<p><br>Top Features:<p>    Live cricket score updates and ball by ball text commentary that helps you visualize the action.<br>    Match Timelines and Twitter Timelines in the Commentary page (Match Center)<br>    Match alerts via push notification service - so that you don&#39;t miss THE moment<br>    Latest cricket news and editorials - to keep you posted on the latest happenings.<br>    Current Matches page - To help you follow all live matches in one place.<br>    Upcoming matches - what&#39;s up for tomorrow, next week, next month?<br>    Series Home - Complete coverage of any major series/tournament in one place.<br>    Results of recent matches - in case you want to look at the scorecard of a game that you recently missed.<br>    Series Stats and Overall Records - for the ones obsessed with numbers<br>    Photos - because a picture is worth a thousand words and all that.<br>    Differential sized Widgets - Bringing the game onto your home-screen. <br>    Player profiles - Cricket is all about the players - runs, wickets and everything else.<br>    Player and Team Rankings for ODIs, Tests, and T20Is.<br>    Points tables for all major tournaments - Which team is at the top and who will get knocked out?<br>    Share the score - Give score updates via sms/email or share the scores of Facebook/Twitter.<br>    Cricket On Twitter: Follow your favorite cricketers and commentators on Twitter.<br>    Cricket Videos (BETA): For select series and countries only at this point of time.</p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/cricbuzz/android', 'cricbuzz-cricket-scores-amp-news.png', '["cricbuzz-cricket-scores-amp-news-0.png","cricbuzz-cricket-scores-amp-news-1.png","cricbuzz-cricket-scores-amp-news-2.png","cricbuzz-cricket-scores-amp-news-3.png","cricbuzz-cricket-scores-amp-news-4.png","cricbuzz-cricket-scores-amp-news-5.png","cricbuzz-cricket-scores-amp-news-6.png"]', 0, 0, '', 'com.cricbuzz.android', 'cricket, matches, twitter, series, that you, score updates, one place, share the, and everything else', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:18:01', '2016-05-18 01:18:01', 0),
