fficults levels ranging from Beginner to Expert bubble shooter. <p>3 game modes versions - brain trainer &amp; attention focus training - ways to become a stars! You can challenge yourself in expert mode or choose to just lay back &amp; relax while solving your puzzles in easy &amp; medium modes . In medium mode, you have 5 seconds to take your decision. In expert mode, you have a special item who will give you some pain &amp; you need to be faster. A ranking system &amp; achievements are also added to keep you even more challenged<p>Numbers Addict™ «  improved my memory &amp; my cognitive &amp; concentration flexibility, I stimulated brain cells that were asleep… It’s the mansion of the math, kingdom of the strategy »<p>It&#39;s a mix with 2048 math workout test, sudoku, chess, logical raisonning.<p>The best app for family, adults, kids, girls, boys, women, men, all ages and genders! If you are a kid, a boy, a girl, a man, a woman or love space, puzzles, riddles games and brain teaser.<p>And test your brain Age too!<p>If you desire to improve your brain performance and be above the line take this test several times in a row.<p>Even kids that like to play sandbox will love this game. You just need to know counting.<p>keywords : epic,tile,black,white,swipe,threes,tiles<p>Features:<br> * 3 difficult levels ranging from Beginner to Expert (so 3 game modes, Relax Mode &amp; Challenge Mode) * Endless puzzles mania for you to enjoy * Ranking system to keep you more challenged<br> * Keep track of all the score<br>* Hint system that will guide you through the puzzle  <br>* Test your logic &amp; your intelligence with these original puzzle mind quiz game, the only one who boost your IQ (Intelligence quotient).<br>* Improve your result in Psycho-technical tests, IQ test / QI tester, competitive exam admission, MBA, luminosity, lumosity, GMAT, SAT, LSAT, GRE, CAT<br>* Samsung Galaxy note, note2 &amp; note3 stylus S PEN (SPEN) optimised<br>* Facebook, Google+ connect &amp; Tweet on Twitter <p><br>Support:<br> something wrong? Need help? Or just addicted? Please submit us an email: <a href="mailto:contact@barings-prod.com">contact@barings-prod.com</a></p></p></p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/baringsprod/numbersAddict/free/gp', 'numbers-addict.png', '["numbers-addict-0.png","numbers-addict-1.png","numbers-addict-2.png","numbers-addict-3.png","numbers-addict-4.png","numbers-addict-5.png","numbers-addict-6.png"]', 0, 0, '', 'com.baringsprod.numbersAddict.free.gp', 'addict™, brain, expert, bubbles, numbers addict™, you have, expert mode, game modes, ranging from beginner, levels ranging from', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:25', '2016-05-18 01:23:25', 0),
(176, 42, 5999, 'Fire Fighters Racing for Kids', 'fire-fighters-racing-for-kids', ' <div jsname="C4s9Ed">New fun racing game for kids! Help these monkeys to save the city! There is fire starting to spread everywhere and you are the only one that can stop it!<p>Pick one of these 4 cool cars, find a fire source in the city, use your car power to kill the fire or use special button to summon monkeys that will help you to do it quickly!<p>This is a fun game for boys and girls, even a toddler can play it without any problems! And it is yet so fun that everyone will find something to laugh from while in adventure. <p>Children loves the cute characters, graphics, fun race, sweet soundtrack and sounds! Try it yourself!</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/tinylabproductions/firefighters', 'fire-fighters-racing-for-kids.png', '["fire-fighters-racing-for-kids-0.png","fire-fighters-racing-for-kids-1.png","fire-fighters-racing-for-kids-2.png","fire-fighters-racing-for-kids-3.png","fire-fighters-racing-for-kids-4.png","fire-fighters-racing-for-kids-5.png","fire-fighters-racing-for-kids-6.png"]', 0, 0, '', 'com.tinylabproductions.firefighters', 'monkeys, , the city, game for', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:30', '2016-05-18 01:23:30', 0),
