(178, 42, 1560, 'Moto Traffic Race', 'moto-traffic-race', ' <div jsname="C4s9Ed">Moto Traffic Race is one of the best moto racing games. Have fun dodging cars and trucks while you speed up to the limit. Take your car and race in 2 different game modes… day or night!<p>Moto Traffic Race has lots of bikes to purchase. You can also upgrade your ride with your hard earned money. Get the best bike money can buy and beat everyone in this amazing moto racing game.<p>Ride your bike through streets packed with real life traffic and thematic cars. Avoid fire trucks, blazing cars, cement trucks, and even police road blocks! <br> <br>What are you waiting for? Download Moto Traffic Race now!<p>FEATURES:<br>- 2 games modes<br>- Lots of bikes<br>- Real life traffic<br>- Thematic cars<br>- Moving and static obstacles<br>- Great 3D graphics<br>- Awesome music<br>- Endless fun!</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/extremefungames/mototrafficrace', 'moto-traffic-race.png', '["moto-traffic-race-0.png","moto-traffic-race-1.png","moto-traffic-race-2.png","moto-traffic-race-3.png","moto-traffic-race-4.png","moto-traffic-race-5.png","moto-traffic-race-6.png"]', 0, 0, '', 'com.extremefungames.mototrafficrace', 'traffic, trucks, thematic, money, moto traffic, traffic race, life traffic, thematic cars, moto traffic race, real life traffic', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:41', '2016-05-18 01:23:41', 0),
(179, 42, 1139, 'Car Driving Simulator', 'car-driving-simulator', ' <div jsname="C4s9Ed">Take control of 3 radio-controlled car in a huge environment with 2 racetracks, a water basin, and a mogul field !<br>Accomplish a lot of variety of missions to become a good driver.<p>!! Car Driving Simulator contains 30 levels !!<p>Example of missions :<br>- Take the bridge in the wrong way, and dodge the cars<br>- Don&#39;t hit the pedestrians and drive safely with your speed car<br>- Do all the stunts with your monster truck<br>- Transport the cargo to the parking pad<br>- Finish the racetrack, and be the first. (2 circuits)<br>- Car chase: follow the car and don&#39;t let you outrun<br>- Finish the obstacle course without crashing with your offroad car<br>- Catch all the gangsters before they escape<br>- Follow the helicopter and the airplane<br>- Drive offroad with your monster truck<br>- Destroy all of the objects around you<br>- Get the birds out of the park<p>Totally free, without &quot;in-app purchase&quot; !<br>You must have (at least) a cpu of 1 GHz in order to play without lag.</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/i6/rccar', 'car-driving-simulator.png', '["car-driving-simulator-0.png","car-driving-simulator-1.png","car-driving-simulator-2.png","car-driving-simulator-3.png","car-driving-simulator-4.png","car-driving-simulator-5.png","car-driving-simulator-6.png"]', 0, 0, '', 'com.i6.rccar', 'finish, offroad, truck, monster, with your, follow the, finish the, your monster, your monster truck, with your monster', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:43', '2016-05-18 01:23:43', 0),
(180, 42, 3195, 'School Driving 3D', 'school-driving-3d', ' <div jsname="C4s9Ed">School Driving 3D is an exciting game where you can learn the road rules and prove that you can drive a car in a real <br>world enviroment. School Driving 3D is a realistic simulator that allows you to choose between different cars, buses and trucks...<br>More than 40 levels with different driving scenarios are waiting you. Show off your driving skills, play School Driving 3D!<p>Mods Support<br>-The game now supports modding! Create your mods or download new ones! <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.ovilex.com/mods%26sa%3DD%26usg%3DAFQjCNEMkE4-HjMV1mAWDU0A-KXqIGHXEA&amp;sa=D&amp;usg=AFQjCNFK0Zk6WD3V8FPc6JRKQxmfWLvxFw" target="_blank">http://www.ovilex.com/mods</a><p>Key Features<br>-Smooth and realistic car handling<br>-Different licenses to take, Car, Bus and Truck<br>-More than 40 levels (new updates every week)<br>-Free Ride mode avalaible<br>-Stunning 3D Graphics with realistic vehicles interiors<br>-Detailed damage system<br>-Tilt steering, buttons and touch steering wheel<br>-Online Leaderboards and Achievements<br>-Real engine sound for each vehicle<br>-Challenge your friends by sharing your score!<br>-New vehicles upcoming! (Requests on our Google+ page)</p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/ovilex/schooldriving3d', 'school-driving-3d.png', '["school-driving-3d-0.png","school-driving-3d-1.png","school-driving-3d-2.png","school-driving-3d-3.png","school-driving-3d-4.png","school-driving-3d-5.png","school-driving-3d-6.png"]', 0, 0, '', 'com.ovilex.schooldriving3d', 'driving, school, different, realistic, school driving, more than, you can', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:46', '2016-05-18 01:23:46', 0),
(181, 43, 1474, 'RPG Glorious Savior', 'rpg-glorious-savior', ' <div jsname="C4s9Ed"><b>An everlasting story about the Hero&#39;s Sword with animated 3D battles that can be played in its entirety for free!</b><p>The Hero&#39;s Sword, which was used 300 years ago to defeat the Overlord, has been stolen, and demons are becoming more and more common.<br>Rain, a member of the aristocracy, is ordered directly by the King to get the sword back, and sets off on a quest with his attendant, Viola, to find the sword.<p>They don&#39;t know, though... They don&#39;t know that their quest will become a journey through time, to places far off in the past. <br>The binding strings of fate, and the desire to trust someone... Where will these tangled threads lead them? <p><b> Change characters&#39; weapons depending on the situation! </b><br>Prepare for battles with enemies by equipping characters with multiple weapons. <br>Think about how best to use different skills for each weapon to make attacks more effective, and defeat enemies.<br>If a weapon is not used in a battle, it collects Aura, and its attack strength increases. Use a weapon with lots of Aura at just the right time to cut down enemies!<p><b> Strengthen weapons more and more </b><br>Collect materials, and use them to strengthen weapons and make the party more and more powerful.<br>Weapons that are no longer needed can be dismantled, too, so you can think carefully about tactics. What weapon will you choose against each enemy?<p><b> Dungeons full of mysteries </b><br>In the dungeon, whose form changes each time you enter, you may be able to find rare weapons, and weapons with special effects.<p>* The game can be played in its entirety without the need for in-game transactions.<br>* The actual price might differ depending on the region.<br>* Please contact us through the Contact button on the title screen if you discover any bugs or problems with the application. Note that we do not respond to bug reports left in application reviews.<br>* A Premium Edition that includes 1000 bonus in-game points is also available for download! For more information, check out &quot;Glorious Savior&quot; on the web!<p>[Supported OS]<br>- 4.0 to 6.0<br>[Supported Screens]<br>- WVGA(480x800) and up<br>[Game Controller]<br>- Optimized<br>[SD Card Storage]<br>- Enabled<br>[Languages]<br>- English, Japanese<br>[Non-Supported Devices]<br>This app has generally been tested to work on any mobile device released in Japan. We cannot guarantee full support on other devices.<p>Your use of the application constitutes your acceptance of the following EULA:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://kemco.jp/eula/eula_EN.html%26sa%3DD%26usg%3DAFQjCNF4YVJ7d2C7gIsRs7bjDD5K7Le5mw&amp;sa=D&amp;usg=AFQjCNGvgJvLzHNjwK7WPD4VmQMzzNeK7w" target="_blank">http://kemco.jp/eula/eula_EN.html</a><p>Get the latest information!<br>[Newsletter]<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://kemcogame.com/c8QM%26sa%3DD%26usg%3DAFQjCNFpqUrqxfSg7YyyRGNueMaoGaaptQ&amp;sa=D&amp;usg=AFQjCNES4ZOyVFYW4UMhIHv61knlhJHQ0A" target="_blank">http://kemcogame.com/c8QM</a><br>[Facebook page]<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/kemco.global%26sa%3DD%26usg%3DAFQjCNFrCEpSxpRPfXKKTSQVPx20P-jSiA&amp;sa=D&amp;usg=AFQjCNGRGp3f8mcp6rdLXe1GpF_bIxzSMA" target="_blank">http://www.facebook.com/kemco.global</a><p>(C)2015 KEMCO/EXE-CREATE</p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/kemco/execreate/glorioussavior', 'rpg-glorious-savior.png', '["rpg-glorious-savior-0.png","rpg-glorious-savior-1.png","rpg-glorious-savior-2.png","rpg-glorious-savior-3.png","rpg-glorious-savior-4.png","rpg-glorious-savior-5.png","rpg-glorious-savior-6.png"]', 0, 0, '', 'kemco.execreate.glorioussavior', 'weapons, weapon, sword, application, and more, more and, weapons and, the application',