(182, 43, 15868, '热血仙境 - 野外PK战况升级，觉醒神兵震撼降临！', 'pk', ' <div jsname="C4s9Ed">【内容提要】<br>首款Q版仙侠MMORPG大作，开放性世界360°任你遨游！<br>无限制野外PK乱斗，即时语音聊天，带领家族称霸仙境！<br>千万种时装造型染色搭配，制定只属于你的专属人物！<p>【游戏特色】<br>——“全新社交，与美女野外约战的ARPG大作”<br>大型约战MMORPG，24小时野战不打烊，萌妹啪啪来激战！即时语音聊天，带团在仙境大陆争夺领地。赶快邀请你心仪的妹子，为她征战最强公会！<p>——“唯美场景，超清画质，一见倾心的Q版人设”<br>3D修仙动作手游，超清仙境世界，美轮美奂的光影特效以及精致的游戏原画设计，为玩家呈现一个如画般优美、让人流连忘返的玄幻仙境。<p>——“至尊法宝，肆意厮杀，特效多样无限连击”<br>仙境大陆有数十种独门法宝，不同的法宝能领悟不同的技能，打造独一无二的你！华丽炫酷的技能配合多种战斗效果，简单操作即可享受整套华丽连击，震撼畅快的打击感、精彩激烈的打斗场面，让你从此爱上战斗！<p>——“梦幻变装，自由选择，满足你的各种需求”<br>独特的avatar系统为你提供近千套精美时装，另外还能根据你所挑选的时装，选择与之匹配的发型发色，打造与众不同的你！还有炫酷的强化翅膀效果和萌萌的坐骑，助你在仙境大陆御剑飞行，驰骋山河！<p>——“四大职业，同屏逐鹿，王者称霸一决雌雄”<br>【剑修】——灵动飘逸，剑破万法。<br>剑修如剑般不屈，是有着让人望尘莫及的高爆发职业！<br>【墨狐】——颠倒众生，狐媚天下。<br>墨狐用墨家之术将万物控制在鼓掌之间，是如狐般身手矫捷如影如幻的高敏捷高控制职业！<br>【道姬】——流光溢彩，道法自然。<br>身为御姐的道姬以日月金轮之锋芒从远处给予敌人超高法术攻击，她虽低血低防，确实机动性非常强的远程攻击职业！<br>【拳侯】——以力证道，拳动乾坤。<br>拳侯以双拳为武器，集全身之力于双拳之间，一息间爆发成吨物理伤害，给予敌人最致命的打击。<br>四职业各具特色，无论是喜欢高爆物理攻击，或者辅助控制玩法，你都找到适合的角色玩法。<p>匠心制作，年度巨献！来热血仙境，与同样充满情怀的你共同创造属于我们的仙境传说！<p>现在加入热血仙境，立刻获得2888仙钻新人成长福利！次日登陆送橙装，连续登陆七天还送稀有法宝哦！<p><br>※本游戏需要网路链接<br>※本游戏為免费使用，游戏内另外提供虚宝、游戏币等付费服务<br> <p>【贴心服务】<br>客服服务时间-周一至周五10:00-18:00(例假日暂停)<br>官方粉丝团：<a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/avalon3d%26sa%3DD%26usg%3DAFQjCNF1UIYzE1lQbUVy_nchzXe43FLVNw&amp;sa=D&amp;usg=AFQjCNFIubnjsuNm9N4BHxjhnVaqaY1FtQ" target="_blank">https://www.facebook.com/avalon3d</a></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/t1gamer/rxxj', 'pk.png', '["pk-0.png","pk-1.png","pk-2.png","pk-3.png","pk-4.png","pk-5.png","pk-6.png"]', 0, 0, '', 'com.t1gamer.rxxj', '', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:52', '2016-05-18 01:23:52', 0),
(183, 43, 15869, 'Legend Of Swords', 'legend-of-swords', ' <div jsname="C4s9Ed">The best Fairy and Action mobile RPG in 2016! With the complex storyline and fabulous weapons, Legend of Swords brings about a brand new fighting experience! In the game, you can enjoy an extremely splendid visual and aural feast with the live speech and customized portrait. Besides, the unique Class Transfer system allows you to choose your favorite class and immerse themselves in various adventures, such as carefree Wild PK and the bloody Legion War. Hero, never miss such a killing banquet!<p>FEATURES<br>-Enjoy the special wild PK<br>-Join the Cross-server battle, a new battlefield for Legion War<br>-Fight for the Kingdom with your fellows in Clan Siege<br>-Transfer the Class and experience another way to immortality<br>-Tie the knot and then challenge Love Instance with your lover<br>-Equip with fashion, firearm and shiny weapons<br>-Adventure with your fellows with real-time social contact<br>-Lead the life with fish farm and Treasure Hunt activity<p>Except killing and fighting, you can also enjoy the casual and happy lifestyle, such as fish-farming, social contact, Treasure Hunt and Legion Activity. Let’s start an exciting adventure in this Fairyland!</p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/vsg/los', 'legend-of-swords.png', '["legend-of-swords-0.png","legend-of-swords-1.png","legend-of-swords-2.png","legend-of-swords-3.png","legend-of-swords-4.png","legend-of-swords-5.png","legend-of-swords-6.png"]', 0, 0, '', 'com.vsg.los', 'class, legion, adventure, social, with your, your fellows, treasure hunt, social contact, with your fellows', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:55', '2016-05-18 01:23:55', 0),
(184, 43, 1083, 'Legion of Heroes', 'legion-of-heroes', ' <div jsname="C4s9Ed">◆ Legion of Heroes is an absolute Free-to-Play mobile 3D MMORPG, featuring dynamic real-time action, PvP and guild wars.<br>Explore the world full of fantasy, and recruit heroes to build your own squad. Train, customize, and gear up your squad to become the ultimate hero.<br> <br>Features:<br>► EXPLORE an epic 3D fantasy world in real-time action<br>► COLLECT 100+ Unique Heroes and discover the story as it unfolds<br>► CUSTOMIZE your squad with gear and costumes and use dynamic, tactical combat strategies<br>► DOMINATE other players in real time open-world PvP and in Coliseum Arena to advance the ranks every week<br>► TEAM UP with your friends and raid the &quot;Chaos Abyss&quot; to vanquish evil bosses<br>► COMPETE against other guilds in massive 45v45 PvP Guild Wars to rule the world<br>► LIVE CHAT with players and Game Masters in open chat room<br>► ADVENTURE myriad of stimulating dungeons in the “Tower of Chaos”<br> <br>Questions and Feedback? Contact our Customer Support!<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://support.nexonm.com/hc/en-us/categories/200177844-Legion-of-Heroes%26sa%3DD%26usg%3DAFQjCNE_afZnYq-un5AI0M8s58A831Wjgw&amp;sa=D&amp;usg=AFQjCNGn7NjZklxF7GeFo2M79FLuTVyQ7Q" target="_blank">https://support.nexonm.com/hc/en-us/categories/200177844-Legion-of-Heroes</a><br> <br>Follow us on Facebook!<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/playlegionofheroes%26sa%3DD%26usg%3DAFQjCNEvXSpdjA4KFt72k41IjuOAOX61Hg&amp;sa=D&amp;usg=AFQjCNEOjYP-ZzpsHFb1TsbipfXQuYZN7A" target="_blank">https://www.facebook.com/playlegionofheroes</a><br> <br>Beginner`s Guide<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://legionofheroesglobal.blogspot.kr/%26sa%3DD%26usg%3DAFQjCNEHJ-xI1FamH5e3yD2XEF4obFQo7g&amp;sa=D&amp;usg=AFQjCNFz1kuY8_xDCC6J1GuQFYr_ztfXXw" target="_blank">http://legionofheroesglobal.blogspot.kr/</a><br> <br>Go to Terms of Service: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://m-page.nexon.com/term/10%26sa%3DD%26usg%3DAFQjCNGqJC-z40VnhnmxAuyt0-mDikzY5A&amp;sa=D&amp;usg=AFQjCNG9vdb-ifSesIBBogEoXqqLwh8aQg" target="_blank">https://m-page.nexon.com/term/10</a><br>Go to Privacy Policy: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://m-page.nexon.com/term/11%26sa%3DD%26usg%3DAFQjCNFhNBHYHfPbvVydNJctpLsUBxWZeQ&amp;sa=D&amp;usg=AFQjCNGRmCrUXW3BiQf_k9uoLkrzac2lfw" target="_blank">https://m-page.nexon.com/term/11</a></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/nexonm/loh/usios', 'legion-of-heroes.png', '["legion-of-heroes-0.png","legion-of-heroes-1.png","legion-of-heroes-2.png","legion-of-heroes-3.png","legion-of-heroes-4.png","legion-of-heroes-5.png","legion-of-heroes-6.png"]', 0, 0, '', 'com.nexonm.loh.usios', 'heroes, https, squad, world, real time, nexon com, com term, page nexon', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:23:59', '2016-05-18 01:23:59', 0),
(185, 43, 1474, 'RPG Revenant Dogma', 'rpg-revenant-dogma', ' <div jsname="C4s9Ed"><b>A full blown fantasy RPG that can be played in its entirety for free!</b> Where does the path of divine power lead? Introducing Revenant Dogma, a 3D battle RPG!<p><b>The Path of Divine Power</b><br>Caine enters a ruins site in search of a feral relic said to be left behind by the gods and meets a mysterious girl in a mask.<br>This strange encounter becomes the catalyst of a grand scheme that will change the worlds of humans and therians.<br>Will this new-found power lead to prosperity or destruction...<p><b>Dynamic Battles</b><br>A battle experience full of ambience featuring Transformations that enable various skills and Bursts that can deal massive damage.<p><b>Fully Customizable Weapons</b><br>Weapons can be customized for stronger attack power or imbued with various effects.<br>Forged weapons can be sold for gold or broken down for reinforcing material.<br>Utilizing weapons effectively will be monumental in your adventure.<p>* The game can be played in its entirety without the need for in-game transactions.<br>* The actual price might differ depending on the region.<br>* Please contact us through the Contact button on the title screen if you discover any bugs or problems with the application. Note that we do not respond to bug reports left in application reviews.<br>* A Premium Edition that includes 1000 bonus in-game points is also available for download! For more information, check out &quot;Revenant Dogma&quot; on the web!<p>[Supported OS]<br>- 4.0 to 6.0<br>[Supported Screens]<br>- WVGA(480x800) and up<br>[Game Controller]<br>- Optimized<br>[SD Card Storage]<br>- Enabled<br>[Languages]<br>- English, Japanese<br>[Non-Supported Devices]<br>This app has generally been tested to work on any mobile device released in Japan. We cannot guarantee full support on other devices.<p>Your use of the application constitutes your acceptance of the following EULA:<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://kemco.jp/eula/eula_EN.html%26sa%3DD%26usg%3DAFQjCNF4YVJ7d2C7gIsRs7bjDD5K7Le5mw&amp;sa=D&amp;usg=AFQjCNGvgJvLzHNjwK7WPD4VmQMzzNeK7w" target="_blank">http://kemco.jp/eula/eula_EN.html</a><p>Get the latest information!<br>[Newsletter]<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://kemcogame.com/c8QM%26sa%3DD%26usg%3DAFQjCNFpqUrqxfSg7YyyRGNueMaoGaaptQ&amp;sa=D&amp;usg=AFQjCNES4ZOyVFYW4UMhIHv61knlhJHQ0A" target="_blank">http://kemcogame.com/c8QM</a><br>[Facebook page]<br><a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/kemco.global%26sa%3DD%26usg%3DAFQjCNFrCEpSxpRPfXKKTSQVPx20P-jSiA&amp;sa=D&amp;usg=AFQjCNGRGp3f8mcp6rdLXe1GpF_bIxzSMA" target="_blank">http://www.facebook.com/kemco.global</a><p>(C)2015 KEMCO/EXE-CREATE</p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/kemco/execreate/revenantdogma', 'rpg-revenant-dogma.png', '["rpg-revenant-dogma-0.png","rpg-revenant-dogma-1.png","rpg-revenant-dogma-2.png","rpg-revenant-dogma-3.png","rpg-revenant-dogma-4.png","rpg-revenant-dogma-5.png","rpg-revenant-dogma-6.png"]', 0, 0, '', 'kemco.execreate.revenantdogma', 'application, supported, power, kemco, revenant dogma, the application, power lead, the path', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:24:04', '2016-05-18 01:24:04', 0),
(186, 44, 2798, 'Bakery Blitz: Cooking Game', 'bakery-blitz-cooking-game', ' <div jsname="C4s9Ed">Sugar’s on a mission to restore sweetness to the world - help her bake and serve divinely delicious desserts as you travel from land to land in a magical airship bakery!  You can almost smell the warm, sweet scents swirling through the air...<p>FEATURING:<br>- Triple-layer chocolate cakes with whipped cream filling and berry buttercream frosting!<br>- Fresh fruit-topped tarts with lemon custard in hazelnut crust! <br>- Red velvet cookie ice cream sandwiches dipped in white chocolate and sprinkled with peppermint crumbles!<br>- Lattes, lemonades, and more!<p>QUIRKY CUSTOMERS!<br>Finagle the fun twists introduced by new customers like the handsome Beekeeper, the oh-so-punctual Clockmaker, and the terrifying Queen!  Learn your customers’ favorite foods to know them better than they know themselves!<p>TREAT YOURSELF!<br>Upgraded Ingredients and Stations make your bakery a well-oiled machine and help you keep up with the outrageous demand for your scrumptious sweets.  Get 3 Stars to earn Star Tickets for traveling to distant Lands!<p>MAGICAL POWER-UPS!<br>Tap into the magic - use potent Power-Ups to speed up your stations, placate your patrons, and multiply your moola!  <p>TONS OF SWEET LEVELS!<br>Help Sugar restore sweetness to the world as you explore hundreds of levels in mystical fantasy lands like Lemonshine Orchard, Cherryglow Forest, and Lavender Lake.  Each land is bursting with fresh, unique ingredients and magical new tools for your bakery!  Every level brings you closer to defeating Baroness von Bitter’s evil curse!<p>FREE GIFTS FROM YOUR FRIENDS!<br>Connect to Facebook to compare scores and exchange free gifts to advance faster and farther in the game! <p>*************************<p>Note: You must be at least 13 years of age to play or download this game. For more information, please refer to our Terms of Service and Privacy Policy.<p>IN-APP PAYMENTS: Bakery Blitz is free to play, but you can buy special items to use in the game.<p>NOTE TO PARENTS: This game may include direct links to social networking sites that are intended for an audience that is at least 13 years of age; direct links to the internet with the potential to browse any web page; and advertising of RockYou products and products from select partners.<p>POLICY: Please see our privacy policy and terms of agreement here: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://rockyou.com/privacy-policy/%26sa%3DD%26usg%3DAFQjCNHB_2QnW2zqnONqJZ3g1j30zFMczw&amp;sa=D&amp;usg=AFQjCNGvf3FbbT3iKMTzlzj1wXc2IsZ4cw" target="_blank">http://rockyou.com/privacy-policy/</a><p>REVIEWS: Please rate Bakery Blitz and leave us a review! We love hearing from our fans! <p>Like us on Facebook: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/games/bakeryblitz/%26sa%3DD%26usg%3DAFQjCNEbeRUhlV-itmAnZppRGsEeULbbWw&amp;sa=D&amp;usg=AFQjCNFgV43A1iIW0UTATZoUWoTp5n26qw" target="_blank">https://www.facebook.com/games/bakeryblitz/</a>. Keep updated on new features and game hints!<p>Tweet at us: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.twitter.com/BakeryBlitzGame%26sa%3DD%26usg%3DAFQjCNEk8ibT0yX0H8WW7UmTBeE7Ut_R2g&amp;sa=D&amp;usg=AFQjCNGzz3BxFGoHKNTChDhlSRrYTXwwUQ" target="_blank">https://www.twitter.com/BakeryBlitzGame</a><p>Having a problem? Got a suggestion? We&#39;d love to hear from you. Please reach us at <a href="mailto:bakeryblitz@rockyou.zendesk.com">bakeryblitz@rockyou.zendesk.com</a>.</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/air/com/rockyou/cake/gp', 'bakery-blitz-cooking-game.png', '["bakery-blitz-cooking-game-0.png","bakery-blitz-cooking-game-1.png","bakery-blitz-cooking-game-2.png","bakery-blitz-cooking-game-3.png","bakery-blitz-cooking-game-4.png","bakery-blitz-cooking-game-5.png","bakery-blitz-cooking-game-6.png"]', 0, 0, '', 'air.com.rockyou.cake.gp', 'bakery, policy, privacy, magical, privacy policy, this game, the game, bakery blitz', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:24:11', '2016-05-18 01:24:11', 0),
(187, 44, 15564, 'Roller Coaster Simulator', 'roller-coaster-simulator', ' <div jsname="C4s9Ed">Feel and live through the excitement of riding on a roller coaster only on Roller Coaster Simulator 3D.  Control the speed of the rides and be careful to slow down while making sharp turns and at intersections! Chase the adrenaline rush as you drop from the skies and make loops and whizz through at lightning speeds. This roller coaster ride is sure to drive oyu crazy and fill you with the ultimate thrill! Enter this realistic simulation to experience the roller coaster madness in your fingertips!<p>Game Controls :<p>Left Button for making turns (Left and Right)<br>Right Button for speed control(Top for acceleration, Down to brake)<p>If you face any problems while installation or while playing this game, please report to us. <br>We will resolve it at the earliest.</p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/timuzsolutions/rollercoastersimulator', 'roller-coaster-simulator.png', '["roller-coaster-simulator-0.png","roller-coaster-simulator-1.png","roller-coaster-simulator-2.png","roller-coaster-simulator-3.png","roller-coaster-simulator-4.png","roller-coaster-simulator-5.png","roller-coaster-simulator-6.png"]', 0, 0, '', 'com.timuzsolutions.rollercoastersimulator', 'roller, coaster, button, right, roller coaster, button for', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:24:16', '2016-05-18 01:24:16', 0),
(188, 44, 15564, 'Train Simulator 2016', 'train-simulator-2016', ' <div jsname="C4s9Ed">Train Simulator 2016 is the latest cutting edge train simulator that will allow you to become the best train driver!<br>Zoom across scenic landscapes and experience the thrill of a buzzing train ride with Train Simulator 2016.<p>With Train Simulator 2016 it’s time to fulfill your dreams as you become the pro train operator and engine driver.<br>Once you are in the game, the train express is all yours to control.Stop the train before you enter the danger zone! Change the camera view as per your comfort; pick up all the passengers to drop at their respective destinations.<p>Dodge oncoming trains and do not cross the trains speed limit. You can EARN XP and level up to be the skillful train driver of them all. Pick the speed, apply brakes and drive past beautiful sceneries as you go round the map picking up passengers fulfilling your train transport duty. Explore the vast collection from the old steam locomotive simulator to today’s high speed rails with tons of exciting engine driver adventures for you to enjoy.<p>Game Features : <p>*Challenging train transport levels<br>*Open/Close Doors Animations<br>*Unlock and Explore 7 regions 35 levels <br>*Accelerate upward to move forward &amp; downwards to slow down<br>*Press halt to stop the train<br>*Swipe left and right to take turns<p>If you face any problems while installation please report to us. This will help us resolve it at the earliest.</p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/timuzsolutions/trainsimulator2016', 'train-simulator-2016.png', '["train-simulator-2016-0.png","train-simulator-2016-1.png","train-simulator-2016-2.png","train-simulator-2016-3.png","train-simulator-2016-4.png","train-simulator-2016-5.png","train-simulator-2016-6.png"]', 0, 0, '', 'com.timuzsolutions.trainsimulator2016', 'train, simulator, driver, speed, train simulator, simulator 2016, stop the, train transport, train simulator 2016, with train simulator', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:24:22', '2016-05-18 01:24:22', 0),
(189, 44, 920, 'Episode + Mean Girls: Sr Year', 'episode-mean-girls-sr-year', ' <div jsname="C4s9Ed">Springtime has arrived and Episode’s introducing a special photo booth outfit in the Demi Lovato collection! Take selfies with your significant other in brand-new spring outfits that are perfect for the season.<p>Episode is your home for interactive, visual stories, where YOU choose your path!<br>NEW STORY – MEAN GIRLS: SENIOR YEAR (plus 13K+ stories already live)! Step inside girl world, right where the movie left off, and navigate the drama and romance of Senior Year at North Shore High. As you battle Regina George, you will get to know characters from the movie like Cady, Janis, Damian, and of course the Plastics. You will also meet the guy of your dreams, but Regina won&#39;t let you get him that easily. What choices will you make Senior Year? And is ‘Fetch’ finally going to happen?<p>- CREATE YOUR PERSONAL LOOK and choose your best outfits! <br>- FLIRT your way to the top and find love! <br>- MAKE FRIENDS WITH MEAN GIRLS CHARACTERS and hang out with the coolest clique! <br>- PARTY at prom with your hot date and meet new friends at the after-party! <br>- DREAM BIG and get into your top college!<p>Explore our wide catalog of over 10,000 stories in your favorite genres, from romance to comedy to fantasy to adventure!<p>- INTERACTIVE STORIES: make choices that determine your success, friends, and popularity! <br>- FIND ROMANCE by dating and fall in love! <br>- UNRAVEL mysteries and survive the dangers that lie ahead! <br>- DRESS your character and choose the style that will help you express yourself!<p>OTHER FEATURED STORIES: <br>DEMI LOVATO: PATH TO FAME: With the help of Demi and her friends, discover your voice and define your musical career through the choices you make! What’s most important to you -- love, friendship, family or fame?<p>- JOIN DEMI in an interactive story where your choices determine who you meet, the friends you make, the people you date and how you rise to the top of the charts! <br>- DESIGN YOUR CHARACTER! Pick your perfect hair, skin tone, eyes, nose, and more! <br>- DRESS LIKE A STAR! Create your style from hundreds of options! <br>- FIND LOVE! Will you date famous, hot musicians or the friend-next-door? <br>- VISIT AMAZING CITIES where you’ll perform shows with Demi and earn dedicated fans! <br>- HANG OUT WITH DEMI, her band, manager, and friends! <br>- EXPERIENCE DEMI&#39;S MUSIC! Listen to her songs as the soundtrack to your story and perform them on-stage alongside Demi herself!<p>CAMPUS CRUSH: Welcome to your freshman year on campus. You&#39;ve managed to get into Lockwood University, the most esteemed college in the state. But will you make friends? Will you find love? And what will you uncover about your mysterious scholarship? All of that is up to you as you choose your way through this interactive story.<p>- PLAY AS Amanda, Kim, Naomi, Taylor, or others! <br>- FLIRT WITH guys and try to find a date for the formal! <br>- MAKE FRIENDS and try to get into the best sorority on campus!<p>TM &amp; ©2015 Paramount Pictures. All Rights Reserved.<p>Supports Tablets!<p>PLEASE NOTE: Episode lets you purchase items within the game for real money. Please disable in-app purchases on your device if you do not want this feature to be accessible.<p>Your use of this application is governed by the Terms of Service available at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://pocketgems.com/episode-terms-of-service/%26sa%3DD%26usg%3DAFQjCNEoYgartI8ADS--xf6NFJgwFExBiA&amp;sa=D&amp;usg=AFQjCNEi6RgbpnL1qc4-znPLyGmYoGl8xA" target="_blank">http://pocketgems.com/episode-terms-of-service/</a>. Collection and use of your data are subject to the Privacy Policy available at <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://pocketgems.com/episode-privacy-policy/%26sa%3DD%26usg%3DAFQjCNEkkutuJAGaB2ejV7IcgnaF7yoJoQ&amp;sa=D&amp;usg=AFQjCNFxhCjsUIxYg_nUnjBA5J7GKcpoPQ" target="_blank">http://pocketgems.com/episode-privacy-policy/</a>.</p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/episodeinteractive/android/catalog', 'episode-mean-girls-sr-year.png', '["episode-mean-girls-sr-year-0.png","episode-mean-girls-sr-year-1.png","episode-mean-girls-sr-year-2.png","episode-mean-girls-sr-year-3.png","episode-mean-girls-sr-year-4.png","episode-mean-girls-sr-year-5.png","episode-mean-girls-sr-year-6.png"]', 0, 0, '', 'com.episodeinteractive.android.catalog', 'friends, stories, interactive, episode, will you, you make, make friends, get into, you choose your', '', 1, '0.0', 0, 0, 0, 0, '2016-05-18 01:24:27', '2016-05-18 01:24:27', 0),
(190, 44, 925, 'The Sims FreePlay', 'the-sims-freeplay', ' <div jsname="C4s9Ed">Create a beautiful Day Spa with everything you need to soothe your Sims’ senses in the latest update.<p>Play the world’s most popular life simulation game!  <p>This app offers in-app purchases. You may disable in-app purchasing using your device settings.<p>Create unique Sims, build dream homes, and let them live your way!<p>• Customize different Sims and dress them in hundreds of stylish outfits<br>• Have them fall in love,  get married and have babies<br>• Experience every stage of life from Babies to Seniors…and everything in-between<br>• Build dream homes and decorate them with thousands of different items<br>• Complete exciting quests that unlock new places in your Town <br>• Care for cuddly and magical pets<br>• Live out your Sims story and play anyway you like<br>________________________________________<br>Terms of Service: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.ea.com/terms-of-service%26sa%3DD%26usg%3DAFQjCNEmDOJlNgFrLyebXgdth3qsCaJA1Q&amp;sa=D&amp;usg=AFQjCNHg74TpJRtGAFHkvQauj4fQ5mLNFg" target="_blank">http://www.ea.com/terms-of-service</a><br>Game EULA: <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://tos.ea.com/legalapp/mobileeula/US/en/GM/%26sa%3DD%26usg%3DAFQjCNFhlC0H5c0rrXtWi0odNbp4j4NP8g&amp;sa=D&amp;usg=AFQjCNGY3xFWBQjVGrH4sprQu2TEVn0H0g" target="_blank">http://tos.ea.com/legalapp/mobileeula/US/en/GM/</a><br>Visit <a href="https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://help.ea.com/%26sa%3DD%26usg%3DAFQjCNGJtFhhKZ2izQ3xjgxZdv8uhc6evg&amp;sa=D&amp;usg=AFQjCNFylF1MBXik8QoY8aPQXY0vPrMSyg" target="_blank">https://help.ea.com/</a> for assistance or inquiries. <br>EA may retire online features and services after 30 days’ notice posted on www.ea.com/1/service-updates<p>Important Consumer Information: <br>This app: requires a persistent Internet connection (network fees may apply); requires acceptance of EA’s Privacy &amp; Cookie Policy, TOS and EULA includes in-game advertising; collects data through third party analytics technology (see Privacy &amp; Cookie Policy for details); contains direct links to the Internet and social networking sites intended for an audience over 13.</p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/ea/games/simsfreeplay_row', 'the-sims-freeplay.png', '["the-sims-freeplay-0.png","the-sims-freeplay-1.png","the-sims-freeplay-2.png","the-sims-freeplay-3.png","the-sims-freeplay-4.png","the-sims-freeplay-5.png","the-sims-freeplay-6.png"]', 0, 0, '', 'com.ea.games.simsfreeplay_row', 'internet, requires, privacy, cookie, &amp cookie, cookie policy, privacy &amp, homes and, &amp cookie policy, privacy &amp cookie', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:24:32', '2016-05-18 01:24:32', 0),
(191, 45, 951, 'Big Sport Fishing 3D Lite', 'big-sport-fishing-3d-lite', ' <div jsname="C4s9Ed">One of the top fishing games with over 9 million downloads! Enjoy beautiful panoramic views and stunning 3D graphics.<p>As you move your phone, the games view changes so you feel like you&#39;re really there. Realistic 3D fish can be seen swimming beneath the waves when they are close and will often jump to give away their location when farther away. When you see a big one just flick your wrist to cast. Pull back on your phone to hook a fish and fight it as you reel in your catch. After you catch a fish you can take a picture to view later or share with friends!<p>The free Lite version includes the first two fishing locations in the game. Please note that the video for the game shows some locations from the full (paid) version of Big Sport Fishing.<p>In Big Sport Fishing Lite you can earn virtual credits to acquire special bonus items. These credits can also be purchased using an In-App purchase.<p>Permissions:<p>We also use the WRITE_EXTERNAL_STORAGE permission to write save game data to your phone&#39;s external storage.<p>Please contact us if you have any concerns about the permissions required by the game.<p>About Tapinator<br>Tapinator (Ticker: TAPM) designs, develops, and publishes games on mobile platforms. The Company’s portfolio includes over 200 mobile gaming titles that, collectively, have achieved over 200 million downloads. Tapinator is headquartered in New York. For more info, visit Tapinator.com.</p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/rocketmind/fishing', 'big-sport-fishing-3d-lite.png', '["big-sport-fishing-3d-lite-0.png","big-sport-fishing-3d-lite-1.png","big-sport-fishing-3d-lite-2.png","big-sport-fishing-3d-lite-3.png","big-sport-fishing-3d-lite-4.png","big-sport-fishing-3d-lite-5.png","big-sport-fishing-3d-lite-6.png"]', 0, 0, '', 'com.rocketmind.fishing', 'fishing, games, write, external, the game, external storage, over 200, sport fishing, big sport fishing', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:24:40', '2016-05-18 01:24:40', 0),
(192, 45, 924, 'BIG WIN Soccer (football)', 'big-win-soccer-football', ' <div jsname="C4s9Ed">The #1 sports game in over 100 countries! <br>Welcome to world class football fun with BIG WIN Soccer! No matter what you call the “beautiful game”, BIG WIN Soccer is the game for everyone. <p>Step into the role of team manager and coach your defenders, midfield players and strikers to be a top eleven team. You can make a real impact on your fantasy football club and the world soccer stage. <p>FRIENDS MODE <br>Connect to Facebook and challenge your friends to action packed football matches <p>EVENTS MODE <br>Players can compete in limited time cup events for a chance to win HUGE prizes <p>TROPHY MODE <br>Choose the number of games you want to play, rally your players and battle it out in Pro and Amateur trophies to reach the top of the table <p>QUICK MATCH MODE <br>Practice your fluid ball skills and test your team’s abilities in this fast, casual game mode <p>CREATE your own unique dream team, COMPETE against opponents from around the world, WATCH your team battle it out on the pitch, BOOST your player’s passing, shooting, dribbling and other skills and get ready for the ultimate BIG WIN! <p>HIGHLIGHTS <br>* Full team and player customization allowing you to create your own fantasy team! <br>* Flick through and open Bronze, Silver and Gold card packs to find new players and skill boosts to improve your team <br>* Play match-changing Big Impact cards and watch them affect the outcome when they come to life on the field! <p>BIG IMPACT CARDS <br>* Super Strike <br>* Crunching Tackles <br>* Great Ball <br>* Free Kick Focus <br>* Off The Woodwork <br>* Penalty Power <br>* and many more… <p>Other games in Hothead Games&#39; BIG WIN Sports Series include: <p>BIG WIN Baseball <br>BIG WIN Basketball <br>BIG WIN Football <br>BIG WIN Hockey <br>BIG WIN MLB <br>BIG WIN NHL<p>Play your favorite sport with BIG WIN Sports! Go for the BIG WIN! <p>© 2013 Hothead Games Inc., Hothead, Big Win and Big Win Sports are registered trademarks of Hothead Games Inc., all rights reserved.</p></p></p></p></p></p></p></p></p></p></p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/hotheadgames/google/free/bigwinsoccer', 'big-win-soccer-football.png', '["big-win-soccer-football-0.png","big-win-soccer-football-1.png","big-win-soccer-football-2.png","big-win-soccer-football-3.png","big-win-soccer-football-4.png","big-win-soccer-football-5.png","big-win-soccer-football-6.png"]', 0, 0, '', 'com.hotheadgames.google.free.bigwinsoccer', 'players, sports, football, games, big win, win sports, players and, big impact, big impact cards', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:24:45', '2016-05-18 01:24:45', 0),
(193, 45, 2661, 'Swimming Race 3D', 'swimming-race-3d', ' <div jsname="C4s9Ed">Pure 3D swimming game for free. Swim with free style, butter fly, Brest stroke<br>Features:<br>1.Stunts<br>2.Front Stroke<br>3.Back Stroke<br>4.Championship<p>This game is really easy to play. All you need to do is press the swim button and win the race by collecting coins, more you play more coins you can collect. <br>You may choose the character before you start the race. While improving the levels your stamina levels will go down, all you need to do is increase the stamina levels by buying stamina.<br>When you do have 50 coins you can buy the stamina, and continue to race.<p>For stunts, you need to swipe your finger to do the stunts. Grab the point and do the stunts.</p></p></div>  <div class="show-more-end" jsaction="click:vhaaFf"></div> ', 'images/com/virtualinfocom/swimming/water', 'swimming-race-3d.png', '["swimming-race-3d-0.png","swimming-race-3d-1.png","swimming-race-3d-2.png","swimming-race-3d-3.png","swimming-race-3d-4.png","swimming-race-3d-5.png","swimming-race-3d-6.png"]', 0, 0, '', 'com.virtualinfocom.swimming.water', 'stamina, stunts, levels, coins, you need, the stamina, the stunts, stamina levels', '', 0, '0.0', 0, 0, 0, 0, '2016-05-18 01:24:50', '2016-05-18 01:24:50', 0);

