(140, '1.1.3', 'bakery-blitz-cooking-game-1-1-3', 186, '  <div class="recent-change">Hey Bakers! Check out these exciting new updates:</div><div class="recent-change">- Coming soon, Sugar''s Airship Bakery will be traveling to the Panna Cotta Cliffs!</div><div class="recent-change">- New feature in Panna Cotta Cliffs: Customers can order more than one item at a time!</div><div class="recent-change">- Bazaar Improvement: more information on Ingredient and Machine upgrades</div><div class="recent-change">- Star Tickets Purchase Pop-up is now directly accessible from the Map screen.</div><div class="recent-change">- Crystal &amp; Coin inventory amounts are now viewable while in the Bazaar!</div><div class="recent-change">- General game improvements &amp; optimization.</div>  <div>     </div> ', '4.0', 0, 0, 0, 0, '2016-05-18 05:57:32', '0000-00-00 00:00:00', '2016-05-15 16:00:00'),
(141, '5.21.0', 'the-sims-freeplay-5-21-0', 190, '  <div class="recent-change">Keep calm as you take off on a journey to enlightenment with the ultimate Day Spa retreat!</div><div class="recent-change">• Create a sanctuary with everything you need to soothe your Sims’ senses</div><div class="recent-change">• Wrap up in comfy robes and awaken the mind with healing facials</div><div class="recent-change">• Enjoy relaxing massages and elbow out those back knots!</div><div class="recent-change">• Invigorate the soul with meditation, or sit by the water finding inner peace</div><div class="recent-change">• Treat yourself with manicure and pedicure stations</div><div class="recent-change">• Get steamy at the sauna or relax in the hot springs</div>  <div>     </div> ', '2.3.3', 0, 0, 0, 0, '2016-05-18 05:57:17', '0000-00-00 00:00:00', '2016-05-01 16:00:00'),
(142, '1.79', 'big-sport-fishing-3d-lite-1-79', 191, '  <div class="recent-change">The latest version contains bonus items like Chum, Dogfish Repellent and additional fishing rods. Earn these items to gain a special advantage in the game and catch more fish!</div>  <div>     </div> ', '2.1', 0, 0, 0, 0, '2016-05-18 05:57:03', '0000-00-00 00:00:00', '2015-10-06 16:00:00'),
(143, '3.9', 'big-win-soccer-football-3-9', 192, '  <div class="recent-change">Big Win Soccer has made some helpful updates!</div><div class="recent-change">- New Google SDK support</div><div class="recent-change">- Better stability and improvements</div><div class="recent-change">- Gave each team a pep talk</div>  <div>     </div> ', '2.3.3', 0, 0, 0, 0, '2016-05-18 05:56:49', '0000-00-00 00:00:00', '2014-09-16 16:00:00'),
(144, '1.9', 'swimming-race-3d-1-9', 193, '  <div class="recent-change">Stunt mode</div><div class="recent-change">Dive Mode</div><div class="recent-change">New look of the total game</div><div class="recent-change">New UI and bug fixes</div>  <div>     </div> ', '2.3', 0, 0, 0, 0, '2016-05-18 05:56:34', '0000-00-00 00:00:00', '2015-11-30 16:00:00'),
(145, '1.6', 'project-parkour-1-6', 195, '  <div class="recent-change">v1.6</div><div class="recent-change">-New Map Parkourland</div><div class="recent-change">-Complex map fix</div><div class="recent-change">v1.5.1</div><div class="recent-change">- New Map - Dream</div><div class="recent-change">- Fixed stuck hands problem</div><div class="recent-change">v1.5 BigOne</div><div class="recent-change">Fixed and Updated</div><div class="recent-change">-Fullbody awareness introduced</div><div class="recent-change">-2 New Maps</div><div class="recent-change">-Improved performance</div><div class="recent-change">-Improved graphics</div><div class="recent-change">-Removed unused permissions</div><div class="recent-change">-Online scoreboard fixed</div><div class="recent-change">-New GUI</div><div class="recent-change">-Community Forum links included</div><div class="recent-change">-Fixed issue with to much ads</div><div class="recent-change">- Other various minor bugfixes</div><div class="recent-change">Known Issues</div><div class="recent-change">- Devices with Adreno 3 series GPU with Android 4.1 and 4.4 may not work</div>  <div>     </div> ', '4.0', 0, 0, 0, 0, '2016-05-18 05:56:20', '0000-00-00 00:00:00', '2015-05-25 16:00:00'),
(146, '1.3.2', 'clash-royale-1-3-2', 196, '  <div class="recent-change">SIX NEW CARDS</div><div class="recent-change">- New Common Card: Fire Spirits</div><div class="recent-change">- New Rare Card: Furnace</div><div class="recent-change">- New Epic Card: Guards</div><div class="recent-change">- New Legendary Cards: Lava Hound, Miner, Sparky</div><div class="recent-change">MORE REWARDS</div><div class="recent-change">- Gold: Receive Gold for each win, even when your chest slots are full</div><div class="recent-change">- Crown Chest: Contains twice as much!</div><div class="recent-change">SPECTATING</div><div class="recent-change">- TV Royale: Watch the best battles from any Arena</div><div class="recent-change">- Friendly Battles: Spectate Friendly Battles live and throw confetti!</div><div class="recent-change">BALANCE</div><div class="recent-change">- Card Balance: We’ve re-balanced a few cards, visit www.clashroyale.com to find out more</div>  <div>     </div> ', '4.0.3', 0, 0, 0, 0, '2016-05-18 05:56:05', '0000-00-00 00:00:00', '2016-05-02 16:00:00'),
(147, '8.212.12', 'clash-of-clans-8-212-12', 197, '  <div class="recent-change">Clash’s newest troop has moved into the Dark Barracks!</div><div class="recent-change">• New troop Bowler throws bouncing boulders into enemy bases</div><div class="recent-change">• New levels for Hog Rider, Valkyrie, Goblin, Inferno Tower and Mortar</div><div class="recent-change">• Faster Spell brewing, Clan War matchmaking update and more!</div>  <div>     </div> ', '4.0.3', 0, 0, 0, 0, '2016-05-18 05:55:50', '0000-00-00 00:00:00', '2016-04-19 16:00:00'),
(148, '1.3.2', 'vlogger-go-viral-clicker-1-3-2', 199, '  <div class="recent-change">- ALL-NEW VLOGGERS with AWESOME new outfits!</div><div class="recent-change">- More customization options for rooms: new colors and item upgrades!</div><div class="recent-change">- New pictures for your produced videos!</div><div class="recent-change">- Balance adjustments for crowns, hats and channels</div><div class="recent-change">1.3.1: Fixes issues that could cause a black screen after updating</div><div class="recent-change">If you like playing Vlogger Go Viral, don''t forget to leave us a new rating or review. It helps us a lot!</div>  <div>     </div> ', '3.0', 0, 0, 0, 0, '2016-05-18 05:55:36', '0000-00-00 00:00:00', '2016-04-10 16:00:00'),
(149, '1.1.49', 'plants-vs-zombies-free-1-1-49', 200, '  <div class="recent-change">Hello, zombie zappers! We’ve made some behind-the-scenes updates to keep your plants powered up and your zombies ready for action. Thanks for playing.</div>  <div>     </div> ', '4.0.3', 0, 0, 0, 0, '2016-05-18 05:55:21', '0000-00-00 00:00:00', '2016-03-08 16:00:00'),
(150, '3.1.1', 'quiz-logo-game-3-1-1', 201, '  <div class="recent-change">3.1 &amp; 3.1.1</div><div class="recent-change">* free hints</div><div class="recent-change">3.0</div><div class="recent-change">* new American level</div><div class="recent-change">* 75 new logos</div>  <div>     </div> ', '4.0', 0, 0, 0, 0, '2016-05-18 05:55:06', '0000-00-00 00:00:00', '2016-03-29 16:00:00'),
(151, '2.1.7.243', 'quizup-2-1-7-243', 202, '  <div class="recent-change">We found the bugs you didn''t like and destroyed them. Also, improved stability and put in some good stuff.</div>  <div>     </div> ', '4.1', 0, 0, 0, 0, '2016-05-18 05:54:52', '0000-00-00 00:00:00', '2016-05-09 16:00:00'),
(152, '1.0.5', 'the-perfectionist-crazy-game-1-0-5', 203, '', '3.0', 0, 0, 0, 0, '2016-05-18 05:54:37', '0000-00-00 00:00:00', '2016-05-03 16:00:00'),
