(154, '2.0.5', 'mash-2-0-5', 206, '  <div class="recent-change">Select from list of possible answers working!</div><div class="recent-change">Fixed funky story endings!</div><div class="recent-change">MASH rebuilt from the ground up as a native Android app!</div><div class="recent-change">Tons of new stories!</div><div class="recent-change">New ways to earn MASH Cash</div><div class="recent-change">Crash and bug fixes</div>  <div>     </div> ', '4.0', 0, 0, 0, 0, '2016-05-18 05:54:08', '0000-00-00 00:00:00', '2015-08-15 16:00:00'),
