(157, '1.4.1', 'wordmania-guess-the-word-1-4-1', 209, '  <div class="recent-change">WordMania 1.4.1 Released!</div><div class="recent-change">- Fix for level 131</div><div class="recent-change">- Fix for a few hints being out by 1 tile</div>  <div>     </div> ', '2.3', 0, 0, 0, 0, '2016-05-18 05:53:25', '0000-00-00 00:00:00', '2016-04-20 16:00:00'),
(158, '1.12.207', 'quick-logic-puzzles-1-12-207', 210, '  <div class="recent-change">A minor update: fixes rare "scrambled text" bug. The new daily puzzles and Cloud Sync are proving popular, thanks for playing!</div><div class="recent-change">If you like Quick Logic Puzzles, please take the time to give us a nice review: it really helps (and we don''t nag inside the app, so this is the only place to ask!)</div>  <div>     </div> ', '2.3.3', 0, 0, 0, 0, '2016-05-18 05:53:11', '0000-00-00 00:00:00', '2015-04-30 16:00:00'),
(159, '3.7.1', 'sing-karaoke-by-smule-3-7-1', 211, '  <div class="recent-change">– More songs than ever - more than 350,000 ready to Sing!</div><div class="recent-change">– Buttons now animate when touched. Enjoy the soothing ripples.</div><div class="recent-change">– Swipe left and right to switch tabs on the Channel and Activity screens.</div>  <div>     </div> ', '4.1', 0, 0, 0, 0, '2016-05-18 05:52:58', '0000-00-00 00:00:00', '2016-05-09 16:00:00'),
